                        new { Id = 120467, Description = "The Grand Budapest Hotel tells of a legendary concierge at a famous European hotel between the wars and his friendship with a young employee who becomes his trusted protégé. The story involves the theft and recovery of a priceless Renaissance painting, the battle for an enormous family fortune and the slow and then sudden upheavals that transformed Europe during the first half of the 20th century.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2/nX5XotM9yprCKarRH4fzOq1VM1J.jpg", Name = "The Grand Budapest Hotel", PurchaseCost = 9.99m, ReleaseDate = new DateTime(2014, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), RentCost = 3.99m, Runtime = new TimeSpan(0, 1, 39, 0, 0), TrailerUrl = "https://www.youtube.com/embed/qmLEsdDnyLg" },
                        new { Id = 10681, Description = "WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ship arrives with a sleek new type of robot, WALL·E thinks he's finally found a friend and stows away on the ship when it leaves.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2/9cJETuLMc6R0bTWRA5i7ctY9bxk.jpg", Name = "WALL·E", PurchaseCost = 11.99m, ReleaseDate = new DateTime(2008, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), RentCost = 3.99m, Runtime = new TimeSpan(0, 1, 38, 0, 0), TrailerUrl = "https://www.youtube.com/embed/8-_9n5DtKOc" },
