                        new { Id = 1091, Description = "Scientists in the Antarctic are confronted by a shape-shifting alien that assumes the appearance of the people it kills.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2/s5fH3GqFcHbi2F0NSBSh4KRNTc0.jpg", Name = "The Thing", PurchaseCost = 5.99m, ReleaseDate = new DateTime(1982, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), RentCost = 1.99m, Runtime = new TimeSpan(0, 1, 49, 0, 0), TrailerUrl = "https://www.youtube.com/embed/p35JDJLa9ec" },
