            modelBuilder.Entity("DotNetFlicks.Accessors.Models.EF.Person", b =>
                {
                    b.Property<int>("Id")
                        .ValueGeneratedOnAdd()
                        .HasAnnotation("SqlServer:ValueGenerationStrategy", SqlServerValueGenerationStrategy.IdentityColumn);

                    b.Property<string>("Biography");

                    b.Property<DateTime?>("BirthDate");

                    b.Property<DateTime?>("DeathDate");

                    b.Property<string>("ImageUrl");

                    b.Property<string>("Name");

                    b.HasKey("Id");

                    b.ToTable("People");

                    b.HasData(
                        new { Id = 1, Biography = "Arguably the most important film innovator in the history of the medium, George Lucas continually \"pushed the envelope\" of filmmaking technology since his early days as a student at U.S.C. Considered a wunderkind by his contemporaries, he had a much harder time communicating his vision to studio executives, whose meddling managed to compromise each of his first three feature directing efforts in some way. The monumental success of \"Star Wars\" (1977) ushered in the era of the \"summer blockbuster,\" which, despite the later popularity of low budget independent films, was still the prevailing mentality powering the Hollywood engine.\\n\\nThough he set the tone and established the expectations which influenced studios to devote the bulk of their resources to films designed to blast off into hyperspace for spectacular profits, it was doubtful that a film as revolutionary as \"Star Wars\" was in its day could get made in the later blockbuster assembly line climate of the new millennium.", BirthDate = new DateTime(1944, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8qxin8urtFE0NqaZNFWOuV537bH.jpg", Name = "George Lucas" },
                        new { Id = 2, Biography = "Mark Richard Hamill (born September 25, 1951) is an American actor, voice artist, producer, director, and writer. Hamill is best known for his role as Luke Skywalker in the original Star Wars trilogy and also well known for voice-acting characters such as the Joker in various animated series, animated films and video games, beginning with Batman: The Animated Series, the Skeleton king in Super Robot Monkey Team Hyperforce Go!, Fire Lord Ozai in Avatar: The Last Airbender, Master Eraqus in Kingdom Hearts: Birth by Sleep, Skips in Regular Show, and Senator Stampington on Metalocalypse.", BirthDate = new DateTime(1951, 9, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fk8OfdReNltKZqOk2TZgkofCUFq.jpg", Name = "Mark Hamill" },
                        new { Id = 3, Biography = "Legendary Hollywood Icon Harrison Ford was born on July 13, 1942 in Chicago, Illinois.  His family history includes a strong lineage of actors, radio personalities, and models.  Harrison attended public high school in Park Ridge, Illinois where he was a member of the school Radio Station WMTH. Harrison worked as the lead voice for sports reporting at WMTH for several years.  Acting wasn’t a major interest to Ford until his junior year at Ripon College when he first took an acting class.  Harrison Ford’s career started in 1964 when he travelled to California in search of a voice-over job. He never received that position, but instead signed a contract with Columbia Pictures where he earned $150 weekly to play small fill in roles in various films.  Through the 60’s Harrison worked on several TV shows including Gunsmoke, Ironside, Kung Fu, and American Style.  It wasn’t until 1967 that Harrison received his first credited role in the Western film, A Time for Killing. Dissatisfied with the meager roles he was being offered, Ford took a hiatus from acting to work as a self-employed carpenter. This seemingly odd diversion turned out to be a blessing in disguise for Harrison’s acting career when he was soon hired by famous film producer George Lucas.  This was a turning point in Harrison’s life that led to him be casted in milestone roles such as Hans Solo and Indiana Jones.  Since his most famous roles in the Star Wars Trilogy and Raiders of the Lost Ark, Harrison Ford has starred in over 40 films.  Many criticize his recent work, saying his performances have been lackluster leading to commercially disappointing films.  Harrison has always worked hard to protect his off-screen private life, keeping details about his children and marriages quite.  He has a total of five children including one recent adoption with third and current wife Calista Flockhart. In addition to acting Harrison Ford is passionate about environmental conservation, aviation, and archeology.", BirthDate = new DateTime(1942, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7LOTdRfHU1H1qHBxpUv3jT04eWB.jpg", Name = "Harrison Ford" },
                        new { Id = 4, Biography = "Carrie Frances Fisher (21 October 1956 - 27 December 2016) was an American actress, novelist, screenwriter, and lecturer. She is most famous for her portrayal of Princess Leia Organa in the original Star Wars trilogy, her bestselling novel Postcards from the Edge, for which she wrote the screenplay to the film of the same name, and her autobiography Wishful Drinking.", BirthDate = new DateTime(1956, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 12, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oVYiGe4GzgQkoJfdHg8qKqEoWJz.jpg", Name = "Carrie Fisher" },
                        new { Id = 6, Biography = "From Wikipedia, the free encyclopedia.\\n\\nAnthony Daniels (born 21 February 1946) is an English actor. He is best known for his role as the droid C-3PO in the Star Wars series of films made between 1977 and 2005.\\n\\nDescription above from the Wikipedia article Anthony Daniels, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1946, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cljvryjb3VwTsNR7fjQKjNPMaBB.jpg", Name = "Anthony Daniels" },
                        new { Id = 7, Biography = "Andrew Stanton (born December 3, 1965) is an American film director, screenwriter, producer, and occasional voice actor based at Pixar Animation Studios. His film work includes writing and directing Finding Nemo and WALL-E; both films earned him the Academy Award for Best Animated Feature.\\n\\nDescription above from the Wikipedia article Andrew Stanton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pvQWsu0qc8JFQhMVJkTHuexUAa1.jpg", Name = "Andrew Stanton" },
                        new { Id = 8, Biography = "Lee Unkrich (born August 8, 1967) is an American director and film editor. He is a longtime member of the creative team at Pixar, where he started in 1994 as a film editor. He later began directing, first as co-director of Toy Story 2. After co-directing Monsters, Inc., and Finding Nemo, Unkrich made his solo directorial debut with Toy Story 3, for which he won the Academy Award for Best Animated Feature in 2011. Unkrich is the 2011 recipient of University of Southern California's Mary Pickford Distinguished Alumni Award recognizing alumni contributions to the cinematic arts. With the award, Unkrich joins a list of distinguished USC alumni including Robert Zemeckis, Walter Murch, Jon Landau, Gary Rydstrom and Jay Roach.\\n\\nA native of Chagrin Falls, Ohio, Unkrich spent his youth acting at the Cleveland Playhouse. Unkrich graduated from the University of Southern California School of Cinematic Arts in 1990. Before joining Pixar in 1994, Unkrich worked for several years in television as an editor and director.\\n\\nDescription above from the Wikipedia article Lee Unkrich, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1967, 8, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bdTCCXjgOV3YyaNmLGYGOxFQMOc.jpg", Name = "Lee Unkrich" },
                        new { Id = 10, Biography = "Robert \"Bob\" Peterson (born January 1961) is an American animator, screenwriter, director and voice actor, who has worked for Pixar since 1994. His first job was working as a layout artist and animator on Toy Story. He was nominated for an Oscar for his screenplay for Finding Nemo. Petersonis a co-director and the writer of Up, which gained him his second Oscar nomination. He also performed the voices of Roz in Monsters, Inc., Mr. Ray in Finding Nemo, Dug the dog and Alpha the dog in Up and in Dug's Special Mission, and the Janitor in Toy Story 3.\\n\\nPeterson  was born in Wooster, Ohio, his family moved to Dover, Ohio, where he graduated from Dover High School. He received his undergraduate degree from Ohio Northern University, and a Master's degree in mechanical engineering from Purdue University in 1986. While attending Purdue, he wrote and illustrated the comic strip Loco Motives for the Purdue Exponent. Prior to coming to Pixar, Peterson worked at Wavefront Technologies and Rezn8 Productions.\\n\\nIn 2008,  Peterson played the part of Terry Cane, a puppeteer in Dan Scanlon's first feature film Tracy. He also played additional voices in Tokyo Mater in 2008, and the voice of Mr. Ray for the Finding Nemo Submarine Voyage ride at Disneyland Park in 2007. His most  recent job at Pixar was voicing the Janitor at Sunnyside Daycare Center in Pixar's 11th film, Toy Story 3, which was released on June 18, 2010.\\n\\nDescription above from the Wikipedia article Bob  Peterson (animator), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1961, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//13YNM8lBKnK26MYd2Lp3OpU6JdI.jpg", Name = "Bob Peterson" },
                        new { Id = 24, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRobert Lee Zemeckis (born May 14, 1952) is an American film director, producer and screenwriter. Zemeckis first came to public attention in the 1980s as the director of the comedic time-travel Back to the Future film series, as well as the Academy Award-winning live-action/animation epic Who Framed Roger Rabbit (1988), though in the 1990s he diversified into more dramatic fare, including 1994's Forrest Gump, for which he won an Academy Award for Best Director.\\n\\nHis films are characterized by an interest in state-of-the-art special effects, including the early use of match moving in Back to the Future Part II (1989) and the pioneering performance capture techniques seen in The Polar Express (2004), Beowulf (2007) and A Christmas Carol (2009). Though Zemeckis has often been pigeonholed as a director interested only in effects, his work has been defended by several critics, including David Thomson, who wrote that \"No other contemporary director has used special effects to more dramatic and narrative purpose.\"\\n\\nDescription above from the Wikipedia article Robert Zemeckis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1951, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//isCuZ9PWIOyXzdf3ihodXzjIumL.jpg", Name = "Robert Zemeckis" },
                        new { Id = 31, Biography = "Thomas Jeffrey \"Tom\" Hanks (born July 9, 1956) is an American actor, producer, writer and director. Hanks worked in television and family-friendly comedies, gaining wide notice in 1988's Big, before achieving success as a dramatic actor in several notable roles, including Andrew Beckett in Philadelphia, the title role in Forrest Gump, Commander James A. Lovell in Apollo 13, Captain John H. Miller in Saving Private Ryan, Joe Fox in You've Got Mail and Chuck Noland in Cast Away. Hanks won consecutive Best Actor Academy Awards, in 1993 for Philadelphia and in 1994 for Forrest Gump. U.S. domestic box office totals for his films exceed $3.9 billion.", BirthDate = new DateTime(1956, 7, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pQFoyx7rp09CJTAb932F2g8Nlho.jpg", Name = "Tom Hanks" },
                        new { Id = 37, Biography = "", BirthDate = new DateTime(1950, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//chEsfnDEtRmv1bfOaNAoVEzhCc6.jpg", Name = "Alan Silvestri" },
                        new { Id = 38, Biography = "", Name = "Arthur Schmidt" },
                        new { Id = 48, Biography = "Shaun Mark \"Sean\" Bean (born 17 April 1959) is an English film and stage actor. Bean is best known for starring roles in the films Lord of the Rings: The Fellowship of the Ring, GoldenEye, Patriot Games, Troy, National Treasure and Silent Hill, as well as the television series Sharpe. Bean has also acted in a number of television productions, most recent being HBO's Game of Thrones, as well as performing voice work for computer games and television adverts.\\n\\nDescription above from the Wikipedia article Sean Bean, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iIxP2IzvcLgr5WaTBD4UfSqaV3q.jpg", Name = "Sean Bean" },
                        new { Id = 62, Biography = "Walter Bruce Willis, better known as Bruce Willis, is an American actor and producer. His career began in television in the 1980s and has continued both in television and film since, including comedic, dramatic, and action roles. He is well known for the role of John McClane in the Die Hard series.\\n\\nWillis was born in Idar-Oberstein, West Germany, the son of a Kassel-born German, Marlene, who worked in a bank, and David Willis, an American soldier. Willis is the eldest of four children.\\n\\nAt the premiere for the film Stakeout, Willis met actress Demi Moore. They married on November 21, 1987 and had three daughters before the couple divorced on October 18, 2000.\\n\\nSince the divorce he has dated models Maria Bravo Rosado and Emily Sandberg; he was engaged to Brooke Burns until they broke up in 2004 after ten months together. He married Emma Heming on March 21, 2009.", BirthDate = new DateTime(1955, 3, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kI1OluWhLJk3pnR19VjOfABpnTY.jpg", Name = "Bruce Willis" },
                        new { Id = 64, Biography = "Gary Leonard Oldman (born 21 March 1958) is an English actor, filmmaker and musician, well-known to audiences for his portrayals of dark and morally ambiguous characters. He has starred in films such as Sid and Nancy, Prick Up Your Ears, JFK, Dracula, True Romance, Léon, The Fifth Element, The Contender, the Harry Potter film series and the Batman film series, as well as in television shows such as Friends and Fallen Angels.\\n\\nOldman came to prominence in the mid-1980s with a string of performances that prompted pre-eminent film critic, Roger Ebert, to describe him as \"the best young British actor around\". He has been cited as an influence by a number of successful actors. In addition to leading and central supporting roles in big-budget Hollywood films, Oldman has frequently acted in independent films and television shows. Aside from acting, he directed, wrote and co-produced Nil by Mouth, a film partially based on his own childhood, and served as a producer on several films.\\n\\nAmong other accolades, Oldman has received Emmy-, Screen Actors Guild-, BAFTA- and Independent Spirit Award nominations for his acting work, and has been described as one of the greatest actors never nominated for an Academy Award. His contributions to the science fiction genre have won him a Saturn Award, with a further two nominations. He was also nominated for the 1997 Palme d'Or and won two BAFTA Awards for his filmmaking on Nil By Mouth. In 2011, Empire readers voted Oldman an \"Icon of Film\", in recognition of his contributions to cinema.\\n\\nDescription above from the Wikipedia article Gary Oldman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1958, 3, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tofLS5A6lBXNjeROGvgpfe2JwaT.jpg", Name = "Gary Oldman" },
                        new { Id = 65, Biography = "Sir Ian Holm, CBE (born 12 September 1931) is a British actor known for his stage work and for many film roles. He received the 1967 Tony Award for Best Featured Actor for his performance as Lenny in The Homecoming and the 1998 Laurence Olivier Award for Best Actor for his performance in the title role of King Lear. He was nominated for the 1981 Academy Award for Best Supporting Actor for his role as athletics trainer Sam Mussabini in Chariots of Fire. Other well-known film roles include the android Ash in Alien, Father Vito Cornelius in The Fifth Element, and the hobbit Bilbo Baggins in the first and third films of the Lord of the Rings film trilogy.\\n\\nDescription above from the Wikipedia article Ian Holm, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1931, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//27SAk1v043GdOeAxT5pPoMUYhGg.jpg", Name = "Ian Holm" },
                        new { Id = 99, Biography = "Amanda Michael Plummer is an American actress. Plummer was born in New York City, New York, the daughter of actors Tammy Grimes and Christopher Plummer. Plummer attended Middlebury College in Vermont and acting classes at the Neighborhood Playhouse in New York. Early in life, her interest was in riding and tending to horses on the East Coast and in Ireland.\\n\\nPlummer began appearing in small to mid size roles in television and films in the early 1980s. Her first successes came from her stage work. She made her Broadway debut as Josephine in the 1981 revival of A Taste of Honey. She won a Tony Award nomination and Theatre World Award for her portrayal. The following year, she won a Tony Award for Featured Actress and a Drama Desk Award for her portrayal of Sister Agnes in the play Agnes of God.\\n\\nFollowing her successes on the stage, Plummer began appearing in major roles on television and in film. One of her most recognized appearances was on L.A. Law as Alice Hackett, a developmentally disabled girlfriend of Benny Stulwitz, played by Larry Drake, for which she received an Emmy Award nomination. Two other well-known roles were Yolanda (a.k.a. \"Honey Bunny\") in Pulp Fiction and Rose in So I Married An Axe Murderer.\\n\\nHer film roles have been described as \"spooky, kooky, half-mad characters.\"", BirthDate = new DateTime(1957, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uICpVUj29yBcwCEGVZzE77FL98W.jpg", Name = "Amanda Plummer" },
                        new { Id = 108, Biography = "Sir Peter Robert Jackson, (born 31 October 1961) is a New Zealand film director, producer, actor, and screenwriter, known for his Lord of the Rings film trilogy, adapted from the novel by J. R. R. Tolkien. He is also known for his 2005 remake of King Kong and as the producer of District 9. He won international attention early in his career with his \"splatstick\" horror comedies, before coming to mainstream prominence with Heavenly Creatures, for which he shared an Academy Award Best Screenplay nomination with his wife, Fran Walsh. Jackson has been awarded three Academy Awards in his career, including the award for Best Director in 2003.\\n\\nDescription above from the Wikipedia article Peter Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1961, 10, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kSrfI3TbMdIMmPVOflLQ56OfscB.jpg", Name = "Peter Jackson" },
                        new { Id = 109, Biography = "Elijah Jordan Wood ( born January 28, 1981) is an American actor. He made his film debut with a minor part in Back to the Future Part II (1989), then landed a succession of larger roles that made him a critically acclaimed child actor by age 9. He is best known for his high-profile role as Frodo Baggins in Peter Jackson's critically acclaimed The Lord of the Rings trilogy. Since then, he has resisted typecasting by choosing varied roles in critically acclaimed films such as Bobby, Eternal Sunshine of the Spotless Mind, Sin City, Green Street and Everything Is Illuminated. He starred in the film Day Zero (2007) and provided the voice of the main character, Mumble, in the award-winning animated film Happy Feet. He played an American tourist turned vampire in Paris, je t'aime. In 2005, he started his own record label, Simian Records. He was cast in the lead role of an Iggy Pop biopic to be called The Passenger, but after years of development, the project now appears to be shelved.\\n\\nDescription above from the Wikipedia article Elijah Wood, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1981, 1, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hHzLAVspGGuPg1KW5JAEsyRvnUT.jpg", Name = "Elijah Wood" },
                        new { Id = 110, Biography = "Viggo Peter Mortensen, Jr. (born October 20, 1958) is an American-Danish actor, poet, musician, photographer and painter. He made his film debut in Peter Weir's 1985 thriller Witness, and subsequently appeared in many notable films of the 1990s, including The Indian Runner (1991), Carlito's Way (1993), Crimson Tide (1995), The Portrait of a Lady (1996), G.I. Jane (1997), A Perfect Murder (1998), and A Walk on the Moon (1999).\\n\\nMortensen made his major breakthrough in 2001 with the epic film trilogy The Lord of the Rings. In 2005, Mortensen won critical acclaim for David Cronenberg's crime thriller A History of Violence. Two years later, another Cronenberg film Eastern Promises (2007) earned him an Academy Award nomination for Best Actor. Other well-received films in recent years have included Appaloosa (2008) and the 2009 film adaptation of Cormac McCarthy's novel The Road.\\n\\nAside from acting, his other artistic pursuits include fine arts, photography, poetry, and music. In 2002, he founded the Perceval Press to publish the works of little-known artists and authors. Mortensen is politically active. He campaigned for Dennis Kucinich in the 2008 United States presidential election, and later endorsed Barack Obama for President. Mortensen has one son from his previous marriage to musician Exene Cervenka.\\n\\nDescription above from the Wikipedia article Viggo Mortensen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1958, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qmC8XfeiFhQtJGKlUk5KyGkPoWp.jpg", Name = "Viggo Mortensen" },
                        new { Id = 112, Biography = "Catherine Élise \"Cate\" Blanchett (born 14 May 1969) is an Australian  actress and theatre director. She has won multiple acting awards, most  notably two SAGs, two Golden Globe Awards, two BAFTAs, and an Academy  Award, as well as the Volpi Cup at the 64th Venice International Film  Festival. Blanchett earned five Academy Award nominations between 1998  and 2007.  Blanchett came to international attention for her role as Elizabeth I of  England in the 1998 film Elizabeth, directed by Shekhar Kapur. She is  also well-known for her portrayals of the elf queen Galadriel in Peter  Jackson's The Lord of the Rings trilogy and the upcoming The Hobbit,  Colonel-Doctor Irina Spalko in Indiana Jones and the Kingdom of the  Crystal Skull and Katharine Hepburn in Martin Scorsese's The Aviator, a  role which brought her an Academy Award for Best Supporting Actress. She  and her husband Andrew Upton are currently artistic directors of the  Sydney Theatre Company.\\n\\nDescription above from the Wikipedia article Cate Blanchett, licensed  under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jLVhu33JgNKQXKm8siWZUBmOGxa.jpg", Name = "Cate Blanchett" },
                        new { Id = 113, Biography = "Sir Christopher Frank Carandini Lee, CBE, CStJ (born May 27, 1922, died June 7, 2015) was an English actor and musician. Lee initially portrayed villains and became famous for his role as Count Dracula in a string of Hammer Horror films. Other notable roles include Lord Summerisle in The Wicker Man (1973), Francisco Scaramanga in The Man with the Golden Gun (1974), Count Dooku in Star Wars episodes II and III (2002, 2005) and Saruman in The Lord of the Rings film trilogy (2001–2003). Lee considers his most important role to have been his portrayal of Pakistan's founder Muhammad Ali Jinnah in the biopic Jinnah (1998). He is well known for his deep, strong voice. Lee has performed roles in 266 films since 1948 making him the Guinness book world record holder for most film acting roles ever. He was knighted in 2009 and received the BAFTA Fellowship in 2011.", BirthDate = new DateTime(1922, 5, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2015, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aVzp6zflzedmdKPLxaPqcZ05PDK.jpg", Name = "Christopher Lee" },
                        new { Id = 114, Biography = "Orlando Jonathan Blanchard Bloom is an English actor. He had his break-through roles in 2001 as the elf-prince Legolas in The Lord of the Rings and starting in 2003 as blacksmith Will Turner in the Pirates of the Caribbean trilogy of films, and subsequently established himself as a lead in Hollywood films, including Elizabethtown and Kingdom of Heaven. He appeared in the ensemble film New York, I Love You, and will have roles in Sympathy for Delicious and Main Street. Bloom made his professional stage debut in West End's In Celebration at the Duke of York's Theatre, St. Martin's Lane, which ended its run on 15 September 2007.\\n\\nOrlando Bloom was born in Canterbury, Kent, England. His mother, Sonia Constance Josephine (née Copeland), was born in the British section of Kolkata, India, the daughter of Betty Constance Josephine Walker and Francis John Copeland, who was a physician and surgeon. During his childhood, Bloom was told that his father was his mother's husband, South African-born Jewish anti-Apartheid novelist Harry Saul Bloom; but when he was thirteen (nine years after Harry's death), Bloom's mother revealed to him that his biological father was actually Colin Stone, his mother's partner and family friend. Stone, the principal of the Concorde International language school, was made Orlando Bloom's legal guardian after Harry Bloom's death. Bloom, who is named after the 16th century composer Orlando Gibbons, has one sister, Samantha Bloom, who was born in 1975.\\n\\nBloom's first appearance on the screen was as a rent boy in the 1997 film Wilde - he had a small part. Two days after graduating from Guildhall in 1999, he was cast in his first major role, playing Legolas in The Lord of the Rings (2001–2003). He had originally auditioned for the part of Faramir, who doesn't appear until the second movie but the director, Peter Jackson, cast him as Legolas instead.\\n\\nBloom met American actress Kate Bosworth outside a coffee shop in 2002, where he was introduced to her by a mutual friend. He met her again at the premiere of The Lord of the Rings: The Two Towers later that year. The two had an \"on-and-off relationship\" from 2002 until splitting up in September 2006. In late 2007, Bloom began dating Australian model Miranda Kerr. The couple's engagement was announced on June 21, 2010.\\n\\nBloom has said that he tries \"not to exclude [himself] from real life as much as possible\". He is a Manchester United fan and lives in London. During filming in Morocco for Kingdom of Heaven, Bloom rescued and adopted a dog, Sidi (a black Saluki mix with a white mark on his chest). Bloom is a practising Buddhist. In 2004, he became a full member of Soka Gakkai International, a lay Buddhist association affiliated with the teachings of Nichiren. Bloom has also been a part of Global Green, an environmental company, since the early 2000s. As part of his environmental involvement, he has renovated his London home to use solar panels, incorporate recycled materials, and utilize energy efficient lightbulbs. Bloom has been approached by UNICEF to act as an international ambassador.", BirthDate = new DateTime(1977, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kKWJlX2tcjqceSfUxnV7Jle5Kt.jpg", Name = "Orlando Bloom" },
                        new { Id = 117, Biography = "", BirthDate = new DateTime(1946, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4HbFF5o13GkO0rHi4OVXXMb7U5L.jpg", Name = "Howard Shore" },
                        new { Id = 123, Biography = "", BirthDate = new DateTime(1944, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xWtXYk6M5NFroddcQDviLlxOnkU.jpg", Name = "Barrie M. Osborne" },
                        new { Id = 126, Biography = "From Wikipedia, the free encyclopedia.  Frances \"Fran\" Walsh, Lady Jackson, MNZM (born January 10, 1959) is a screenwriter, film producer and musician. She is the wife of filmmaker Peter Jackson. They have two children: Billy and Katie.\\n\\nFran Walsh has contributed to all of Jackson's films since they met at the end of Bad Taste. She won three Academy Awards in 2003, for Best Adapted Screenplay, Best Picture, and Best Original Song, all for the movie The Lord of the Rings: The Return of the King. She has received a total of eight Oscar nominations.\\n\\nDescription above from the Wikipedia article Fran Walsh, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 1, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hLihP60zpszrowcMLpWoJ4wvtuy.jpg", Name = "Fran Walsh" },
                        new { Id = 128, Biography = "From Wikipedia, the free encyclopedia.  Philippa Boyens, MNZM, is a New Zealand screenwriter who co-wrote the screenplay for Peter Jackson's film series The Lord of the Rings with Peter Jackson and Fran Walsh, for which the trio won an Oscar at the 76th Academy Awards in 2004. Boyens worked with the same collaborators on the screenplay for Jackson's version of King Kong. Following that movie's completion, the trio once again worked together on The Lovely Bones, Jackson's film adaptation of Alice Sebold's novel of the same name, which was released in 2009. She is also collaborating with Jackson, Walsh and Guillermo del Toro on The Hobbit films which are scheduled for release in 2011 and 2012. Prior to turning to screenwriting with The Lord of the Rings, Boyens was a playwright.\\n\\nBoyens was a part-time student at the University of Auckland, graduating with a BA in English and History in 1994. She received a Distinguished Alumni Award from the university in 2006.  She has three children, daughter Phoebe Gittins, and sons Calum Gittins (both with actor Paul Gittins) and Isaac Miller. Calum starred as Haleth in The Lord of the Rings: The Two Towers.\\n\\nDescription above from the Wikipedia article Philippa Boyens, licensed under CC-BY-SA, full list of contributors on Wikipedia.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//keVPZy02zLh2BEUPkZivJrh6o6U.jpg", Name = "Philippa Boyens" },
                        new { Id = 129, Biography = "John Ronald Reuel Tolkien, CBE (/ˈtɒlkiːn/ tol-keen;[a] 3 January 1892 – 2 September 1973) was an English writer, poet, philologist, and university professor, best known as the author of the classic high-fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion.\\n\\nHe served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow ofPembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis - they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972.  After Tolkien's death, his son Christopher published a series of works based on his father's extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings.  \\n\\nWhile many other authors had published works of fantasy before Tolkien, the great success of The Hobbit and The Lord of the Rings led directly to a popular resurgence of the genre. This has caused Tolkien to be popularly identified as the \"father\" of modern fantasy literature - or, more precisely, of high fantasy.  In 2008, The Times ranked him sixth on a list of \"The 50 greatest British writers since 1945\". Forbes ranked him the 5th top-earning \"dead celebrity\" in 2009. - Wikipedia", BirthDate = new DateTime(1892, 1, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1973, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//z7KBk4TTP1gTXnN01jWNI8FgzkA.jpg", Name = "J.R.R. Tolkien" },
                        new { Id = 130, Biography = "From Wikipedia, the free encyclopedia Kenneth George \"Kenny\" Baker (born 24 August 1934) was a British actor and musician, best known as the man inside R2-D2 in the popular Star Wars film series. Description above from the Wikipedia article Kenny Baker, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1934, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sdd9rgifNF9C51RejG7sUGU8Bka.jpg", Name = "Kenny Baker" },
                        new { Id = 134, Biography = "Eric Marlon Bishop (born December 13, 1967), professionally known as Jamie Foxx, is an American actor, singer-songwriter, stand-up comedian, and talk radio host. As an actor, his work in the film Ray earned him the Academy Award and BAFTA Award for Best Actor as well as the Golden Globe Award for Best Actor in a musical/comedy. He is also a Grammy Award winning musician, producing two albums which have charted highly on the Billboard 200: Unpredictable, which topped the chart, and Intuition.\\n\\nFoxx was abandoned seven months after birth, and was subsequently adopted and raised in Terrell by his mother's adoptive parents, Estelle and Mark Talley. Foxx had a strict Baptist upbringing and began piano lessons at the age of five by his grandmother's orders. He has often acknowledged his grandmother's influence in his life as one of the greatest reasons for his success. When he found that female comedians were often called first to perform, he changed his name to Jamie Foxx, feeling that it was an ambiguous enough name to disallow any biases. He chose his surname as a tribute to comedian Redd Foxx.\\n\\nFrom 1996 to 2001, Foxx starred in his own sitcom The Jamie Foxx Show, and in 1992 he made his film debut in Toys a comedy directed by Barry Levinson. Following Toys, his first dramatic role came in Oliver Stone's 1999 film Any Given Sunday, where he portrayed a hard-partying American football player. Foxx has since evolved into a respected dramatic actor. Foxx was featured as taxi driver Max Durocher in the film Collateral alongside Tom Cruise, for which he received outstanding reviews and a nomination for the Academy Award for Best Supporting Actor. His standout performance, however, was his portrayal of Ray Charles in the biopic Ray (2004), for which he won the Academy Award for Best Actor and the BAFTA Award for Best Actor in a Leading Role. Foxx is the second male in history to receive two acting Oscar nominations in the same year for two different movies, Collateral and Ray.\\n\\nIn September 2007, Foxx was awarded a star on the Hollywood Walk of Fame.", BirthDate = new DateTime(1967, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cDRGXCNrwf1p9jouw9GzhU2vWP7.jpg", Name = "Jamie Foxx" },
                        new { Id = 138, Biography = "Quentin Jerome Tarantino is an American film director, screenwriter, producer, cinematographer and actor. In the early 1990s he was an independent filmmaker whose films used nonlinear storylines and aestheticization of violence. His films have earned him a variety of Academy Award, Golden Globe, BAFTA and Palme d'Or Awards and he has been nominated for Emmy and Grammy Awards. In 2007, Total Film named him the 12th-greatest director of all time.\\n\\nTarantino was born in Knoxville, Tennessee, the son of Connie McHugh Tarantino Zastoupil, a health care executive and nurse born in Knoxville, and Tony Tarantino, an actor and amateur musician born in Queens, New York.\\n\\nTarantino's mother allowed him to quit school at age 17, to attend an acting class full time. Tarantino gave up acting while attending the acting school, saying that he admired directors more than actors. Tarantino also worked in a video rental store before becoming a filmmaker, paid close attention to the types of films people liked to rent, and has cited that experience as inspiration for his directorial career.\\n\\nTarantino has been romantically linked with numerous entertainers, including actress Mira Sorvino, directors Allison Anders and Sofia Coppola, actresses Julie Dreyfus and Shar Jackson and comedians Kathy Griffin and Margaret Cho. There have also been rumors about his relationship with Uma Thurman, whom he has referred to as his \"muse\". However, Tarantino has stated that their relationship is strictly platonic. He has never married and has no children.\\n\\nDescription above from the Wikipedia article Quentin Tarantino, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1963, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9ci4NBvHXJktxjALdJsrtasqgtV.jpg", Name = "Quentin Tarantino" },
                        new { Id = 139, Biography = "Uma Karuna Thurman (born April 29, 1970) is an American actress and model. She has performed in leading roles in a variety of films, ranging from romantic comedies and dramas to science fiction and action movies. Following early roles in films such as Dangerous Liaisons (1988), she rose to international prominence in 1994 following her role in Quentin Tarantino's Pulp Fiction for which she was nominated for an Academy Award, a BAFTA Award and a Golden Globe Award. She starred in several more films throughout the 1990s such as The Truth About Cats & Dogs, Batman & Robin, Gattaca and Les Misérables.\\n\\nShe won a Golden Globe Award for the miniseries Hysterical Blindness (2002). Her career was revitalized when she reunited with director Quentin Tarantino to play the central role in two Kill Bill films (2003/2004), which brought her an additional two Golden Globe Award nominations and a BAFTA Award nomination.\\n\\nThurman was born in Boston, Massachusetts. Her father, Robert Alexander Farrar Thurman, a New York-born professor, is a Buddhist writer and academic. Her mother, Nena von Schlebrügge, is a model who was born in Mexico City, Mexico, of German, Swedish and Danish descent. Thurman and her siblings spent time in the Himalayan town of Almora, Uttarakhand, India, during childhood, and the Dalai Lama, to whom Robert Thurman has long been close, once visited their home. She grew up mostly in Amherst, Massachusetts, where she went to Amherst Regional Middle School, then moved to Woodstock, New York. While her father gave his children a Buddhist upbringing, she has the same name as one of the Hindu goddess Parvati's alternate names, \"Uma\", which means \"light\" in Sanskrit. Regarding religion, she now calls herself agnostic.\\n\\nShe has three brothers, Ganden (b. 1968), Dechen (b. 1973), and Mipam (b. 1978), and a half-sister named Taya (b. 1960), from her father's previous marriage. She is described as having been an awkward and introverted girl who was teased for her tall frame, angular bone structure, enormous feet and unusual name (sometimes using the name “Uma Karen” instead of her birth name). When Thurman was 10 years old, a friend's mother suggested a nose job. As a child, she suffered bouts of body dysmorphic disorder, which she discussed in an interview with Talk magazine in 2001.\\n\\nUma attended Amherst Public Schools. In the eighth grade, she discovered her love for acting. Talent scouts noticed her performance as Abigail in a production of The Crucible and offered her the chance to act professionally. Thurman attended Northfield Mount Hermon School, a preparatory school in Massachusetts, before dropping out to pursue a career in acting.", BirthDate = new DateTime(1970, 4, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6SuOc2R7kXjq3Em24KTNDW9qblJ.jpg", Name = "Uma Thurman" },
                        new { Id = 149, Biography = "Robert Richardson is an American Cinematographer. He was born on August 27, 1955 in Hyannis, Massachusetts as Robert Bridge Richardson. He is a member of the American Society of Cinematographers (ASC) since 1992.", BirthDate = new DateTime(1955, 8, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9tLrDHL9qL9yYIhcJVaINwnzmWN.jpg", Name = "Robert Richardson" },
                        new { Id = 150, Biography = "Robert Fitzgerald Diggs, better known by his stage name RZA or The RZA ( /ˈrɪzə/; born July 5, 1969), is an American Grammy-winning music producer, multi-instrumentalist, author, rapper, and occasional actor, director, and screenwriter. A prominent figure in hip hop music, he is the de facto leader of the Wu-Tang Clan. He has produced almost all of Wu-Tang Clan's albums as well as many Wu-Tang solo and affiliate projects. He is widely considered one of the most influential and landmark hip-hop producers of all time. He subsequently gained attention for his work scoring and acting in films. He has also released solo albums under the alter-ego Bobby Digital. In addition to the Wu-Tang Clan and his solo releases, RZA was also a founding member of the horrorcore rap group Gravediggaz where he used the name The Rzarector. He has also acted in several movies including Coffee and Cigarettes, American Gangster, Gospel Hill, Life Is Hot in Cracktown, Ghost Dog, Funny People, Derailed, Due Date and Repo Men. In 2008, RZA was ranked number four on About.com's best hip hop producers of all time list.\\n\\nDescription above from the Wikipedia article RZA, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 7, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//v5bwcyzUWVqjmczWu4PrdwnL6t6.jpg", Name = "RZA" },
                        new { Id = 151, Biography = "Roger Alexander Deakins, CBE, ASC, BSC (born May 24, 1949) is an English cinematographer best known for his work on the films of the Coen brothers, Sam Mendes, and Denis Villeneuve. Deakins is a member of both the American and British Society of Cinematographers. He received the 2011 American Society of Cinematographers (A.S.C.) Lifetime Achievement Award. Its president, Richard Crudo, called Deakins \"the pre-eminent cinematographer of our time.\"\\n\\nIn recognition of outstanding contribution to the British film industry, Deakins is an honorary fellow of the National Film School in Buckinghamshire of which he is an alumnus. In 2013 he received a CBE at Buckingham Palace for \"services to film\". A recipient of four BAFTA Awards for Best Cinematography, Deakins has received fourteen nominations and one win for the Academy Award for Best Cinematography. His most well-known works include The Shawshank Redemption, Fargo, A Beautiful Mind, Skyfall, Sicario and Blade Runner 2049, the last of which won him the Oscar.", BirthDate = new DateTime(1949, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pSCN7CfILlfQrxX43Kgqrx5mBYQ.jpg", Name = "Roger Deakins" },
                        new { Id = 153, Biography = "", BirthDate = new DateTime(1955, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nZSsNIrjbkqqxFYwsD3zcHskxdP.jpg", Name = "Thomas Newman" },
                        new { Id = 154, Biography = "", BirthDate = new DateTime(1943, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7ZUPk0aT7IBm4xPeILzm8dUrl48.jpg", Name = "Walter Murch" },
                        new { Id = 156, Biography = "", BirthDate = new DateTime(1953, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2010, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8cUdiGU7KhBgd8UNnoUYNCMZYgQ.jpg", Name = "Sally Menke" },
                        new { Id = 190, Biography = "Clinton \"Clint\" Eastwood, Jr. (born May 31, 1930) is an American film actor, director, producer, composer and politician. Following his breakthrough role on the TV series Rawhide (1959–65), Eastwood starred as the Man with No Name in Sergio Leone's Dollars Trilogy of spaghetti westerns (A Fistful of Dollars, For a Few Dollars More, and The Good, the Bad and the Ugly) in the 1960s, and as San Francisco Police Department Inspector Harry Callahan in the Dirty Harry films (Dirty Harry, Magnum Force, The Enforcer, Sudden Impact, and The Dead Pool) during the 1970s and 1980s. These roles, along with several others in which he plays tough-talking no-nonsense police officers, have made him an enduring cultural icon of masculinity.\\n\\nEastwood won Academy Awards for Best Director and Producer of the Best Picture, as well as receiving nominations for Best Actor, for his work in the films Unforgiven (1992) and Million Dollar Baby (2004). These films in particular, as well as others including Play Misty for Me (1971), The Outlaw Josey Wales (1976), Pale Rider (1985), In the Line of Fire (1993), The Bridges of Madison County (1995), and Gran Torino (2008), have all received commercial success and/or critical acclaim. Eastwood's only comedies have been Every Which Way but Loose (1978) and its sequel Any Which Way You Can (1980); despite being widely panned by critics they are the two highest-grossing films of his career after adjusting for inflation.\\n\\nEastwood has directed most of his own star vehicles, but he has also directed films in which he did not appear such as Mystic River (2003) and Letters from Iwo Jima (2006), for which he received Academy Award nominations and Changeling (2008), which received Golden Globe Award nominations. He has received considerable critical praise in France in particular, including for several of his films which were panned in the United States, and was awarded two of France's highest honors: in 1994 he received the Ordre des Arts et des Lettres medal and in 2007 was awarded the Légion d'honneur medal. In 2000 he was awarded the Italian Venice Film Festival Golden Lion for lifetime achievement.\\n\\nSince 1967 Eastwood has run his own production company, Malpaso, which has produced the vast majority of his films. He also served as the nonpartisan mayor of Carmel-by-the-Sea, California, from 1986 to 1988. Eastwood has seven children by five women, although he has only married twice. An audiophile, Eastwood is also associated with jazz and has composed and performed pieces in several films along with his eldest son, Kyle Eastwood.\\n\\nDescription above from the Wikipedia article Clint Eastwood, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1930, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n8h4ZHteFFXfmzUW6OEaPWanDnm.jpg", Name = "Clint Eastwood" },
                        new { Id = 192, Biography = "Morgan Porterfield Freeman, Jr. is an American actor, film director, and narrator. He is noted for his reserved demeanor and authoritative speaking voice. Freeman has received Academy Award nominations for his performances in Street Smart, Driving Miss Daisy, The Shawshank Redemption and Invictus and won in 2005 for Million Dollar Baby. He has also won a Golden Globe Award and a Screen Actors Guild Award.\\n\\nMorgan Freeman was born in Memphis, Tennessee, the son of Mayme Edna (née Revere) and Morgan Porterfield Freeman, Sr., a barber who died in 1961 from liver cirrhosis. Freeman was sent as an infant to his paternal grandmother in Charleston, Mississippi. He has three older siblings. Freeman's family moved frequently during his childhood, living in Greenwood, Mississippi; Gary, Indiana; and finally Chicago, Illinois.\\n\\nFreeman made his acting debut at age 9, playing the lead role in a school play. He then attended Broad Street High School, currently Threadgill Elementary School, in Mississippi. At age 12, he won a statewide drama competition, and while still at Broad Street High School, he performed in a radio show based in Nashville, Tennessee. In 1955, he graduated from Broad Street High School, but turned down a partial drama scholarship from Jackson State University, opting instead to work as a mechanic in the United States Air Force.\\n\\nFreeman moved to Los Angeles in the early 1960s and worked as a transcript clerk at Los Angeles Community College. During this period, he also lived in New York City, working as a dancer at the 1964 World's Fair, and in San Francisco, where he was a member of the Opera Ring music group. Freeman acted in a touring company version of The Royal Hunt of the Sun, and also appeared as an extra in the 1965 film The Pawnbroker. He made his off-Broadway debut in 1967, opposite Viveca Lindfors in The Nigger Lovers (about the civil rights era \"Freedom Riders\"), before debuting on Broadway in 1968's all-black version of Hello, Dolly!, which also starred Pearl Bailey and Cab Calloway.\\n\\nFreeman was married to Jeanette Adair Bradshaw from October 22, 1967, until 1979. He married Myrna Colley-Lee on June 16, 1984. The couple separated in December 2007. Freeman's attorney and business partner, Bill Luckett, announced in August 2008 that Freeman and his wife are in the process of divorce. He has two sons from previous relationships. He adopted his first wife's daughter and the couple also had a fourth child. Freeman lives in Charleston, Mississippi, and New York City. He has a private pilot's license, which he earned at age 65, and co-owns and operates Madidi, a fine dining restaurant, and Ground Zero, a blues club, both located in Clarksdale, Mississippi. He officially opened his second Ground Zero in Memphis, Tennessee on April 24, 2008.\\n\\nFreeman has publicly criticized the celebration of Black History Month and does not participate in any related events, saying, \"I don't want a black history month. Black history is American history.\" He says the only way to end racism is to stop talking about it, and he notes that there is no \"white history month\". Freeman once said on an interview with 60 Minutes' Mike Wallace: \"I am going to stop calling you a white man and I'm going to ask you to stop calling me a black man.", BirthDate = new DateTime(1937, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oGJQhOpT8S1M56tvSsbEBePV5O1.jpg", Name = "Morgan Freeman" },
                        new { Id = 207, Biography = "From Wikipedia, the free encyclopedia\\n\\nThomas Geoffrey \"Tom\" Wilkinson, OBE (born 5 February 1948) is an English actor. He has twice been nominated for an Academy Award for his roles in In The Bedroom and Michael Clayton. In 2009, he won The Golden Globe and Primetime Emmy Award for best Supporting Actor in a Miniseries or Movie for John Adams.\\n\\nDescription above from the Wikipedia article Tom Wilkinson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1948, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4mxZKgdem0sQ8hJd0Y7TREwq7TJ.jpg", Name = "Tom Wilkinson" },
                        new { Id = 223, Biography = "Alejandro González Iñárritu (American Spanish: [aleˈxandɾo gonˈsales iˈɲaritu]; credited since 2014 as Alejandro G. Iñárritu; born August 15, 1963) is a Mexican film director, producer and screenwriter. He is the first Mexican director to be nominated for the Academy Award for Best Director and the Directors Guild of America Award for Outstanding Directing, for Babel (2007).\\n\\nIñárritu's six feature films—Amores perros (2000), 21 Grams (2003), Babel (2006) (comprising the \"Death Trilogy\"), Biutiful (2010), Birdman or (The Unexpected Virtue of Ignorance) (2014), and The Revenant (2015)—have garnered critical acclaim and numerous accolades, including Academy Award nominations and wins. In 2015, Iñárritu won the Academy Award for Best Director, Best Original Screenplay, and Best Picture for Birdman. The following year, he won the Academy Award for Best Director for The Revenant, making him the third director to win back to back Academy Awards, and the first since 1950.\\n\\nHe is friends with fellow Mexican directors Guillermo del Toro and Alfonso Cuarón, collectively known as \"The Three Amigos of Cinema.\"\\n\\nDescription above from the Wikipedia article Alejandro González Iñárritu, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1963, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qWrltG9e0ssM3Y9pF86EAgteKHu.jpg", Name = "Alejandro González Iñárritu" },
                        new { Id = 240, Biography = "Stanley Kubrick (July 26, 1928 – March 7, 1999) was an American film director, writer, producer, and photographer who lived in England during most of the last four decades of his career. Kubrick was noted for the scrupulous care with which he chose his subjects, his slow method of working, the variety of genres he worked in, his technical perfectionism, and his reclusiveness about his films and personal life. He maintained almost complete artistic control, making movies according to his own whims and time constraints, but with the rare advantage of big-studio financial support for all his endeavors. Kubrick's films are characterized by a formal visual style and meticulous attention to detail—his later films often have elements of surrealism and expressionism that eschews structured linear narrative. His films are repeatedly described as slow and methodical, and are often perceived as a reflection of his obsessive and perfectionist nature. A recurring theme in his films is man's inhumanity to man. While often viewed as expressing an ironic pessimism, a few critics feel his films contain a cautious optimism when viewed more carefully.\\n\\nThe film that first brought him attention to many critics was Paths of Glory, the first of three films of his about the dehumanizing effects of war. Many of his films at first got a lukewarm reception, only to be years later acclaimed as masterpieces that had a seminal influence on many later generations of film-makers. Considered especially groundbreaking was 2001: A Space Odyssey noted for being both one of the most scientifically realistic and visually innovative science-fiction films ever made while maintaining an enigmatic non-linear storyline. He voluntarily withdrew his film A Clockwork Orange from England, after it was accused of inspiring copycat crimes which in turn resulted in threats against Kubrick's family. His films were largely successful at the box-office, although Barry Lyndon performed poorly in the United States. Living authors Anthony Burgess and Stephen King were both unhappy with Kubrick's adaptations of their novels A Clockwork Orange and The Shining respectively, and both authors were engaged with subsequent adaptations. All of Kubrick's films from the mid-1950s to his death except for The Shining were nominated for Oscars, Golden Globes, or BAFTAs. Although he was nominated for an Academy Award as a screenwriter and director on several occasions, his only personal win was for the special effects in 2001: A Space Odyssey.\\n\\nEven though all of his films, apart from the first two, were adapted from novels or short stories, his works have been described by Jason Ankeny and others as \"original and visionary\". Although some critics, notably Andrew Sarris and Pauline Kael, frequently disparaged Kubrick's work, Ankeny describes Kubrick as one of the most \"universally acclaimed and influential directors of the postwar era\" with a \"standing unique among the filmmakers of his day.\"\\n\\nDescription above from the Wikipedia article Stanley Kubrick, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1928, 7, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1999, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ywoN9gI2lFOA5EAxxyRbQ1R4GQ6.jpg", Name = "Stanley Kubrick" },
                        new { Id = 244, Biography = "", BirthDate = new DateTime(1939, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2001, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Ray Lovejoy" },
                        new { Id = 255, Biography = "", Name = "Winston Ryder" },
                        new { Id = 258, Biography = "​García Bernal was born in Guadalajara, Mexico, the son of Patricia Bernal, an actress and former model, and José Angel García, an actor and director. His stepfather is Sergio Yazbek, whom his mother married when García Bernal was young. He started acting at just a year old and spent most of his teen years starring in telenovelas. Gael studied the International Baccalaureate, with chemistry being unquestionably his favorite subject. When he was fourteen, he taught indigenous peoples in Mexico to read, often working with the Huichol Indians. In his later teens, he took part in peaceful demonstrations during the Chiapas uprisingof 1994.", BirthDate = new DateTime(1978, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//o4sdHKTBbF8GpooIwp5bvliubyY.jpg", Name = "Gael García Bernal" },
                        new { Id = 275, Biography = "Rodrigo Prieto (born November 1965) is a Mexican cinematographer.\\n\\n Rodrigo Prieto was born in Mexico City, Mexico.  His grandfather, Jorge Prieto Laurens, was the mayor of Mexico City and leader of the Chamber of Deputies of Mexico, but was later persecuted by the country's ruler because of political differences. Prieto's grandfather escaped with his family to Texas and then to Los Angeles. There, Prieto's father would spend most of his childhood. He studied aeronautical engineering at New York University, where he met and married Prieto's mother, an art student. Prieto graduated from Centro de Capacitación Cinematográfica in Mexico City; He has become an established cinematographer, working with such names as Spike Lee(25th Hour), Curtis Hanson (8 Mile), Ang Lee (Brokeback Mountain, Lust, Caution) and Pedro Almodovar (Broken Embraces.) Nonetheless, his political legacy still has a visible effect on his career. In 2002, he shot Frida, a film about Frida Kahlo, a communist Mexican artist. In 2003, he cooperated with Oliver Stone in two documentaryprojects: Comandante, about Fidel Castro, and Persona Non Grata, about Yassir Arafat. In 2004, he shot Alexander for Stone. Prieto also worked with Alejandro González Iñárritu on the acclaimed Amores Perros, 21 Grams, Babel and Biutiful. Prieto has most recently formed an artistic collaboration with Martin Scorsese; first on The Wolf of Wall Street and most recently, Silence.  Prieto is noted for his unconventional use of the camera often combined with strong moody lighting. In 25th Hour, Prieto utilized overexposure and other techniques to create original dream-like images to signify that the events shown on screen are memories or visions. Similarly innovative photography could be spotted in Frida, featuring strong colors and sharp imagery blended with atmospheric yellows and browns, as well as his experimental use of infrared during a battle scene in Alexander. He also is interested in evoking naturalism, most evident in The Homesman and Brokeback Mountain.", BirthDate = new DateTime(1965, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uf5OnYiLnHSiAoeqK6lpWK8O0M8.jpg", Name = "Rodrigo Prieto" },
                        new { Id = 282, Biography = "", BirthDate = new DateTime(1949, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4uJLoVstC1CBcArXFOe53N2fDr1.jpg", Name = "Charles Roven" },
                        new { Id = 284, Biography = "", Name = "Gary Levinsohn" },
