                        new { Id = 335, Biography = "Michael Corbett Shannon (born August 7, 1974) is an American actor and musician. He made his film debut opposite Bill Murray in Groundhog Day (1993) and received widespread attention for his performance in 8 Mile (2002), where he portrayed the boyfriend of Eminem's character's mother (Kim Basinger). Shannon is known for his on-screen versatility, performing in both comedies and dramas. Notable projects include Pearl Harbor (2001), Bad Boys II (2003), Bug (2006), Before the Devil Knows You're Dead (2007), The Iceman (2012), Man of Steel (2013) and Elvis & Nixon (2016). He is a frequent collaborator with Jeff Nichols, appearing in all of his films: Shotgun Stories (2007), Take Shelter (2011), Mud (2012), Midnight Special and Loving (both 2016). He is also known for his role as Nelson Van Alden/George Mueller in the HBO period drama series Boardwalk Empire (2010–2014).\\n\\nShannon has been twice nominated for the Academy Award for Best Supporting Actor, first for Revolutionary Road (2008) and again for Nocturnal Animals (2016). 99 Homes (2014) further earned him nominations for a Screen Actors Guild Award and the Golden Globe Award for Best Supporting Actor – Motion Picture.\\n\\nDescription above from the Wikipedia article Michael Shannon, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1974, 8, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5yGCJ6znHM96zTfW2LNP6uPPDCZ.jpg", Name = "Michael Shannon" },
                        new { Id = 366, Biography = "James Allen Mangold (born 16 December 1963) is an American film director and screenwriter. He is perhaps best known for Walk the Line (2005) which he co-wrote and directed.\\n\\nDescription above from the Wikipedia article James Mangold, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1963, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1gt0VmCyBHhQLKhaBDCEIwvRWe.jpg", Name = "James Mangold" },
                        new { Id = 376, Biography = "", BirthDate = new DateTime(1944, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5crR5twLRcIdvRR06dB1O0EQ8x0.jpg", Name = "Arnon Milchan" },
                        new { Id = 380, Biography = "Robert De Niro, Jr. (born August 17, 1943) is an American actor, director, and producer.\\n\\nHis first major film role was in 1973's Bang the Drum Slowly. In 1974, he played the young Vito Corleone in The Godfather Part II, a role that won him the Academy Award for Best Supporting Actor. His longtime collaboration with Martin Scorsese began with 1973's Mean Streets, and earned De Niro an Academy Award for Best Actor for his portrayal of Jake LaMotta in the 1980 film, Raging Bull. He was also nominated for an Academy Award for his roles in Scorsese's Taxi Driver (1976) and Cape Fear (1991). In addition, he received nominations for his acting in Michael Cimino's The Deer Hunter (1978) and Penny Marshall's Awakenings (1990).\\n\\nHe has received high critical praise in Scorsese's films such as for his portrayals as Travis Bickle in Taxi Driver, Jake Lamotta in Raging Bull, and as Jimmy Conway in Goodfellas. He has earned four nominations for the Golden Globe Award for Best Actor – Motion Picture Musical or Comedy: New York, New York (1977), Midnight Run (1988), Analyze This (1999) and Meet the Parents (2000). He directed A Bronx Tale (1993) and The Good Shepherd (2006).", BirthDate = new DateTime(1943, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lvTSwUcvJRLAJ2FB5qFaukel516.jpg", Name = "Robert De Niro" },
                        new { Id = 388, Biography = "One of England's most versatile character actors, Jim Broadbent was born on May 24, 1949, in Lincolnshire, the youngest son of furniture maker Roy Broadbent and sculptress Dee Broadbent. Jim attended a Quaker boarding school in Reading before successfully applying for a place at an art school. His heart was in acting, though, and he would later transfer to the London Academy of Music and Dramatic Art (LAMDA). Following his 1972 graduation, he began his professional career on the stage, performing with the Royal National Theatre, the Royal Shakespeare Company, and as part of the National Theatre of Brent, a two-man troupe which he co-founded. In addition to his theatrical work, Broadbent did steady work on television, working for such directors as Mike Newell and Stephen Frears. Broadbent made his film debut in 1978 with a small part in Jerzy Skolimowski's The Shout (1978). He went on to work with Frears again in The Hit (1984) and with Terry Gilliam in Time Bandits (1981) and Brazil (1985), but it was through his collaboration with Mike Leigh that Broadbent first became known to an international film audience. In 1990 he starred in Leigh's Life Is Sweet (1990), a domestic comedy that cast him as a good-natured cook who dreams of running his own business. Broadbent gained further visibility the following year with substantial roles in Neil Jordan's The Crying Game (1992) and Mike Newell's Enchanted April (1992), and he could subsequently be seen in such diverse fare as Woody Allen's Bullets Over Broadway (1994), Widows' Peak (1994), Richard Loncraine's highly acclaimed adaptation of Shakespeare's Richard III (1995) and Little Voice (1998), the last of which cast him as a seedy nightclub owner. Appearing primarily as a character actor in these films, Broadbent took center stage for Leigh's Topsy-Turvy (1999), imbuing the mercurial W.S. Gilbert with emotional complexity and comic poignancy. Jim's breakthrough year was 2001, as he starred in three critically and commercially successful films. Many would consider him the definitive supporting actor of that year. First he starred as Bridget's dad (Colin Jones) in Bridget Jones's Diary (2001), which propelled Renée Zellweger to an Oscar nomination for Best Actress. Next came the multiple Oscar-nominated film (including Best Picture) Moulin Rouge! (2001), for which he won a Best Supporting Actor BAFTA award for his scene-stealing performance as Harold Zidler. Lastly, came the small biopic Iris (2001/I), for which he won the Oscar for Best Supporting Actor as devoted husband John Bayley to Judi Dench's Iris Murdoch, the British novelist who suffered from Alzheimer's disease. The film hit home with Jim, since his own mother had passed away from Alzheimer's in 1995.", BirthDate = new DateTime(1949, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//50TV6UKJKjmqdn1GQNuuCIYHLzP.jpg", Name = "Jim Broadbent" },
                        new { Id = 390, Biography = "", Name = "Irene Lamb" },
                        new { Id = 432, Biography = "From Wikipedia, the free encyclopedia.  \\n\\nPhedon Papamichael (Greek: Φαίδων Παπαμιχαήλ, born 1962) is a cinematographer and film director.\\n\\nBorn in Athens, Greece, Papamichael came to the United States at age six when his father went to work as a production designer for John Cassavetes. He studied photography and art at the University of Munich, graduating with a degree in Fine Arts in 1982. He learned cinematography on the job, starting with Dance of the Damned in 1988.\\n\\nPapamichael made his directorial debut with Showtime's Sketch Artist in 1992. He also directed the 1994 independent film Dark Side of Genius. He has been a member of the American Society of Cinematographers (ASC) since 2000. In the same year he won the Prix Vision at the Avignon Film Festival for 27 Missing Kisses.\\n\\nPhedon's most recent directed film From Within premiered April 25, 2008 at the Tribeca Film Festival and was later included as one of the films in the third After Dark Films 8 Films to Die For series.\\n\\nDescription above from the Wikipedia article Phedon Papamichael, licensed under CC-BY-SA, full list of contributors on Wikipedia", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vsALQXJ7XDO3VPwS4kEYtqqLkeV.jpg", Name = "Phedon Papamichael" },
