                        new { Id = 449, Biography = "Jonathan Adam Saunders \"Jay\" Baruchel (born April 9, 1982) is a Canadian actor. He has had a successful career in comedy films, and has appeared in such box office successes as Million Dollar Baby, Knocked Up, Tropic Thunder, and How to Train Your Dragon, as well as the films She's Out of My League, The Trotsky, and The Sorcerer's Apprentice.\\n\\nDescription above from the Wikipedia article Jay Baruchel, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1982, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7EX0od3FwdaoEegJlY1q0kZgEqt.jpg", Name = "Jay Baruchel" },
