                        new { Id = 477, Biography = "Julie Walters is an English actress and novelist.\\n\\nWalters was born as Julia Mary Walters in Smethwick, Sandwell, the daughter of Mary Bridget, a postal clerk of Irish Catholic extraction, and Thomas Walters, a builder and decorator.\\n\\nWalters met her husband, Grant Roffey, an AA patrol man, in a whirlwind romance. The couple have a daughter, Maisie Mae Roffey (born 1988, City of Westminster, London), but did not marry until 1997, 11 years into their relationship, when they went to New York. The couple live on an organic farm run by Roffey in West Sussex.", BirthDate = new DateTime(1950, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//f88FYv3EYWvbXaeTXyO56dWCbez.jpg", Name = "Julie Walters" },
                        new { Id = 486, Biography = "Wallace Wolodarsky is an American television writer and director. He wrote for The Simpsons during the first four seasons; all of his episodes were co-written with former writing partner Jay Kogen. Since he left, he has directed several films (the most notable being Sorority Boys).\\n\\nAccording to DVD commentary for the season 9 episode, \"Miracle on Evergreen Terrace\", Wolodarsky had a wiffle ball bat that read \"I KEELL YOU!\" which was one of the threats spray-painted on The Simpsons' car after the family is shunned by the town for lying to them about a robber stealing the family's Christmas tree.\\n\\nThe character \"Vladimir Wolodarsky\" in The Life Aquatic with Steve Zissou was named after him. He has roles in Rushmore and The Darjeeling Limited, and is a voice actor in Fantastic Mr. Fox.\\n\\nDescription above from the Wikipedia article Wallace Wolodarsky, licensed under CC-BY-SA, full list of contributors on Wikipedia.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dvmEq92L4UwL20uO2BOQ8vnpPBP.jpg", Name = "Wallace Wolodarsky" },
                        new { Id = 488, Biography = "Steven Allan Spielberg (born December 18, 1946) is an American film director, screenwriter, producer, and studio entrepreneur.\\n\\nIn a career of more than four decades, Spielberg's films have covered many themes and genres. Spielberg's early science-fiction and adventure films were seen as archetypes of modern Hollywood blockbuster filmmaking. In later years, his films began addressing issues such as the Holocaust, the Transatlantic slave trade, war, and terrorism. He is considered one of the most popular and influential filmmakers in the history of cinema. He is also one of the co-founders of DreamWorks movie studio.\\n\\nSpielberg won the Academy Award for Best Director for Schindler's List (1993) and Saving Private Ryan (1998). Three of Spielberg's films—Jaws (1975), E.T. the Extra-Terrestrial (1982), and Jurassic Park (1993)—achieved box office records, each becoming the highest-grossing film made at the time. To date, the unadjusted gross of all Spielberg-directed films exceeds $8.5 billion worldwide. Forbes puts Spielberg's wealth at $3.2 billion.", BirthDate = new DateTime(1946, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pOK15UNaw75Bzj7BQO1ulehbPPm.jpg", Name = "Steven Spielberg" },
