                        new { Id = 496, Biography = "Rick Carter is an American production designer and art director. He is known for his work in the film Forrest Gump, which earned him an Oscar nomination, as well as numerous nominations of other awards for his work in Amistad and A.I.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nIkkWGDlvAuZUAmVQZOIKew9kxw.jpg", Name = "Rick Carter" },
                        new { Id = 498, Biography = "", Name = "Joanna Johnston" },
                        new { Id = 500, Biography = "Thomas \"Tom\" Cruise (born Thomas Cruise Mapother IV; July 3, 1962) is an American actor and filmmaker. He has been nominated for three Academy Awards and has won three Golden Globe Awards.\\n\\nHe started his career at age 19 in the 1981 film Endless Love. After portraying supporting roles in Taps (1981) and The Outsiders (1983), his first leading role was in Risky Business, released in August 1983. Cruise became a full-fledged movie star after starring as Pete \"Maverick\" Mitchell in Top Gun (1986). He has since 1996 been well known for his role as secret agent Ethan Hunt in the Mission: Impossible film series. One of the biggest movie stars in Hollywood, Cruise has starred in many successful films, including The Color of Money (1986), Cocktail (1988), Rain Man (1988), Born on the Fourth of July (1989), Far and Away(1992), A Few Good Men (1992), The Firm (1993), Interview with the Vampire: The Vampire Chronicles (1994), Jerry Maguire (1996), Eyes Wide Shut (1999), Magnolia (1999), Vanilla Sky (2001), Minority Report (2002),The Last Samurai (2003), Collateral (2004), War of the Worlds (2005), Lions for Lambs (2007), Valkyrie (2008), Knight and Day (2010), Jack Reacher (2012), Oblivion (2013), and Edge of Tomorrow (2014).\\n\\nIn 2012, Cruise was Hollywood's highest-paid actor. Fifteen of his films grossed over $100 million domestically; twenty-one have grossed in excess of $200 million worldwide. Cruise is known for his support for the Church of Scientology and its affiliated social programs. From: Wikipedia.", BirthDate = new DateTime(1962, 7, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3oWEuo0e8Nx8JvkqYCDec2iMY6K.jpg", Name = "Tom Cruise" },
                        new { Id = 502, Biography = "Miranda Otto  (born 16 December 1967) is an Australian actress. The daughter of actors Lindsay and Barry Otto and the sister of actress Gracie Otto, she began acting at age eighteen, and has performed in a variety of independent and major studio films. Her first major film appearance was in the 1986 film Emma's War, in which she played a teenager who moves to Australia's bush country during World War II. After a decade of critically acclaimed roles in Australian films, she gained Hollywood's attention after appearing in supporting roles in The Thin Red Line (1998) and What Lies Beneath (2000). Her breakthrough role came in 2002, when she portrayed Éowyn in The Lord of the Rings trilogy. More recent work includes a starring role in the 2008 now-cancelled American television series Cashmere Mafia, and Australian films such as In Her Skin and Blessed (2009).\\n\\nDescription above from the Wikipedia article Miranda Otto, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1967, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pp6WCSXw3EHOSNSG5jUDspuiFgf.jpg", Name = "Miranda Otto" },
                        new { Id = 508, Biography = "​From Wikipedia, the free encyclopedia.  David Koepp  (born June 9, 1963) is an American screenwriter and director.  Description above from the Wikipedia article David Koepp, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1963, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3A7kfyMXaVjGcSbGdRD25msbHcj.jpg", Name = "David Koepp" },
                        new { Id = 511, Biography = "", BirthDate = new DateTime(1949, 4, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Larry J. Franco" },
                        new { Id = 514, Biography = "John Joseph \"Jack\" Nicholson (born April 22, 1937) is an American actor, film director, producer and writer. He is renowned for his often dark-themed portrayals of neurotic characters. Nicholson has been nominated for Academy Awards 12 times. He has won the Academy Award for Best Actor twice, for One Flew Over the Cuckoo's Nest and for As Good as It Gets. He won the Academy Award for Best Supporting Actor for the 1983 film Terms of Endearment. He is tied with Walter Brennan for most acting wins by a male actor (three), and second to Katharine Hepburn for most acting wins overall (four).\\n\\nHe is also one of only two actors nominated for an Academy Award for acting (either lead or supporting) in every decade from the 1960s to 2000s (the other one being Michael Caine). He has won seven Golden Globe Awards, and received a Kennedy Center Honor in 2001. In 1994, he became one of the youngest actors to be awarded the American Film Institute's Life Achievement Award. Notable films in which he has starred include, in chronological order, Easy Rider, Five Easy Pieces, Chinatown, One Flew Over the Cuckoo's Nest, The Shining, The Postman Always Rings Twice, Reds, Terms of Endearment, Batman, A Few Good Men, As Good as It Gets, About Schmidt, Something's Gotta Give and The Departed.\\n\\nDescription above from the Wikipedia article Jack Nicholson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1937, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//z5kVLyn3sxj0wNRlFgVgT6deeRO.jpg", Name = "Jack Nicholson" },
                        new { Id = 515, Biography = "Glenn Close (born March 19, 1947) is an American actress and singer of theatre and film, known for her roles as a femme fatale (the scheming Marquise de Merteuil in Dangerous Liaisons (1988), and deranged stalker Alex Forrest in Fatal Attraction (1987). She is also known for playing Cruella de Vil in 101 Dalmatians (1996), and its sequel 102 Dalmatians (2000). She has been more recently known for her Emmy winning role as Patty Hewes in the FX TV series Damages. She has been nominated five times for an Oscar, and once for a BAFTA Film Award, and has won three Tonys, an Obie, three Emmys, two Golden Globes, and a Screen Actors Guild Award. Description above from the Wikipedia article Glenn Close, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 3, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fF6tCfuvuUhaePm5onUNnIE4FvL.jpg", Name = "Glenn Close" },
                        new { Id = 518, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDaniel Michael \"Danny\" DeVito, Jr. (born November 17, 1944 height 5' (1,52 m)) is an American actor, comedian, director, and producer. He first gained prominence for his portrayal of Louie De Palma on the ABC and NBC TV series Taxi (1978–1983), for which he won a Golden Globe and an Emmy.\\n\\nDeVito and his wife, Rhea Perlman, founded Jersey Films, a production company known for films such as Pulp Fiction, Garden State, and Freedom Writers. DeVito also owns Jersey Television, which produced the Comedy Central series Reno 911!. DeVito and Perlman also starred together in his 1996 film Matilda, based on Roald Dahl's children's novel. He currently stars as Frank Reynolds on the FX sitcom It's Always Sunny in Philadelphia.\\n\\nDescription above from the Wikipedia article Danny DeVito, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1944, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zKuyzmKzPLG7RJo7lbbHjx6CCZc.jpg", Name = "Danny DeVito" },
                        new { Id = 521, Biography = "Born Michael Andrew Fox in Edmonton, Alberta, Canada, he adopted the \"J\" as an homage to character actor Michael J. Pollard. Moving several times during the course of his childhood, Michael and his family settled in Burnaby, a suburb of Vancouver. At the age of 15 he made his professional acting debut in the situation comedy \"Leo and Me\" (1981).\\n\\nMoving to Los Angeles at the age of 18, Fox appeared in several small parts and a television series, \"Palmerstown, U.S.A.\" (1980), before landing the role that would bring him to prominence in \"Family Ties\" (1982). Some of his other films include Bright Lights, Big City (1988), The Hard Way (1991), Light of Day (1987), Doc Hollywood (1991) and the three \"Back to the Future\" films.", BirthDate = new DateTime(1961, 6, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2CwTJuL6UHqPJ82oh8WpWUw8Q0V.jpg", Name = "Michael J. Fox" },
                        new { Id = 525, Biography = "Christopher Jonathan James Nolan (born July 30, 1970) is a British/American film director, screenwriter and producer. He is known for writing and directing such critically acclaimed films as Memento (2000), Insomnia (2002), The Prestige (2006), Inception (2010), and rebooting the Batman film franchise. Nolan is the founder of the production company Syncopy Films. He often collaborates with his wife, producer Emma Thomas, and his brother, screenwriter Jonathan Nolan, as well as cinematographer Wally Pfister, film editor Lee Smith, composers David Julyan and Hans Zimmer, special effects coordinator Chris Corbould, and actors Christian Bale and Michael Caine. Nolan's most critically and commercially successful film is The Dark Knight.\\n\\nDescription above from the Wikipedia article Christopher Nolan, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1970, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7OGmfDF4VHLLgbjxuEwTj3ga0uQ.jpg", Name = "Christopher Nolan" },
                        new { Id = 526, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nLukas Daniel Haas (born April 16, 1976) is an American actor, known for roles both as a child and as an adult. His career has spanned more than 20 years during which time he has appeared in more than 36 feature films, as well as a number of television shows and theater productions.\\n\\nDescription above from the Wikipedia article Lukas Haas, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 4, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1n1CTF6fi52BF407iQU6aMMKWFU.jpg", Name = "Lukas Haas" },
                        new { Id = 527, Biography = "Jonathan \"Jonah\" Nolan (born 1976) is a British-American author and screenwriter. His most famous work is the short story \"Memento Mori\", which was used by his brother, director Christopher Nolan, as the basis for the screenplay for the critically acclaimed film Memento. He has also co-written the screenplays for The Prestige and The Dark Knight, with his brother.\\n\\nDescription above from the Wikipedia article Jonathan Nolan, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1976, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rYBQ8M3hDDY0eThVIvWHmrf4i0Y.jpg", Name = "Jonathan Nolan" },
                        new { Id = 535, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7JFQueMbXqGIz16wKBlok7WfNNz.jpg", Name = "Russ Fega" },
                        new { Id = 539, Biography = "From Wikipedia, the free encyclopedia\\n\\nThomas Patrick Lennon (born August 9, 1970) is an American actor, comedian, writer, director and producer best known as a cast member on MTV's The State and for his role as Lieutenant Jim Dangle on the Comedy Central series Reno 911!.\\n\\nDescription above from the Wikipedia article Thomas Lennon (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1970, 8, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oq83rqBNfgpB2IEHRbs7cbTvzbd.jpg", Name = "Thomas Lennon" },
                        new { Id = 547, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cdOR8cgySFsgxWtp6hGA3eMsVra.jpg", Name = "Victoria Thomas" },
                        new { Id = 555, Biography = "", Name = "Nancy Haigh" },
                        new { Id = 556, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//f12TsNlAEomPdwxueS7ImMoJtsP.jpg", Name = "Emma Thomas" },
                        new { Id = 559, Biography = "Wally Pfister was born on July 8, 1961 in Chicago, Illinois, USA as Walter Pfister. He is known for his work on The Dark Knight (2008), Inception (2010) and The Dark Knight Rises (2012). He has been married to Anna Julien since 1992.", BirthDate = new DateTime(1961, 7, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tyYtVatXW16EM7NYJZkxI3K2NQi.jpg", Name = "Wally Pfister" },
                        new { Id = 561, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//quM89TMS6BncoIh4NdlWugXVhuF.jpg", Name = "John Papsidera" },
                        new { Id = 578, Biography = "Scott was born in South Shields, Tyne and Wear, England, the son of Elizabeth and Colonel Francis Percy Scott. He was raised in an Army family, meaning that for most of his early life, his father — an officer in the Royal Engineers — was absent. Ridley's older brother, Frank, joined the Merchant Navy when he was still young and the pair had little contact. During this time the family moved around, living in (among other areas) Cumbria, Wales and Germany. He has a younger brother, Tony, also a film director. After the Second World War, the Scott family moved back to their native north-east England, eventually settling in Teesside (whose industrial landscape would later inspire similar scenes in Blade Runner). He enjoyed watching films, and his favourites include Lawrence of Arabia, Citizen Kane and Seven Samurai. Scott studied in Teesside from 1954 to 1958, at Grangefield Grammar School and later in West Hartlepool College of Art, graduating with a Diploma in Design. He progressed to an M.A. in graphic design at the Royal College of Art from 1960 to 1962.\\n\\nAt the RCA he contributed to the college magazine, ARK and helped to establish its film department. For his final show, he made a black and white short film, Boy and Bicycle, starring his younger brother, Tony Scott, and his father. The film's main visual elements would become features of Scott's later work; it was issued on the 'Extras' section of The Duellists DVD. After graduation in 1963, he secured a job as a trainee set designer with the BBC, leading to work on the popular television police series Z-Cars and the science fiction series Out of the Unknown. Scott was an admirer of Stanley Kubrick early in his development as a director. For his entry to the BBC traineeship, Scott remade Paths of Glory as a short film.\\n\\nHe was assigned to design the second Doctor Who serial, The Daleks, which would have entailed realising the famous alien creatures. However, shortly before Scott was due to start work, a schedule conflict meant that he was replaced on the serial by Raymond Cusick.\\n\\nAt the BBC, Scott was placed into a director training programme and, before he left the corporation, had directed episodes of Z-Cars, its spin-off, Softly, Softly, and adventure series Adam Adamant Lives!\\n\\nIn 1968, Ridley and Tony Scott founded Ridley Scott Associates (RSA), a film and commercial production company.Five members of the Scott family are directors, all working for RSA. Brother Tony has been a successful film director for more than two decades; sons, Jake and Luke are both acclaimed commercials directors as is his daughter, Jordan Scott. Jake and Jordan both work from Los Angeles and Luke is based in London.\\n\\nIn 1995, Shepperton Studios was purchased by a consortium headed by Ridley and Tony Scott, which extensively renovated the studios while also expanding and improving its grounds.  ", BirthDate = new DateTime(1937, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oTAL0z0vsjipCruxXUsDUIieuhk.jpg", Name = "Ridley Scott" },
                        new { Id = 587, Biography = "Edward James Olmos (born February 24, 1947) is a Mexican American actor and director. Among his most memorable roles are William Adama in the re-imagined Battlestar Galactica, Lt. Martin Castillo in Miami Vice, teacher Jaime Escalante in Stand and Deliver, patriarch Abraham Quintanilla in the film Selena, Detective Gaff in Blade Runner, and narrator El Pachuco in both the stage and film versions of Zoot Suit. Description above from the Wikipedia article Edward James Olmos, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//i7zKqsFqL5L1HPmAMeSA1xZzlD5.jpg", Name = "Edward James Olmos" },
                        new { Id = 592, Biography = "Joseph Turkel is a  prolific American character actor. He is noted for his craggy Bronx looks and distinctive, penetrating voice. Turkel worked steadily from 1949 - 1998 in both films and television. He retired in 1998. He still makes the occasional appearance at fan conventions even at the age of 90+.", BirthDate = new DateTime(1927, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//p8qRmki4MnEwiuTcGJH0LZVZxdz.jpg", Name = "Joe Turkel" },
                        new { Id = 596, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kvhIAnrrVdOdAwQ3ps1KkOTyW77.jpg", Name = "Lawrence G. Paull" },
                        new { Id = 597, Biography = "", Name = "Jane Feinberg" },
                        new { Id = 598, Biography = "", Name = "Mike Fenton" },
                        new { Id = 608, Biography = "Hayao Miyazaki (Miyazaki Hayao, born January 5, 1941) is a Japanese manga artist and prominent film director and animator of many popular anime feature films. Through a career that has spanned nearly five decades, Miyazaki has attained international acclaim as a maker of animated feature films and, along with Isao Takahata, co-founded Studio Ghibli, an animation studio and production company. The success of Miyazaki's films has invited comparisons with American animator Walt Disney, British animator Nick Park as well as Robert Zemeckis, who pioneered Motion Capture animation, and he has been named one of the most influential people by Time Magazine.\\n\\nMiyazaki began his career at Toei Animation as an in-between artist for Gulliver's Travels Beyond the Moon where he pitched his own ideas that eventually became the movie's ending. He continued to work in various roles in the animation industry over the decade until he was able to direct his first feature film Lupin III: The Castle of Cagliostro which was published in 1979. After the success of his next film, Nausicaä of the Valley of the Wind, he co-founded Studio Ghibli where he continued to produce many feature films until Princess Mononoke whereafter he temporarily retired.\\n\\nWhile Miyazaki's films have long enjoyed both commercial and critical success in Japan, he remained largely unknown to the West until Miramax released his 1997 film, Princess Mononoke. Princess Mononoke was the highest-grossing film in Japan—until it was eclipsed by another 1997 film, Titanic—and the first animated film to win Picture of the Year at the Japanese Academy Awards. Miyazaki returned to animation with Spirited Away. The film topped Titanic's sales at the Japanese box office, also won Picture of the Year at the Japanese Academy Awards and was the first anime film to win an American Academy Award.\\n\\nMiyazaki's films often incorporate recurrent themes, such as humanity's relationship to nature and technology, and the difficulty of maintaining a pacifist ethic. Reflecting Miyazaki's feminism, the protagonists of his films are often strong, independent girls or young women. Miyazaki is a vocal critic of capitalism and globalization.[3] While two of his films, The Castle of Cagliostro and Castle in the Sky, involve traditional villains, his other films such as Nausicaa or Princess Mononoke present morally ambiguous antagonists with redeeming qualities.", BirthDate = new DateTime(1941, 1, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1OBQPIwR88n49oAEzk47k0fhhOV.jpg", Name = "Hayao Miyazaki" },
                        new { Id = 628, Biography = "Isao Takahata, co-founder of Studio Ghibli, is one of the most famous directors of Japanese animated films. Unlike most anime directors, he doesn't draw and never worked as an animator before becoming a director.", BirthDate = new DateTime(1935, 10, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fzteqJkXW3mzNC9KZuH5ejPSut1.jpg", Name = "Isao Takahata" },
                        new { Id = 636, Biography = "Joe Hisaishi is a Japanese composer and director known for over 100 film scores and solo albums dating back to 1981. While possessing a stylistically distinct sound, his music has been known to explore and incorporate different genres.", BirthDate = new DateTime(1950, 12, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9U16jEYcoCyXGBpHrSQ7pZGdHfd.jpg", Name = "Joe Hisaishi" },
                        new { Id = 655, Biography = "​From Wikipedia, the free encyclopedia.   John Rhys-Davies (born 5 May 1944) is a Welsh actor and vocal artist. He is perhaps best known for playing the charismatic Arab excavator Sallah in the Indiana Jones films and the dwarf Gimli in The Lord of the Rings trilogy, in which he also voiced the ent, Treebeard. He also played Agent Michael Malone in the 1993 remake of the 1950s television series The Untouchables, Professor Maximillian Arturo in Sliders, King Richard I in Robin of Sherwood, General Leonid Pushkin in the James Bond film The Living Daylights, and Macro in I, Claudius. Additionally, he provided the voices of Cassim in Disney's Aladdin and the King of Thieves, Man Ray in SpongeBob SquarePants, and Tobias in the computer game Freelancer. He is also the narrator for the TV show Wildboyz. Description above from the Wikipedia article  John Rhys-Davies, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1944, 5, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dvT1NPY8CXIVQh0O1h6rpfYOgKz.jpg", Name = "John Rhys-Davies" },
                        new { Id = 664, Biography = "​From Wikipedia, the free encyclopedia.    Frank Wilton Marshall (born September 13, 1946) is an American film producer and director, often working in collaboration with his wife, Kathleen Kennedy. With Kennedy and Steven Spielberg, he was one of the founders of Amblin Entertainment. He is a partner with Kennedy in The Kennedy/Marshall Company, a film production company formed in 1991, which signed a new contract with Columbia Pictures effective April 1, 2009 and in force through to October 31, 2011.  Description above from the Wikipedia article Frank Marshall (film producer), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dVPOD85wQ1Xscpe3DOVQ1I59IIF.jpg", Name = "Frank Marshall" },
                        new { Id = 665, Biography = "", Name = "Howard G. Kazanjian" },
                        new { Id = 668, Biography = "", BirthDate = new DateTime(1936, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2004, 4, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Mary Selway" },
                        new { Id = 669, Biography = "", BirthDate = new DateTime(1934, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Norman Reynolds" },
                        new { Id = 670, Biography = "From Wikipedia, the free encyclopedia.  Benjamin \"Ben\" Burtt, Jr. (born July 12, 1948) is an American sound designer for the films Star Wars (1977), Invasion of the Body Snatchers (1978), Raiders of the Lost Ark (1981), E.T. the Extra-Terrestrial (1982), Indiana Jones and the Last Crusade (1989) and WALL-E (2008). He is also a film editor and director, screenwriter, and voice actor.  He is most notable for creating many of the iconic sound effects heard in the Star Wars film franchise, including the \"voice\" of R2-D2, the lightsaber hum and the heavy-breathing sound of Darth Vader.  Description above from the Wikipedia article Ben Burtt, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1948, 7, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nfkHcZkAIGEyJ0m2jtOKaPyqNxu.jpg", Name = "Ben Burtt" },
                        new { Id = 671, Biography = "", Name = "Richard L. Anderson" },
                        new { Id = 694, Biography = "From Wikipedia, the free encyclopedia  Philip Stone (14 April 1924 – 15 June 2003) was an English actor.  He was born Philip Stones in Leeds, West Riding of Yorkshire. Stone appeared in three successive Stanley Kubrick films: playing the central character Alex's \"Dad\" in A Clockwork Orange (1971), \"Graham\" (the Lyndon family lawyer) in Barry Lyndon (1975) and as \"Delbert Grady,\" the original caretaker in The Shining (1980). The only other actor to be credited in three Kubrick films is Joe Turkel.  Other notable film roles included parts in Unearthly Stranger (1964),Thunderball (1965), Where Eagles Dare (1968), Two Gentlemen Sharing(1969), Fragment of Fear (1970), Quest for Love (1971), Carry On Loving(1971), O Lucky Man! (1973), Hitler: The Last Ten Days (1973), Voyage of the Damned (1976), It Shouldn't Happen to a Vet (1977), The Medusa Touch (1978),S.O.S. Titanic (1979), Flash Gordon (1980), Green Ice (1981), Indiana Jones and the Temple of Doom (1984) and Shadowlands (1985). In the 1978 Ralph Bakshi's animated film The Lord of the Rings, he voiced the role of Théoden.  Stone was also a prolific stage and television actor, appearing in many popular TV series, including the very first Avengers episode, The Rat Catchers, Dalziel and Pascoe, A Touch of Frost, Heartbeat, Yes Minister, Justice and Coronation Street.", BirthDate = new DateTime(1924, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2003, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2thWE9JSWeYj1Oea0uwNtF8ntrJ.jpg", Name = "Philip Stone" },
                        new { Id = 711, Biography = "Robert Watts was a British producer and production manager for film projects, amongst others for the \"Indiana Jones\" and the \"Star Wars\" universes.", BirthDate = new DateTime(1938, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//28BlqdvRGNAdbWuzdXAIYissbgZ.jpg", Name = "Robert Watts" },
                        new { Id = 722, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJennifer Elise Grey (born March 26, 1960) is an American actress. She is best known for playing Frances \"Baby\" Houseman in the hit film Dirty Dancing (1987), Jeanie Bueller in Ferris Bueller's Day Off (1986) and for being the winner of season 11 of the American version of Dancing with the Stars.\\n\\nDescription above from the Wikipedia article Jennifer Grey, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rlJes7UWZXnykKBEmBh6ilx1Sb1.jpg", Name = "Jennifer Grey" },
                        new { Id = 735, Biography = "Art Repola is the Senior Vice President of Visual Effects and Production for the Walt Disney Motion Pictures Group. Repola is responsible for all aspects of Visual Effects production for the studio's various banners, including Disney, Touchstone and Hollywood Pictures. In this role he has managed the visual effects on more than 80 Disney live action films, including \"Pearl Harbor,\" \"Armageddon,\" \"Inspector Gadget\" and \"Mighty Joe Young.\" He is also the Executive in Charge of Production for the company's Large Format film business. He was previously responsible for overseeing the operation of Dream Quest Images, the Academy Award®-winning visual effects facility, which was acquired in 1996 by the Walt Disney Studios. Under Repola's leadership, Disney Studios has received three Academy Award® nominations for Best Visual Effects.\\n\\nRepola had previously worked at the Walt Disney Studios where he served as Vice President of Post Production for Hollywood Pictures. Following that, he co-wrote and produced a Special Venue-High-Definition, Interactive film for the Sony Corporation. This educational film details Sound and Picture technologies through the use of live-action, computer graphics and traditional animation. He went on to produce a television pilot, and also served as the Associate Producer on the 1995 fantasy film, \"The Indian in the Cupboard.\" Before rejoining Disney, he served as Vice President of Film and Video Production for the Universal Theme Parks. There his credits included Executive Producer of the innovative 12-minute, 3D film featured in the theme park attraction, \"T2 -- 3D: Battle Across Time,\" which was directed by James Cameron and stars Arnold Schwarzenegger. Repola began his professional career in the International Film department at 20th Century Fox. After working on the foreign versions of George Lucas' \"Star Wars,\" he joined Lucasfilm's Marin County-based Industrial Light and Magic (ILM) as a visual effects editor, eventually being named Visual Effects Producer. During his stay at ILM, he contributed to such ground-breaking projects as \"The Empire Strikes Back,\" \"Raiders of the Lost Ark,\" \"Indiana Jones and the Temple of Doom,\" \"Dragonslayer\" and \"Return of the Jedi.\"\\n\\nAfter moving back to Los Angeles, Repola became a member of the team at Boss Films, which was responsible for the visual effects on \"Ghostbusters\" and \"2010\". He then joined Steven Spielberg's Amblin Entertainment as the Executive in Charge of Post Production, supervising the post activities for such projects as \"Back to the Future,\" \"The Color Purple\" and \"Empire of the Sun,\" among others. He also served as the Associate Producer for Lucasfilm's \"Indiana Jones and the Last Crusade.\"\\n\\nRepola is a member of the Academy of Motion Picture Arts and Sciences and serves on the Board of Directors of the Visual Effects Society.\\n\\n- IMDb Mini Biography", BirthDate = new DateTime(1953, 8, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Arthur F. Repola" },
                        new { Id = 740, Biography = "Primarily a classical stage actor, Julian Glover trained at the National Youth Theatre, performed with the Royal Shakespeare Company and became a familiar face to British television viewers by appearing in many popular series during the 1960s and 1970s. His talent for accents and cold expression made him an ideal choice for playing refined villains. During the 1980s, Glover achieved some fame in Hollywood by playing roles in such popular films as Star Wars: Episode V - The Empire Strikes Back (1980), For Your Eyes Only (1981) and Indiana Jones and the Last Crusade (1989).", BirthDate = new DateTime(1935, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2sQWrB4of8O2k7DGwJ3OdGJi2Mj.jpg", Name = "Julian Glover" },
                        new { Id = 752, Biography = "", Name = "Judy Taylor" },
                        new { Id = 783, Biography = "Jonathan Banks (born January 31, 1947) is an American character actor in film and television. He tends to play villains.\\n\\nBanks dropped out of Indiana University to join a touring company as a stage manager. He went to Australia with the company and stayed on working in theatre there. In 1974, he moved to Los Angeles and performed on stage before picking up bit parts on television. Probably his best-known movie roles are in two films starring Eddie Murphy: 48 Hrs. and Beverly Hills Cop. In 48 Hrs. he plays a character who is a friend of the lead and is killed by the villain, beginning the lead characters' story. In Beverly Hills Cop, he plays a villain who kills the lead characters' friend and begins his story. Other movie roles include appearances in Armed and Dangerous, Freejack, Flipper, Airplane!, Gremlins, Murder Me, Murder You, and Under Siege 2: Dark Territory. His most recent film to date is the 2007 film Reign Over Me.\\n\\nHis biggest break on television, came with the series Wiseguy, in which he played Frank McPike for four years, a role which led to an Emmy award nomination. Although his character was primarily the hero's mentor, stories occasionally featured McPike as hero. In 1981 he appeared as Dutch Schultz on the NBC series the Gangster Chronicles. He also starred on the short-lived science fiction TV series Otherworld, as Kommander Neveen Kroll and in the sitcom Fired Up.\\n\\nBanks has also made guest appearances on TV shows including Alias, CSI, Day Break, Highlander: The Series, Matlock, SeaQuest DSV, Star Trek: Deep Space Nine, Women of the House and Walker Texas Ranger. Most recently, Banks appeared in the final Season Two episodes of Dexter, and in episodes of ER, Cold Case, and Shark, Modern Family. In the second season finale of Breaking Bad, Banks appeared as a mysterious character named Mike. Banks was made a series regular for the third season.", BirthDate = new DateTime(1947, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//s6K0lromCtmSTzuX9hig8OPiRsC.jpg", Name = "Jonathan Banks" },
                        new { Id = 785, Biography = "From Wikipedia, the free encyclopedia\\n\\nJames Vincent Russo (born April 23, 1953) is an American film and television actor. He has starred in over 90 films in three decades.\\n\\nDescription above from the Wikipedia article James Russo, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1953, 4, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tV4X0uEuqu6XYml3yEs9rsG9EzW.jpg", Name = "James Russo" },
                        new { Id = 794, Biography = "", Name = "Angelo P. Graham" },
                        new { Id = 796, Biography = "", Name = "John M. Dwyer" },
                        new { Id = 819, Biography = "Edward Harrison Norton (born August 18, 1969) is an American actor, screenwriter, film director and producer. In 1996, his supporting role in the courtroom drama Primal Fear garnered him a nomination for the Academy Award for Best Supporting Actor. Two years later, his lead role as a reformed white power skinhead in American History X earned a nomination for Academy Award for Best Actor. His other films include period dramas such as Kingdom of Heaven (2005), The Illusionist (2006), and The Painted Veil (2006); and other notable films such as Rounders (1998), Fight Club (1999), 25th Hour (2002), Red Dragon (2002), and The Incredible Hulk (2008).\\n\\nIn addition to acting, Norton is also a writer and director. He made his directorial debut with the film Keeping the Faith (2000) and is slated to direct the film adaptation of the novel Motherless Brooklyn. Norton did uncredited work on the scripts for The Score, Frida, and The Incredible Hulk.\\n\\nIn his private life, Norton is an environmental and social activist. He is a member of the board of trustees of Enterprise Community Partners, a non-profit organization for developing affordable housing, founded by his grandfather, James Rouse. Norton is president of the American branch of the Maasai Wilderness Conservation Trust. He ran in the 2009 New York City Marathon to raise money for the Trust. He also raises money for charity through Crowdrise, a social networking community for volunteers and a micro-donations fundraising platform. In July 2010, Norton was designated as the United Nations Goodwill Ambassador for Biodiversityby UN Secretary-General Ban Ki-moon.", BirthDate = new DateTime(1969, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eIkFHNlfretLS1spAcIoihKUS62.jpg", Name = "Edward Norton" },
                        new { Id = 824, Biography = "Ethan Suplee (born May 25, 1976) is an American film and television actor best known for his roles as Seth Ryan in American History X, Louie Lastik in Remember the Titans, Frankie in Boy Meets World, Randy Hickey in My Name Is Earl, Thumper in The Butterfly Effect, Dewey in Unstoppable, and his roles in Kevin Smith films.\\n\\nDescription above from the Wikipedia article Ethan Suplee, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tdfUFBwYm9rjwD2YtVl9LYoyoE2.jpg", Name = "Ethan Suplee" },
                        new { Id = 882, Biography = "Liv Rundgren Tyler is an American actress and model. She is the daughter of Aerosmith's lead singer, Steven Tyler, and Bebe Buell, model and singer. Tyler began a career in modeling at the age of 14, but after less than a year she decided to focus on acting. She made her film debut in the 1994 film Silent Fall. She then appeared in supporting roles in Empire Records (1995), Heavy (1996), and That Thing You Do! (1996). Tyler later achieved critical recognition in the leading role Stealing Beauty (1996). She followed this by starring in supporting roles including Inventing the Abbotts (1997) and Cookie's Fortune (1999).\\n\\nTyler achieved international recognition as a result of her portrayal of Elf maiden Arwen Undómiel in the Lord of the Rings film trilogy. She has appeared in an eclectic range of films, including the 2004 comedy Jersey Girl, the indie film Lonesome Jim (2005), the drama Reign Over Me (2007) and big-budget studio films such as Armageddon (1998), The Strangers (2008) and The Incredible Hulk (2008).\\n\\nSince 2003, Tyler has served as a United Nations Children's Fund (UNICEF) Goodwill Ambassador for the United States, and as a spokesperson for Givenchy's line of perfume and cosmetics. Tyler married musician Royston Langdon of the band Spacehog in 2003; they have one son, Milo, born December 14, 2004. The couple announced their separation in May 2008.  ", BirthDate = new DateTime(1977, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jDxaBShnipKE2wvRaHavTtZb0qk.jpg", Name = "Liv Tyler" },
                        new { Id = 884, Biography = "Steven Vincent \"Steve\" Buscemi is an American actor, writer and film director. He was born in Brooklyn, New York, the son of Dorothy, who worked as a hostess at Howard Johnson's, and John Buscemi, a sanitation worker and Korean War veteran. Buscemi's father was Sicilian American and his mother Irish American. He has three brothers: Jon, Ken, and Michael. Buscemi was raised Roman Catholic.\\n\\nIn April 2001, while shooting the film Domestic Disturbance in Wilmington, North Carolina, Buscemi was stabbed three times while intervening in a bar fight at Firebelly Lounge between his friend Vince Vaughn, screenwriter Scott Rosenberg and a local man, who allegedly instigated the brawl.\\n\\nBuscemi has one son, Lucian, with his wife Jo Andres.", BirthDate = new DateTime(1957, 12, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ieDyVKnQHo7eMGu1GOE7YYr2Fk4.jpg", Name = "Steve Buscemi" },
                        new { Id = 887, Biography = "Owen Cunningham Wilson (born November 18, 1968) is an American actor and screenwriter from Dallas, Texas. His older brother, Andrew and younger brother, Luke, are also actors. He has had a long association with filmmaker Wes Anderson, having shared co-writing and acting credits for Bottle Rocket (1996) and The Royal Tenenbaums (2001), which was nominated for an Academy Award for Best Original Screenplay, and for his collaborations with fellow actor Ben Stiller. The two have appeared in ten films together.\\n\\nWilson is best known for his roles in Meet the Parents (2000), Shanghai Noon (2000), Zoolander (2001), Shanghai Knights (2003), Wedding Crashers (2005), Night at the Museum (2006), Cars (2006), Marley & Me (2008), Night at the Museum: Battle of the Smithsonian (2009), Midnight in Paris (2011), Cars 2 (2011) and The Internship (2013).", BirthDate = new DateTime(1968, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//j7oYgvfDiO34VcFdSB7GhM2CSle.jpg", Name = "Owen Wilson" },
                        new { Id = 900, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qPYrAJif2AYqgUckgE9bEkjrdVw.jpg", Name = "Christopher Boyes" },
                        new { Id = 902, Biography = "", BirthDate = new DateTime(1969, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n3BYt4bbPey6UwMGRyhlRCaaFkB.jpg", Name = "Milton Welsh" },
                        new { Id = 908, Biography = "", Name = "Michael Tronick" },
                        new { Id = 915, Biography = "From Wikipedia, the free encyclopedia.  David Giler is an American filmmaker who has been active in the motion picture industry since the early 1960s.\\n\\nHe started his career as a writer, providing scripts for television programs such as Kraft Suspense Theatre and The Man from U.N.C.L.E.. He then moved to screenplays in the 70's, helping to write films such as The Parallax View and the original version of Fun With Dick and Jane. He produced his first film in 1970, the critically reviled Myra Breckinridge, an adaptation of Gore Vidal's controversial novel (he also co-wrote the film with director Michael Sarne). He helped Walter Hill produce the legendary horror thriller Alien in 1979, and it is for this film that he is probably best remembered. He and Hill became embroiled in a much-publicized behind-the-scenes fight with Alien's original writer, Dan O'Bannon, over who was to receive screenplay credit. Giler and Hill claim that they completely rewrote the script from top to bottom, and therefore they wanted to relegate O'Bannon to a \"story by\" credit only. O'Bannon claims that they did little more than change the names of the characters and dialogue, and felt that the two were trying to bully him out of the more prestigious screenplay credit. As evidenced by the interviews on the supplemental DVD features, the two parties were extremely antagonistic when it comes to this topic (O'Bannon has since died), though O'Bannon was the only one to receive credit for the screenplay in the final film. The various drafts can be found online, allowing audiences to decide for themselves.\\n\\nGiler worked with Hill on several more projects, including the continuation of the Alien franchise. The two were responsible for the final and very controversial rewrite of the Alien 3 story which killed off the Bishop, Hicks and Newt characters from Aliens. Some of the films that he wrote during this period include The Money Pit, Southern Comfort, and an uncredited rewrite for Beverly Hills Cop II.\\n\\nHe has also directed one film, The Black Bird (1975).\\n\\nDescription above from the Wikipedia article David Giler, licensed under CC-BY-SA, full list of contributors on Wikipedia.     ", Name = "David Giler" },
                        new { Id = 930, Biography = "", BirthDate = new DateTime(1932, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Branko Lustig" },
                        new { Id = 938, Biography = "Djimon Gaston Hounsou is a Beninese-American actor and model. As an actor, Hounsou has been nominated for two Academy Awards. Hounsou became a naturalized American citizen in 2007. He was reluctant to renounce his Beninese citizenship and therefore opted to become a dual citizen of both Benin and the United States, effectively rendering him a Beninese-American. Djimon Hounsou was born in Cotonou, Benin, in 1964, to lbertine and Pierre Hounsou. He immigrated to Lyon in France at the age of thirteen with his brother, Edmond. In 1987, he became a model and established a career in Paris. He moved to the U.S. in 1990. One year before obtaining his college degree, he dropped out of school. In the 1989 he appeared in a music video of Straight Up by Paula Abdul. Hounsou's film debut was in the 1990 Sandra Bernhard film Without You I’m Nothing, and he has had television parts on Beverly Hills, 90210 and ER and a guest starring role on Alias, but received a larger role in the science fiction film Stargate. His first on-screen appearance was in the 1990 Janet Jackson video “Love Will Never Do (Without You).” He also starred in a 2002 Gap commercial directed by Peter Lindbergh, dancing to a rendition of John Lee Hooker's \"Boom Boom\" by Arrested Development's Baba Oje. He received wide critical acclaim and a Golden Globe Award nomination for his role as Cinqué in the 1997 Steven Spielberg film Amistad. He gained further notice as Juba, in the 2000 film Gladiator. He was nominated for the Academy Award for Best Supporting Actor, for In America, in 2004, becoming the fourth African male to be nominated for an Oscar (along with Basil Rathbone, Cecil Kellaway and Omar Sharif). In 2006, he won the National Board of Review Award for Best Supporting Actor for his performance in Blood Diamond; he received Broadcast Film Critics Association, Screen Actors Guild Award, and Academy Award nominations for this performance. In 2007, Hounsou began dating model/CEO of Baby Phat, Kimora Lee Simmons. In 2008 Hounsou and Simmons visited Hounsou's family and while there, the two participated in a traditional commitment ceremony. On May 30, 2009, Simmons gave birth to their son, Kenzo Lee Hounsou, reportedly named because Kenzo means 3 (Kimora's third child). Hounsou is now a naturalized United States citizen and resides in Los Angeles.  ", BirthDate = new DateTime(1964, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//y22Pb0XAVqC0l7ukzKKtXzPEuHk.jpg", Name = "Djimon Hounsou" },
                        new { Id = 941, Biography = "He co-starred as Quintus in Ridley Scott's Gladiator (2000), the Dreamworks-Universal movie and winner of five Oscars, including Best Picture, co-starring Russell Crowe, Joaquin Phoenix, Connie Nielsen, Richard Harris, Derek Jacobi, and Oliver Reed. Three of Tomas Arana's more recent films are: La volpe a tre zampe (2005), directed by Sandro Dionisio, a Teatri Uniti (Angelo Curti)/Cattelya Production that co-stars Miranda Otto, Angela Luce, and Nadja Uhl; Outpatient (2002), directed by Alec Carlin, with Justin Kirk and Catherine Kellner and the Jean-Claude Van Damme action film, Derailed (2002), directed by Bob Misiorowski. He was in Chimera (2001), directed by Pappi Corsicato, with Iaia Forte and Tommaso Ragno. He has appeared in more than 40 films, ranging from large budget Hollywood Studio pictures to Independent films in both the U.S. and Europe. His studio pictures include L.A. Confidential (1997) (as Bruening, a rogue cop), The Bodyguard (1992) (as Portman, Kevin Costner's antagonist and Whitney Houston's assassin), The Hunt for Red October (1990) (as Loginov, the Russian Saboteur), Tombstone (1993), and First Kid (1996).\\n\\nHe played Lazarus in Martin Scorsese's controversial The Last Temptation of Christ (1988). He was also featured in the Sundance-developed Wildflowers (1999), an independent film by Melissa Painter starring Clea DuVall and Daryl Hannah. Arana has played leading and supporting roles in over 30 European productions including films by directors such as Lina Wertmüller, Liliana Cavani, Carlo Verdone, Michele Soavi and with one of Japan's most successful directors: Koreyoshi Kurahara in the Toho production See You (1988). In theatre, Arana was the producer as well as a leading actor in the internationally acclaimed Theatre Company Falso Movimento, based in Naples, Italy. Under Arana and the artistic director Mario Martone (now a major Italian Film Director), Falso Movimento won many awards including Best Play of the Year, Best Set Design and the prestigious Mondello Prize. The company toured worldwide for more than nine years at major International Festivals including London, Frankfurt, New York, Los Angeles, Madrid, Barcelona, Copenhagen, Stockholm, Jerusalem, and others. Tomas Arana grew up in San Francisco and studied classical theatre at its prestigious American Conservatory Theatre, afterwards relocating to New York and acting in off-Broadway productions. He then hitchhiked throughout Europe and ended up living in Naples, Italy, where he worked in the Lucio Amelio Art Gallery, working with such artists as Warhol, Rauschenberg, Beuys, Richter, Longobardi, Clemente, Gilbert & George, etc. Andy Warhol painted his portrait, which is now part of his extensive art collection. He has both U.S. and Italian citizenship. He is married and has two sons.\\n\\nIMDb Mini Biography By: anonymous", BirthDate = new DateTime(1955, 4, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sx8tDGA7e7d5oDYpQwaydmGcc93.jpg", Name = "Tomas Arana" },
                        new { Id = 943, Biography = "", BirthDate = new DateTime(1961, 5, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "John Mathieson" },
                        new { Id = 947, Biography = "Hans Florian Zimmer (born September 12th, 1957) is a German composer and record producer. Since the 1980s, he has composed music for over 150 films. His works include The Lion King, for which he won Academy Award for Best Original Score in 1994, the Pirates of the Caribbean series, The Thin Red Line, Gladiator, The Last Samurai, The Dark Knight Trilogy, Inception, and Interstellar. Zimmer spent the early part of his career in the United Kingdom before moving to the United States. He is the head of the film music division at DreamWorks studios and works with other composers through the company that he founded, Remote Control Productions.  Zimmer's works are notable for integrating electronic music sounds with traditional orchestral arrangements. He has received fourGrammy Awards, three Classical BRIT Awards, two Golden Globes, and an Academy Award. He was also named on the list of Top 100 Living Geniuses, published by The Daily Telegraph.", BirthDate = new DateTime(1957, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7IjJpvGtCfY0DsritmfCh2iX9I4.jpg", Name = "Hans Zimmer" },
                        new { Id = 975, Biography = "Nicholas James \"Nick\" Moran is an English actor, writer, producer and director, best known for his role as Eddy the card shark in Lock, Stock, and Two Smoking Barrels. He also appeared as Scabior in Harry Potter and the Deathly Hallows.\\n\\nMoran first hit the big screen in 1990 alongside Roger Daltrey and Chesney Hawkes, in Buddy's Song (1990). Moran co-starred with John Hurt in New Blood (1999), and also starred with Joseph Fiennes, Sadie Frost and Tara FitzGerald in Rancid Aluminium (2000). In 2001, he played the role of Aramis in The Musketeer, a film loosely based on Alexandre Dumas, père's classic novel, The Three Musketeers. The film co-starred Catherine Deneuve, Tim Roth, Mena Suvari, Stephen Rea, and Bill Treacher, with Justin Chambers in the role of D'Artagnan.", BirthDate = new DateTime(1969, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jf5M1SxmWFOm8lsOmxlFGSaUSm6.jpg", Name = "Nick Moran" },
                        new { Id = 1004, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nDaniel Louis \"Danny\" Aiello, Jr.  (born June 20, 1933) is an American actor who has appeared in numerous motion pictures, including Once Upon a Time in America, Ruby, The Godfather: Part II, Hudson Hawk, The Purple Rose of Cairo, Moonstruck, Léon, Two Days in the Valley, and Dinner Rush. He had a pivotal role in the 1989 Spike Lee film Do the Right Thing, earning a nomination for a Best Supporting Actor Academy Award for his portrayal of Salvatore 'Sal' Frangione, the pizzeria owner, and also as Don Domenico Clericuzio in the miniseries Mario Puzo's The Last Don.\\n\\nDescription above from the Wikipedia article Danny Aiello, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1933, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//UvPalkz4ynJJrTcrbpfD05gVoO.jpg", Name = "Danny Aiello" },
                        new { Id = 1032, Biography = "​American film director, screenwriter, producer, actor, and film historian Martin Marcantonio Luciano Scorsese made the short films while he attended New York University's film school; these include “What's a Nice Girl Like You Doing in a Place Like This?” (1963), “It's Not Just You, Murray!” (1964), and his most famous short of the period “The Big Shave” (1967). This came shortly after seriously considering entering into priesthood. He entered a seminary in 1956 then opted to direct his focus toward film; he graduated from NYU as a film major in 1964.\\n\\nScorsese made his first feature-length film in 1967, “Call First”, which was later retitled “Who's That Knocking at My Door”, which was followed by “Boxcar Bertha” (1972). The Film “Taxi Driver” (1976) won the Palme d'Or at the 1976 Cannes Film Festival, and received four Oscar nominations, including Best Picture, establishing Scorsese as an accomplished filmmaker operating on a highly skilled level. \\n\\nScorsese has been married five times. His first wife was Laraine Marie Brennan; they have a daughter, Catherine. He married the writer Julia Cameron in 1976; they have a daughter, Domenica Cameron-Scorsese, who is an actress and appeared in The Age of Innocence, but the marriage lasted only a year. He was married to actress Isabella Rossellini from 1979 to their divorce in 1983. He then married producer Barbara De Fina in 1985; their marriage ended in divorce as well, in 1991. He has been married to Helen Morris since 1999; they have a daughter, Francesca, who appeared in The Departed and The Aviator. He is primarily based in New York City.", BirthDate = new DateTime(1942, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4Xwx5XL1RJj0JQmEo8Fhr6nkpOg.jpg", Name = "Martin Scorsese" },
                        new { Id = 1037, Biography = "Harvey Keitel (born May 13, 1939) is an American actor. Some of his more notable starring roles were in Martin Scorsese's Mean Streets and Taxi Driver, Ridley Scott's The Duellists and Thelma and Louise, Quentin Tarantino's Reservoir Dogs and Pulp Fiction, Jane Campion's The Piano, Abel Ferrara's Bad Lieutenant, James Mangold's Cop Land, Nicolas Roeg's Bad Timing, and Theo Angelopoulos's Ulysses' Gaze. His latest work was as Detective Lieutenant Gene Hunt on the American adaptation of Life on Mars.\\n\\nDescription above from the Wikipedia article Harvey Keitel, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1939, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4IcHhp1SCKijRxb7kqnxZNJuKdn.jpg", Name = "Harvey Keitel" },
