                        new { Id = 1058, Biography = "From Wikipedia, the free encyclopedia.\\n\\nMichael Robert \"Bob\" Gale (born May 21, 1951) is an American screenwriter who co-wrote the science fiction film Back to the Future with writing partner Robert Zemeckis, and the screenplays for the film's two sequels. Gale also co-produced all three films.\\n\\nDescription above from the Wikipedia article Bob Gale, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1951, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3LMtxKoveYdhHQqHUBKdqK7SnIQ.jpg", Name = "Bob Gale" },
