                        new { Id = 1060, Biography = "From Wikipedia, the free encyclopedia.  Dean Raymond Cundey, A.S.C.  (born 12 March 1946) is an American cinematographer.\\n\\nDescription above from the Wikipedia article Dean Cundey, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 3, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xunb0FZLZLhca2F5OJcKzV1mjR0.jpg", Name = "Dean Cundey" },
                        new { Id = 1061, Biography = "", Name = "Harry Keramidas" },
                        new { Id = 1062, Biography = "From Wikipedia, the free encyclopedia. Christopher Allen Lloyd (born October 22, 1938) is an American actor. He is best known for playing Doc Brown in the Back to the Future trilogy, Uncle Fester in The Addams Family films, and Judge Doom in Who Framed Roger Rabbit. He played Reverend Jim Ignatowski in the television series Taxi and most recently Mr. Goodman in Piranha 3D. He also starred in the short-lived television series Deadly Games, and also was a regular in the short-lived TV series Stacked, in the mid-2000s. Lloyd has used his vocal talents in animation, frequently voicing villains. He currently voices the character Hacker on the animated PBS series Cyberchase. Lloyd has won three Primetime Emmy Awards and an Independent Spirit Award, and has been nominated for two Saturn Awards and a Daytime Emmy Award. Description above from the Wikipedia article Christopher Lloyd, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1938, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iQzG9apaIsHnn7iGrer3YEDp8Zo.jpg", Name = "Christopher Lloyd" },
                        new { Id = 1063, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLea Katherine Thompson (born May 31, 1961, height 5' 3\" (1,60 m)) is an American actress and director. She is best known for her 1990s NBC situation comedy Caroline in the City and her portrayal of Lorraine Baines McFly, Marty McFly's mother, in the Back to the Future trilogy. As a staple in big budget/high profile blockbusters of the 1980's and 90's, other roles include Red Dawn, Howard the Duck, Jaws 3-D, Some Kind of Wonderful, The Beverly Hillbillies and All the Right Moves.", BirthDate = new DateTime(1961, 5, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gaZhgJdLmWkEdqkkfomnBQn16uo.jpg", Name = "Lea Thompson" },
                        new { Id = 1064, Biography = "Crispin Hellion Glover (born April 20, 1964) is an American film actor, director and screenwriter, recording artist, publisher and author. Glover is known for portraying eccentric people on screen such as George McFly in Back to the Future, Layne in River's Edge, unfriendly recluse Rubin Farr in Rubin and Ed, the \"Creepy Thin Man\" in the big screen adaptation of Charlie's Angels and its sequel, Willard Stiles in the Willard remake, The Knave of Hearts in Alice in Wonderland, and as Phil in Hot Tub Time Machine.\\n\\nIn the late 1980s Glover started his company, Volcanic Eruptions, which issues his books and also serves as the production company of Glover's films, What Is It? and It is Fine. Everything is Fine! Glover tours with those films and plans to film more at the property he owns in the Czech Republic. Description above from Wikipedia, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1964, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//thA5rOv5XE1oFpxD9DSp0tDrIIR.jpg", Name = "Crispin Glover" },
                        new { Id = 1065, Biography = "Thomas Francis Wilson (born April 15, 1959) is an American actor, writer, musician, painter, voice-over artist and stand-up comedian. He is best known for playing Biff Tannen (and his grandson Griff Tannen and great-grandfather Buford \"Mad Dog\" Tannen) in the Back to the Future trilogy and Coach Ben Fredricks on NBC's Freaks and Geeks.\\n\\nDescription above from the Wikipedia article Thomas F. Wilson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n5Vk17hmXW5OqltDYH3i0qOTHcZ.jpg", Name = "Thomas F. Wilson" },
                        new { Id = 1066, Biography = "Claudia was born in Kuala Lumpur, Malaysia on July 5, 1966. She grew up in Venezuela and then San Francisco, California and after high school, studied voice and dance before pursuing acting as a career. She studied at the American Conservatory Theater and has performed soprano roles with the San Francisco Opera.", BirthDate = new DateTime(1966, 7, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lQWUidwPartKLzV3NYMVrkxooRO.jpg", Name = "Claudia Wells" },
                        new { Id = 1067, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nMarc A. McClure (born March 31, 1957) is an American actor. McClure was born in San Mateo, California.\\n\\nDescription above from the Wikipedia article Marc McClure, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1957, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5VPLVH1eAiIQ3s7aNjrgvzwTt3t.jpg", Name = "Marc McClure" },
                        new { Id = 1068, Biography = "From Wikipedia, the free encyclopedia. \\n\\n \\n\\nWendie Jo Sperber (September 15, 1958 – November 29, 2005) was an American actress, best known for her performances in the films I Wanna Hold Your Hand (1978), Bachelor Party (1984) and Back to the Future (1985) as well as the television sitcom Bosom Buddies (1980–1982).\\n\\nDescription above from the Wikipedia article Wendie Jo Sperber , licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1958, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2005, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nadvO9Q24eNrGAznKmlOwV6E6Wb.jpg", Name = "Wendie Jo Sperber" },
