                        new { Id = 1088, Biography = "", BirthDate = new DateTime(1959, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//Avz9EkxdDbI2DN9h3wAVRUXsesz.jpg", Name = "Ludger Pistor" },
                        new { Id = 1117, Biography = "​Dennis Farina was one of Hollywood's busiest actors and a familiar face  to moviegoers and television viewers alike. Recently, he appeared in the  feature films, \"The Grand,\" a comedy about a Vegas poker tournament  with Woody Harrelson, Cheryl Hines and Ray Romano; \"Bottle Shock,\" also  starring Alan Rickman, Bill Pullman and Bradley Whitford; and Fox's  \"What Happens in Vegas,\" in which Dennis starred as Cameron Diaz's boss.  Farina also appeared on the NBC series \"Law and Order\" and in the HBO  miniseries, \"Empire Falls,\" for which he won a Golden Globe Award for  Best Mini-Series. Farina is well remembered for his role in  memorable features such as Steven Soderbergh's \"Out of Sight,\" in which  he played the retired lawman father of Jennifer Lopez's character. This  was Farina's second outing in an Elmore Leonard best seller, the  previous one being \"Get Shorty,\" directed by Barry Sonnenfeld and  co-starring John Travolta, Rene Russo and Gene Hackman. Farina received  an American Comedy Award for Funniest Supporting Male for his  performance as \"Ray 'Bones' Barboni.\" In 1998's \"Saving Private  Ryan,\" directed by Steven Spielberg, Farina played \"Col. Anderson,\" a  pivotal role in the film. It is this character who convinces Tom Hanks  character to lead a squad deep into Nazi territory to rescue \"Pvt.  Ryan.\" He also co-starred with Brad Pitt and Oscar-winner Benicio Del  Toro in the darkly comedic crime drama \"Snatch,\" directed by Guy  Ritchie. Farina's numerous other screen credits include John  Frankenheimer's \"Reindeer Games,\" \"Paparazzi,\" Martin Brest's \"Midnight  Run,\" the Michael Mann film \"Manhunter\", among many other feature films.  Farina is also recognized for his role in the critically acclaimed  television series, NBC's \"Crime Story\". A veteran of the Chicago  theater, Farina has appeared in Joseph Mantegna's \"Bleacher Bums,\" and  \"A Prayer For My Daughter,\" directed by John Malkovich, and many others.  He died on July 22, 2013 in Scottsdale, Arizona at age 69.", BirthDate = new DateTime(1944, 2, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2013, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//o649nAtUimSZxEV6xa5JbMSgsED.jpg", Name = "Dennis Farina" },
                        new { Id = 1121, Biography = "Benicio Monserrate Rafael del Toro Sánchez (born February 19, 1967) is a Puerto Rican actor and film producer. His awards include the Academy Award, Golden Globe, Screen Actors Guild (SAG) Award and British Academy of Film and Television Arts (BAFTA) Award. He is known for his roles as Fred Fenster in The Usual Suspects, Javier Rodríguez in Traffic (his Oscar-winning role), Jack 'Jackie Boy' Rafferty in Sin City, Dr. Gonzo in Fear and Loathing in Las Vegas, Franky Four Fingers in Snatch, and Che Guevara in Che. He is the third Puerto Rican to win an Academy Award.\\n\\nDescription above from the Wikipedia article Benicio del Toro, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1967, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5TlC56RMfTeeBxhI6myQe4SDEEo.jpg", Name = "Benicio del Toro" },
                        new { Id = 1158, Biography = "Alfredo James \"Al\" Pacino (born April 25, 1940) is an American film and stage actor and director. He is famous for playing mobsters, including Michael Corleone in The Godfather trilogy, Tony Montana in Scarface, Alphonse \"Big Boy\" Caprice in Dick Tracy and Carlito Brigante in Carlito's Way, though he has also appeared several times on the other side of the law — as a police officer, detective and a lawyer. His role as Frank Slade in Scent of a Woman won him the Academy Award for Best Actor in 1992 after receiving seven previous Oscar nominations.\\n\\nHe made his feature film debut in the 1969 film Me, Natalie in a minor supporting role, before playing the leading role in the 1971 drama The Panic in Needle Park. Pacino made his major breakthrough when he was given the role of Michael Corleone in The Godfather in 1972, which earned him an Academy Award nomination for Best Supporting Actor. Other Oscar nominations for Best Supporting Actor were for Dick Tracy and Glengarry Glen Ross. Oscar nominations for Best Actor include The Godfather Part II, Serpico, Dog Day Afternoon, the court room drama ...And Justice for All and Scent of a Woman.\\n\\nIn addition to a career in film, he has also enjoyed a successful career on stage, picking up Tony Awards for Does a Tiger Wear a Necktie? and The Basic Training of Pavlo Hummel. His love of Shakespeare led him to direct his first film with Looking for Richard, a part documentary on the play Richard III. Pacino has received numerous lifetime achievement awards, including one from the American Film Institute. He is a method actor, taught mainly by Lee Strasberg and Charlie Laughton at the Actors Studio in New York. Although he has never married, Pacino has had several relationships with actresses and has three children.", BirthDate = new DateTime(1940, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//f9tBVwcNHnawvMoyuuzmKvEhBsb.jpg", Name = "Al Pacino" },
                        new { Id = 1164, Biography = "From Wikipedia, the free encyclopedia.\\n\\nFahrid Murray Abraham (born October 24, 1939) is an American actor. He became known during the 1980s after winning the Academy Award for Best Actor for his role as Antonio Salieri in Amadeus. He has appeared in many roles, both leading and supporting, in films such as All the President's Men and Scarface. He is also known for his television and theatre work.", BirthDate = new DateTime(1939, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vXurMA6XOAREPEyW6QRu5xKfGIT.jpg", Name = "F. Murray Abraham" },
                        new { Id = 1223, Biography = "American filmmaker Joel David Coen is known for writing, directing and producing films jointly with his brother Ethan Jesse Coen professionally they are known as the Coen brothers. In 1984, the brothers wrote and directed Blood Simple, their first film together. The film received was well received and won awards for Joel's direction at both the Sundance and Independent Spirit awards.\\n\\nThe brothers were recognized for their talents having been nominated for a number of awards, and achievements. No Country for Old Men (2007) won them the Oscar for Best Achievement in Directing, and Best Motion Picture of the Year, as well as the British Academy of Film and Television Arts (BAFTA) Film Award for best director. They were also awarded the Oscar for Best Writing, Screenplay Written Directly for the Screen in Fargo (1996) \\n\\nJoel has been married to actress Frances McDormand since 1984. They adopted a son from Paraguay, named Pedro McDormand Coen", BirthDate = new DateTime(1954, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rgVaJNkZCgMarUcZuUAsVfXMWk3.jpg", Name = "Joel Coen" },
                        new { Id = 1224, Biography = "American filmmaker Ethan Jesse Coen is known for writing, directing and producing films jointly with his brother Joel David Coen, professionally they are known as the Coen brothers. In 1984, the brothers wrote and directed Blood Simple, their first film together. The film received was well received and won awards for Joel's direction at both the Sundance and Independent Spirit awards. \\n\\nThe brothers were recognized for their talents having been nominated for a number of awards, and achievements. No Country for Old Men (2007) won them the Oscar for Best Achievement in Directing, and Best Motion Picture of the Year, as well as the British Academy of Film and Television Arts (BAFTA) Film Award for best director. They were also awarded the Oscar for Best Writing, Screenplay Written Directly for the Screen in Fargo (1996).\\n\\nEthan is married to film editor Tricia Cooke; they reside in New York City. ", BirthDate = new DateTime(1957, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//AH5YwNZC5txyJKyjVZhA4ZXFzP.jpg", Name = "Ethan Coen" },
                        new { Id = 1225, Biography = "", BirthDate = new DateTime(1955, 11, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//feAqzRbewe6r2icciqiTeaqzTm4.jpg", Name = "Carter Burwell" },
                        new { Id = 1259, Biography = "​Ennio Morricone was born in Rome on 10.11.1928. His long artistic career includes a wide range of composition genres, from absolute music, which he has always produced, to applied music, working as orchestrator as well as conductor in the recording field, and then as a composer for theatre, radio and cinema.\\n\\nIn 1946 Ennio received his trumpet diploma and in 1947 he was engaged as composer for theatre music.\\n\\nIn 1953 he made his first arrangement for a series of evening radio shows.\\n\\nIn 1954 he received his diploma in Composition at the Conservatory under the guidance of Goffredo Petrassi.\\n\\nIn 1958 he obtained a job at RAI (Italian Television) as music assistant, but he resigned on the first day of work. \\n\\nHis career as film music composer started in 1961 with the film “Il Federale” directed by Luciano Salce, but he became famous worldwide with Sergio Leone’s westerns: A Fistful Of Dollars (1964),For A Few Dollars More(1965), The Good, The Bad And The Ugly (1966), Once Upon A Time In The West (1968)and A Fistful Of Dynamite (1971). \\n\\nIn 1965 Morricone entered the group of improvisation “Nuova Consonanza”; \\n\\nin 1984, he and other composers founded the I.R.TE.M. (Institute Of Research For Musical Theatre) in Rome. \\n\\nSince 1960, Morricone has scored over 400 films working with many Italian and international directors (among whom Sergio Leone, Gillo Pontecorvo, Pier Paolo Pasolini, Bernardo Bertolucci, Giuliano Montaldo, Lina Wertmuller, Giuseppe Tornatore, Brian De Palma, Roman Polanski, Warren Beatty, Adrian Lyne, Oliver Stone, Margarethe Von Trotta, Henry Verneuil, Pedro Almodovar and Roland Joffè). His most famous films include: The Battle Of Algiers; Sacco and Vanzetti; Cinema Paradiso; The Legend Of 1900, Malena; The Untouchables, Once Upon A Time In America; The Mission and U-Turn. His absolute music production includes over 100 pieces composed since 1946 to this day. Here are some titles: Concerto per orchestra 1 (1957); Frammenti di Eros (1985); Rag in Frantumi (1986); Cantata per L’Europa (1988); UT, per tromba, archi e percussioni (1991); Ombra di Lontana Presenza (1997); Voci dal Silenzio (2002); Sicilo ed altri Frammenti (2006); Vuoto di Anima Piena (2008). \\n\\nEnnio Morricone has conducted many orchestras worldwide, including the Orchestra of the Santa Cecilia Academy for many symphonic seasons. He also conducted the Philharmonic Orchestra and Chorus of La Scala Theatre, the Rome Opera House Orchestra, the Budapest Opera House Orchestra, the Orquesta Nacionales de España (ONE), the National Brazilian Orchestra, the Orchestra of the Bavarian Radio Munich Rundfunk, the London Symphony Orchestra, the Bulgarian Symphony Orchestra and the Orchestra and Chorus of the Spanish Television.\\n\\nMorricone often works with the Roma Sinfonietta Orchestra for many concerts both in Italy and abroad as well as for the recordings of film scores. \\n\\nOn 2nd February 2007 Maestro Morricone and the Roma Sinfonietta Orchestra held an important concert at the United Nations General Assembly Hall to celebrate the UN Secretary General Ban-ki Moon taking office. \\n\\nIn his long career, Ennio Morricone has received many awards other than the Golden Lion and the Honorary Oscar, among which 8 Nastri D’argento, 5 Baftas, 5 Oscar Nominations, 7 David Di Donatello, 3 Golden Globes, 1 Grammy Award and 1 European Film Award. In the 2009 the President of the French Republic, Nicolas Sarkozy, has signed a decree appointing  M° Ennio Morricone to the rank of Knight in the Order of the Legion of Honor. \\n\\nIn the recording field, Morricone has received 27 Golden Records, 7 Platinum Records, 3 Golden Plates and the “Critica discografica” award for the music of the film “Il Prato”. The soundtrack from the film The Good, The Bad and The Ugly has been included in the list of inductees for the Grammy Hall of Fame 2009. ", BirthDate = new DateTime(1928, 11, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tlntfyflyEHgJTFjqIgg8P8UIx9.jpg", Name = "Ennio Morricone" },
