                        new { Id = 1327, Biography = "Sir Ian Murray McKellen, CH, CBE (born 25 May 1939) is an English actor. He is the recipient of six Laurence Olivier Awards, a Tony Award, a Golden Globe Award, a Screen Actors Guild Award, a BIF Award, two Saturn Awards, four Drama Desk Awards and two Critics' Choice Awards. He has also received two Academy Award nominations, eight BAFTA film and TV nominations and five Emmy Award nominations. McKellen's work spans genres ranging from Shakespearean and modern theatre to popular fantasy and science fiction. His notable film roles include Gandalf in The Lord of the Rings and The Hobbit trilogies and Magneto in the X-Men films.", BirthDate = new DateTime(1939, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//coWjgMEYJjk2OrNddlXCBm8EIr3.jpg", Name = "Ian McKellen" },
                        new { Id = 1328, Biography = "Sean Astin (born February 25, 1971) is an American film actor, director, and producer better known for his film roles as Mikey Walsh in The Goonies, the title character of Rudy, and Samwise Gamgee in the Lord of the Rings trilogy. In television, he appeared as Lynn McGill in the fifth season of 24. Most recently, he provided the voice for the title character in Disney's Special Agent Oso.", BirthDate = new DateTime(1971, 2, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//m40tSOPKJScFY7acY0hEWtE1ncR.jpg", Name = "Sean Astin" },
                        new { Id = 1329, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nBilly Boyd (born 28 August 1968) is a Scottish actor and musician most widely known for playing the character Peregrin \"Pippin\" Took in the film adaptations of The Lord of the Rings and Barret Bonden in Master and Commander: The Far Side of the World.\\n\\nDescription above from the Wikipedia article Billy Boyd, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1968, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nwNHDM67VYAb87sjSqYQVWaZKyK.jpg", Name = "Billy Boyd" },
                        new { Id = 1330, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDominic Bernard Patrick Luke Monaghan ( born 8 December 1976) is an English actor. He has received international attention from playing Merry in Peter Jackson's adaptation of J. R. R. Tolkien's The Lord of the Rings and for his role as Charlie Pace on the television show Lost.", BirthDate = new DateTime(1976, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sXkqoK3v1nfCudXIcxKVwDc0imw.jpg", Name = "Dominic Monaghan" },
                        new { Id = 1331, Biography = "From Wikipedia, the free encyclopedia\\n\\nHugo Wallace Weaving (born 4 April 1960) is a British-Australian film and stage actor. He is best known for his roles as Agent Smith in the Matrix trilogy, Elrond in the Lord of the Rings trilogy, \"V\" in V for Vendetta, and performances in numerous Australian character dramas.\\n\\nDescription above from the Wikipedia article Hugo Weaving, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fZ3wXniGrqbHk4eRt9gE2pSz4Jy.jpg", Name = "Hugo Weaving" },
                        new { Id = 1333, Biography = "Andrew \"Andy\" Clement Serkis (born 20 April 1964) is an English film actor and director. He is best known for his performance capture roles comprising motion capture acting, animation and voice work for such computer-generated characters as Gollum in The Lord of the Rings film trilogy (2001–2003) and The Hobbit: An Unexpected Journey (2012), King Kong in the eponymous 2005 film, Caesar in the Planet of the Apes reboot series (2011–17), Captain Haddock / Sir Francis Haddock in Steven Spielberg's The Adventures of Tintin (2011), and Supreme Leader Snoke in Star Wars: The Force Awakens (2015). Upcoming performance capture roles include Supreme Leader Snoke in Star Wars: The Last Jedi (2017), and Baloo in Jungle Book (2018).\\n\\nSerkis's film work in motion capture has been critically acclaimed. He has received an Empire Award, and two Saturn Awards for his motion-capture acting. He earned a Golden Globe nomination for his portrayal of serial killer Ian Brady in the British television film Longford (2006) and was nominated for a BAFTA for his portrayal of new wave and punk rock musician Ian Dury in the biopic Sex & Drugs & Rock & Roll (2010).\\n\\nIn 2015, he began playing Ulysses Klaue in the Marvel Cinematic Universe beginning with Avengers: Age of Ultron. Serkis has his own motion capture workshop, The Imaginarium Studios in London, which he used for Jungle Book. He made his directorial debut with the 2017 film Breathe.\\n\\nDescription above from the Wikipedia article Andy Serkis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1964, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eNGqhebQ4cDssjVeNFrKtUvweV5.jpg", Name = "Andy Serkis" },
                        new { Id = 1365, Biography = "", BirthDate = new DateTime(1968, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//othnINT2XVhM9k4KC5qykhnOOZz.jpg", Name = "Lawrence Makoare" },
                        new { Id = 1369, Biography = "From Wikipedia, the free encyclopedia.  Bernard Hill (born 17 December 1944) is a British actor of film, stage and television. In a career spanning thirty years, he is best known for playing Captain Edward John Smith in Titanic, King Théoden in The Lord of the Rings film trilogy, and as the Warden of San Quentin Prison in the Clint Eastwood film True Crime. Hill is the only actor to have appeared in more than one of the three films awarded 11 Oscars, and one of only three actors to have starred in more than one film grossing more than $1 billion USD, namely: Titanic and The Return of the King (the others being Orlando Bloom who also starred in The Return of the King, as well as Pirates of the Caribbean and Johnny Depp who also starred in Pirates of the Caribbean, as well as Alice in Wonderland). Hill has appeared in three films which have won Best Picture: Gandhi, Titanic, and The Return of the King.\\n\\nDescription above from the Wikipedia article Bernard Hill, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1944, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fX9ggRFAZM7J8vPBdTWQphUNiRt.jpg", Name = "Bernard Hill" },
                        new { Id = 1371, Biography = "David Wenham (born 21 September 1965) is an Australian actor who has appeared in movies, television series and theatre productions. He is known in Hollywood for his roles as Faramir in The Lord of the Rings film trilogy, Carl in Van Helsing and Dilios in 300. He is also known in his native Australia for his role as Diver Dan in SeaChange.\\n\\nDescription above from the Wikipedia David Wenham, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xDUXLTF5i2fYx7eSEAR3IdaUb9y.jpg", Name = "David Wenham" },
                        new { Id = 1372, Biography = "He is known for playing Éomer in the second and third installments of Peter Jackson's The Lord of the Rings trilogy, Dr. Leonard \"Bones\" McCoy in the 2009 film Star Trek and Julius Caesar on Xena: Warrior Princess. He played Vaako in The Chronicles of Riddick, the Russian assassin Kirill in The Bourne Supremacy, and Ghost in Pathfinder and won acclaim for his performances in New Zealand films The Price of Milk and Out of the Blue.\\n\\nHis father, a German immigrant, owned a leather goods retail store, and his mother once worked for Film Facilities in Wellington, through which the young Urban was exposed to New Zealand cinema and developed an interest in the film industry. Urban attended St Mark's Church School, where he showed an early love for public performance. His first acting role came at age eight, when he had a single line in one episode of the New Zealand television series 'Pioneer Woman', but he did not act professionally again until after high school.\\n\\nHe attended Wellington College in 1990, then Victoria University of Wellington in the Bachelor of Arts programme for one year, but left to pursue his acting career. Over the next few years, he landed several theatre roles in the Wellington area, and eventually he moved to Auckland, where he was offered many guest roles in local shows (one of which was playing a heroin addict in the police drama Shark in the Park). The role which launched him to local fame was that of gay paramedic Jamie Forrest in the hit New Zealand TV series Shortland Street. He appeared on the show for the 1993–1994 season.\\n\\nUrban then moved to Bondi Beach, Sydney, Australia in 1995, returning to New Zealand the following year.", BirthDate = new DateTime(1972, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tHYOUO33K7iaDw8nXyqRvDIkVuM.jpg", Name = "Karl Urban" },
                        new { Id = 1373, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mDTcsOTb8j3UAUZ6xEGb3W0vjNU.jpg", Name = "Dan Hennah" },
                        new { Id = 1381, Biography = "John Noble (born 20 August 1948 height 5' 11¾\" (1,82 m)) is an Australian film and television actor, and theater director of more than 80 plays. He was born in Port Pirie, South Australia, Australia and is currently starring as scientist Walter Bishop in the J. J. Abrams television series Fringe.\\n\\nHe made occasional appearances on the television series All Saints. He is internationally known for his performance as Denethor in The Lord of the Rings trilogy. His latest film is One Night with the King. He played Russian Consul Anatoly Markov in the sixth season of the American television series 24. In 2011 he will star as a Real Estate Agent in Rockstar's video game L.A. Noire.", BirthDate = new DateTime(1948, 8, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4A2mSS9Bea5I2bNur8ZlQZXu0H9.jpg", Name = "John Noble" },
