                        new { Id = 1723, Biography = "From Wikipedia, the free encyclopedia\\n\\nWalter Hill (born January 10, 1940) is an American film director, screenwriter, and producer. Hill is known for male-dominated action films and revival of the Western. He said in an interview, \"Every film I've done has been a Western,\" and elaborated in another, \"The Western is ultimately a stripped down moral universe that is, whatever the dramatic problems are, beyond the normal avenues of social control and social alleviation of the problem, and I like to do that even within contemporary stories.\"\\n\\n \\n\\nDescription above from the Wikipedia article Walter Hill (filmmaker), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1942, 1, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gCU3dgnNaZuvmArtBJgjCUMmimd.jpg", Name = "Walter Hill" },
                        new { Id = 1729, Biography = "James Roy Horner (August 14, 1953 – June 22, 2015) was an American composer, conductor and orchestrator of film scores. He was known for the integration of choral and electronic elements in many of his film scores, and for his frequent use of motifs associated with Celtic music. Horner was an accomplished concert hall composer before he moved into writing film scores. His first major film score was for the 1979 film The Lady in Red, but did not establish himself as a mainstream composer until he worked on the 1982 film Star Trek II: The Wrath of Khan. Horner's score for Titanic is the best selling orchestral film soundtrack of all time while Titanic and Avatar, both directed by James Cameron, are the two highest-grossing films of all time. Horner collaborated on multiple projects with directors including Don Bluth, James Cameron, Walter Hill and Ron Howard; producers including David Kirschner, Jon Landau, Brian Grazer and Steven Spielberg; and songwriters including Will Jennings, Barry Mann andCynthia Weil. Horner composed music for over 100 films; he won two Academy Awards, two Golden Globe Awards, three Satellite Awards, and three Saturn Awards, and was nominated for three British Academy Film Awards. Horner died when his single-engine Tucano aircraft crashed in the Los Padres National Forest. He was 61.", BirthDate = new DateTime(1953, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2015, 6, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oLOtXxXsYk8X4qq0ud4xVypXudi.jpg", Name = "James Horner" },
                        new { Id = 1733, Biography = "Nicholas King \"Nick\" Nolte (born February 8, 1941) is an American actor, film producer, voice artist, comedian, and former model.\\n\\nDescription above from the Wikipedia article Nick Nolte, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1941, 2, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//o6O7WP3vokKstxJFMiiyRMNyPsH.jpg", Name = "Nick Nolte" },
                        new { Id = 1736, Biography = "James Remar (born December 31, 1953) is an American actor. He has appeared in movies, video games, and TV shows. He is perhaps best known as Richard, the on-off tycoon boyfriend of Kim Cattrall's character in Sex and the City, as Ajax in The Warriors, as the homicidal maniac Albert Ganz in the 1982 comedy/thriller 48 Hrs., Dutch Shultz in The Cotton Club, Lord Raiden in Mortal Kombat: Annihilation and more recently as Harry Morgan in Dexter. Description above from the Wikipedia article James Remar, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1953, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//AeSuQlBclvWqztlpkf9nIhvvhsc.jpg", Name = "James Remar" },
                        new { Id = 1737, Biography = "David Patrick Kelly (born January 23, 1951) is an American actor and musician who has appeared in numerous films, including some major roles.\\n\\nDescription above from the Wikipedia article David Patrick Kelly, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1951, 1, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ujvmeyBvEJ7gkvww0OYDBlbxOTT.jpg", Name = "David Patrick Kelly" },
                        new { Id = 1760, Biography = "Jerry Goldsmith was an American music composer and conductor for film and television productions, best known for his scores of movies like \"Planet of the Apes\", \"Papillon\", \"Alien\", \"Total Recall\", \"Basic Instinct\", and also three \"Rambo\" films and five \"Star Trek\" films. He was nominated for six Grammy Awards, five Primetime Emmy Awards, nine Golden Globe Awards, four British Academy Film Awards, and eighteen Academy Awards (he won only one, in 1976, for the feature film \"The Omen\").", BirthDate = new DateTime(1929, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2004, 7, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//e6sd10VuwFXkgRFrCTCygbhMq2q.jpg", Name = "Jerry Goldsmith" },
                        new { Id = 1761, Biography = "", BirthDate = new DateTime(1919, 12, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2008, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Alexander Courage" },
                        new { Id = 1767, Biography = "", Name = "Todd C. Ramsay" },
                        new { Id = 1769, Biography = "Sofia Carmina Coppola (born May 14, 1971) is an American screenwriter, film director, actress, and producer. In 2003 she became the third woman (and the first American woman) to be nominated for an Academy Award for Directing, for Lost in Translation. In 2010, with Somewhere, she became the first American woman (and fourth American filmmaker) to win the Golden Lion, the top prize at the Venice Film Festival.", BirthDate = new DateTime(1971, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zG1WS4sS5jvYkObHMxsK6fGK7Uk.jpg", Name = "Sofia Coppola" },
                        new { Id = 1771, Biography = "Giovanni Ribisi (born December 17, 1974) is an American actor. His film credits include Gone in 60 Seconds, Boiler Room, Saving Private Ryan, The Mod Squad, The Gift, Sky Captain and the World of Tomorrow, Lost in Translation and more recently, Public Enemies and Avatar. He is also known for his role as Phoebe Buffay's brother Frank on the sitcom Friends. He also appeared in music videos for Crystal Ball by Keane and Talk About The Blues by The Jon Spencer Blues Explosion.\\n\\nDescription above from the Wikipedia article Giovanni Ribisi, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1974, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jvq2pimmpNdQj8o75Au9RKC7E1z.jpg", Name = "Giovanni Ribisi" },
                        new { Id = 1776, Biography = "Francis Ford Coppola  (born April 7, 1939) is an American film director, producer and screenwriter. He is widely acclaimed as one of Hollywood's most celebrated and influential film directors. He epitomized the group of filmmakers known as the New Hollywood, which included George Lucas, Martin Scorsese, Robert Altman, Woody Allen and William Friedkin, who emerged in the early 1970s with unconventional ideas that challenged contemporary filmmaking.\\n\\nHe co-authored the script for Patton, winning the Academy Award in 1970. His directorial fame escalated with the release of The Godfather in 1972. The film revolutionized movie-making in the gangster genre, garnering universal laurels from critics and public alike. It went on to win three Academy Awards, including his second, which he won for Best Adapted Screenplay, and it was instrumental in cementing his position as one of the prominent American film directors. Coppola followed it with an equally successful sequel The Godfather Part II, which became the first ever sequel to win the Academy Award for Best Picture. The film received yet higher praises than its predecessor, and gave him three Academy Awards—for Best Adapted Screenplay, Best Director and Best Picture. In the same year was released The Conversation, which he directed, produced and wrote. The film went on to win the Palme d'Or at the 1974 Cannes Film Festival. His next directorial venture was Apocalypse Now in 1979, and it was as notorious for its lengthy and troubled production as it was critically acclaimed for its vivid and stark depiction of the Vietnam War. It won his second Palme d'Or at the 1979 Cannes Film Festival.\\n\\nAlthough some of Coppola's ventures in the 1980s and early 1990s were critically lauded, Coppola's later work has not met the same level of critical and commercial success as his '70s films. Description above from the Wikipedia article Francis Ford Coppola, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1939, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vEGwqahu7UlI6OwELy92xbXk9Kd.jpg", Name = "Francis Ford Coppola" },
                        new { Id = 1813, Biography = "Anne Jacqueline Hathaway (born November 12, 1982) is an American actress. After several stage roles, she appeared in the 1999 television series Get Real. She played Mia Thermopolis in The Princess Diaries (2001). Over the next three years, Hathaway reprised that role for The Princess Diaries 2: Royal Engagement, and starred in family films, appearing as the title character in Ella Enchanted, both in 2004.\\n\\nHathaway had dramatic roles in Havoc and Brokeback Mountain, both in 2005. She starred in The Devil Wears Prada (2006) and in Becoming Jane (2007) as Jane Austen. In 2008, she was acclaimed for her lead role in Rachel Getting Married, for which she won awards and was nominated for the Academy Award for Best Actress. In 2010, she starred in the box office hits Valentine's Day and Tim Burton's Alice In Wonderland, as well as Love and Other Drugs. In 2011, she had a voice role in the animated box office Rio. She is scheduled to play Selina Kyle/Catwoman in Christopher Nolan's The Dark Knight Rises.\\n\\nPeople magazine named her one of its breakthrough stars of 2001, and she first appeared on its list of the world's 50 Most Beautiful People in 2006.\\n\\nDescription above from the Wikipedia article Anne Hathaway (actress), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1982, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xENM3XJAtdpolwELYDy9iaCtU4m.jpg", Name = "Anne Hathaway" },
                        new { Id = 1886, Biography = "", Name = "Ted Griffin" },
                        new { Id = 1891, Biography = "", BirthDate = new DateTime(1969, 2, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Stephen Mirrione" },
                        new { Id = 1892, Biography = "Matthew Paige \"Matt\" Damon (born October 8, 1970) is an American actor, screenwriter, and philanthropist.\\n\\nHis career launched following the success of the film Good Will Hunting (1997) from a screenplay he co-wrote with friend Ben Affleck. The pair won an Academy Award for Best Original Screenplay and a Golden Globe Award for Best Screenplay for their work. Damon alone received multiple Best Actor nominations, including an Academy Award nomination for his lead performance in the film. Damon has since starred in commercially successful films such as Saving Private Ryan (1998), the Ocean's trilogy, and the first three films in the Bourne series, while also gaining critical acclaim for his performances in dramas such as Syriana (2005), The Good Shepherd (2006), and The Departed (2006). He garnered a Golden Globe nomination for portraying the title character in The Talented Mr. Ripley (1999) and was nominated for an Academy Award for Best Supporting Actor in Invictus (2009).\\n\\nHe is one of the top 40 highest grossing actors of all time. In 2007, Damon received a star on the Hollywood Walk of Fame and was named Sexiest Man Alive by People magazine. Damon has been actively involved in charitable work, including the ONE Campaign, H2O Africa Foundation, and Water.org.", BirthDate = new DateTime(1970, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//elSlNgV8xVifsbHpFsqrPGxJToZ.jpg", Name = "Matt Damon" },
                        new { Id = 1893, Biography = "Caleb Casey McGuire Affleck-Boldt (born August 12, 1975), best known as Casey Affleck is an American actor and film director. Throughout the 1990s and early 2000s, he played supporting roles in mainstream hits like Good Will Hunting (1997) and Ocean's Eleven (2001) as well as in critically acclaimed independent films such as Chasing Amy (1997). During this time, he became known as the younger brother of actor and director Ben Affleck, with whom he has frequently collaborated professionally. In 2007, his breakout year, Affleck gained recognition and critical acclaim for his work in Gone Baby Gone and The Assassination of Jesse James by the Coward Robert Ford, which gained him an Academy Award nomination for Best Supporting Actor.", BirthDate = new DateTime(1975, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kPNMpiZHsAzeQar4DiNsrekwHBU.jpg", Name = "Casey Affleck" },
                        new { Id = 1923, Biography = "Robbie Coltrane, is a Scottish actor, comedian and author. He is known both for his role as Dr Eddie \"Fitz\" Fitzgerald in the British TV series Cracker and as Rubeus Hagrid in the Harry Potter films.\\n\\nColtrane was born Anthony Robert McMillan in Rutherglen, South Lanarkshire, the son of Jean McMillan Ross, a teacher and pianist, and Ian Baxter McMillan, a general practitioner who also served as a forensic police surgeon. He has an older sister, Annie, and a late younger sister, Jane.\\n\\nColtrane moved into acting in his early twenties, taking the stage name Coltrane (in tribute to jazz saxophonist John Coltrane) and working in theatre and stand-up comedy. Coltrane soon moved into films, obtaining roles in a number of movies such as Flash Gordon. On television, he also appeared as Samuel Johnson in Blackadder.\\n\\nHis roles went from strength to strength in the 1990s with the TV series Cracker and a BAFTA award as the stepping stone to parts in bigger films such as the James Bond films GoldenEye and The World Is Not Enough and a major supporting role as half-giant Rubeus Hagrid in the Harry Potter films.", BirthDate = new DateTime(1950, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//u07QKPs7wvXxzjXi1UUBSGjjmQm.jpg", Name = "Robbie Coltrane" },
                        new { Id = 1953, Biography = "Casey Siemaszko (born Kazimierz A. Siemaszko) is a Polish-American actor and the brother of actress Nina Siemaszko. The son of a fighter in the Polish Underground who survived the Sachsenhausen concentration camp, Siemaszko narrated the 1998 feature, The Polish-Americans. Siemaszko was a graduate of the Goodman School of Drama at DePaul University in Chicago, which his sister, Nina Siemaszko later also attended.", BirthDate = new DateTime(1961, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kW2A2OrOMnlU7FoVDFbFmZJIUa8.jpg", Name = "Casey Siemaszko" },
                        new { Id = 1954, Biography = "From Wikipedia, the free encyclopedia William George \"Billy\" Zane, Jr. (born February 24, 1966) is an American actor, producer and director. He is probably best known for his roles as Caledon \"Cal\" Hockley in Titanic, The Phantom from The Phantom, John Wheeler in Twin Peaks and Mr. E in CQ.\\n\\nDescription above from the Wikipedia article Billy Zane, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1966, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lkwvmo7vVL8TpMCDLRoHjZIkJQ4.jpg", Name = "Billy Zane" },
                        new { Id = 2037, Biography = "Cillian Murphy is an Irish film and theatre actor. He is often noted by critics for his chameleonic performances in diverse roles and distinctive blue eyes.\\n\\nA native of Cork, Murphy began his performing career as a rock musician. After turning down a record deal, he made his professional acting debut in the play Disco Pigs in 1996. He went on to star in Irish and UK film and stage productions throughout the late 1990s and early 2000s, first coming to international attention in 2003 as the hero in the post-apocalyptic film 28 Days Later. Murphy's best-known roles are as villains in two 2005 blockbusters: the Scarecrow in the superhero film Batman Begins, and Jackson Rippner in the thriller Red Eye. Next came two contrasting, widely acclaimed starring roles: his Golden Globe Award-nominated performance as transgender outcast \"Kitten\" in 2005's Breakfast on Pluto and a turn as a 1920s Irish revolutionary in the 2006 Palme d'Or winner, The Wind That Shakes the Barley.\\n\\nIn 2010, Murphy will co-star in Inception, a big budget movie starring Leonardo DiCaprio by Batman Begins/The Dark Knight director Christopher Nolan.\\n\\nA resident of London since 2001, Murphy often works in or near the city and has expressed no desire to move to Hollywood. Uncomfortable on the celebrity circuit, he customarily gives interviews about his work, but does not appear on television talk shows or discuss details of his private life with the press.\\n\\nBorn in Douglas and raised in Ballintemple, two suburbs of Cork, Cillian Murphy is the eldest of four children. His father, Brendan, works for the Irish Department of Education and his mother is a French teacher. Not only are his parents educators, but his aunts and uncles are also teachers, as was his grandfather. Musicianship also runs in the family, and Murphy started playing music and writing songs at age ten.\\n\\nIn mid-2004, Murphy married his long-time live-in girlfriend, Yvonne McGuinness, an artist whom he met in 1996 at one of his rock band's shows. The couple live in northwest London with their two sons Malachy (born in 2005) and Aaron (born in 2007).\\n\\nMurphy is known for being reluctant to speak about his personal life. He frequently gives interviews about his work but did not appear on a single live TV chat show, where actors customarily share information about their private lives, until 2010, when he was a guest on The Late Late Show on Ireland's RTÉ to promote Perrier's Bounty. He does not have a stylist or a personal publicist, travels without an entourage, and often attends premieres alone. Shy and private, Murphy professes a lack of interest in the celebrity scene, finding the red carpet experience \"a challenge... and not one I want to overcome.\" He intentionally practices a lifestyle that will not interest the tabloids: \"I haven't created any controversy, I don't sleep around, I don't go and fall down drunk.\"\\n\\nMurphy is friends with fellow Irish actors Colin Farrell and Liam Neeson, looking up to the latter like a \"surrogate movie dad\". But primarily, Murphy's close friendships are those he made before becoming a star.", BirthDate = new DateTime(1976, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gybXt7gjFCeV67l3jgJtp6Pxm77.jpg", Name = "Cillian Murphy" },
                        new { Id = 2041, Biography = "Andre Romelle Young, known by his stage name Dr. Dre, is an American rapper, record producer, record executive, entrepreneur, and actor. He is the founder and current CEO of Aftermath Entertainment and Beats Electronics.", BirthDate = new DateTime(1965, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lPcS1QAULXTZP53ogsYSW4bZAOe.jpg", Name = "Dr. Dre" },
                        new { Id = 2141, Biography = "​From Wikipedia, the free encyclopedia\\n\\nNed Bellamy (born May 7, 1957) is an American actor. Bellamy was born in Dayton, Ohio. After graduating UCLA, he founded the Los Angeles based theater company The Actors' Gang with fellow actor Tim Robbins. He was featured on a role on an episode of Seinfeld entitled The Fatigues. His brother, Mark Bellamy, was the United States Ambassador to Kenya from 2003-2006.\\n\\nDescription above from the Wikipedia article Ned Bellamy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1957, 5, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aPAsdVFewZK3ldhvrL1ea2VUkUK.jpg", Name = "Ned Bellamy" },
                        new { Id = 2162, Biography = "", BirthDate = new DateTime(1950, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Lynda Obst" },
                        new { Id = 2165, Biography = "Rosanna Arquette is an American film and television actress, director and producer. Her siblings, Patricia, Alexis, Richmond, and David Arquette, are also actors.", BirthDate = new DateTime(1959, 8, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rQMQYQUF9QzD6oDfkP6tsjmyZhS.jpg", Name = "Rosanna Arquette" },
                        new { Id = 2176, Biography = "Tommy Lee Jones (born September 15, 1946) is an American actor and film director.\\n\\nHe has received three Academy Award nominations, winning one as Best Supporting Actor for the 1993 thriller film The Fugitive. His notable film roles include federal marshal Samuel Gerard in The Fugitive and its sequel U.S. Marshals, the villain \"Two-Face\" in Batman Forever, terrorist William Strannix in Under Siege, Agent K in the Men in Black films, former Texas Ranger Woodrow F. Call in Lonesome Dove, Ed Tom Bell in No Country for Old Men, a Texas Ranger in Man of the House and rancher Pete Perkins in The Three Burials of Melquiades Estrada. Jones has also portrayed real-life figures such as businessman Howard Hughes, executed murderer Gary Gilmore, Oliver Lynn in Coal Miner's Daughter and baseball great Ty Cobb.\\n\\nDescription above from the Wikipedia article Tommy Lee Jones, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gRXugLFvr1oHZ6alLUxmYDq8cgW.jpg", Name = "Tommy Lee Jones" },
                        new { Id = 2177, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLloyd Vernet Bridges, Jr. (January 15, 1913 – March 10, 1998), was an American actor who starred in a number of television series and appeared in more than 150 feature films. Bridges is best known for his role of Mike Nelson in Sea Hunt, the most-popular syndicated American TV series in 1958. He is the father of actors Beau Bridges and Jeff Bridges.\\n\\nDescription above from the Wikipedia article Lloyd Bridges, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1913, 1, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1998, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qez0xZiQGt3f530vAGcoYAWd7FM.jpg", Name = "Lloyd Bridges" },
                        new { Id = 2199, Biography = "From Wikipedia, the free encyclopedia.\\n\\nScott Frank (born March 10, 1960) is an American screenwriter &amp; director.", BirthDate = new DateTime(1960, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hV0DEtOsiiQAMb7Oqo2VEII8o2l.jpg", Name = "Scott Frank" },
                        new { Id = 2210, Biography = "", Name = "Bonnie Curtis" },
                        new { Id = 2211, Biography = "From Wikipedia, the free encyclopedia.\\n\\nGerald Robert Molen (born January 6, 1935) is a high profile American film producer. He works very closely with Steven Spielberg, having produced five of his films, and won an Academy Award for co-producing Schindler's List. Gerald \"Jerry\" Molen is now semi-retired and spends his time alternating between Montana and Las Vegas, Nevada.\\n\\nMolen was born in Great Falls, Montana, the son of Edith Lorraine (née Meyer) and Gerald Richard Molen. He grew up in North Hollywood, California, after moving from Montana, with a number of younger brothers and sisters. His mother ran a diner, \"The Blue Onion\", which was located across from one of the major studios. Molen got his start in the movie business by changing tires on studio trucks.\\n\\nMolen has appeared in cameos in several of the films he produced, including Rain Man, Days of Thunder, and Jurassic Park. The name 'Molen' can be seen painted on the front of a large black cauldron in the movie Hook as the camera pans across the pirate docks in Neverland.\\n\\nMolen is an active member of The Church of Jesus Christ of Latter-day Saints.\\n\\nDescription above from the Wikipedia article Gerald R. Molen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1935, 1, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ih3yLiYixeQuW2Zp545aHtD5nq.jpg", Name = "Gerald R. Molen" },
                        new { Id = 2215, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mEn7U8Dt5zqnNMO0Y1YtXO7evS.jpg", Name = "Denise Chamian" },
                        new { Id = 2216, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nGary Roger Rydstrom (born 1959) is an American sound designer and director. He has won 7 Academy Awards for his work in sound for picture.\\n\\nDescription above from the Wikipedia article Gary Roger Rydstrom, licensed under CC-BY-SA, full list of contributors on Wikipedia.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jZpr1nVfO7lldWI0YtmP1FGw7Rj.jpg", Name = "Gary Rydstrom" },
                        new { Id = 2219, Biography = "Tobias Vincent \"Tobey\" Maguire (born June 27, 1975) is an American actor and producer. He began his career in the 1980s, and has since become best known for his role as Peter Parker/Spider-Man in the 2002 - 2007 Spider-Man films.\\n\\nDescription above from the Wikipedia article Tobey Maguire, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1975, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//l8e9we9RmTsYgNpx4xqQIlMplLl.jpg", Name = "Tobey Maguire" },
                        new { Id = 2221, Biography = "Leland Jones Orser (born August 6, 1960) is an American film and television actor. Orser is a character actor, whose career has included playing a number of parts of deranged, psychotic, and degenerate characters. Orser has appeared in small roles in a wide variety of films and television shows, including Chief of Surgery Dr. Lucien Dubenko on the television show ER.\\n\\nDescription above from the Wikipedia article Leland Orser, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2XnpH5LOE7Ln0JMhFTT73QscLQh.jpg", Name = "Leland Orser" },
                        new { Id = 2229, Biography = "Catherine Ann Keener (born March 23, 1959) is an American actress. She has been nominated for the Academy Award for Best Supporting Actress twice, for Being John Malkovich (1999) and Capote (2005).\\n\\nDescription above from the Wikipedia article Catherine Keener, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tEBdqBUduF3dBcJcBeY5ffZ9MMu.jpg", Name = "Catherine Keener" },
                        new { Id = 2231, Biography = "Samuel Leroy Jackson (born December 21, 1948) is an American film and television actor and film producer. After Jackson became involved with the Civil Rights Movement, he moved on to acting in theater at Morehouse College, and then films. He had several small roles such as in the film Goodfellas, Def by Temptation, before meeting his mentor, Morgan Freeman, and the director Spike Lee. After gaining critical acclaim for his role in Jungle Fever in 1991, he appeared in films such as Patriot Games, Amos & Andrew, True Romance and Jurassic Park. In 1994 he was cast as Jules Winnfield in Pulp Fiction, and his performance received several award nominations and critical acclaim.\\n\\nJackson has since appeared in over 100 films including Die Hard with a Vengeance, The 51st State, Jackie Brown, Unbreakable, The Incredibles, Black Snake Moan, Shaft, Snakes on a Plane, as well as the Star Wars prequel trilogy and small roles in Quentin Tarantino's Kill Bill Vol. 2 and Inglourious Basterds. He played Nick Fury in Iron Man and Iron Man 2, Thor, the first two of a nine-film commitment as the character for the Marvel Cinematic Universe franchise. Jackson's many roles have made him one of the highest grossing actors at the box office. Jackson has won multiple awards throughout his career and has been portrayed in various forms of media including films, television series, and songs. In 1980, Jackson married LaTanya Richardson, with whom he has one daughter, Zoe.\\n\\nDescription above from the Wikipedia article Samuel L. Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1948, 12, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//AvCReLikjzYEf9XjTQxbv3JWgKT.jpg", Name = "Samuel L. Jackson" },
                        new { Id = 2232, Biography = "Michael John Douglas (born September 5, 1951), better known as Michael Keaton, is an American actor, well known for his early comedic roles in films such as Night Shift, Mr. Mom, Johnny Dangerously, Beetlejuice, and for his dramatic portrayal of Batman in Tim Burton's Batman and Batman Returns, as well as lead roles in other films including The Paper, Jackie Brown, Jack Frost, White Noise, Cars, The Other Guys and Toy Story 3.", BirthDate = new DateTime(1951, 9, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//myVdrYNGTgqunLfUSaM8DuVD7DL.jpg", Name = "Michael Keaton" },
                        new { Id = 2234, Biography = "Michael Bowen (born June 21, 1953) is an American actor. Films he has appeared in include Jackie Brown, Magnolia, and Less Than Zero. Bowen also had a recurring role as Danny Pickett on the ABC television series, Lost.\\n\\nBowen (also credited as Michael Bowen Jr.) was born to actress Sonia Sorel (1921–2004) and Beat painter Michael Bowen. He is half-brother to Robert and Keith Carradine. His nieces are actresses Martha Plimpton and Ever Carradine.\\n\\nDescription above from the Wikipedia article Michael Bowen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1953, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xGNcy5uCe0Ke5vqC7oZlOV3GGDx.jpg", Name = "Michael Bowen" },
