                        new { Id = 2246, Biography = "", BirthDate = new DateTime(1917, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4bDKeRU96RxpJ2Uv8x2yrjCmGks.jpg", Name = "Earl Cameron" },
                        new { Id = 2247, Biography = "From Wikipedia, the free encyclopedia.  George William Harris (born 20 October 1949) is a British actor of film, stage, television, radio and musical theatre. His notable roles include Kingsley Shacklebolt in Harry Potter and the Order of the Phoenix, Captain Simon Katanga in Raiders of the Lost Ark and Clive King in popular medical drama Casualty, where he was one of the original cast members. He also played real-life Somali warlord Osman Ali Atto in the 2001 film Black Hawk Down.\\n\\nDescription above from the Wikipedia article George Harris (actor) , licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1949, 10, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dqfdsdtliWJ7yvJupQXxphllHkK.jpg", Name = "George Harris" },
                        new { Id = 2256, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRobert Clohessy (born June 10, 1958) is an American actor, known for playing Correctional Officer Sean Murphy on the HBO drama Oz. He was also a cast member in the final season of Hill Street Blues.\\n\\nClohessy was born in the Bronx, the son of John Clohessy, a police officer. Clohessy graduated from SUNY Purchase, along with Oz co-stars Edie Falco, Kirk Acevedo, and Seth Gilliam. Clohessy fought in the 1975 Golden Gloves in Madison Square Garden. He graduated from Pearl River High School in Pearl River, New York where he played varsity football. Clohessy first appeared on stage at Pearl River High School in their class production of \"Guys and Dolls\", playing, of all things, a police officer.\\n\\nHe has had recurring roles in the ABC daytime drama All My Children, Guiding Light, and appeared in the short lived Fox show New Amsterdam. He also played a semi-minor role in the film \"Across the Universe\", playing the part of Jude's long-lost father. He was also a series regular in short-lived shows such as Laurie Hill who at that time starred a then-unknown Ellen Degeneres.\\n\\nHe played the role of \"Mike\" in the Broadway Roundabout Theatre Company revival of Pal Joey, from November 2008 through February 2009. He is currently seen on HBO's new show Boardwalk Empire.", BirthDate = new DateTime(1958, 6, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mtXOGkDYBZhcbKaNbcSYfZJsUY7.jpg", Name = "Robert Clohessy" },
                        new { Id = 2260, Biography = "From Wikipedia, the free encyclopedia.\\n\\nSteven Ernest Bernard Zaillian (born January 30, 1953) is an Armenian-American screenwriter, film director, film editor, producer, and founder of Film Rites, a film production company. He won an Academy Award for his screenplay for Schindler's List and he has been nominated two times for Awakenings and Gangs of New York. The Times called him \"the most artful and subtle screenwriter Hollywood has had since Robert Towne.\"\\n\\nZaillian was born in Fresno, California, the son of Jim Zaillian, a radio news reporter. He attended Sonoma State University, graduated from San Francisco State University and lives in Los Angeles.\\n\\nDescription above from the Wikipedia article Steven Zaillian, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1953, 1, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7fPmGcUA8I0l74UrVunepIFEjMa.jpg", Name = "Steven Zaillian" },
                        new { Id = 2262, Biography = "​From Wikipedia, the free encyclopedia\\n\\nJohn Burgess Wilson (25 February 1917 – 22 November 1993) — who published under the pen name Anthony Burgess — was an English author, poet, playwright, composer, linguist, translator and critic. The dystopian satire A Clockwork Orange is Burgess' most famous novel, though he dismissed it as one of his lesser works. It was adapted into a highly controversial 1971 film by Stanley Kubrick; which Burgess said was chiefly responsible for the popularity of the book. Burgess produced numerous other novels, including the Enderby quartet, and Earthly Powers. He was a prominent critic, writing acclaimed studies of classic writers such as William Shakespeare, James Joyce, D. H. Lawrence and Ernest Hemingway. In 2008, The Times placed Burgess number 17 on their list of \"The 50 greatest British writers since 1945\". Burgess was an accomplished musician and linguist. He composed over 250 musical works, including a first symphony around age 18, wrote a number of libretti, and translated, among other works, Cyrano de Bergerac, Oedipus the King and Carmen.\\n\\nDescription above from the Wikipedia article Anthony Burgess, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1917, 2, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5H2axr42f2P3C2F4NHrI0cJ2GtN.jpg", Name = "Anthony Burgess" },
                        new { Id = 2264, Biography = "​From Wikipedia, the free encyclopedia\\n\\nPatrick Magee (31 March 1922 – 14 August 1982) was a Northern Irish actor best known for his collaborations with Samuel Beckett and Harold Pinter, as well as his appearances in horror films and in Stanley Kubrick's films A Clockwork Orange and Barry Lyndon.\\n\\nDescription above from the Wikipedia article Patrick Magee (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1922, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1982, 8, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//32ReETRLWtjg4eQO1SRhJsn8aSE.jpg", Name = "Patrick Magee" },
                        new { Id = 2265, Biography = "​From Wikipedia, the free encyclopedia\\n\\nAdrienne Corri (born 13 November 1930 in Edinburgh, Scotland) is an actress of Italian parentage.\\n\\nShe is probably best known for her role as the rape victim Mrs. Alexander in the 1971 Stanley Kubrick film A Clockwork Orange, and for her appearances as Valerie in Jean Renoir's The River (1951) and as Lara's mother in David Lean's Dr. Zhivago (1965). She appeared in many horror and suspense films in the 1950s until the 1970s including Devil Girl from Mars, The Tell-Tale Heart, A Study in Terror and Vampire Circus. She also appeared as Therese Duval in Revenge of the Pink Panther. She also was in the 1969 science fiction movie Moon Zero Two and in the 1969 Twelfth Night, directed by John Sichel, as the Countess Olivia opposite Alec Guinness as Malvolio.\\n\\nHer numerous television credits include Angelica in Sword of Freedom (1958), a regular role in A Family At War and You're Only Young Twice, a 1971 television play by Jack Trevor Story, as Mena in the Doctor Who story \"The Leisure Hive\" and guest starred as the mariticidal Liz Newton in the UFO episode \"The Square Triangle\".\\n\\nShe had a major stage career. There is a story that, when the audience booed on the first night of John Osborne's The World Of Paul Slickey, Corri responded with her own abuse: she raised two fingers to the audience and shouted \"Go fuck yourselves\".\\n\\nCorri has married and divorced twice, to the actors Daniel Massey (1961-1967) and Derek Fowlds.\\n\\nHer book The Search for Gainsborough (Jonathan Cape: 1984) contained much original research, including examination of banking records, and made a plausible case for 1726 as his birth year.\\n\\nDescription above from the Wikipedia article  Adrianne Corri, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1930, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 3, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fEO6V3zvvyWpviIvEdJ8jSLkTL1.jpg", Name = "Adrienne Corri" },
                        new { Id = 2267, Biography = "​From Wikipedia, the free encyclopedia\\n\\nMichael Hammond Bates was an Indian-born English actor. He was educated at Uppingham School in Rutland and St Catharine's College, Cambridge. \\n\\nBates served as a Major serving with the Brigade of Gurkhas in Burma before his discharge at the end of World War II. In 1953, while an ensemble member with the Stratford Festival in Stratford, Ontario, he appeared in Richard III and All's Well That End's Well. In 1956 he appeared in Hotel Paradiso which starred Alec Guinness, at the Winter Garden Theatre in London.\\n\\nHe appeared in many UK television series including Last of the Summer Wine from 1973 to 1975 as Cyril Blamire and It Ain't Half Hot Mum from 1974 to 1977 as Rangi Ram, as well as many others. His role as Rangi Ram caused some controversy as it required Bates to be made-up with fake tan to look like an Indian, which he took to naturally as he was born in India and spoke the Hindi language fluently. On radio he played a variety of characters in the BBC's long-running comedy series The Navy Lark. These were: Able Seaman Ginger, Lt. Bates, Rear Admiral Ironbridge, the Padre and Captain Ignatius Aloysius Atchison.\\n\\nBates' film roles include Battle of Britain (1969) as Warrant Officer Warwick, Oh! What a Lovely War (1969) as a Lance-corporal, Patton (1970) as Field Marshal Sir Bernard Law Montgomery (to whom he bore a striking resemblance), Frenzy (1972) by Alfred Hitchcock, and the Stanley Kubrick film A Clockwork Orange (1971). On stage, he did Shakespeare at Stratford and the Old Vic and made a big impression as Inspector Truscott in the West End production of Loot by Joe Orton in 1966. He died of cancer in Cambridge, aged 57.\\n\\nDescription above from the Wikipedia article Michael Bates (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1920, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1978, 1, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//98HKLKoiYyVfLrINOPdySPN8QnM.jpg", Name = "Michael Bates" },
                        new { Id = 2268, Biography = "​From Wikipedia, the free encyclopedia\\n\\nWarren Clarke (26 April 1947 – 12 November 2014) was an English actor. He was known for his appearances in many films, including a significant early role as Dim in Stanley Kubrick's A Clockwork Orange, and for numerous television appearances, including lead roles in the TV series Dalziel and Pascoe (as Detective Superintendent Andy Dalziel), The Manageress and Sleepers. \\n\\nDescription the Wikipedia article Warren Clarke, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 4, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zb7YcAIYjHYBSsdfqa5b4QLcneb.jpg", Name = "Warren Clarke" },
