                        new { Id = 2294, Biography = "Robert Anthony Rodríguez (born June 20, 1968) is an American film director, screenwriter, producer, cinematographer, editor and musician. He shoots and produces many of his films in his native Texas and Mexico. He has directed such films as Desperado (1995), From Dusk till Dawn (1996), The Faculty (1998), Spy Kids (2001), Sin City (2005), Planet Terror (2007), and Machete (2010). He also produced the latest installment in the Predator series, Predators (2010).\\n\\nDescription above from the Wikipedia article Robert Rodriguez, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1968, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bPqRdLWWwpOT8sBdj9PWOzNgwou.jpg", Name = "Robert Rodriguez" },
                        new { Id = 2315, Biography = "", BirthDate = new DateTime(1950, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dt5DPEmk9VF23BSWxE3ZZmpcsGf.jpg", Name = "Hans Martin Stier" },
                        new { Id = 2319, Biography = "Maria de Medeiros Esteves Vitorino de Almeida (born August 19, 1965), better known as Maria de Medeiros, is a Portuguese actress, director, and singer who has been involved in both European and American film productions.  Description above from the Wikipedia article Maria de Medeiros, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1965, 8, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//q1DKWoG16njgoku7MIK38VDHjjf.jpg", Name = "Maria de Medeiros" },
                        new { Id = 2361, Biography = "From Wikipedia, the free encyclopedia\\n\\nTonino Delli Colli (20 November 1923 – 16 August 2005) was an Italian cinematographer.\\n\\nCousin of Franco Delli Colli, Antonio (Tonino) Delli Colli was born in Rome, and began work at Rome's Cinecittà studio in 1938, at the age of sixteen. By the mid-1940s he was working as a cinematographer and in 1952 shot the first Italian film in colour, Totò a colori. He went on to work with a number of acclaimed and diverse directors including, Sergio Leone (The Good, the Bad and the Ugly, Once Upon a Time in the West and Once Upon a Time in America), Roman Polanski (Death and the Maiden and Bitter Moon), Louis Malle (Lacombe, Lucien), Jean-Jacques Annaud (The Name of the Rose), and Federico Fellini, whose last three films he photographed.\\n\\nHis collaboration with Pier Paolo Pasolini was especially fruitful: they made twelve films together, including Pasolini's debut Accattone (1961), Mamma Roma (1962), The Gospel According to St. Matthew (1964), The Decameron (1971), The Canterbury Tales (1972) and Salò o le 120 giornate di Sodoma (1976).\\n\\nHis last film was Roberto Benigni's Life Is Beautiful (1997), for which he won his fourth David di Donatello for Best Cinematography. In 2005 he was awarded the American Society of Cinematographers' International Achievement Award. In August of the same year, he died at home in Rome.\\n\\nTonino Delli Colli died from a heart attack in 2005 at the age of 81 in Rome, Italy.\\n\\nIn 2005, Delli Colli was posthumously awarded the Lifetime Achievement Award at the 13th annual Camerimage Film Festival in Łódź, Poland.\\n\\n ", BirthDate = new DateTime(1922, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2005, 8, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eZiIxNxmEJPLWsGokFX98IcgdF2.jpg", Name = "Tonino Delli Colli" },
                        new { Id = 2387, Biography = "Sir Patrick Hewes Stewart is an English film, television and stage actor. He has had a distinguished career in theatre and television for around half a century. He is most widely known for his television and film roles, as Captain Jean-Luc Picard in Star Trek: The Next Generation and as Professor Charles Xavier in the X-Men films.\\n\\nStewart was born in Mirfield near Dewsbury in the West Riding of Yorkshire, England, the son of Gladys, a weaver and textile worker, and Alfred Stewart, a Regimental Sergeant Major in the British Army who served with the King's Own Yorkshire Light Infantry and previously worked as a general labourer and as a postman. Stewart and his first wife, Sheila Falconer, have two children: Daniel Freedom and Sophie Alexandra. Stewart and Falconer divorced in 1990. In 1997, he became engaged to Wendy Neuss, one of the producers of Star Trek: The Next Generation, and they married on 25 August 2000, divorcing three years later. Four months prior to his divorce from Neuss, Stewart played opposite actress Lisa Dillon in a production of The Master Builder. The two dated for four years, but are no longer together. He is now seeing Sunny Ozell; at 31, she is younger than his daughter. \"I just don't meet women of my age,\" he explains.\\n\\nStewart has been a prolific actor in performances by the Royal Shakespeare Company, appearing in over 60 productions.", BirthDate = new DateTime(1940, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wEy5qSDT5jT3ZASc2hbwi59voPL.jpg", Name = "Patrick Stewart" },
                        new { Id = 2394, Biography = "From Wikipedia, the free encyclopedia.  Alan Ruck (born July 1, 1956) is an American film, stage and television actor, perhaps best known for his roles as Cameron Frye in Ferris Bueller's Day Off and Stuart Bondek on Spin City.", BirthDate = new DateTime(1956, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vIR73PIttX21BfZv1LgfsadDMaT.jpg", Name = "Alan Ruck" },
                        new { Id = 2395, Biography = "Whoopi Goldberg (born Caryn Elaine Johnson, November 13, 1955) is an American comedian, actress, singer-songwriter, political activist, and talk show host. Goldberg made her film debut in The Color Purple (1985) playing Celie, a mistreated black woman in the Deep South. She received a nomination for the Academy Award for Best Actress and won her first Golden Globe Award for her role in the film. In 1990, she starred as Oda Mae Brown, a psychic helping a slain man (Patrick Swayze) find his killer in the blockbuster film Ghost. This performance won her a second Golden Globe and an Academy Award for Best Supporting Actress. Notable later films include Sister Act and Sister Act 2, The Lion King, Made in America, How Stella Got Her Groove Back, Girl, Interrupted and Rat Race. She is also acclaimed for her roles as the bartender Guinan in Star Trek: The Next Generation and as Terry Dolittle in Jumpin' Jack Flash. Her latest role is the voice of Stretch in Toy Story 3. Goldberg has been nominated for 13 Emmy Awards for her work in television. She was co-producer of the popular game show Hollywood Squares from 1998 to 2004. She has been the moderator of the daytime talk show The View since 2007. Goldberg has a Grammy, two Emmys, two Golden Globes, a Tony, and an Oscar. In addition, Goldberg has a British Academy Film Award, four People's Choice Awards and has been honored with a star on the Hollywood Walk of Fame and is one of the few entertainers who have won an Oscar, Emmy, Grammy, and Tony Award.", BirthDate = new DateTime(1955, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n3lF8w4X4rDa4J2LMDIxMEcuUeH.jpg", Name = "Whoopi Goldberg" },
                        new { Id = 2445, Biography = "", Name = "Eric McLeod" },
                        new { Id = 2461, Biography = "Mel Colm-Cille Gerard Gibson, AO (born January 3, 1956) is an actor, film director, producer and screenwriter. Born in Peekskill, New York, Gibson moved with his parents to Sydney, Australia when he was 12 years old and later studied acting at the Australian National Institute of Dramatic Art. After appearing in the Mad Max and Lethal Weapon series, Gibson went on to direct and star in the Academy Award-winning Braveheart. In 2004, he directed and produced The Passion of the Christ, a controversial, yet successful, film portraying the last hours in the life of Jesus Christ. Outside his career, remarks by Gibson have generated accusations of homophobia, antisemitism, racism, and misogyny; he has previously attributed the statements to his alcoholism.\\n\\nDescription from Wikipedia", BirthDate = new DateTime(1956, 1, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4IsmIFUgoJgUZjen8Ldxnw5YQvG.jpg", Name = "Mel Gibson" },
                        new { Id = 2483, Biography = "", BirthDate = new DateTime(1952, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "John Toll" },
                        new { Id = 2486, Biography = "", Name = "Thomas E. Sanders" },
                        new { Id = 2487, Biography = "", Name = "Bruce Davey" },
                        new { Id = 2493, Biography = "Robert Langford Modini Stack was a multilingual American actor and television host. In addition to acting in more than 40 films, he also appeared on the television series The Untouchables and later served as the host of Unsolved Mysteries.\\n\\nBorn in Los Angeles, California, Stack spent his early childhood growing up in Europe.  Becoming fluent in French and Italian at an early age, and he did not learn English until returning to Los Angeles.  Stack achieved minor fame in sporting, winning multiple championships including setting two world records and winning multiple honors in skeet shooting\\n\\nStack studied drama at Bridgewater State College, earning his first hollywood role at the age of 20 and continuing to star in numerous roles throughout the early 1940s.\\n\\nAfter serving in the military, Stack returned to Hollywood to star in numerous films including stand out roles in The High and the Mighty (opposite John Wayne) and Written on the Wind (1957), for which he was awarded an Academy Award for Best Supporting Actor.\\n\\nStack later moved on to televised dramatic series, depicting the crime-fighting Eliot Ness in The Untouchables (1959–1963), which earned him a best actor Emmy Award in 1960. Stack also starred in multiple drama series, before returning to film, this time in comedies to satirize his famed stoic and humorless demeanor.\\n\\nHe began hosting Unsolved Mysteries in 1987, and served as the show's host throughout it's entire original run from 1987 to 2002.", BirthDate = new DateTime(1919, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2003, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//f1MchlCMVc4LDWEALsodZHPkbIu.jpg", Name = "Robert Stack" },
                        new { Id = 2518, Biography = "From Wikipedia, the free encyclopedia.\\n\\nGregg Lee Henry (born May 6, 1952) is an American theatre, film and television character actor and rock, blues and country musician.", BirthDate = new DateTime(1952, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ltCW4AenmpuDau3x5etBkGxiCkV.jpg", Name = "Gregg Henry" },
                        new { Id = 2524, Biography = "Edward Thomas \"Tom\" Hardy (born 15 September 1977) is an English actor. He is best known for playing the title character in the 2009 British film Bronson, and for his roles in the films Star Trek Nemesis, RocknRolla, and Inception. He has been cast in the Christopher Nolan film The Dark Knight Rises as Bane.  Description above from the Wikipedia Tom Hardy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1977, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4CR1D9VLWZcmGgh4b6kKuY2NOel.jpg", Name = "Tom Hardy" },
                        new { Id = 2536, Biography = "From Wikipedia, the free encyclopedia.\\n\\nMichael Parks (born Harry Samuel Parks; April 24, 1940) was an American actor and singer. He appeared in almost fifty films and made frequent TV appearances, but is probably best known for his work in recent years with Quentin Tarantino, Robert Rodriguez, and Kevin Smith as well as the 1969 television series Then Came Bronson.\\n\\nParks died on 9 May 2017.\\n\\nDescription above from the Wikipedia article Michael Parks, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1940, 4, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 5, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//54P22YwbYCwfjJWT1jbiHN77TD.jpg", Name = "Michael Parks" },
