                        new { Id = 2593, Biography = "Rupert Gregson-Williams is a British composer of motion picture and television scores. Educated at St John's College, Cambridge, choir school and Lancing College, he is the brother of film composer Harry Gregson-Williams and he is a member of Hans Zimmer's Remote Control Productions team of composers.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6qr9v5tsFrZtAA8EUfO1XQtUHhB.jpg", Name = "Rupert Gregson-Williams" },
                        new { Id = 2829, Biography = "From Wikipedia, the free encyclopedia\\n\\nAndrzej Seweryn (born 25 April 1946) is a Polish actor and director. One of the most successful Polish theatre actors, he starred in over 50 films, mostly in Poland, France and Germany. He is also one of only three non-French actors to be hired by the Paris-based Comédie-Française. He is currently serving as director general of the Polski Theatre in Warsaw. Has three children with three different wives: daughter Maria Seweryn (born 1975) with his first wife, Polish actress, Krystyna Janda and two sons Yann-Baptiste and Maximilien.", BirthDate = new DateTime(1946, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cv5QWhXGPhWdFYsGOtg3856uNYJ.jpg", Name = "Andrzej Seweryn" },
