                        new { Id = 2949, Biography = "​Alexandre Desplat is a french film composer. He has received four Academy Award nominations, five BAFTA nominations and five Golden Globe nominations, winning a Golden Globe for his work on The Painted Veil in 2006. \\n\\nIn 2011, Desplat won his first British Academy Film Award for his score for The King's Speech. Among various projects, Desplat has worked on a variety of successful Hollywood films including The Queen, The Curious Case of Benjamin Button, New Moon, Fantastic Mr. Fox and both parts of Harry Potter and the Deathly Hallows.", BirthDate = new DateTime(1961, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sdGjvOGJqjK1CTbxRedE64Txk0t.jpg", Name = "Alexandre Desplat" },
                        new { Id = 2988, Biography = "", BirthDate = new DateTime(1938, 10, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Barry Malkin" },
                        new { Id = 2997, Biography = "​American film producer and a theatrical producer started working as an assistant to theater producer Kermit Bloomgarden at the age of sixteen. Later, he worked for producers Robert Whitehead and Emanuel Azenberg. Rudin ended up starting his own company after he took a job as a casting agent In lieu of attending college.  In 1980, Rudin moved to Los Angeles, taking up employment at Edgar J. Scherick Associates, where he served as producer on a variety of films including I'm Dancing as Fast as I Can (1981), the NBC miniseries Little Gloria... Happy at Last (1982) and the Oscar-winning documentary He Makes Me Feel Like Dancin' (1983). Rudin later formed his own business, Scott Rudin Productions. His first film under that banner was Gillian Armstrong's Mrs. Soffel (1984). But, not long after, Rudin joined 20th Century-Fox as an executive producer. At Fox, he met Jonathan Dolgen, a higher-level executive, with whom he would be working once again at Paramount Pictures years later. Rudin swiftly rose through the ranks at Fox and became president of production by 1986 at the age of 29. His stint at the top of Fox was short lived though, and he soon left and entered into a producing deal with Paramount.  Rudin lives in New York City with his longtime boyfriend John Barlow, a Broadway theatre publicist and founding partner of Barlow/Hartman Public Relations.", BirthDate = new DateTime(1958, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zR8sdlGblto6dneAr2mckTowwEl.jpg", Name = "Scott Rudin" },
                        new { Id = 3026, Biography = "Robert Norman \"Rob\" Reiner (born March 6, 1947) is an American actor, director, producer, writer, and political activist.\\n\\nAs an actor, Reiner first came to national prominence as Archie and Edith Bunker's (played by Carroll O'Connor and Jean Stapleton, respectively) son-in-law, Michael \"Meathead\" Stivic, on All in the Family. That role earned him two Emmy Awards during the 1970s. As a director, Reiner was recognized by the Directors Guild of America (DGA) with nominations for Stand by Me, When Harry Met Sally..., and A Few Good Men. He was trained at the UCLA Film School.\\n\\nDescription above from the Wikipedia article Rob Reiner, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 3, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2zw9Iq9uo4vZiTQNQWdNFwbA1TA.jpg", Name = "Rob Reiner" },
                        new { Id = 3027, Biography = "From Wikipedia, the free encyclopedia\\n\\nStephen Edwin King (born September 21, 1947) is an American author of contemporary horror, suspense, science fiction and fantasy fiction. His books have sold more than 350 million copies, which have been adapted into a number of feature films, television movies and comic books. As of 2011, King has written and published 49 novels, including seven under the pen name Richard Bachman, five non-fiction books, and nine collections of short stories. Many of his stories are set in his home state of Maine.\\n\\nKing has received Bram Stoker Awards, World Fantasy Awards, British Fantasy Society Awards, his novella The Way Station was a Nebula Award novelette nominee, and in 2003, the National Book Foundation awarded him the Medal for Distinguished Contribution to American Letters.", BirthDate = new DateTime(1947, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//z8cHPoqTslxRR7oWQ5wsh0fNLt2.jpg", Name = "Stephen King" },
                        new { Id = 3038, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//d1TZEZcWxyTnqLdop06MOKWMvm8.jpg", Name = "Gary Riley" },
                        new { Id = 3052, Biography = "Rachel Anne Griffiths is an Australian film and television actress. She came to prominence with the 1994 film Muriel's Wedding and her Academy Award nominated performance in Hilary and Jackie (1998). She is best known for her portrayals of Brenda Chenowith in the HBO series Six Feet Under and Sarah Walker Laurent on the ABC primetime drama Brothers &amp; Sisters. Her work in film and television has earned her a Golden Globe Award, two Screen Actors Guild Awards and three Australian Film Institute Awards.\\n\\nGriffith attended Melbourne University, studying philosophy, before attending the drama department at Victoria School of the Art.  After college, she began working with the touring youth company Woolly Jumpers Theater Company, as well as the Melbourne Theater Company, where she appeared in numerous dramas.  \\n\\nGriffiths made a name for herself in 1991 when she wrote and performed in the short film \"Barbie Gets Hip,” which was screened at the Melbourne International Film Festival. She landed a few TV spots before she was cast as Rhonda, Toni Collette's sidekick in P.J. Hogan's \"Muriel's Wedding\" (1994), winning her an Australian Film Institute Award for Best Supporting Actress. These successes jump-started her career, landing her numerous dramatic and comedic roles in overseas productions, before making her American cinema debut with her second P.J. Hogan collaboration, \"My Best Friend's Wedding” (1997).\\n\\nIn the fall of 2001, Griffiths accepted her first major television series role and came aboard Alan Ball’s HBO series \"Six Feet Under.\"  Griffith stayed with the show during its five years of critical acclaim, while at the same time, continued to appear an lend her voice to screen and direct-to-video features before returning to telvision to star in \"Brothers and Sisters\" to much similar acclaim. ", BirthDate = new DateTime(1968, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eufpAqIIViSBe0ZpMRs47drKiQw.jpg", Name = "Rachel Griffiths" },
                        new { Id = 3063, Biography = "Katherine Mathilda \"Tilda\" Swinton (born 5 November 1960) is a British actress known for both arthouse and mainstream films. She won the Academy Award for Best Supporting Actress for her performance in Michael Clayton.", BirthDate = new DateTime(1960, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eGNo9qwlunvAi4kCVUEFtQFM5X.jpg", Name = "Tilda Swinton" },
                        new { Id = 3064, Biography = "From Wikipedia, the free encyclopedia.\\n\\nPeter Mullan (born 2 November 1959) is a Scottish actor and film-maker who has been appearing in films since 1990.\\n\\nDescription above from the Wikipedia article Peter Mullan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 11, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//g344UcfsoYtz3Lt148mDtuQ9CQ0.jpg", Name = "Peter Mullan" },
                        new { Id = 3083, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nMario Gianluigi Puzo  (October 15, 1920 – July 2, 1999) was an American author and screenwriter, known for his novels about the Mafia, including The Godfather (1969), which he later co-adapted into a film with Francis Ford Coppola. He won the Academy Award for Best Adapted Screenplay in both 1972, and 1974.\\n\\nDescription above from the Wikipedia article Mario Puzo, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1920, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1999, 7, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sxZPpfKJ1Rr9vlO5eVZs0tyCv5u.jpg", Name = "Mario Puzo" },
                        new { Id = 3085, Biography = "James Caan  (born March 26, 1940) is an American actor. He is best-known for his starring roles in The Godfather, Thief, Misery, A Bridge Too Far, Brian's Song, Rollerball, Kiss Me Goodbye, Elf, and El Dorado. He also starred as \"Big Ed\" Deline in the television series Las Vegas.", BirthDate = new DateTime(1940, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//g4bxNXWft1jLZX8gKk4G6ypkTUf.jpg", Name = "James Caan" },
                        new { Id = 3087, Biography = "Robert Selden Duvall (born January 5, 1931) is an American actor and director. He has won an Academy Award, two Emmy Awards, and four Golden Globe Awards over the course of his career. Duvall has been in some of the most acclaimed and popular films of all time, among them To Kill a Mockingbird, The Godfather, The Godfather Part II, MASH, Network, True Grit, Bullitt, The Conversation, Apocalypse Now, Tender Mercies, The Natural and Lonesome Dove. He began appearing in theatre during the late 1950s, moving into small, supporting television and film roles during the early 1960s in such works as To Kill a Mockingbird (1962) (as Boo Radley) and Captain Newman, M.D. (1963). He started to land much larger roles during the early 1970s with movies like MASH (1970) (as Major Burns) and THX 1138 (1971). This was followed by a series of critical successes: The Godfather (1972), The Godfather Part II (1974), Network (1976), The Great Santini (1979), Apocalypse Now (1979), and True Confessions (1981). Since then Duvall has continued to act in both film and television with such productions as Tender Mercies (1983) (for which he won an Academy Award, The Natural (1984), Colors (1988), the television mini-series Lonesome Dove (1989), Stalin (1992), The Man Who Captured Eichmann (1996), A Family Thing (1996), The Apostle (1997) (which he also wrote and directed), A Civil Action (1998), Gods and Generals (2003), Broken Trail (2006) and Get Low (2010).\\n\\nDescription above from the Wikipedia article Robert Duvall, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1931, 1, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1aBC7NxPy10ofng6HsJBecJ1vMZ.jpg", Name = "Robert Duvall" },
                        new { Id = 3092, Biography = "American film actress Diane Keaton (Born Diane Hall), began her career on stage and got her first major role in the Broadway rock musical \"Hair\" as understudy to the lead. Keaton made her film debut in the 1972 screen adaptation of Woody Allen’s Broadway play \"Play It Again, Sam\". That same year Keaton was cast in her first major film role as Kay Adams-Corleone in the Oscar-winning movie “The Godfather”. Keaton established herself as a comic actor in her next two films “Sleeper” (1973) and “Love and Death” (1975).\\n\\nIn 1977, Keaton veered away from her comedic image to appear in the remarkable “Looking for Mr. Goodbar”, which won her a Golden Globe nomination. It was that same year that she appeared in the title role of “Annie Hall”, which many consider to be her best performance. The following year Keaton was awarded the Oscar for best actress in a leading role, as well as the British Academy of Film and Television Arts (BAFTA) Film Award. In the early 1990’s Keaton began to play more mature roles, though she reprised the role of Kay Adams-Corleone in the third \"Godfather\" epic, The Godfather: Part III (1990). She appeared in the well-liked  “Father of the Bride” (1991) and “Father of the Bride Part II” (1995) as “Nina Banks” the wife of “George Banks” played by Steve Martin. Some of her popular later films include: The First Wives Club (1996), Something's Gotta Give (2003) and The Family Stone (2005). In addition to acting, she is also a director, producer, screenwriter, photographer, real estate developer, and occasional singer. Her first record was an original cast recording of Hair, in 1971. In 1977, she began recording tracks for a solo album, but the finished product was never seen. In 1995 she received high marks for Unstrung Heroes (1995), her first major feature as a director. Keaton was romantically involved with several other celebrities such as Warren Beatty, Al Pacino and her most famous romance - Woody Allen. In 2001 Keaton publicly announced that she was giving up on pursuing romance and later adopted two children, a daughter, Dexter (adopted 1996), and a son, Duke (adopted 2001). ", BirthDate = new DateTime(1946, 1, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fzgUMnbOkxC6E3EFcYHWHFaiKyp.jpg", Name = "Diane Keaton" },
                        new { Id = 3093, Biography = "Tall, dour-faced and slouch-shouldered character actor Abe Vigoda proved himself in both gritty dramatic roles, and as an actor with wonderful comedic timing.\\n\\nVigoda was born in Brooklyn, New York, to Lena (Moses) and Samuel Vigoda, both Russian Jewish immigrants. His father was a tailor on the Lower East Side. He made his first stage appearance at the age of 17 and plodded away in small theater shows for over 20 years. For the majority of film-goers, Vigoda first came to prominence in The Godfather (1972) as the double-crossing Tessio, pleading with Robert Duvall to get him off the hook \"for old times' sake.\" He also appeared in its sequel.\\n\\nVigoda had roles in a few nondescript TV films before landing the plum part of Sgt. Phil Fish on the brilliant sitcom Barney Miller (1974). Perhaps his best known role, Sgt. Fish proved popular enough to be spun off to his own (short-lived) series Fish (1977).\\n\\nWith his long face and unusual looks, Vigoda remained in high demand in mafioso-type roles, and for a while in the mid-1980s, he was mistakenly believed to have been dead, leading producers to remark, \"I need an Abe Vigoda type actor,\" not realizing Vigoda was still alive and well. The 1990s and beyond became busy again for him, with appearances in North (1994), The Misery Brothers (1995), A Brooklyn State of Mind (1998), and Crime Spree (2003). He continued acting into his 90s, surprising audiences with his entertaining style.\\n\\nAbe Vigoda died in his sleep on January 26, 2016 in Woodland Park, New Jersey.", BirthDate = new DateTime(1921, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 1, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//luWKPNb58IgJ2ovrtgPAzHGLLYL.jpg", Name = "Abe Vigoda" },
                        new { Id = 3094, Biography = "From Wikipedia, the free encyclopedia.\\n\\nTalia Shire (born April 25, 1946) is an American actress most known for her roles as Adrian Balboa in the Rocky series and Connie Corleone in The Godfather films.\\n\\nDescription above from the Wikipedia article Talia Shire, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 4, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//liNfrVB3eZFBOjcUGltISCucews.jpg", Name = "Talia Shire" },
                        new { Id = 3095, Biography = "With a singularly nebulous background, which, by his account, included stints as a Las Vegas nightclub emcee, radio personality, and jewelry tycoon, and comparatively little acting experience, Gianni Russo won the role of Carlo Rizzi in The Godfather (1972) on the basis of his screen test. Since then, Russo has remained busy as an actor, mostly playing assorted \"wiseguys\" and Mafia types. He was appeared again with Marlon Brando in a small role in The Freshman (1990) in which Brando parodied his Don Corleone role to good effect. IMDb Mini Biography By: Bob Sorrentino", BirthDate = new DateTime(1943, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ttNwx2hFyQ7RkhAFhcfXtOYr6md.jpg", Name = "Gianni Russo" },
                        new { Id = 3096, Biography = "John Holland Cazale (/kəˈzeɪl/; Italian pronunciation: [kaˈdzaːle]; August 12, 1935 – March 12, 1978) was an American actor. He appeared in five films during six years that were nominated for the Academy Award for Best Picture: The Godfather, The Conversation, The Godfather Part II, Dog Day Afternoon, and The Deer Hunter. He appeared in archival footage in The Godfather Part III, also nominated for Best Picture, making him the only actor to have this multi-film distinction. From his start as a theater actor, he became one of Hollywood's premier character actors, starting with his role as the doomed, weak-minded Fredo Corleone opposite longtime friend Al Pacino in Francis Ford Coppola's film The Godfather and its 1974 sequel. Cazale chose to continue acting despite being diagnosed with lung cancer. He died in New York City on March 12, 1978, shortly after completing his role in The Deer Hunter.\\n\\nTheatre producer Joseph Papp called Cazale \"an amazing intellect, an extraordinary person and a fine, dedicated artist\". A film documentary tribute to Cazale, I Knew It Was You, was screened at the 2009 Sundance Film Festival Description above from the Wikipedia article John Cazale, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1935, 8, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1978, 3, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//d8lIfeeAbX8qALMYpVBc3y5Lkp6.jpg", Name = "John Cazale" },
                        new { Id = 3097, Biography = "From Wikipedia, the free encyclopedia\\n\\nGordon Hugh Willis, Jr., ASC (May 28, 1931 – May 18, 2014) was an American cinematographer. He is best known for his work on Francis Ford Coppola's The Godfather series as well as Woody Allen's Annie Hall and Manhattan. Fellow cinematographer William Fraker called Willis's work a \"milestone in visual storytelling\", while one critic suggested that Willis \"defined the cinematic look of the 1970s: sophisticated compositions in which bolts of light and black put the decade's moral ambiguities into stark relief\".\\n\\nWhen the International Cinematographers Guild conducted a survey in 2003, they placed Willis among the ten most influential cinematographers in history.", BirthDate = new DateTime(1931, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6gOmfatlF7UdhaHi2tPsZMb5vmz.jpg", Name = "Gordon Willis" },
                        new { Id = 3098, Biography = "From Wikipedia, the free encyclopedia\\n\\nGiovanni \"Nino\" Rota (3 December 1911 – 10 April 1979) was an Italian composer, pianist, conductor and academic who is best known for his film scores, notably for the films of Federico Fellini and Luchino Visconti. He also composed the music for two of Franco Zeffirelli's Shakespeare films, and for the first two films of Francis Ford Coppola's Godfather trilogy, receiving the Academy Award for Best Original Score for The Godfather Part II (1974).\\n\\nDuring his long career Rota was an extraordinarily prolific composer, especially of music for the cinema. He wrote more than 150 scores for Italian and international productions from the 1930s until his death in 1979—an average of three scores each year over a 46-year period, and in his most productive period from the late 1940s to the mid-1950s he wrote as many as ten scores every year, and sometimes more, with a remarkable thirteen film scores to his credit in 1954. Alongside this great body of film work, he composed ten operas, five ballets and dozens of other orchestral, choral and chamber works, the best known being his string concerto. He also composed the music for many theatre productions by Visconti, Zeffirelli and Eduardo De Filippo as well as maintaining a long teaching career at the Liceo Musicale in Bari, Italy, where he was the director for almost 30 years.", BirthDate = new DateTime(1911, 12, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1979, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//v42v3uM7jqwoZxDJ8MlEtT6Ol7a.jpg", Name = "Nino Rota" },
                        new { Id = 3100, Biography = "", BirthDate = new DateTime(1919, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2007, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Peter Zinner" },
                        new { Id = 3102, Biography = "", Name = "Howard Beals" },
                        new { Id = 3113, Biography = "Guillermo Navarro  is a cinematographer and director.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//AfZkxrEiLlqqHONhfJyVOLrHR8A.jpg", Name = "Guillermo Navarro" },
                        new { Id = 3115, Biography = "From Wikipedia, the free encyclopedia.\\n\\nAndrzej Sekuła (born 1954 in Wrocław, Poland) is a Polish cinematographer and film director. He left his native Poland in 1980 and currently lives in Los Angeles. His cinematography work has appeared in such prominent films as Reservoir Dogs and Pulp Fiction.\\n\\nIn Armored, Sekula's work helped convey the bleakness at the core of the film, critic A. O. Scott wrote in The New York Times.\\n\\nDescription above from the Wikipedia article Andrzej Sekuła, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1954, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Andrzej Sekula" },
                        new { Id = 3129, Biography = "Tim Roth (born May 14, 1961) is an English film actor. Notable credits include Reservoir Dogs, Pulp Fiction, Four Rooms, Planet of the Apes, The Incredible Hulk and Rob Roy.", BirthDate = new DateTime(1961, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hgaIXIW9GKnZhrweplBonG7uhhP.jpg", Name = "Tim Roth" },
                        new { Id = 3130, Biography = "From Wikipedia, the free encyclopedia\\n\\nJennifer Beals (born December 19, 1963, height 5' 8½\" (1,74 m)) is an American actress and a former teen model. She is known for her roles as Alexandra \"Alex\" Owens in the 1983 film Flashdance, and as Bette Porter on the Showtime drama series The L Word. She earned an NAACP Image Award and a Golden Globe Award nomination for the former. She has appeared in more than 50 films.\\n\\nBeals was born on the South Side of Chicago, the daughter of Jeanne (née Anderson), an elementary school teacher, and Alfred Beals, who owned grocery stores. She is multiracial; her father was African American, and her mother is Irish American. She has two brothers, Bobby and Gregory.Her father died when Beals was nine years old, and her mother married Edward Cohen in 1981. Beals has said her biracial heritage had some effect on her, as she \"always lived sort of on the outside\", with an idea \"of being the other in society\". She got her first job at age 13 at an ice cream store, using her height at the time (she is now nearly 5 ft 9 in (1.75 m)), to convince her boss she was 16.\\n\\nBeals was inspired to become an actress by two events: doing a high school production of Fiddler on the Roof and seeing Balm in Gilead with Joan Allen while volunteer-ushering at the Steppenwolf Theatre.\\n\\nBeals graduated from the progressive Francis W. Parker School. She also was chosen to attend the elite Goodman Theatre Young People's Drama Workshop. Beals attended Yale University, receiving a B.A. in American literature in 1987; she deferred a term so she could film Flashdance. While at Yale, Beals was a resident of Morse College.\\n\\nDescription above from the Wikipedia article Jennifer Beals, licensed under CC-BY-SA, full list of contributors on Wikipedia. ​", BirthDate = new DateTime(1963, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//x3HHLQ7UVZDuSU5e2wZMQWEjrwl.jpg", Name = "Jennifer Beals" },
                        new { Id = 3137, Biography = "He was born in Puerto Rico 1959. Calderon moved to New York with his family at the age of six, where he grew up on the streets of the Lower East Side and Spanish Harlem. Following some time in college, he enlisted in the United States Army and served overseas as an infantryman.  Returning to the States, Calderon set his sights on an acting career. Starting out on the New York stage, he won an Obie Award for his performance in Blade to the Heat at the Public Theatre. His most notable Broadway role was opposite Robert De Niro in Cuba and His Teddy Bear. Calderon also appeared off-Broadway in such plays as Requiem For A Heavyweight and Divine Horsemen, and played Achilles in the New York Shakespeare Festival’s production of Troilus and Cressida in Central Park. He is a founding member of the Touchstone Theatre, the American Folk Theatre and the Labyrinth Theatre Company.\\n\\nCalderon was originally slated to portray the role of Jules Winnfield in Pulp Fiction; Samuel L. Jackson was subsequently given the role.\\n\\nCorrection Samuel Jackson told Tarantino he had messed up by not casting him in Reservoir Dogs. Tarantino agreed and told him he was writing a script and had a character that he had written specifically with Jackson in mind. Calderon had a better initial reading than Jackson and Tarantino gave serious consideration to casting him as Jules Winnfield.\\n\\nCalderon portrays Paul the bartender in dialogue scene between Butch Coolidge and Marsellus Wallace.\\n\\nCalderon also co-wrote Abel Ferrara's 1992 crime drama Bad Lieutenant, starring Harvey Keitel.\\n\\nCalderon acted in The Last Castle and the critically acclaimed independent feature Girlfight. His more than three dozen film credits also include Out of Sight, Cop Land, Four Rooms, Pulp Fiction, Bad Lieutenant, The Firm, The Addiction, Q &amp; A, Sea of Love, Clockers and King of New York. In addition, he has made numerous guest appearances on television series, including recurring roles on Dream Street, Law &amp; Order and Miami Vice.\\n\\nIn 2010, Calderon is set to star as The Businessman in Sanzhar Sultanov's crime drama - The Story.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2v8spXfKtaMbFZ25FrVsV0SAPwW.jpg", Name = "Paul Calderon" },
                        new { Id = 3138, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nKathleen Mary \"Kathy\" Griffin (born November 4, 1960) is an American actress, model, stand-up comedian, television personality, New York Times best-selling author and an LGBT rights advocate. Griffin first gained recognition for appearances on two episodes of Seinfeld, and then for her supporting role on the NBC sitcom Suddenly Susan. She was the star of the Bravo reality show Kathy Griffin: My Life on the D-List, for which she won two Emmy Awards as executive producer. She has also worked as a voice artist and red carpet commentator, in addition to several other career pursuits. From 2008-2013 she was nominated for a Grammy Award for Best Comedy Album, winning in 2013. In her bid to win a Tony Award, she made her Broadway debut in Kathy Griffin Wants a Tony in March 2011.\\n\\nDescription above from the Wikipedia article Kathy Griffin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//psg895Ye46vGenRdX0EXvGOm92p.jpg", Name = "Kathy Griffin" },
                        new { Id = 3170, Biography = "", Name = "Mona Skager" },
                        new { Id = 3171, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nLee Strasberg (November 17, 1901 – February 17, 1982) was an American actor, director and acting teacher.  He cofounded, with directors Harold Clurman and Cheryl Crawford, the Group Theatre in 1931, which was hailed as \"America's first true theatrical collective\".  In 1951, he became director of the non-profit Actors Studio, in New York City, considered \"the nation's most prestigious acting school\".  In 1969, Strasberg founded the Lee Strasberg Theatre and Film Institute in New York City and in Hollywood to teach the work he pioneered. He is considered the \"father of method acting in America,\" according to author Mel Gussow, and from the 1920s until his death in 1982 \"he revolutionized the art of acting by having a profound influence on performance in American theater and movies\".  From his base in New York, he trained several generations of theatre and film's most illustrious talents, including Anne Bancroft, Dustin Hoffman, Montgomery Clift, Marlon Brando, James Dean, Marilyn Monroe, Julie Harris, Paul Newman, Al Pacino, Robert De Niro and director Elia Kazan.  Former student Elia Kazan directed James Dean in East of Eden (1955), for which Kazan and Dean were nominated for Academy Awards. As a student, Dean wrote that Actors Studio was \"the greatest school of the theater [and] the best thing that can happen to an actor\".  Playwright Tennessee Williams, writer of A Streetcar Named Desire, said of Strasberg's actors, \"They act from the inside out. They communicate emotions they really feel. They give you a sense of life.\" Directors like Sidney Lumet, a former student, have intentionally used actors skilled in Strasberg's \"Method\".  Kazan, in his autobiography, wrote, \"He carried with him the aura of a prophet, a magician, a witch doctor, a psychoanalyst, and a feared father of a Jewish home.... [H]e was the force that held the thirty-odd members of the theatre together, and made them 'permanent.'\"  :61 Today, Ellen Burstyn, Al Pacino, and Harvey Keitel lead this nonprofit studio dedicated to the development of actors, playwrights, and directors.\\n\\nDescription above from the Wikipedia article Lee Strasberg, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1901, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1982, 2, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ygEiIBPmoDfv4T8f4jL3EDn4cm3.jpg", Name = "Lee Strasberg" },
                        new { Id = 3172, Biography = "", BirthDate = new DateTime(1923, 4, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1995, 2, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ufzxcRUTvPmY5orKukJbkbsel4K.jpg", Name = "Michael V. Gazzo" },
                        new { Id = 3173, Biography = "From Wikipedia, the free encyclopedia.\\n\\nGervais Duan \"G. D.\" Spradlin (born August 31, 1920) is an American actor. He often plays devious authority figures. He is credited in over 70 television and film productions, and has performed alongside such notable actors as Marlon Brando, Al Pacino, Johnny Depp, George C. Scott, Robert Duvall, Michael Douglas, Danny DeVito, Sean Connery, Gene Hackman, Jack Palance, Martin Sheen, Christopher Walken, Arnold Schwarzenegger, Nick Nolte and Harrison Ford.\\n\\nDescription above from the Wikipedia article G. D. Spradlin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1920, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2011, 7, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nV5UsQKyHP87cVHJjkrPkHT3mzM.jpg", Name = "G. D. Spradlin" },
