                        new { Id = 3197, Biography = "Tom Sizemore (born November 29, 1961) is an American film and television actor and producer. He is known for his roles in films such as Saving Private Ryan, Pearl Harbor, Heat and Black Hawk Down and supporting roles in well known films such as The Relic, True Romance, Natural Born Killers, Wyatt Earp and Devil in a Blue Dress.", BirthDate = new DateTime(1961, 11, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//soINOuacuiThRb2LyPD4tTWve7C.jpg", Name = "Tom Sizemore" },
