                        new { Id = 3223, Biography = "Robert John Downey, Jr. (born April 4, 1965) is an American actor. Downey made his screen debut in 1970, at the age of five, when he appeared in his father's film Pound, and has worked consistently in film and television ever since. During the 1980s he had roles in a series of coming of age films associated with the Brat Pack. Less Than Zero (1987) is particularly notable, not only because it was the first time Downey's acting would be acknowledged by critics, but also because the role pushed Downey's already existing drug habit one step further. After Zero, Downey started landing roles in bigger films such as Air America (1990), Soapdish (1991) and Natural Born Killers (1994). He played Charlie Chaplin in the 1992 film Chaplin, for which he received an Academy Award nomination for Best Actor.", BirthDate = new DateTime(1965, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1YjdSym1jTG7xjHSI0yGGWEsw5i.jpg", Name = "Robert Downey Jr." },
                        new { Id = 3234, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJoan Mary Cusack (born October 11, 1962, height 5' 9\" (1,75 m)) is an American film, stage and television actress. A well-respected comedic character actor, she has twice been nominated for the Academy Award for Best Supporting Actress for her roles in the movies Working Girl and In & Out and is a three-time winner of the American Comedy Award as \"Funniest Supporting Actress in a Motion Picture.\" Cusack was a cast member of the sketch comedy TV show Saturday Night Live in 1985-86. She was born the second of five children, and is the sister of fellow actor, John Cusack.", BirthDate = new DateTime(1962, 10, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3jcrXcFYoSKEUvokzqrQ2UJGtw.jpg", Name = "Joan Cusack" },
                        new { Id = 3265, Biography = "From Wikipedia, the free encyclopedia\\n\\nEli Herschel Wallach (born December 7, 1915) is an American film, television and stage actor, who gained fame in the late 1950s. For his performance in Baby Doll he won a BAFTA Award for Best Newcomer and a Golden Globe nomination. One of his most famous roles is that of Tuco in The Good, the Bad and the Ugly (1966). Other roles include his portrayal of Don Altobello in The Godfather Part III, Calvera in The Magnificent Seven, and Arthur Abbott in The Holiday. Wallach has received BAFTA Awards, Tony Awards and Emmy Awards for his work. Wallach also has a cameo as a liquor store owner in Clint Eastwood's Mystic River. His most recent roles are in movies Wall Street: Money Never Sleeps and The Ghost Writer.\\n\\nWallach received an Honorary Academy Award at the 2nd Annual Governors Awards, presented on November 13, 2010.\\n\\nDescription above from the Wikipedia article Eli Wallach, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1915, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nRoyZzUjzY7iGdnp2V2kOgrMMFi.jpg", Name = "Eli Wallach" },
