                        new { Id = 3415, Biography = "​From Wikipedia, the free encyclopedia\\n\\nJerry Zucker (born March 11, 1950) is an American movie director known for his role in directing comedy spoof films, and the hit film Ghost.\\n\\nZucker was born in Milwaukee, Wisconsin, the son of Charlotte (d. 2007) and Burton Zucker, who was a real estate developer. He graduated from Shorewood High School.\\n\\nZucker's early career work started with Jim Abrahams and brother David Zucker at the Kentucky Fried Theatre on Pico Blvd in West Los Angeles where they honed their comedic skills doing skits in front of a live audience. From there the three went on and together co-directed Airplane! in 1980 and then went on to do Top Secret! in 1984, and Ruthless People in 1986. In 1990, he lent his directorial skills to the dramatic genre with Ghost, which was nominated for an Academy Award for Best Picture. Recent directorial efforts of Zucker's include the 2001 film Rat Race (which re-teamed him with Ghost star Whoopi Goldberg).\\n\\nLike his brother David Zucker, Jerry often cast his mother, Charlotte (who died in 2007), and his sister, Susan Breslau, in small roles in his films. Along with Jim Abrahams, the Zuckers constitute the \"ZAZ\" team of directors.\\n\\nDescription above from the Wikipedia article Jerry Zucker (film director), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1950, 3, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n2iX1gJyOxImJie2LTORZNKM9n9.jpg", Name = "Jerry Zucker" },
                        new { Id = 3428, Biography = "", BirthDate = new DateTime(1916, 4, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2001, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ocnNi4vGIENHuQFzv2ecoLjP9pB.jpg", Name = "Howard W. Koch" },
                        new { Id = 3489, Biography = "Naomi Watts had already been a working actress for over a decade when she earned notice as a promising newcomer in David Lynch's Cannes Film Festival prizewinner Mulholland Drive (2001).\\n\\nBorn September 28th, 1968, Watts began acting in her teens, landing her first film role in For Love Alone (1986). Watts subsequently appeared with future Hollywood headliners Nicole Kidman and Thandie Newton in John Duigan's disarming teen romance Flirting (1991). Watts's next film with Duigan, Wide Sargasso Sea (1992), was not so well received. After her first taste of Hollywood with Joe Dante's schlock movie homage Matinee (1992), Watts nabbed a starring role as Jimmy Smits's disturbed student in George Miller's little seen courtroom drama Gross Misconduct (1993). Watts then starred as Jet Girl to Lori Petty's Tank Girl (1995), but the science fiction fantasy suffered an ignominious box office fate. After a series of TV movies and thrillers, including Sleepwalkers (1997) and Children of the Corn IV (1996), Watts appeared in Marshall Herskovitz's high-toned Venetian courtesan costumer Dangerous Beauty (1998) and successful TV docudrama The Hunt for the Unicorn Killer (1999). Watts's breakthrough finally arrived when David Lynch cast her in his ABC pilot Mulholland Drive. Though ABC canceled the project in 1999 after Lynch turned in a typically mood-drenched work, StudioCanal financed its transformation into a feature that debuted to acclaim at Cannes in 2001. A Los Angeles dreamscape akin to Lost Highway, Mulholland Drive featured Watts as the blonde half of a female duo caught in a mystery of shifting identities. Drawing attention for her not-for-network TV love scene with co-star Laura Harring, Watts also earned praise as a rising \"new\" actress.\\n\\nThough ignored for an Oscar nomination, Watts's tour-de-force dual performance earned her numerous accolades and critics' awards, igniting her career. Working steadily in the wake of Mulholland Drive, Watts scored a box-office as well as critical success a year later with The Ring (2002), the Hollywood remake of the Japanese horror blockbuster. Starring Watts as an intrepid reporter investigating the origins of a lethal videotape, The Ring overcame studio doubts to become a sleeper hit, solidifying Watts's new star status. Watts subsequently donned period dress for the Showtime western The Outsider (2002), and to co-star alongside fellow Aussie Heath Ledger in The Kelly Gang (2003). Balancing her genre work with potentially headier fare guided by notable directors, Watts also appeared with Kate Hudson, Glenn Close and Stockard Channing in the Merchant-Ivory romantic comedy Le Divorce (2003), and won a leading role opposite formidable actors Sean Penn and Benicio Del Toro in Alejandro González Iñárritu's 21 Grams (2003).", BirthDate = new DateTime(1968, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8W02WOJI1pEGh2iqQsgITR5tV0P.jpg", Name = "Naomi Watts" },
                        new { Id = 3490, Biography = "Adrien Nicholas Brody was born in Woodhaven, Queens, New York, the only child of retired history professor Elliot Brody and Hungarian-born photographer Sylvia Plachy. He accompanied his mother on assignments for the Village Voice, and credits her with making him feel comfortable in front of the camera. Adrien attended the American Academy of Dramatic Arts and LaGuardia High School for the Performing Arts in New York.", BirthDate = new DateTime(1973, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zvMslH1C8xmEBpGgDsdzL797Rv.jpg", Name = "Adrien Brody" },
