                        new { Id = 3497, Biography = "Kyle Martin Chandler (born September 17, 1965) is an American film and television actor best known for his roles in the television shows Early Edition as Gary Hobson and as Eric Taylor in Friday Night Lights. Description above from the Wikipedia article Kyle Chandler, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 9, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1un1X4SxxcSVUYEgQ0HXPPRhKcv.jpg", Name = "Kyle Chandler" },
