                        new { Id = 3794, Biography = "Bob Kane (born Robert Kahn; October 24, 1915 – November 3, 1998) was an American comic book artist and writer, credited as the creator of the DC Comics superhero Batman. He was inducted into both the comic book industry's Jack Kirby Hall of Fame in 1994 and the Will Eisner Comic Book Hall of Fame in 1996.\\n\\nDescription above from the Wikipedia article Bob Kane, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1915, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1998, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vuXwrlqaUydA4t5SFVdQkK9KsZL.jpg", Name = "Bob Kane" },
                        new { Id = 3799, Biography = "Billy Dee Williams was born in New York, the son of Loretta Anne (1915-2016), a West Indian-born elevator operator from Montserrat, and William December Williams, Sr. (1910-2007), an African-American caretaker from Texas. He has a twin sister, Loretta, and grew up in Harlem, where he was raised by his maternal grandmother while his parents worked at several jobs. Williams graduated from The High School of Music & Art (later merged with the High School of Performing Arts to become the Fiorello H. LaGuardia High School of Music & Art) in Manhattan, where he was a classmate of Diahann Carroll, who would later play the wife of his character Brady Lloyd on the 1980s prime-time soap opera Dynasty.", BirthDate = new DateTime(1937, 4, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sDuo82Mb5o3ZGt4SuV9dR0lAh8P.jpg", Name = "Billy Dee Williams" },
                        new { Id = 3810, Biography = "Javier Ángel Encinas Bardem is a Spanish actor from the Canary Islands. He is best known for his role in the 2007 film No Country for Old Men, for which he won the Academy Award for Best Supporting Actor portraying the psychopathic assassin Anton Chigurh. He has also received critical acclaim for roles in films such as Jamón, jamón, Carne trémula, Boca a boca, Los Lunes al sol, Mar adentro, and Skyfall, for which he received both a BAFTA and a SAG nomination for Best Supporting Actor.\\n\\nBardem has also won a Screen Actors Guild Award, a BAFTA, five Goya Awards, two European Film Awards, a Prize for Best Actor at Cannes and two Volpi Cups at Venice for his work. He is the first Spaniard actor to be nominated for an Oscar (Best Actor, 2000, for Before Night Falls), as well as the first Spanish actor to win an Academy Award. He received his third Academy Award nomination, and second Best Actor nomination, for the film Biutiful.", BirthDate = new DateTime(1969, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xuNNAISHISlbYI0HjZhmfXcMwnn.jpg", Name = "Javier Bardem" },
                        new { Id = 3813, Biography = "Alejandro \"Álex\" Angulo León (12 April 1953 - 20 July 2014) was a Spanish Basque actor who performed in over sixty films during his career spanning more than 30 years. Angulo died at the age of 61 when the vehicle in which he was travelling veered from the road.", BirthDate = new DateTime(1953, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6wnu91irLrsgy5nF3IxRoH2qKfl.jpg", Name = "Alex Angulo" },
                        new { Id = 3893, Biography = "David Samuel Goyer (born December 22, 1965) is an American screenwriter, film director and comic book writer.", BirthDate = new DateTime(1965, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vh0ULL0N22JlVlQ5mXFmreA6Ubz.jpg", Name = "David S. Goyer" },
                        new { Id = 3894, Biography = "Christian Charles Philip Bale is a Welsh-born English actor. In addition to starring roles in big budget Hollywood films, he has long been heavily involved in films produced by independent producers and art houses. Bale first caught the public eye when he was cast in the starring role of Steven Spielberg's Empire of the Sun at the age of 13, playing an English boy who is separated from his parents and subsequently finds himself lost in a Japanese internment camp during World War II. Since then, he has portrayed a wide range of characters. Bale is especially noted for his cult following: the tenth anniversary issue of Entertainment Weekly hailed him as one of the \"Top 8 Most Powerful Cult Figures of the Past Decade\", citing his cult status on the Internet. EW called Bale one of the \"Most Creative People in Entertainment\" in anticipation of the release American Psycho (2000). The Guardian named Bale as one of the best actors never to have received an Academy Award nomination.\\n\\nBale was born in Haverfordwest, Pembrokeshire, Wales to parents of English descent. His father, David Bale, was an entrepreneur, commercial pilot, and talent manager and his mother, Jenny James, was a circus clown and performer. He is the youngest of four children. After leaving Wales in 1976, Bale spent his childhood in several countries, including England, Portugal and the United States. Settling for four years in Bournemouth and Henley-on-Thames, Bale was educated at Shiplake C of E Primary School, the independent Dolphin School in Berkshire, and at Bournemouth School. He participated actively in rugby union. Bale has described his childhood, with respect to his mother being in the circus, as \"interesting\". He recalled his first kiss was with an acrobat named Barta. As a child, he trained in ballet and guitar. His sister Louise's work in theatre also influenced his decision to become an actor. Bale's father was very supportive of his son's acting, resigning from his job as a commercial pilot to travel and manage Bale's burgeoning career. Bale's first foray into acting was a commercial for the fabric softener Lenor in 1982, when he was eight years old. He appeared in a Pac-Man cereal commercial playing a child rock star a year later and in 1984 made his stage debut in The Nerd, opposite Rowan Atkinson.\\n\\nOn 29 January, 2000, Bale married Sandra \"Sibi\" Blažić (born 1970), a one-time model, make-up artist and personal assistant to Winona Ryder; the couple have a daughter, Emmeline, who was born on 27 March 2005, in Santa Monica, California. Since 1992, Bale has resided in Los Angeles.", BirthDate = new DateTime(1974, 1, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2ocrTd8ChuUyJOzMuD4PsQw8eCB.jpg", Name = "Christian Bale" },
                        new { Id = 3895, Biography = "Sir Michael Caine is an English film actor. He became known for several notable critically acclaimed performances, particularly in films such as Zulu (1964), The Italian Job (1969), Get Carter (1971), Educating Rita (1983) and more recently Batman Begins and The Dark Knight. Caine was knighted in 2000 by Queen Elizabeth II, in recognition of his contribution to cinema.\\n\\nCaine was born Maurice Joseph Micklewhite in Rotherhithe, South East London, the son of Ellen Frances Marie, a cook and charlady, and Maurice Joseph Micklewhite, a fish market porter.\\n\\nHe was married to actress Patricia Haines from 1955 to 1958. They had one daughter named Dominique. He dated Bianca Jagger in 1968. Caine has been married to actress and model Shakira Baksh since 8 January 1973. They met after Caine saw her appearing in a Maxwell House coffee commercial and a friend gave him her telephone number. They have a daughter named Natasha.", BirthDate = new DateTime(1933, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vvj0JMSFpOajXCE46Hy4dyqSP2U.jpg", Name = "Michael Caine" },
                        new { Id = 3896, Biography = "William John \"Liam\" Neeson OBE (born 7 June 1952) is an Irish actor who has been nominated for an Oscar, a BAFTA and three Golden Globe Awards.\\n\\nHe has starred in a number of notable roles including Oskar Schindler in Schindler's List, Michael Collins in Michael Collins, Peyton Westlake in Darkman, Jean Valjean in Les Misérables, Qui-Gon Jinn in Star Wars Episode I: The Phantom Menace, Alfred Kinsey in Kinsey, Ras Al Ghul in Batman Begins and the voice of Aslan in The Chronicles of Narnia film series. He has also starred in several other notable films, from major Hollywood studio releases (ie. Excalibur, The Dead Pool, Nell, Rob Roy, The Haunting, Love Actually, Kingdom of Heaven, Taken, Clash of the Titans, The A-Team, Unknown) to smaller arthouse films (ie. Deception, Breakfast on Pluto, Chloe).\\n\\nHe was born in Ballymena, County Antrim, Northern Ireland and educated at Saint Patrick's College, Ballymena Technical College and Queen's University Belfast. He moved to Dublin after university to further his acting career, joining the renowned Abbey Theatre. In the early 1990s, he moved again to the United States, where the wide acclaim for his performance in Schindler's List led to more high-profile work. He is widowed and lives in New York with his two sons.\\n\\nDescription above from the Wikipedia article Liam Neeson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1952, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9mdAohLsDu36WaXV2N3SQ388bvz.jpg", Name = "Liam Neeson" },
                        new { Id = 3899, Biography = "From Wikipedia, the free encyclopedia.\\n\\nKen Watanabe (born October 21, 1959) is a Japanese stage, film, and television actor. To English-speaking audiences he is known for playing tragic hero characters, such as General Tadamichi Kuribayashi in Letters from Iwo Jima and Lord Katsumoto Moritsugu in The Last Samurai, for which he was nominated for the Academy Award for Best Supporting Actor. Among other awards, he has won the Japan Academy Prize for Best Actor twice, in 2007 for Memories of Tomorrow and in 2010 for Shizumanu Taiyō. He is also known for his roles in director Christopher Nolan's Hollywood blockbusters Batman Begins and Inception.\\n\\nDescription above from the Wikipedia article Ken Watanabe, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//v8WQ5wCIZsnqVZn7jQveaDqurox.jpg", Name = "Ken Watanabe" },
                        new { Id = 3904, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5XNVKGYwQraa4LYk0pjRhvdC3c1.jpg", Name = "Lee Smith" },
                        new { Id = 3907, Biography = "Harve Presnell (September 14, 1933 – June 30, 2009) was an American actor and singer. He began his career in the mid 1950s as a classical baritone, singing with orchestras and opera companies throughout the United States. His career reoriented away from classical music to musical theatre in 1960 after Meredith Willson cast him in the lead role of his new Broadway musical The Unsinkable Molly Brown. His portrayal of \"Leadville Johnny\" was a resounding success and he reprised the role in the 1964 film version of the musical, winning a Golden Globe Award for his portrayal.\\n\\nPresnell went on to star in a few more films during the 1960s, but by the early 1970s that aspect of his career came to a standstill. From 1970 to 1995 he mostly worked as a musical theatre performer on Broadway, the West End, and in touring productions out of New York. In his early 60s, Presnell saw a resurgence in his movie career which lasted until his death. He portrayed character roles in films like Fargo (1996), Saving Private Ryan (1998), and Flags of Our Fathers (2006). He also appeared on television as Mr. Parker in The Pretender and Lew Staziak in Andy Barker, P.I.. He had recurring roles on Lois &amp; Clark: The New Adventures of Superman and Dawson's Creek.\\n\\nDescription above from the Wikipedia article Harve Presnell, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1933, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2009, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hH4HYzCa5BzWxOs76HQnDBOKe4c.jpg", Name = "Harve Presnell" },
                        new { Id = 3970, Biography = "From Wikipedia, the free encyclopedia\\n\\nErwin Alois Robert Leder (born 30 July 1951 in St. Pölten, Lower Austria, Austria) is an Austrian actor. He is best known for his role as Chief Mechanic Johann in Das Boot, a 1981 feature film directed by Wolfgang Petersen about a mission of one World War II U-boat and its crew.\\n\\nIn 2003, Leder appeared as the lycan scientist Singe in the gothic horror/action film Underworld. He reprised his role in the sequel in a brief cameo as a corpse.", BirthDate = new DateTime(1951, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//un9OJSaOjmh2WHsvhA62z3FaeAm.jpg", Name = "Erwin Leder" },
                        new { Id = 3989, Biography = "", BirthDate = new DateTime(1949, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Marlene Stewart" },
                        new { Id = 4003, Biography = "Ms. Ebersole won the 2007 Tony Award for Best Actress in a Musical for her work in \"Grey Gardens\". Previously, she was awarded the Drama Desk Award, the Outer Critics Circle Award, the Drama League awarded\\n\\n her both a citation and the Outstanding Performance of the Year, and \\n\\nshe was named to its dais for 2007. She also received a special citation\\n\\n from the New York Drama Critics' Circle and the Obie for her off-Broadway turn in \"Grey Gardens\".", BirthDate = new DateTime(1953, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dl8uNpIyYeGpjA90C0W1SGSsfla.jpg", Name = "Christine Ebersole" },
                        new { Id = 4004, Biography = "Jeffrey Duncan Jones (born September 28, 1946) is an American actor. He has appeared in many films and television shows, but may be best known for his roles as Emperor Joseph II in Miloš Forman’s Amadeus, Charles Deetz in Beetlejuice, and dean of students Edward R. Rooney in the 1986 John Hughes film Ferris Bueller's Day Off.\\n\\nDescription above from the Wikipedia article Jeffrey Jones, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 9, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//96J47E34mbjqnhiW9dbLuBqyqmD.jpg", Name = "Jeffrey Jones" },
                        new { Id = 4023, Biography = "Suzanne Smith Crowley is an American casting director know for Se7en, Boys Don't Cry, American Psycho and The Blacklist.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fASNhfD4Tmw6KPW0LoPUycIFxEL.jpg", Name = "Suzanne Smith" },
                        new { Id = 4030, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nMartin Klebba (born June 23, 1969) is an American actor and stunt performer. Klebba has a form of dwarfism called acromicric dysplasia; he is 4'1\" tall.\\n\\nKlebba was born and grew up in Troy, Michigan, graduating from Athens High School.\\n\\nKlebba has acted in various productions, most notably Pirates of the Caribbean as \"Marty\", one of Captain Jack Sparrow's Black Pearl crew, in all three of the first trilogy. He made many appearances as \"Randall Winston\" in the television series Scrubs. As of 2010, he is working on the 2011 NBC show The Cape as a series regular named \"Rollo.\" Also guest starred as \"Hibachi\" in Pair of Kings, a Disney TV series. He starred in the CSI: Crime Scene Investigation episode \"The Chick Chop Flick Shop\" (2007) as \"Dickie Jones\", and in the CSI: NY episode \"Uncertainty Rules\" (2010) as \"Calvin Moore.\" He played \"Todd Moore\" in the Bones episode \"Dwarf in the Dirt\" (2010). He also made an appearance as a demon in the Charmed episode \"Witch Wars\" (2004), and starred as \"Hank Dingo\" in the Comedy Central made-for-TV movie Knee High P.I. He appeared in iCarly and Drake and Josh as \"Nug Nug.\" Additionally, Klebba plays the role of \"Count Le Petite\" in the upcoming (2010) release of All's Faire in Love, a romantic comedy set at a Renaissance fair, which was shot on location at the Michigan Renaissance Festival. He also starred as \"Friday,\" one of the seven dwarfs in the 2001 made-for-TV film Snow White, and appeared as the ring announcer in the movie Cradle 2 the Grave alongside Jet Li, Tito Ortiz, Chuck Liddell, Randy Couture and DMX. He has also been in low budget horror/comedy films Feast 2 &amp; 3 as \"Thunder.\" He has numerous stunt credits as well including Hancock, Zombieland, Bedtime Stories, Evan Almighty, Meet the Spartans, Epic Movie, and Van Helsing.\\n\\nKlebba has also been featured on the TLC reality show, Little People, Big World, with his good friend Amy Roloff.\\n\\nDescription above from the Wikipedia article Martin Klebba, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//amlhUrXQ7t1NEPajdj2dQdbC0rt.jpg", Name = "Martin Klebba" },
                        new { Id = 4078, Biography = "From Wikipedia, the free encyclopedia\\n\\nLee Van Cleef (January 9, 1925 – December 16, 1989) was an American film actor who appeared mostly in Western and action pictures. His sharp features and piercing eyes led to his casting as a villain in scores of films as in The Good The Bad and the Ugly.\\n\\nDescription above from the Wikipedia article Lee Van Cleef, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1925, 1, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1989, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oEEsdGCBjpyJyVZlx1X8PKvHe7S.jpg", Name = "Lee Van Cleef" },
                        new { Id = 4139, Biography = "​From Wikipedia, the free encyclopedia\\n\\nThomas Roy \"Tom\" Skerritt (born August 25, 1933) is an American actor who has appeared in over 40 films and more than 200 television episodes since 1962.\\n\\nDescription above from the Wikipedia article Tom Skerritt, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1933, 8, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fVuxSZ8VoPxRJDm3VohtDDz5x8l.jpg", Name = "Tom Skerritt" },
