                        new { Id = 4201, Biography = "Wayne Knight is an American comedian and film, television and voice actor, best known for playing Newman in the television sitcom \"Seinfeld\".", BirthDate = new DateTime(1955, 8, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oW9aeZwkz1S1IMjQGtd9mnvlEax.jpg", Name = "Wayne Knight" },
                        new { Id = 4222, Biography = "", Name = "Simone Bär" },
                        new { Id = 4298, Biography = "Leigh Brackett was a Hollywood writer and a noted science fiction and fantasy author who was a regular contributor to various science fiction pulps in the 1940's. She was also a mentor and collaborator of Ray Bradbury. She was married to fellow science fiction pulp writer Edmond Hamilton for 31 years (until his death in 1977).\\n\\nIn Hollywood, she wrote such films as The Long Goodbye, Hatari! and Rio Bravo. She also wrote the first draft of Star Wars: Episode V The Empire Strikes Back. Shortly after she completed the draft, she died after a battle with cancer.\\n\\nAfter her death, George Lucas decided that he did not prefer the direction Brackett's draft was going in. Lucas discarded it and wrote two new drafts with Lawrence Kasdan finishing the script. Brackett's original draft was not mentioned or referenced in the new drafts. However, Lucas felt that her name should be in the credits as a reward for her effort. To ensure Writers Guild of America (which determines screenwriting credit for the film) would award her the credit, Lucas intentionally did not submit his drafts.", BirthDate = new DateTime(1915, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1978, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zJ4NaZQAAPbsHbpNuCJjfsSItUo.jpg", Name = "Leigh Brackett" },
                        new { Id = 4385, Biography = "Sergio Leone (January 3, 1929 – April 30, 1989) was an Italian film director, producer and screenwriter most associated with the \"Spaghetti Western\" genre. Leone's film-making style includes juxtaposing extreme close-up shots with lengthy long shots. His movies include The Colossus of Rhodes, the Dollars Trilogy (A Fistful of Dollars; For a Few Dollars More; and The Good, the Bad and the Ugly), Once Upon a Time in the West; Duck, You Sucker!; and Once Upon a Time in America.\\n\\nDescription above from the Wikipedia article Sergio Leone,  licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1929, 1, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1989, 4, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//AhQ1Y67fCiEzntFbiHb2EAM8DgQ.jpg", Name = "Sergio Leone" },
                        new { Id = 4406, Biography = "", Name = "Antoinette Boulat" },
                        new { Id = 4506, Biography = "", Name = "James D. Brubaker" },
                        new { Id = 4515, Biography = "Richard Treat Williams (born December 1, 1951) is a Screen Actors Guild Award-nominated American actor who has appeared on film, stage and television. From 2002 to 2006, he was the star of the television series Everwood.", BirthDate = new DateTime(1951, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uKejRJTEVOy6IOsJX2mJH3SwbTl.jpg", Name = "Treat Williams" },
                        new { Id = 4566, Biography = "Alan Sidney Patrick Rickman (born 21 February 1946) was  an English actor and theatre director. He was a renowned stage actor in modern and classical productions and a former member of the Royal Shakespeare Company. Rickman was known for his film performances as Hans Gruber in Die Hard, Severus Snape in the Harry Potter film series, Eamon de Valera in Michael Collins, and Metatron in Dogma. He was also known for his prominent roles as the Sheriff of Nottingham in the 1991 film, Robin Hood: Prince of Thieves, and as Colonel Brandon in Ang Lee's 1995 film Sense and Sensibility. More recently he played Judge Turpin in Tim Burton's Sweeney Todd: The Demon Barber of Fleet Street and voiced the Caterpillar in Tim Burton's Alice in Wonderland.\\n\\nDescription above from the Wikipedia article Alan Rickman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 1, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zOJgiaztnrnB7TSdGYU3uwpgivl.jpg", Name = "Alan Rickman" },
                        new { Id = 4581, Biography = "Stephen John \"Steve\" Coogan (born 14 October 1965) is an English comedian, actor, writer and producer.\\n\\nHis best known character in the United Kingdom is Alan Partridge, a socially awkward and politically incorrect regional media personality, who featured in several television series, such as The Day Today, Knowing Me Knowing You with Alan Partridge and I'm Alan Partridge. Outside the UK, Coogan is better known for his film roles.", BirthDate = new DateTime(1965, 10, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ljhsNmGQQrgeBj64x5uL27U6UqY.jpg", Name = "Steve Coogan" },
                        new { Id = 4589, Biography = "Benjamin Bratt (born December 16, 1963) is an American actor. He is most famous for his role as Rey Curtis on the TV series Law &amp; Order; and his appearances in the movies Blood in Blood Out, Miss Congeniality, Cloudy with a Chance of Meatballs, Traffic, and Piñero. He starred on the A&amp;E Network drama The Cleaner.", BirthDate = new DateTime(1963, 12, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5g88fU683ZXhFn0VSsBMjLHsXG1.jpg", Name = "Benjamin Bratt" },
                        new { Id = 4610, Biography = "John David Landis (born August 3, 1950) is an American film director, screenwriter, actor, and producer. He is known for his comedies, his horror films, and his music videos with singer Michael Jackson.\\n\\nDescription above from the Wikipedia article John Landis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1950, 8, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4MVt3MDXZzW2TsiQNvZCGv1ivRx.jpg", Name = "John Landis" },
                        new { Id = 4616, Biography = "", Name = "Michael Seymour" },
                        new { Id = 4654, Biography = "Jeremy Davies (born October 8, 1969) is an American film and television actor. He is known for portraying the interpreter Cpl. Timothy E. Upham in the film Saving Private Ryan and the physicist Daniel Faraday on the television series Lost. He most recently appeared in the FX series, \"Justified\", as Dickie Bennett.\\n\\nDescription above from the Wikipedia Jeremy Davies, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xPM0Wf4zVDpdNw3xokD2mDTqtoP.jpg", Name = "Jeremy Davies" },
