                        new { Id = 4661, Biography = "", BirthDate = new DateTime(1928, 9, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1999, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5c5ek7iXeJMdx1bEM2mw195zmPD.jpg", Name = "Benito Stefanelli" },
                        new { Id = 4670, Biography = "", Name = "Nino Baragli" },
                        new { Id = 4690, Biography = "Christopher Walken (born Ronald Walken, usually called \"Chris\") is an American stage and screen actor.\\n\\nHe has appeared in more than 100 movies and television shows. Walken was born Ronald Walken (named after actor Ronald Colman) into a Methodist family in Astoria, Queens, New York. His mother, Rosalie, was a Scottish immigrant from Glasgow, and his father, Paul Walken, emigrated from Germany in 1928 with his brothers, Wilhelm and Alois. His father was a baker and his mother worked as a window dresser. Influenced by their mother's own dreams of stardom, he and his brothers Kenneth and Glenn were child actors on television in the 1950s. Walken studied at Hofstra University on Long Island, but did not graduate. Walken initially trained as a dancer in music theatre at the Washington Dance Studio before moving on to dramatic roles in theatre and then film. Walken is imitated for his deadpan affect, sudden off-beat pauses, and strange speech rhythm, in a manner similar to William Shatner. He is revered for his quality of danger and menace, but his unpredictable deliveries and expressions make him invaluable in comedy as well. Walken is noted for refusing movie roles only rarely, having stated in interviews that he will decline a role only if he is simply too busy on other projects to take it. He regards each role as a learning experience. Walken has been married to Georgianne Walken (born Thon) since 1969; she is a casting director, most notably for The Sopranos. They live in Connecticut and have no children (Walken has stated in interviews that not having children is one of the reasons he has had such a prolific career). In regard to his villainous roles preceding him when meeting new people, Walken says, \"When they see me in a movie, they expect me to be something nasty ... That's why it's good to defy expectations sometimes.\"", BirthDate = new DateTime(1943, 3, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ApgDL7nudR9T2GpjCG4vESgymO2.jpg", Name = "Christopher Walken" },
                        new { Id = 4701, Biography = "", Name = "James W. Skotchdopole" },
                        new { Id = 4756, Biography = "Matthew Broderick is an American actor whose career has spanned both the silver screen and the stage.  Broderick got his start off broadway but quickly wound up as the lead in Neil Simon's Brighton Beach Memoirs. His first screen role was Max Dugan Returns, also penned by Neil Simon.  His breakout role came the same year for his role as a young hacker in Wargames.  Later he stared as the eponymous Ferris Bueller in 1985's Ferris Bueller's Day Off, a film which has achieved cult status and had made Broderick a household name.   In 1985 while on Vacation in Ireland with his then fiancee Jennifer Grey, who played his sister in Ferris Bueller's Day Off, Broderick was involved in a head on collision that killed two locals.  Broderick was deemed at fault and faced five years in prison but his punishment was lessened to just a fine.   In 1997 he married Sarah Jessica Parker and the pair have had 3 children together.", BirthDate = new DateTime(1962, 3, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//j9ETatVKFxYR5Ijk8l5tzKO4HPn.jpg", Name = "Matthew Broderick" },
                        new { Id = 4764, Biography = "John Christopher Reilly (born May 24, 1965), better known as John C. Reilly is an American film and theatre actor. Debuting in Casualties of War in 1989, he is one of several actors whose careers were launched by Brian De Palma. To date, he has appeared in more than fifty films, including three separate films in 2002, each of which was nominated for the Academy Award for Best Picture. He was nominated for an Academy Award for Best Supporting Actor for his role in Chicago and a Grammy Award for the song \"Walk Hard\", which he performed in Walk Hard: The Dewey Cox Story. Description above from the Wikipedia article John C. Reilly, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 5, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3LpfXon9xQZc1M2AFvfXyLeICbg.jpg", Name = "John C. Reilly" },
                        new { Id = 4782, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJohn Michael Crichton (October 23, 1942 – November 4, 2008), best known as Michael Crichton, was an American author, producer, director, and screenwriter, best known for his work in the science fiction, medical fiction, and thriller genres. His books have sold over 150 million copies worldwide, and many have been adapted into films. In 1994, Crichton became the only creative artist ever to have works simultaneously charting at #1 in television, film, and book sales (with ER, Jurassic Park, and Disclosure, respectively).\\n\\nHis literary works are usually based on the action genre and heavily feature technology. His novels epitomize the techno-thriller genre of literature, often exploring technology and failures of human interaction with it, especially resulting in catastrophes with biotechnology. Many of his future history novels have medical or scientific underpinnings, reflecting his medical training and science background. He was the author of, among others, Jurassic Park, The Andromeda Strain, Congo, Travels, Sphere, Rising Sun, Disclosure, The Lost World, Airframe, Timeline, Prey, State of Fear, Next (the final book published before his death), Pirate Latitudes (published November 24, 2009), and a final unfinished techno-thriller yet to be released. Forbes listed Crichton in tenth place in its list of \"Top-Earning Dead Celebrities\" of 2009.\\n\\nDescription above from the Wikipedia article Michael Crichton, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1942, 10, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2008, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lAQ6LYkhdVxa2tDSCOGxQZ3t0wO.jpg", Name = "Michael Crichton" },
                        new { Id = 4783, Biography = "Nigel John Dermot \"Sam\" Neill (born 14 September 1947) is a New Zealand actor. He is perhaps best known for his starring role as paleontologist Dr Alan Grant in Jurassic Park and Jurassic Park III. He has also had a number of high-profile roles including: the lead in Reilly, Ace of Spies, the adult Damien in Omen III: The Final Conflict, Merlin in the miniseries Merlin, Captain Vasily Borodin in The Hunt for Red October, Lord Friedrich Hoffman in Snow White: A Tale of Terror, and Alisdair Stewart in The Piano.\\n\\nMost recently he played Cardinal Thomas Wolsey in the Peace Arch Entertainment production for Showtime, The Tudors.\\n\\nDescription above from the Wikipedia article Sam Neill licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 9, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1ZHExb2rz6210NutoUhQcqQpwnl.jpg", Name = "Sam Neill" },
                        new { Id = 4784, Biography = "Laura Elizabeth Dern (born February 10, 1967) is an American actress, film director and producer. Dern has acted in such films as Smooth Talk (1985), Blue Velvet (1986), Fat Man and Little Boy (1988), Wild at Heart (1990), Jurassic Park (1993) and October Sky (1999). She has won awards for her performance in the 1991 film Rambling Rose, for which she received an Academy Award nomination for Best Actress in a Leading Role. She was awarded a Golden Globe Award for Best Supporting Actress – Series, Miniseries or Television Film for her portrayal of Florida Secretary of State Katherine Harris in the film Recount (2008).", BirthDate = new DateTime(1967, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hoijifqwuyIXO6Lsp8QpO3MhIXv.jpg", Name = "Laura Dern" },
                        new { Id = 4785, Biography = "Jeffrey Lynn \"Jeff\" Goldblum (born October 22, 1952) is an American actor. His career began in the mid-1970s and he has appeared in major box-office successes including The Fly, Jurassic Park and its sequel Jurassic Park: The Lost World, and Independence Day. He starred as Detective Zach Nichols for the eighth and ninth seasons of the USA Network's crime drama series Law & Order: Criminal Intent.", BirthDate = new DateTime(1952, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//t812WlNdP6F2ksRj21JF68DUiwz.jpg", Name = "Jeff Goldblum" },
                        new { Id = 4786, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRichard Samuel Attenborough, Baron Attenborough, Kt, CBE (29 August 1923 – 24 August 2014) was an English actor, filmmaker, entrepreneur, and politician. He was the President of the Royal Academy of Dramatic Art (RADA) and the British Academy of Film and Television Arts (BAFTA). Attenborough joined the Royal Air Force during World War II and served in the film unit. He went on several bombing raids over Europe and filmed action from the rear gunner's position.\\n\\nAs a film director and producer, Attenborough won two Academy Awards for Gandhi in 1983. He also won four BAFTA Awards and four Golden Globe Awards. As an actor, he is perhaps best known for his roles in Brighton Rock, The Great Escape, 10 Rillington Place, Miracle on 34th Street (1994) and Jurassic Park.\\n\\nHe was the older brother of David Attenborough, a naturalist and broadcaster, and John Attenborough, an executive at Alfa Romeo. He was married to actress Sheila Sim from 1945 until his death.", BirthDate = new DateTime(1923, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//Abo8fAcdruACs344ut6PNSKH7N4.jpg", Name = "Richard Attenborough" },
                        new { Id = 4787, Biography = "Joseph Mazzello III (born September 21, 1983, height 5' 9\" (1,75 m)) is an American actor who is best known for his roles as Tim Murphy in Jurassic Park, Eugene Sledge in the HBO miniseries The Pacific, and Dustin Moskovitz in The Social Network. Mazzello was born in Rhinebeck, New York, and raised in Hyde Park, New York, the son of Ginnie and Joseph Mazzello, Jr., who owned a performing arts school. He has one older sister, Mary Mazzello, and a younger brother, John Mazzello, who have both appeared in films.  Mazzello is an alumnus of Our Lady of Lourdes High School and the University of Southern California. Mazzello's most notable roles were as Douglas Gresham in Shadowlands and Tim Murphy in Jurassic Park, both in 1993, Dexter in the 1995 film The Cure, and \"Sledgehammer\" Eugene Sledge in the HBO miniseries The Pacific. In 2010, Mazzello played the part of Dustin Moskovitz, one of the co-founders of Facebook in the David Fincher-directed movie, The Social Network. Mazzello's directorial debut was made with the film Matters of Life and Death in which he also stars; the cast includes David Strathairn (with whom he has worked in The Sensation of Sight, The River Wild, and Simon Birch), Daniel Gillies and Rachael Leigh Cook.", BirthDate = new DateTime(1983, 9, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zsBGvymDqB737PerJTqhS9dPuBd.jpg", Name = "Joseph Mazzello" },
                        new { Id = 4788, Biography = "", BirthDate = new DateTime(1979, 9, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//b4S0q3uSDIophwYcPlBABgJObSX.jpg", Name = "Ariana Richards" },
                        new { Id = 4789, Biography = "", BirthDate = new DateTime(1945, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1999, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fuuD2J4JIVkpi0aEurKX6jfYyoK.jpg", Name = "Bob Peck" },
                        new { Id = 4790, Biography = "Martin Ferrero rejoint le California Actors Theater de Los Gatos en Californie. En 1979, il part à Los Angeles pour commencer sa carrière à Hollywood.  Après avoir décroché des petits rôles dans de nombreuses séries télévisées telles que Soap, Capitaine Furillo, Arnold et Willy ou encore Les Jours heureux, il décroche un rôle dans l'épisode pilote de Deux flics à Miami. Il y tient le rôle de Trini DeSoto. Mais il incarnera finalement le personnage d'Izzy Moreno, un indic' qui apparaîtra à plusieurs reprises dans les 5 saisons de la série jusqu'en 1990.  En parallèle, il continue d'apparaître dans d'autres séries comme Les Incorruptibles de Chicago, Clair de lune ou encore La Loi de Los Angeles.  Il décroche de petits rôles au cinéma, par exemple dans Un ticket pour deux (1987) de John Hughes puis dans L'embrouille est dans le sac (1991) de John Landis avec Sylvester Stallone, qu'il retrouvera dans Arrête ou ma mère va tirer ! (1992).  Il se fait surtout connaître du grand public en 1993 grâce à Jurassic Park de Steven Spielberg.  En 1995, il tient un petit rôle dans Get Shorty, Stars et Truands aux côtés de John Travolta, et dans Heat de Michael Mann.  Il retrouve ensuite Don Johnson, son ancien partenaire dans Deux flics à Miami, le temps d'un épisode de Nash Bridges en 1996.  Il apparaît ensuite dans les séries The Practice : Bobby Donnell et Associés et X-Files.  En 2000, il joue dans le 3e volet de la saga Air Bud puis incarne Angelo Dundee, l'entraîneur de Mohamed Ali, dans le téléfilm Ali - Un héros, une légende.  Sa dernière apparition au cinéma est dans Le Tailleur de Panama, sorti en 2001.  Depuis 2008, Ferrero est un membre de la Compagnie Antaeus, une compagnie de théâtre classique basée à Los Angeles.", BirthDate = new DateTime(1947, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gTIclBDE9q6TFmOx7JIn32zTaVk.jpg", Name = "Martin Ferrero" },
                        new { Id = 4791, Biography = "Gregory Lewis \"Greg\" Burson was an American voice actor.\\n\\nGreg Burson was given the responsibility of voicing Bugs Bunny in the 1995 Carrotblanca, a well-received 8-minute Looney Tunes cartoon originally shown in cinemas alongside The Amazing Panda Adventure (US) and The Pebble and the Penguin (non-US).", BirthDate = new DateTime(1949, 6, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2008, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//A8sRcbpxZ5ft9UN8nRTc51DNWxS.jpg", Name = "Greg Burson" },
                        new { Id = 4795, Biography = "From Wikipedia, the free encyclopedia\\n\\nFlorian Lukas (born March 16, 1973 in Berlin) is a German actor.\\n\\nDescription above from the Wikipedia article Florian Lukas, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1973, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//89HomMwffAGWeMss78LsfzmDnbr.jpg", Name = "Florian Lukas" },
