                        new { Id = 4924, Biography = "From Wikipedia, the free encyclopedia\\n\\nMartin Semmelrogge (born 8 December 1955, Boll-Eckwälden, Bad Boll, Germany) is a German actor, best known for his role as the comical 2WO (1st Lieutenant/Second Watch Officer) in the film Das Boot. He is the brother of former actor Joachim Bernhard, who appeared in Das Boot as the religious sailor.\\n\\nLike many of his Das Boot co-stars, Semmelrogge went on to have a successful career in the German cinema.", BirthDate = new DateTime(1955, 12, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1QLBQoyszTLfk4WZmoXixpyjBb6.jpg", Name = "Martin Semmelrogge" },
                        new { Id = 4935, Biography = "Peter William \"Pete\" Postlethwaite, OBE ( 7 February 1946 – 2 January 2011), was an English stage, film and television actor.\\n\\nAfter minor television appearances including in The Professionals, Postlethwaite's first success came with the film Distant Voices, Still Lives in 1988. He played a mysterious lawyer, Mr. Kobayashi, in The Usual Suspects, and he appeared in Alien 3, In the Name of the Father, Amistad, Brassed Off, The Shipping News, The Constant Gardener, The Age of Stupid, Inception, The Town, Romeo + Juliet, and Æon Flux. In television, Postlethwaite's most notable performance was as the villain Sergeant Obadiah Hakeswill in the Sharpe television series and television movies opposite actor Sean Bean's character of Richard Sharpe.\\n\\nPostlethwaite was born in Warrington, England in 1946. He trained as a teacher and taught drama before training as an actor. Steven Spielberg called Postlethwaite \"the best actor in the world\" after working with him on The Lost World: Jurassic Park. He received an Academy Award nomination for his role in In the Name of the Father in 1993, and was made an Officer of the Order of the British Empire in the 2004 New Year's Honours List. He died of pancreatic cancer on 2 January 2011.\\n\\nDescription above from the Wikipedia article Pete Postlethwaite, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1945, 2, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2011, 1, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5nbSzrwyDcLhC15buncGdrQqJ8e.jpg", Name = "Pete Postlethwaite" },
                        new { Id = 4936, Biography = "", BirthDate = new DateTime(1959, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qOw3O1JEZOR8GmlqwPG4nemozEC.jpg", Name = "Jochen Nickel" },
                        new { Id = 4937, Biography = "Vincent Anthony \"Vince\" Vaughn (born March 28, 1970) is an American film actor, screenwriter, producer and comedian. He began acting in the late 1980s, appearing in minor television roles before experiencing wider recognition with the 1996 movie, Swingers. He has since appeared in a number of films, mostly comedies, including The Lost World: Jurassic Park, Old School, Starsky &amp; Hutch, Dodgeball: A True Underdog Story, Couples Retreat, Mr. &amp; Mrs. Smith, and Wedding Crashers", BirthDate = new DateTime(1970, 3, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//r6ISnWjO5fA9QA1BTWUGaqdPyxE.jpg", Name = "Vince Vaughn" },
                        new { Id = 4949, Biography = "", BirthDate = new DateTime(1957, 2, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Don Davis" },
