                        new { Id = 5045, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDaniel Thomas \"Dan\" O'Bannon (September 30, 1946 – December 17, 2009) was an American motion picture screenwriter, director and occasional actor, usually in the science fiction and horror genres.\\n\\nDescription above from the Wikipedia article Dan O'Bannon, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2009, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//slLZWXZ1lmdF763166ATRRI200n.jpg", Name = "Dan O'Bannon" },
                        new { Id = 5046, Biography = "", Name = "Ronald Shusett" },
                        new { Id = 5047, Biography = "Veronica A. Cartwright (born 20 April 1949) is an English-born actress who has worked mainly in American film and television.\\n\\nDescription above from the Wikipedia article Veronica Cartwright, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1949, 4, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8s31kdotRrghkH4DkxpRZCmELYd.jpg", Name = "Veronica Cartwright" },
                        new { Id = 5048, Biography = "Harry Dean Stanton (July 14, 1926 - September 15, 2017) was an American actor, musician, and singer. Stanton's career spanned over fifty years, which saw him star in such films as Cool Hand Luke, Kelly's Heroes, Dillinger, Alien, Repo Man, The Last Temptation of Christ, Wild at Heart, The Green Mile and The Pledge. In the late 2000s, he played a recurring role in the HBO television series Big Love.  Mr. Stanton died on September 15, 2017. He was 91.\\n\\nDescription above from the Wikipedia article Harry Dean Stanton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1926, 7, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fkl5iJYpKxSFGixyvAsBpLdDmqN.jpg", Name = "Harry Dean Stanton" },
                        new { Id = 5049, Biography = "John Vincent Hurt, CBE (born 22 January 1940) was an English actor, known for his leading roles as John Merrick in The Elephant Man, Winston Smith in Nineteen Eighty-Four, Mr. Braddock in The Hit, Stephen Ward in Scandal and Quentin Crisp in The Naked Civil Servant, Caligula in the television series, I, Claudius (TV series), and An Englishman in New York. Recognizable for his distinctive rich voice, he has also enjoyed a successful voice acting career, starring in films such as Watership Down, The Lord of the Rings and Dogville, as well as BBC television series Merlin. Hurt initially came to prominence for his role as Richard Rich in the 1966 film A Man for All Seasons, and has since appeared in such popular motion pictures as: Alien, Midnight Express, Rob Roy, V for Vendetta, Indiana Jones and the Kingdom of the Crystal Skull, the Harry Potter film series and the Hellboy film series. Hurt is one of England's best-known, most prolific and sought-after actors, and has had a versatile film career spanning six decades. He is also known for his many Shakespearean roles. Hurt has received multiple awards and honours throughout his career including three BAFTA Awards and a Golden Globe Award, with six and two nominations respectively, as well as two Academy Award nominations. His character's final scene in Alien is consistently named as one of the most memorable in cinematic history.", BirthDate = new DateTime(1940, 1, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 1, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rpuH2YRLpxJjMxHq4T1QdOSVtlN.jpg", Name = "John Hurt" },
                        new { Id = 5050, Biography = "From Wikipedia, the free encyclopedia.\\n\\nYaphet Frederick Kotto (born November 15, 1937) is an African-American actor, known for numerous film roles (including the sci-fi/horror film Alien and as a James Bond villain in Live and Let Die), and his starring role in the NBC television series Homicide: Life on the Street (1993-2000).\\n\\nDescription above from the Wikipedia article Yaphet Kotto, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1937, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qsaWzjzI41EXMldEn6sSp5fnsQ0.jpg", Name = "Yaphet Kotto" },
                        new { Id = 5051, Biography = "Bolaji Badejo was a Nigerian design student who portrayed the eponymous Alien in the 1979 film Alien. Alien was Badejo's only acting appearance.\\n\\nAs a child, Badejo had been diagnosed with sickle cell anaemia. Several months after his 39th birthday, Bolaji fell ill and was taken to St. Stephen Hospital in Ebute Metta, Lagos, where he died on December 22, 1992 of complications from the disease.\\n\\nWhile at a bar in early 1977, Bolaji Badejo was approached by Alien casting director Peter Archer, who was scouting for someone suitably tall and thin to play the eponymous Alien. Ivor Powell, the film's associate producer, explained that \"The person that put the suit on had to be impossibly tall. \\n\\nWe wanted them to be incredibly long-limbed, especially from the waist to the knee.\" However, the production had reached an impasse casting their Alien. They tried various female models, a family of contortionists and even Chewbacca actor Peter Mayhew.", BirthDate = new DateTime(1953, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1992, 12, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jVZaRxJjzVXKRCaOu3XFZSPeSts.jpg", Name = "Bolaji Badejo" },
