                        new { Id = 5293, Biography = "Willem Dafoe (born July 22, 1955) is an American film, stage, and voice actor, and a founding member of the experimental theatre company The Wooster Group. He has had roles in a wide range of films, including Streets of Fire, To Live and Die in L.A., Platoon, Born on the Fourth of July, The English Patient, The Last Temptation of Christ, Mississippi Burning, Wild at Heart, The Boondock Saints, Inside Man, The Life Aquatic with Steve Zissou, Spider-Man, Shadow of the Vampire, The Aviator, American Psycho, Antichrist, and voice roles in Fantastic Mr. Fox and Finding Nemo.\\n\\nDafoe has been nominated for the Academy Award for Best Supporting Actor twice. The first was for his role in Platoon in 1986 and the second time for his performance in Shadow of the Vampire in 2000.\\n\\nDescription above from the Wikipedia article Willem Dafoe, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1955, 7, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xM5lhOR5tWWdIlFpBDeZJx9opIP.jpg", Name = "Willem Dafoe" },
                        new { Id = 5301, Biography = "Waris Ahluwalia is an Indian American designer and actor based in New York City. His company, House of Waris, has collaborated with a number of other designers and artists throughout the years. House of Waris came into being after the owners of Maxfield's in Los Angeles noticed Ahluwalia's elaborate diamond rings and placed an order, which sold out.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//608mxzVDmbQtWt3IedJyQ72FNg5.jpg", Name = "Waris Ahluwalia" },
