                        new { Id = 5588, Biography = "From Wikipedia, the free encyclopedia.  Alicia Silverstone ( born October 4, 1976) is an American actress, author, and former fashion model. She first came to widespread attention in music videos for Aerosmith, and is perhaps best known for her roles in Hollywood films such as Clueless (1995) and her portrayal of Batgirl in Batman &amp; Robin (1997).  Description above from the Wikipedia article Alicia Silverstone, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//12OZNUQRfloOCJ7Q4JQneojSyQ4.jpg", Name = "Alicia Silverstone" },
                        new { Id = 5632, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJack Fisk (born December 19, 1945) is an American movie industry professional, frequently working as either a production designer or art director on Hollywood movies.\\n\\nFisk met Sissy Spacek when working on Terrence Malick's 1973 movie Badlands. The couple married on April 12, 1974; their daughter Schuyler Fisk is also an actress.\\n\\nFisk was art director on Brian De Palma's Carrie (1976), in which Spacek stars. He frequently collaborates with directors Terrence Malick and David Lynch (whom he has known since childhood). His production design and art director credits include all six of Malick's feature films and Lynch's The Straight Story (1999) and Mulholland Drive (2001). He was nominated for the Academy Award for Best Art Direction for Paul Thomas Anderson's There Will Be Blood.\\n\\nFisk appeared in Lynch's Eraserhead (1977) as the Man in the Planet, and the film's credits give \"special thanks\" to him and to Sissy Spacek (who reputedly held the slates between takes).\\n\\nDescription above from the Wikipedia article Jack Fisk, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1945, 12, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5T0M4HdNTKkTzY7kkNYIotegJtq.jpg", Name = "Jack Fisk" },
                        new { Id = 5655, Biography = "Wesley Wales Anderson (born May 1, 1969) is an American film director, screenwriter, actor, and producer of features, short films and commercials.\\n\\nHe was nominated for a 2001 Academy Award for Best Original Screenplay for The Royal Tenenbaums. Anderson has been called an auteur, as he is involved in every aspect of his films' production. His films employ a similar aesthetic, employing a deliberate, methodical cinematography, with mostly primary colors. His soundtracks feature early folk and rock music, in particular classic British rock. Anderson's films combine dry humor with poignant portrayals of flawed characters – often a mix of the wealthy and the working class. He is also known for working with many of the same actors and crew on varying projects. He also works with Indian Paintbrush, Steven M. Rales's production company.", BirthDate = new DateTime(1969, 5, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//s03CeUeC5yAXyB1acqP0zGNo2SC.jpg", Name = "Wes Anderson" },
                        new { Id = 5658, Biography = "Sir Michael Gambon is an Irish-British actor who has worked in theatre, television and film. A highly respected theatre actor, Gambon is recognised for his role in The Singing Detective and for his role as Albus Dumbledore in the Harry Potter film series, replacing the late actor Richard Harris. Gambon was born in Cabra, Dublin during World War II. His father, Edward Gambon, was an engineer, and his mother, Mary, was a seamstress. His father decided to seek work in the rebuilding of London, and so the family moved to Mornington Crescent in North London, when Gambon was five. His father had him made a British citizen - a decision that would later allow Michael to receive an actual, rather than honorary, knighthood. Gambon married Anne Miller when he was 22, but has always been secretive about his personal life, responding to one interviewer's question about her: \"What wife?\" The couple lived near Gravesend, Kent, where she has a workshop. While filming Gosford Park, Gambon brought Philippa Hart on to the set and introduced her to co-stars as his girlfriend. When the affair was revealed in 2002, he moved out of the marital home and bought a bachelor pad. In February 2007, it was revealed that Hart was pregnant with Gambon's child, and gave birth to son, Michael, in May 2007. On 22 June 2009 she gave birth to her second child, a boy named William, who is Gambon's third child. Gambon is a qualified private pilot and his love of cars led to his appearance on the BBC's Top Gear programme. Gambon raced the Suzuki Liana and was driving so aggressively that it went round the last corner of his timed lap on two wheels. The final corner of the Dunsfold Park track has been named \"Gambon\" in his honour.", BirthDate = new DateTime(1940, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//k6VxRs7xcG6DLEVM1izjb3UWSyC.jpg", Name = "Michael Gambon" },
