                        new { Id = 5813, Biography = "From Wikipedia, the free encyclopedia\\n\\nAldo Giuffrè (10 April 1924 – 26 June 2010) was an Italian film actor and comedian who appeared in over 90 films between 1948 and 2001. He was born in Naples.\\n\\nHe is known for his roles in The Four Days of Naples, and as the alcoholic Union Army captain in the Sergio Leone film The Good, the Bad and the Ugly in 1966.\\n\\nGiuffrè died in Rome in 2010 of peritonitis.", BirthDate = new DateTime(1924, 4, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2010, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aBp4PnfO43mTgCGg0pjmfhHrfdZ.jpg", Name = "Aldo Giuffrè" },
