                        new { Id = 5892, Biography = "David Ian Hewlett (born April 18, 1968) is an English-born Canadian actor best known for his role as Dr. Meredith Rodney McKay on the science fiction television shows Stargate SG1 and Stargate Atlantis.\\n\\nDescription above from the Wikipedia article David Hewlett, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1968, 4, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yntJ7Lur8LmjQ9rTfoVzlKb5WsX.jpg", Name = "David Hewlett" },
                        new { Id = 5921, Biography = "From Wikipedia, the free encyclopedia.\\n\\nMartin Jamie Roach is a Canadian actor. He is perhaps best known for his roles on Aaron Stone as T. Abner Hall and in the films Cube Zero, Diary of the Dead, and The Lookout.\\n\\nDescription above from the Wikipedia article Martin Roach, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1962, 7, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eTZ3B7EN18tm2hopkGaFDh6aNNa.jpg", Name = "Martin Roach" },
                        new { Id = 5953, Biography = "Spike Jonze (born Adam Spiegel; October 22, 1969) is an American director, producer and actor, whose work includes music videos, commercials, film and television. He is best known for his collaborations with writer Charlie Kaufman, which include the 1999 film Being John Malkovich and the 2002 film Adaptation., and for his work as director of the 2009 film Where the Wild Things Are. He was also a co-creator and executive producer of MTV's Jackass. He is currently the creative director of VBS.tv. He is also part owner of skateboard company Girl Skateboards with riders Rick Howard and Mike Carroll.\\n\\nHe also co-founded Directors Label with filmmakers Chris Cunningham and Michel Gondry.\\n\\nDescription above from the Wikipedia article Spike Jonze, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 10, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uzpGNO2zUV8y830U8LnPyAxhQSf.jpg", Name = "Spike Jonze" },
