                        new { Id = 6184, Biography = "Todd Hallowell is an assistant director and producer, known for A Beautiful Mind (2001), X-Men: Days of Future Past (2014) and Apollo 13 (1995).", BirthDate = new DateTime(1952, 8, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Todd Hallowell" },
                        new { Id = 6193, Biography = "Leonardo DiCaprio is an American actor and film producer.\\n\\nHe began his film career by starring as Josh in Critters 3 before starring in the film adaptation of the memoir This Boy's Life (1993) alongside Robert De Niro. DiCaprio was praised for his supporting role in the drama What's Eating Gilbert Grape (1993), and gained public recognition with leading roles in the drama The Basketball Diaries (1995) and the romantic drama Romeo + Juliet (1996), before achieving international fame with James Cameron's epic romance Titanic (1997) He has been nominated for six Academy Awards—five for acting and one for producing—and in 2016, he won the Academy Award for Best Actor for The Revenant.\\n\\nDiCaprio is the founder of his own production company, named Appian Way Productions. He is also a committed environmentalist.", BirthDate = new DateTime(1974, 11, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//A85WIRIKVsD2DeUSc8wQ4fOKc4e.jpg", Name = "Leonardo DiCaprio" },
                        new { Id = 6199, Biography = "From Wikipedia, the free encyclopedia.  Miriam Margolyes, OBE (born 18 May 1941) is an English actress and voice artist. Her earliest roles were in theatre and after several supporting roles in film and television she won a BAFTA Award for her role in The Age of Innocence (1993).\\n\\nDescription above from the Wikipedia article Miriam Margolyes, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1941, 5, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7Fijg5sZ7gKbooq6tId3MUS5sDY.jpg", Name = "Miriam Margolyes" },
                        new { Id = 6283, Biography = "Rolf Åke Michael Nyqvist (born November 8, 1960 in Stockholm) is a Swedish actor. Educated at the School of Drama in Malmö, he became well known from his role as police officer Banck in the first series of Beck movies made in 1997. He is recently most recognized for his role in the internationally acclaimed The Girl with the Dragon Tattoo Trilogy as Mikael Blomkvist and is one of Sweden's most beloved actors.\\n\\nDescription above from the Wikipedia article Michael Nyqvist, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bDjPDDiSna8FN5rqHdheg2wIYYo.jpg", Name = "Michael Nyqvist" },
                        new { Id = 6365, Biography = "Desmond Harrington (born October 19, 1976) is an American actor. He is known for movies such as The Hole, Wrong Turn and Ghost Ship. He joined the cast of the Showtime series Dexter in its third season as Joey Quinn.\\n\\nDescription above from the Wikipedia article Desmond Harrington , licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//z9EoAcqWjPD5vPtNCRT7p8Kj6o6.jpg", Name = "Desmond Harrington" },
                        new { Id = 6368, Biography = "Embeth Jean Davidtz (born August 11, 1965) is an American-born South African actress. Description above from the Wikipedia article Embeth Davidtz, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1965, 8, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gmc4nZtGc6bge9DnriR57VYq0dA.jpg", Name = "Embeth Davidtz" },
