                        new { Id = 6725, Biography = "From Wikipedia, the free encyclopedia\\n\\nRussell Irving \"Russ\" Tamblyn (born December 30, 1934) is an American film and television actor, who is arguably best known for his performance in the 1961 movie musical West Side Story as Riff, the leader of the Jets gang.\\n\\n \\n\\nDescription above from the Wikipedia article Russ Tamblyn, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1934, 12, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eSVSJvOR18dTgLRkeOqRYd6ew31.jpg", Name = "Russ Tamblyn" },
                        new { Id = 6730, Biography = "Sacha Noam Baron Cohen (born 13 October 1971) is a British comedian, actor, and writer. He is most widely known for his portrayal of three unorthodox fictional characters, Ali G, Borat, and Brüno. In his routines, Baron Cohen's characters interact with unsuspecting people who do not realize they are being set up for comic situations and self-revealing ridicule. Baron Cohen's work has been recognised with several Emmy nominations, an Oscar nomination for Best Adapted Screenplay, a BAFTA award, and a Golden Globe for Best Actor for his work in the feature film Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan. After the release of the film Borat, Baron Cohen stated that because the public had become too familiar with the characters, he would retire Borat and Ali G. Similarly, after the release of Brüno, he has stated he would also retire the title character. Description above from the Wikipedia article Sacha Baron Cohen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1971, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9UWxlTsGAfRAcxG2LcUMbfR3FiF.jpg", Name = "Sacha Baron Cohen" },
                        new { Id = 6828, Biography = "", Name = "Ken King" },
                        new { Id = 6856, Biography = "Kurt Vogel Russell (born March 17, 1951) is an American television and film actor. His first acting roles were as a child in television series, including a lead role in the Western series The Travels of Jaimie McPheeters (1963–1964). In the 1970s, he signed a ten-year contract with the Walt Disney Company, where he became, according to Robert Osborne, the \"studio's top star of the '70s\". In 1979, Russell was nominated for an Emmy Award for the made-for-television film Elvis.\\n\\nIn 1983, he was nominated for a Golden Globe Award for Best Performance by an Actor in a Supporting Role in a Motion Picture for his performance opposite Meryl Streep in the 1984 film, Silkwood. During the 1980s, Russell was cast in several films by director John Carpenter, including anti-hero roles such as former air force hero-turned robber Snake Plissken in the futuristic action film Escape from New York, Antarctic helicopter pilot R.J. MacReady in the horror film The Thing (1982), and truck driver Jack Burton in the dark kung-fu comedy/action film Big Trouble in Little China (1986). Both Escape from New York and Big Trouble in Little China have since become cult films.\\n\\nIn 1994, he had a starring role in the military/science fiction film Stargate. In the mid-2000s, his portrayal of U.S. Olympic hockey coach Herb Brooks in Miracle (2004) won the praise of critics. In 2006, he appeared in the disaster-thriller Poseidon, and in 2007 Quentin Tarantino's Death Proof segment from the film Grindhouse.\\n\\nDescription above from the Wikipedia article Kurt Russell, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1951, 3, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rlnFuNkisPpuypARI7QaGCmOY6V.jpg", Name = "Kurt Russell" },
                        new { Id = 6905, Biography = "Bruce MacLeish Dern (born June 4, 1936) is an American film actor. He also appeared as a guest star in numerous television shows. He frequently takes roles as a character actor, often playing unstable and villainous characters. Dern appeared in more than 80 feature films and made for TV movies.", BirthDate = new DateTime(1936, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fYhCiXGBARWUevnWDkeCEpwi4h4.jpg", Name = "Bruce Dern" },
                        new { Id = 6940, Biography = "", Name = "Karyn Rachtman" },
                        new { Id = 6944, Biography = "From Wikipedia, the free encyclopedia.\\n\\nOctavia Spencer (born 25 May 1972) is an American actress. She is perhaps best known for her role on Ugly Betty as Constance Grady, the INS Agent turned stalker of Betty's father, Ignacio Suarez", BirthDate = new DateTime(1972, 5, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4FEVru6fBFyJECqwqjHwlZdsL4c.jpg", Name = "Octavia Spencer" },
                        new { Id = 6952, Biography = "Carlos Irwin Estévez (born September 3, 1965), better known by his stage name Charlie Sheen, is an American film and television actor. He is the youngest son of actor Martin Sheen.\\n\\nHis character roles in films have included Chris Taylor in the 1986 Vietnam War drama Platoon, Jake Kesey in the 1986 film The Wraith, and Bud Fox in the 1987 film Wall Street. His career has also included more comedic films such as Major League, the Hot Shots! films, and Scary Movie 3 and Scary Movie 4. On television, Sheen is known for his roles on two sitcoms: as Charlie Crawford on Spin City and as Charlie Harper on Two and a Half Men. In 2010, Sheen was the highest paid actor on television, earning US$1.8 million per episode of Two and a Half Men.\\n\\nSheen's personal life has also made headlines, including reports about alcohol and drug abuse and marital problems as well as allegations of domestic violence. He was fired from his role on Two and a Half Men by CBS and Warner Bros. on March 7, 2011. Sheen subsequently announced a nationwide tour.\\n\\nDescription above from the Wikipedia article Charlie Sheen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//g4e1QpcNTpmq2uPr5GDNuMvjRuU.jpg", Name = "Charlie Sheen" },
                        new { Id = 6968, Biography = "Hugh Michael Jackman (born 12 October 1968) is an Australian actor and producer who is involved in film, musical theatre, and television. Jackman has won international recognition for his roles in major films, notably as action/superhero, period and romance characters.\\n\\nHe is known for his role as Wolverine in the X-Men series, as well as for his leads in Kate &amp; Leopold, Van Helsing, The Prestige, and Australia. Jackman is a singer, dancer, and actor in stage musicals, and won a Tony Award for his role in The Boy from Oz. In November 2008, Open Salon named Jackman one of the sexiest men alive. Later that same month, People magazine named Jackman \"Sexiest Man Alive.” A three-time host of the Tony Awards, winning an Emmy Award for one of these appearances, Jackman also hosted the 81st Academy Awards on 22 February 2009. Description above from the Wikipedia article Hugh Jackman , licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1968, 10, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dFbNlPpiEPupTAlNVNh5vrxBU1h.jpg", Name = "Hugh Jackman" },
                        new { Id = 6972, Biography = "Ian David McShane (born 29 September 1942) is an English actor. Although he has appeared in numerous films, it is by his television roles that he is generally known, starting with the BBC's Lovejoy (1986–94) and particularly in the HBO Western drama Deadwood (2004–06). He starred as King Silas Benjamin in NBC series Kings and as Blackbeard in Pirates of the Caribbean: On Stranger Tides.\\n\\nDescription above from the Wikipedia article Ian McShane, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1942, 9, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pY9ud4BJwHekNiO4MMItPbgkdAy.jpg", Name = "Ian McShane" },
                        new { Id = 7036, Biography = "​From Wikipedia, the free encyclopedia\\n\\nEric Hamilton Stoltz (born September 30, 1961) is an American actor and director. He is known for playing sensitive misfits (Mask, Kicking and Screaming, The Waterdance, Killing Zoe). He was nominated for a Golden Globe Award for Best Supporting Actor in a Motion Picture for Mask. He recently starred in the science fiction television series Caprica.\\n\\nDescription above from the Wikipedia article Eric Stoltz, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1961, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fXaULtqnMDKsqT1to8vnLjSXe0w.jpg", Name = "Eric Stoltz" },
                        new { Id = 7056, Biography = "Emma Thompson (born 15 April 1959) is a British actress, comedian and screenwriter. Her first major film role was in the 1989 romantic comedy The Tall Guy. In 1992, Thompson won multiple acting awards, including an Academy Award and a BAFTA Award for Best Actress, for her performance in the British drama Howards End. The following year Thompson garnered dual Academy Award nominations, as Best Actress for The Remains of the Day and as Best Supporting Actress for In the Name of the Father. In 1995, Thompson scripted and starred in Sense and Sensibility, a film adaptation of the Jane Austen novel of the same name, which earned her an Academy Award for Best Adapted Screenplay and a BAFTA Award for Best Actress in a Leading Role. Other notable film and television credits have included the Harry Potter film series, Wit (2001), Love Actually (2003), Angels in America (2003), Nanny McPhee (2005), Stranger than Fiction (2006), Last Chance Harvey (2008), An Education (2009), and Nanny McPhee and the Big Bang (2010). Thompson is also a patron of the Refugee Council and President of the Teaching Awards.\\n\\nDescription above from the Wikipedia article Emma Thompson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cWTBHN8kLf6yapxiaQD9C6N1uMw.jpg", Name = "Emma Thompson" },
                        new { Id = 7077, Biography = "​From Wikipedia, the free encyclopedia\\n\\nBenjamin Sherman \"Scatman\" Crothers (May 23, 1910 – November 22, 1986) was an American actor, singer, dancer and musician known for his work as Louie the Garbage Man on the TV show Chico and the Man, and as Dick Hallorann in The Shining in 1980. He was also a prolific voiceover artist, and provided the voices of Meadowlark Lemon in the animated TV version of The Harlem Globetrotters, Jazz the Autobot in The Transformers, the title character in Hong Kong Phooey, and Scat Cat in the 1970 film The Aristocats.\\n\\nDescription above from the Wikipedia article Scatman Crothers, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1910, 5, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1986, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nzSlIgwX4vMSJhDPdUSkV9MAAai.jpg", Name = "Scatman Crothers" },
                        new { Id = 7119, Biography = "", BirthDate = new DateTime(1923, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2013, 3, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//b1td2cfJhlxEG7QEijf3c6e2mCi.jpg", Name = "Jerzy Nowak" },
                        new { Id = 7139, Biography = "", BirthDate = new DateTime(1924, 9, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2012, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vdzvCDT4UtVctmo17OSpU8HVUxe.jpg", Name = "Norman Alden" },
                        new { Id = 7167, Biography = "Don Rickles, nicknamed \"Mr. Warmth\", was an American stand-up comedian and actor. He acted in comedic and dramatic roles, but is best known as an insult comic. He enjoyed a sustained career as such, thanks to his distinctive humor, wit, and impeccable timing. Rickles frequently appeared as a guest on The Tonight Show Starring Johnny Carson.", BirthDate = new DateTime(1926, 5, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 4, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//h5BcaDMPRVLHLDzbQavec4xfSdt.jpg", Name = "Don Rickles" },
                        new { Id = 7182, Biography = "From Wikipedia\\n\\nElmer Bernstein (April 4, 1922 – August 18, 2004) was an American composer and conductor best known for his many film scores. In a career which spanned fifty years, he composed music for hundreds of film and television productions. His most popular works include the scores to The Magnificent Seven, The Ten Commandments, The Great Escape, To Kill a Mockingbird, Ghostbusters, The Black Cauldron, Airplane!, and The Rookies.\\n\\nBernstein won an Oscar for his score to Thoroughly Modern Millie (1967) and was nominated for fourteen Oscars in total. He also won two Golden Globes and was nominated for two Grammy Awards.\\n\\nBernstein wrote the theme songs or other music for more than 200 films and TV shows, including The Magnificent Seven, The Great Escape, The Ten Commandments (1956), The Man with the Golden Arm, To Kill a Mockingbird, Robot Monster, and the fanfare used in the National Geographic television specials. His theme for The Magnificent Seven is also familiar to television viewers, as it was used in commercials for Marlboro cigarettes. Bernstein also provided the score to many of the short films of Ray and Charles Eames.\\n\\nIn 1961 Bernstein co-founded Äva Records an American record label based in Los Angeles together with Fred Astaire, Jackie Mills and Tommy Wolf.", BirthDate = new DateTime(1922, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2004, 8, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3H3AqKesJnkwJzWFJY9hyFwci5m.jpg", Name = "Elmer Bernstein" },
