                        new { Id = 7242, Biography = "From Wikipedia, the free encyclopedia\\n\\nTemuera Derek Morrison (born December 26, 1960) is a New Zealand actor. He has become one of the country's most famous stars for his roles as the abusive Jake \"the Muss\" Heke in 1994's Once Were Warriors and as bounty hunter Jango Fett and the Clone Troopers in the Star Wars series. He also voiced Boba Fett in the 2004 special edition of Star Wars Episode V: The Empire Strikes Back.\\n\\nDescription above from the Wikipedia article Temuera Morrison, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 12, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1ckHDFgKXJ8pazmvLCW7DeOKqA0.jpg", Name = "Temuera Morrison" },
                        new { Id = 7399, Biography = "​Benjamin Edward \"Ben\" Stiller (born November 30, 1965) is an American comedian, actor, writer, film director, and producer. He is the son of veteran comedians and actors Jerry Stiller and Anne Meara. After beginning his acting career with a play, Stiller wrote several mockumentaries, and was offered two of his own shows, both entitled The Ben Stiller Show. He began acting in films, and had his directorial debut with Reality Bites. Throughout his career he has since written, starred in, directed, and/or produced over 50 films including Heavyweights, There's Something About Mary, Meet the Parents, Zoolander, Dodgeball, and Tropic Thunder. In addition, he has had multiple cameos in music videos, television shows, and films. Stiller is a member of the comedic acting brotherhood colloquially known as the Frat Pack. His films have grossed more than $2.1 billion domestically (United States and Canada), with an average of $73 million per film. Throughout his career, he has received several awards and honors including an Emmy Award, several MTV Movie Awards, and a Teen Choice Award.", BirthDate = new DateTime(1965, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//o9M2PyoF7QDSMq1OwW0D892fIkV.jpg", Name = "Ben Stiller" },
                        new { Id = 7418, Biography = "", BirthDate = new DateTime(1964, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Mary Zophres" },
                        new { Id = 7467, Biography = "David Andrew Leo Fincher (born August 28, 1962) is an American film director and music video director. Known for his dark and stylish thrillers, such as Seven (1995), The Game (1997), Fight Club (1999), Panic Room (2002), and Zodiac (2007), Fincher received Academy Award nominations for Best Director for his 2008 film The Curious Case of Benjamin Button and his 2010 film The Social Network, which also won him the Golden Globe and the BAFTA for best director.", BirthDate = new DateTime(1962, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dcBHejOsKvzVZVozWJAPzYthb8X.jpg", Name = "David Fincher" },
                        new { Id = 7496, Biography = "", Name = "Dan Leigh" },
                        new { Id = 7624, Biography = "Stan Lee (born Stanley Martin Lieber; December 28, 1922)  is an American comic book writer, editor, actor, producer, publisher, television personality, and the former president and chairman of Marvel Comics.\\n\\nIn collaboration with several artists, most notably Jack Kirby and Steve Ditko, he co-created Spider-Man, the Fantastic Four, the X-Men, the Avengers, Iron Man, the Hulk, Thor, Daredevil, Doctor Strange, and many other fictional characters, introducing complex, naturalistic characters and a thoroughly shared universe into superhero comic books. In addition, he headed the first major successful challenge to the industry's censorship organization, the Comics Code Authority, and forced it to reform its policies. Lee subsequently led the expansion of Marvel Comics from a small division of a publishing house to a large multimedia corporation.\\n\\nHe was inducted into the comic book industry's Will Eisner Comic Book Hall of Fame in 1994 and the Jack Kirby Hall of Fame in 1995.\\n\\nDescription above from the Wikipedia article Stan Lee, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1922, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dTr2gJPL7jELKVkcjtoNx80uVKR.jpg", Name = "Stan Lee" },
                        new { Id = 7633, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLeslie William Nielsen, OC (11 February 1926 – 28 November 2010) was a Canadian and naturalized American actor and comedian. Nielsen appeared in over one hundred films and 1,500 television programs over the span of his career, portraying over 220 characters. Born in Regina, Saskatchewan, Nielsen enlisted in the Royal Canadian Air Force and worked as a disc jockey before receiving a scholarship to Neighborhood Playhouse. Making his television debut in 1948, he quickly expanded to over 50 television appearances two years later. Nielsen made his film debut in 1956, and began collecting roles in dramas, westerns, and romance films. Nielsen's performances in the films Forbidden Planet (1956) and The Poseidon Adventure (1972) received positive reviews as a serious actor, though he is primarily known for his comedic roles.\\n\\nAlthough Nielsen's acting career crossed a variety of genres in both television and films, his deadpan delivery in Airplane! (1980) marked a turning point in his career, one that would make him, in the words of film critic Roger Ebert, \"the Olivier of spoofs.\" Nielsen enjoyed further success with The Naked Gun film series (1988 – 1994), based on a short-lived television series Police Squad! in which he starred earlier. His portrayal of serious characters seemingly oblivious to (and complicit in) their absurd surroundings gave him a reputation as a comedian. In the final years of his career, Nielsen appeared in multiple spoof and parody films, many of which were met poorly by critics, but performed well in box office and home media releases. Nielsen married four times and had two daughters from his second marriage. He was recognized with a variety of awards throughout his career, and was inducted into the Canada and Hollywood Walks of Fame.\\n\\nDescription above from the Wikipedia article Leslie Nielsen, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1926, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2010, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cZpuTfE1j63tCEXoSL2A7KZjk5d.jpg", Name = "Leslie Nielsen" },
