                        new { Id = 8186, Biography = "Miko John Hughes (born February 22, 1986) is an American actor best known for his film roles as a child actor as Gage Creed in Pet Sematary (1989), as an autistic boy opposite Bruce Willis in Mercury Rising (1998) and as Dylan, Heather Langenkamp's son in Wes Craven's New Nightmare (1994).\\n\\nDescription above from the Wikipedia article Miko Hughes, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1986, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hpteoojNUAomlQVbiL4eSjUeJ4K.jpg", Name = "Miko Hughes" },
                        new { Id = 8191, Biography = "Chris Ellis is an American film and television actor who was born April 14, 1956 in Dallas, Texas. Ellis always wanted to be an actor because of television. He grew up in the 50's in the deep south in a \"world of privation and violence\", but saw on television people who seemed to have lives of ease and privilege.\\n\\nIt took him seven years to finish college however, because \"I have always been shiftless\". During those years Chris became involved in community theatre in Memphis, where \"I did and do still think the quality of the work has always been quite good\". By the time he moved to New York, he had worked with many excellent actors in about two dozen plays, classical and contemporary. \"I cannot imagine what might have supplanted that background for a newcomer in New York.\"\\n\\nHis first part in either television or film came in 1979, where he played a truck driver in the TV movie The Suicide's Wife, which starred Angie Dickinson. The role resulted in very little TV or film work. After working in regional theatre for a year or so, Chris fell off the radar screen and did not work for about ten years. During that time he lived in \"bone-grinding poverty\" in Manhattan's Hell's Kitchen. In one nine-month period of 1987, Chris accepted 102 dinner invitations. \"I don't know why they kept arriving, nor why I counted them, though I do know why I accepted them.\"\\n\\nIn 1990, a break came when he got a part in Days of Thunder, which starred Tom Cruise, Nicole Kidman, Cary Elwes, Robert Duvall, and Randy Quaid. John C. Reilly and Fred Dalton Thompson also appear. This seemed to jump-start Ellis' career as parts in films like My Cousin Vinny with Joe Pesci and Marisa Tomei, a small part in Addams Family Values, and a larger one in Apollo 13 as former NASA Mercury Seven astronaut Deke Slayton, alongside Tom Hanks, followed. He also began picking up credits on well-known television shows like Melrose Place, NYPD Blue, and The X-Files.\\n\\nSince working with Hanks on Apollo 13, the two have worked together on That Thing You Do, the TV miniseries From the Earth to the Moon, and Catch Me If You Can. Ellis returned to a fictional NASA Mission Control when he played a Flight Director in 1998's Armageddon.\\n\\nAdditional films in which Ellis has appeared include Home Fries, October Sky, Live Free or Die Hard, and Transformers. His television credits also include The West Wing, Ghost Whisperer, Chicago Hope, The Pretender, Alias, JAG, CSI: NY, Burn Notice, and Cold Case. He appeared in three season one episodes of Millennium as group member Jim Panseayres. He has established a reputation as being particularly talented at portraying Southern lawmakers or serious military or police-type characters.\\n\\nHe also appeared in Criminal Minds as Sheriff Jimmy Rhodes who calls for the BAU's help in investigating a string of murders in New Mexico. In addition to that, he also had two guest appearances in NCIS as Gunnery Sergeant John Deluca. Ellis's appearance in the Season 1 episode, \"The Curse\" was uncredited while his second and final appearance in Season 2's \"The Bone Yard\" was credited.\\n\\nDescription above from the Wikipedia article Chris Ellis (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1956, 4, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vbltM7DQXON9xvpiyNuUCglNRmz.jpg", Name = "Chris Ellis" },
                        new { Id = 8210, Biography = "Wesley Cook \"Wes\" Bentley (born September 4, 1978) is an American film actor known for his roles as Ricky Fitts in American Beauty (1999) and Seneca Crane in The Hunger Games (2012). Bentley was one of four subjects in the documentary My Big Break (2009), which covered his fame after American Beauty and struggles with substance abuse. Rebuilding his career, he starred in the premier of Venus in Fur by David Ives in the off-Broadway production in 2010, whose run was extended.\\n\\nDescription above from the Wikipedia article Wes Bentley, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1978, 9, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fbHHalL9CS52zvJp015G31vwX23.jpg", Name = "Wes Bentley" },
                        new { Id = 8276, Biography = "", Name = "Tim Holland" },
                        new { Id = 8285, Biography = "", Name = "Richard L. Johnson" },
                        new { Id = 8293, Biography = "Marion Cotillard (born 30 September 1975) is a French actress. She garnered critical acclaim for her roles in films such as My Sex Life... or How I Got Into an Argument, Taxi, Furia, Pretty Things and Inception.\\n\\nShe won the Academy Award for Best Actress, BAFTA Award for Best Actress, César for Best Actress and the Golden Globe for Best Actress in Musical or a Comedy for her portrayal of French singer Édith Piaf in La Vie en Rose. She made film history by becoming the first person to win an Academy Award for a French language performance. In 2010 she received a Golden Globe nomination for her performance in the musical Nine.\\n\\nCotillard, in addition to her film work, is interested in environmental activism and participated in campaigns for environmental protection. Cotillard used her high public profile to bring attention to the aims of Greenpeace, working for the environmental organization as a spokesperson, allowing the organization to use her apartment to test products. In 2005, she also contributed to Dessins pour le climat (“Drawings for the Climate”), a book of drawings published by Greenpeace to raise funds for the group.\\n\\nCotillard currently lives with French actor and director Guillaume Canet. Many reports say the couple prefers to live a simple lifestyle, and they are often spotted in cafes and shopping together in Paris. Neither star discusses their relationship with the media, although photos of the couple being affectionate regularly surface in the European tabloids.\\n\\nShe is a fan of Radiohead and Canadian singer Hawksley Workman; she has appeared in two of the latter's music videos, most notably \"No Reason to Cry Out your Eyes (On the Highway Tonight)\". Workman even revealed in interviews about his last album Between The Beautifuls that he worked and wrote songs with Cotillard while they both were in Los Angeles during the movie awards season.", BirthDate = new DateTime(1975, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eSRyCYy2qiGIRodOV5eZJJRZIyP.jpg", Name = "Marion Cotillard" },
                        new { Id = 8294, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nRobert \"Bob\" Guillaume (November 30, 1927 – October 24, 2017) was an American stage and television actor, best known for his role as Benson Du Bois on the TV-series Soap and the spin-off Benson, voicing the mandrill Rafiki in The Lion King and as Isaac Jaffe on Sports Night. In a career that  spanned more than 50 years he worked extensively on stage (including a Tony Award nomination), television (including winning two Emmy Awards), and film.\\n\\nDescription above from the Wikipedia article Robert Guillaume, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1927, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 10, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6lXvLF1v4wpW1uLDIjti3WuSoAX.jpg", Name = "Robert Guillaume" },
                        new { Id = 8297, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRoger Avary (born Roger d'Avary on August 23, 1965) is a Canadian film and television producer, screenwriter and director in the American mass media industry. He was behind the screenplays of the films Silent Hill and Beowulf. Before that, he had worked on Reservoir Dogs and Pulp Fiction, the latter of which earned both him and Quentin Tarantino an Oscar for Best Original Screenplay at the 67th Academy Awards. He also directed the films Killing Zoe and The Rules of Attraction, among other film and television projects as well.\\n\\nDescription above from the Wikipedia article Roger Avary, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 8, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//x9E17YQVlzKoRU8E4SEoEOwRKay.jpg", Name = "Roger Avary" },
