                        new { Id = 8654, Biography = "Matthew Avery Modine (born March 22, 1959) is an award-winning American actor. His film roles include Private Joker in Stanley Kubrick's Full Metal Jacket, the title character in Alan Parker's Birdy, high school wrestler Louden Swain in Vision Quest, and the oversexed Sullivan Groff in Weeds.", BirthDate = new DateTime(1959, 3, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tEQG1Us5IuoKYtufZe6waWtxfeg.jpg", Name = "Matthew Modine" },
                        new { Id = 8655, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRonald Lee Ermey (born March 24, 1944) is a retired United States Marine Corps drill instructor and actor.\\n\\nErmey has often played the roles of authority figures, such as his breakout performance as Gunnery Sergeant Hartman in Full Metal Jacket, Mayor Tilman in the Alan Parker film Mississippi Burning, Bill Bowerman in Prefontaine, Sheriff Hoyt in The Texas Chainsaw Massacre remake, and plastic army men leader Sarge in the Toy Story films.\\n\\nHe has hosted two programs on the History Channel: Mail Call, in which he answered viewers' questions about various militaria both modern and historic; and Lock N' Load with R. Lee Ermey, which focused on the development of different types of weapons.\\n\\nHe is currently a candidate for the National Rifle Association board of directors.\\n\\nDescription above from the Wikipedia article R. Lee Ermey, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1944, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//r8GBqFBjypLUP9VVqDqfZ7wYbSs.jpg", Name = "R. Lee Ermey" },
                        new { Id = 8664, Biography = "Bruce Boa was a Canadian actor, who found success playing the token North American in British films and television.", BirthDate = new DateTime(1930, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2004, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nPCLZTuTfOzSN5CvMnocX3hS92P.jpg", Name = "Bruce Boa" },
                        new { Id = 8679, Biography = "", Name = "William James Teegarden" },
                        new { Id = 8691, Biography = "Zoë Yadira Saldana was born June 19, 1978 in Passaic NJ to a Puerto Rican mother and Dominican father. Her family relocated to the Dominican Republic when she was ten years old. There she practiced ballet at one of the most prestigious dance schools in the country. Saldana returned to New York at age 17, where she began involving herself in theatre groups such as Faces and the New York Youth Theatre. Her ballet training helped land her first on-screen part as Eva in the dance film, Center Stage (2000). The actress’ career continued to flourish with roles in Pirates of The Caribbean: The Curse of the Black Pearl (2003) with Johnny Depp, The Terminal (2004) starring Tom Hanks, and Guess Who (2005) opposite Ashton Kutcher. Saldana continues to act and model with editorial features in Elle, Vanity Fair, V, GQ Italia, and Nylon.", BirthDate = new DateTime(1978, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ofNrWiA2KDdqiNxFTLp51HcXUlp.jpg", Name = "Zoe Saldana" },
                        new { Id = 8694, Biography = "", BirthDate = new DateTime(1974, 7, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6iWAS8xqeK99D39qMFSMhxee9ho.jpg", Name = "Corey Reynolds" },
                        new { Id = 8704, Biography = "", Name = "Isabelle Guay" },
                        new { Id = 8705, Biography = "", Name = "Brad Ricker" },
                        new { Id = 8785, Biography = "Ciaran Hinds was born in Belfast, Northern Ireland on February 9, 1953. He was one of five children and the only son. His father was a doctor who hoped to have Ciaran follow in his footsteps, but that was not to be. It was his mother Moya, an amateur actress, who was the real influence behind his decision to become an actor. Though he did enroll in Law at Queens' University of Belfast, he left that in order to train in acting at RADA. He began his stage career at the Glasgow Citizens' Theatre as a pantomime horse in the production of \"Cinderella\". Staying with the company for several years, he starred in a number of productions, including playing the lead roles in \"Arsenic and Old Lace\" and \"Faust\". His stage career has included working with The Field Day Company and a number of world tours. He has starred in a number of productions with the Royal Shakespeare Company, including a world tour in the title role of \"Richard III\". Hinds' film career began in 1981 in the movie Excalibur (1981), which boasted a cast rich in talented actors including Liam Neeson, Gabriel Byrne and Patrick Stewart. In-between his movie work, he's amassed a large number of television credits. Playing such classic characters as \"Mr. Rochester\" in Jane Eyre (1997) (TV), and \"Captain Wentworth\" in Persuasion (1995) has increased his popularity and most definitely given him much increased recognition. As for his personal life, you won't be likely to see his name in the weekly tabloids. He likes to keep his private life private. It is known that he is in a long-term, committed relationship with a French-Vietnamese actress named Hélène Patarot and they have a daughter together and live in Paris. He is in very high demand and his reputation as a quality, professional actor is sure to keep him busy for as long as he chooses. IMDb Mini Biography By: Sheryl Reeder", BirthDate = new DateTime(1953, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//h5n8B12WoY1UAZjzSVEup4vsoBw.jpg", Name = "Ciarán Hinds" },
                        new { Id = 8789, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nMathieu Amalric (born 25 October 1965) is a French actor and film director, perhaps best known internationally for his performance in The Diving Bell and the Butterfly, for which he drew critical acclaim. He also has won the Étoile d'or and the Lumière Award.\\n\\nDescription above from the Wikipedia article Mathieu Amalric, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1965, 10, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yJlm02FobTETwbyaCTOOU26OfmS.jpg", Name = "Mathieu Amalric" },
                        new { Id = 8844, Biography = "From Wikipedia, the free encyclopedia.  \\n\\nLawrence Edward \"Larry\" Kasdan (born January 14, 1949) is an American film producer, director and screenwriter. He is best known as co-writer of the films The Empire Strikes Back, Raiders of the Lost Ark, and Return of the Jedi. Kasdan co-wrote the Star Wars sequel trilogy film Star Wars: The Force Awakens, and will co-write the series' Han Solo spin-off film.\\n\\nHe has been nominated for three Oscars: twice for Best Original Screenplay for The Big Chill and Grand Canyon and once for Best Adapted Screenplay for The Accidental Tourist. He is the father of directors Jake Kasdan and Jon Kasdan, and the father-in-law of musician Inara George.\\n\\nDescription above from the Wikipedia article Lawrence Kasdan, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1949, 1, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pBAB9NAMRhL2IBYcgLu6P1CdXbW.jpg", Name = "Lawrence Kasdan" },
                        new { Id = 8882, Biography = "", Name = "Joel Thurm" },
                        new { Id = 8885, Biography = "", BirthDate = new DateTime(1930, 11, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Albert Wolsky" },
                        new { Id = 8891, Biography = "John Joseph Travolta is an American actor, dancer and singer. He first became known in the 1970s, after appearing on the television series Welcome Back, Kotter and starring in the box office successes Saturday Night Fever and Grease. Travolta's career re-surged in the 1990s, with his role in Pulp Fiction, and he has since continued starring in Hollywood films, including Face/Off, Ladder 49 and Wild Hogs. Travolta has twice been nominated for the Academy Award for Best Actor. The first, for his role in Saturday Night Fever and the second for Pulp Fiction. He won the Golden Globe Award for Best Actor - Motion Picture Musical or Comedy for his performance in Get Shorty.\\n\\nTravolta, the youngest of six children, was born and raised in Englewood, New Jersey, an inner-ring suburb of New York City. His father, Salvatore Travolta, was a semi-professional football player turned tire salesman and partner in a tire company. His mother, Helen Cecilia, was an actress and singer who had appeared in The Sunshine Sisters, a radio vocal group, and acted and directed before becoming a high school drama and English teacher. His siblings are Joey, Ellen, Ann, Margaret, and Sam Travolta. Travolta's father was a second-generation Italian American and his mother was Irish American; he grew up in an Irish-American neighborhood and has said that his household was predominantly Irish in culture. His family was Roman Catholic.\\n\\nTravolta married actress Kelly Preston in 1991. The couple had a son, Jett, (April 13, 1992 - January 2, 2009), and have a daughter, Ella Bleu, born in 2000. On May 18, 2010, Travolta and Preston announced that she is pregnant with the couple's third child. The couple has regularly attended marriage counselling, and Travolta admits that therapy has helped the marriage. Travolta was involved with actress Diana Hyland, whom he met while filming The Boy in the Plastic Bubble; the relationship ended when she died of breast cancer in 1977.\\n\\nTravolta is a certified pilot and owns five aircraft, including an ex-Australian Boeing 707–138 airliner. The plane bears the name Jett Clipper Ella in honor of his children. His $4.9 million estate in the Jumbolair subdivision in Ocala, Florida, is situated on Greystone Airport with its own runway and taxiway right to his front door.\\n\\nTravolta has been a practitioner of Scientology since 1975 when he was given the book Dianetics while filming the movie The Devil's Rain in Durango, Mexico.", BirthDate = new DateTime(1954, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6CKR08ipxM8d2xOB26ja7OlXx7H.jpg", Name = "John Travolta" },
                        new { Id = 9015, Biography = "Kelly Macdonald (born 23 February 1976) is a Scottish actress, known for her role in the independent film Trainspotting and mainstream releases such as Nanny McPhee, Gosford Park, Intermission and No Country for Old Men. On television, she is known for her roles in Boardwalk Empire, The Girl in the Café and State of Play.\\n\\nDescription above from the Wikipedia article Kelly Macdonald, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 2, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ncpSRbNH44itdir2FLJHsD0nGVV.jpg", Name = "Kelly Macdonald" },
                        new { Id = 9027, Biography = "", BirthDate = new DateTime(1960, 4, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6J0JwsWmFv3vKEguRTV71aK5J.jpg", Name = "Sandy Powell" },
                        new { Id = 9111, Biography = "Peter Graves was born Peter Duesler Aurness on March 18, 1926 on Minneapolis, Minnesota. While growing up in Minnesota, he excelled at sports and music (as a saxophonist), and by age 16, he was a radio announcer at WMIN in Minneapolis. After two years in the United States Air Force, he studied drama at the University of Minnesota and then headed to Hollywood, where he first appeared on television and later made his film debut in Rogue River (1951). Numerous film appearances followed, especially in Westerns. However, Graves is primarily recognized for his television work, particularly as Jim Phelps in Mission: Impossible (1966). Peter Graves died of a heart attack on March 14, 2010, just four days before his 84th birthday.", BirthDate = new DateTime(1926, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2010, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sR9B0mE399EGI9aRxMbWMpk2GKT.jpg", Name = "Peter Graves" },
                        new { Id = 9136, Biography = "Hans Ruedi \"H.R.\" Giger (/ˈɡiːɡər/ GHEE-gər; German: [ˈɡiːɡər]; 5 February 1940 – 12 May 2014) was a Swiss painter, whose style was adapted for many forms of media, including record albums, furniture and tattoos.\\n\\nThe Zurich-based artist was best known for airbrush images of humans and machines linked together in a cold 'biomechanical' relationship. Later he abandoned airbrush work for pastels, markers, and ink. He was part of the special effects team that won an Academy Award for design work on the film Alien. In Switzerland there are two theme bars that reflect his interior designs, and his work is on permanent display at the H.R. Giger Museum at Gruyères.", BirthDate = new DateTime(1940, 2, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 5, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//noCBbLN8oVq1GfXCN48yMQwq2XB.jpg", Name = "H.R. Giger" },
                        new { Id = 9138, Biography = "", BirthDate = new DateTime(1942, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//doDUez5AkN0bfqmZWB0bKO9mcJe.jpg", Name = "Gemma Jones" },
