                        new { Id = 9191, Biography = "Timothy Leonard Spall, OBE (born 27 February 1957) is an English character actor and occasional presenter.\\n\\nDescription above from the Wikipedia article Timothy Spall, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1957, 2, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yMClxMrLdOXk37RGvrqJEWjg9ko.jpg", Name = "Timothy Spall" },
