                        new { Id = 9560, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nEllen Burstyn  (born December 7, 1932) is an American actress, who has worked in film, stage and television. Her acting career began in theatre during the late 1950s, and over the next ten years, Burstyn appeared in several films and television series before joining the Actors Studio in 1967. She achieved recognition for her roles in The Last Picture Show (1971) and The Exorcist (1973), receiving Academy Award nominations for both performances. She won the Academy Award for Best Actress the following year for her work in Martin Scorsese's Alice Doesn't Live Here Anymore (1973). In 1975, she won a Tony Award for her work in the Broadway production of Same Time, Next Year, and received a Golden Globe Award and a fourth Academy Award nomination for her performance in the 1978 film version. Burstyn continued to work extensively since the 1980s, and was acclaimed for her performance in the film Requiem for a Dream, for which she received several critic's awards.\\n\\nDescription above from the Wikipedia article Ellen Burstyn, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1932, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kxWFljG3JjJMbOMCLm0SkrPQjhf.jpg", Name = "Ellen Burstyn" },
                        new { Id = 9568, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3jCBSmYtDHs2u6ugFENa52SC9HT.jpg", Name = "Jim Palmer" },
                        new { Id = 9619, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wnQisLNWHfsVCRPX8mvEn3s6tXY.jpg", Name = "Skip Lievsay" },
                        new { Id = 9621, Biography = "", Name = "Peter Chesney" },
                        new { Id = 9632, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nFredric Lehne (also known as Fredric Lane; born 3 February 1959, Buffalo, New York, USA) is an actor who has appeared in over 200 films, mini-series, and television shows as well as many stage productions including works by Shakespeare, Molière and Ibsen on Broadway. He appeared in such films as Con Air, Ordinary People and Being There.", BirthDate = new DateTime(1959, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ii4DF6gv3DG7NBVHfhTAPZvLGXH.jpg", Name = "Fredric Lehne" },
                        new { Id = 9642, Biography = "David Jude Heyworth Law (born 29 December 1972), known professionally as Jude Law, is an English actor, film producer and director.\\n\\nHe began acting with the National Youth Music Theatre in 1987, and had his first television role in 1989. After starring in films directed by Andrew Niccol, Clint Eastwood and David Cronenberg, he was nominated for the Academy Award for Best Supporting Actor in 1999 for his performance in Anthony Minghella's The Talented Mr. Ripley. In 2000 he won a Best Supporting Actor BAFTA Award for his work in the film. In 2003, he was nominated for the Academy Award for Best Actor for his performance in another Minghella film, Cold Mountain.\\n\\nIn 2006, he was one of the top ten most bankable movie stars in Hollywood. In 2007, he received an Honorary César and he was named a Chevalier of the Ordre des Arts et des Lettres by the French government. In April 2011, it was announced that he would be a member of the main competition jury at the 2011 Cannes Film Festival.\\n\\nDescription above from the Wikipedia article Jude Law, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1972, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4077Cyuo1mw53u1gNjLyQkqeZN0.jpg", Name = "Jude Law" },
                        new { Id = 9651, Biography = "", BirthDate = new DateTime(1962, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Craig Berkey" },
                        new { Id = 9778, Biography = "O'Shea Jackson Sr., better known by his stage name Ice Cube, is an American rapper, record producer, actor, screenwriter, film producer, and director. He began his career as a member of the hip-hop group C.I.A. and later joined N.W.A. Monetary conflict with his bandmate Eric \"Eazy-E\" Wright and manager Jerry Heller caused him to embark on a solo rap career, leading to forays into acting, writing and directing.", BirthDate = new DateTime(1969, 6, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dzdn1tyWkC4EjlBVKvpAhg5osYA.jpg", Name = "Ice Cube" },
                        new { Id = 9968, Biography = "", Name = "Jackie Carr" },
                        new { Id = 9971, Biography = "Charles L. Campbell (August 17, 1930 – June 21, 2013) was an American sound engineer who won three Academy Awards for Best Sound Editing. He also served as Governor of the Academy of Motion Picture Arts and Sciences (AMPAS) 1984-1987. Source, Wikipedia", BirthDate = new DateTime(1930, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2013, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1MoCPekZ23I9uyq6VPFka6o9Zkz.jpg", Name = "Charles L. Campbell" },
                        new { Id = 9987, Biography = "", Name = "Ian Bryce" },
                        new { Id = 9991, Biography = "", Name = "Karen Blynder" },
                        new { Id = 10127, Biography = "From Wikipedia, the free encyclopedia\\n\\nJonathan Vincent \"Jon\" Voight (born December 29, 1938) is an American actor. He has received an Academy Award, out of four nominations, and three Golden Globe Awards, out of nine nominations.\\n\\nVoight came to prominence in the late 1960s with his performance as a would-be gigolo in Midnight Cowboy (1969). During the 1970s, he became a Hollywood star with his portrayals of a businessman mixed up with murder in Deliverance (1972), a paraplegic Vietnam veteran in Coming Home (1978), for which he won an Academy Award for Best Actor, and a penniless ex-boxing champion in The Champ (1979).\\n\\nAlthough his output slowed during the 1980s, Voight received critical acclaim for his performance as a ruthless bank robber in Runaway Train (1985). During the 1990s, he most notably starred as an unscrupulous showman attorney in The Rainmaker (1997).\\n\\nVoight gave critically acclaimed biographical performances during the 2000s, appearing as sportscaster Howard Cosell in Ali (2001), as Nazi officer Jürgen Stroop in Uprising (2001), and as Pope John Paul II in the television film of the same name (2005).\\n\\nVoight is the father of actress Angelina Jolie.\\n\\nDescription above from the Wikipedia article Jon Voight, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1938, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//c7BvyqlvqDkfkFqSBUCiR21fvTh.jpg", Name = "Jon Voight" },
                        new { Id = 10182, Biography = "Irving Rameses \"Ving\" Rhames (born May 12, 1959) is an American actor best known for his work in Bringing Out the Dead, Pulp Fiction, Baby Boy, Don King: Only in America, and the Mission: Impossible film series. Rhames was born in New York City, New York, he entered New York's School of Performing Arts, where he discovered his love of acting. After high school, he studied drama at SUNY Purchase where he met fellow actor Stanley Tucci, who gave him his nickname \"Ving\". He later transferred to Juilliard, where he began his career in New York theater. Rhames first appeared on Broadway in the play The Winter Boys in 1984. Ving continued his rise to fame through his work in soap operas. He found work as a supporting actor, and came to the attention of the general public by playing the role of Marsellus Wallace in Pulp Fiction (1994). Rhames was also getting public exposure on television as Peter Benton's brother-in-law on the medical drama ER, a recurring role he filled for 3 seasons. Not long after, Rhames was cast with Tom Cruise as the ace computer hacker Luther Stickell in Brian De Palma's Mission: Impossible (1996). With solid performances in two of these highly popular productions, his face was now known to moviegoers; the work offers began rolling in more frequently and he can been seen in several popular films such as Con Air and Dawn of the Dead.  Rhames won a Golden Globe in 1998 for best actor in a TV miniseries for his performance in HBO's Don King: Only in America. At the ceremony Rhames gave his award to fellow nominee Jack Lemmon (who is White), saying \"I feel that being an artist is about giving, and I'd like to give this to you.\" Lemmon was clearly touched by the gesture as was the celebrity audience who gave Lemmon a standing ovation. Lemmon, who tried unsuccessfully to give the award back to Rhames said it was \"one of the sweetest moments I've ever known in my life.\" The Hollywood Foreign Press Association announced later that they would have a duplicate award prepared for Rhames.", BirthDate = new DateTime(1959, 5, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8nS83GOu0iqxjL2Oj2DgwkAceFQ.jpg", Name = "Ving Rhames" },
                        new { Id = 10205, Biography = "Sigourney Weaver (born October 8, 1949, height 5' 11\" (1,80 m)) is an American actress best known for her role as Ellen Ripley in the Alien film series, a role for which she has received worldwide recognition. Other notable roles include the Ghostbusters films, Gorillas in the Mist, The Ice Storm, Working Girl, Death and the Maiden, Prayers for Bobby and Avatar.\\n\\nShe is a three-time Academy Award nominee for her performances in Aliens (1986), Gorillas in the Mist (1988), and Working Girl (1988) winning Golden Globe Awards in the latter two films. Weaver has been called \"The Sci-Fi Queen\" by many on account of her many science fiction and fantasy films.", BirthDate = new DateTime(1949, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gxBIAr3CnBjkNRoPovVJCvEGqP0.jpg", Name = "Sigourney Weaver" },
                        new { Id = 10297, Biography = "Matthew David McConaughey (born November 4, 1969) is an American actor. After a series of minor roles in the early 1990s, McConaughey gained notice for his breakout role in Dazed and Confused (1993). It was in this role that he first conceived the idea of his catch-phrase \"Well alright, alright.\" He then appeared in films such as A Time to Kill, Contact, U-571, Tiptoes, Sahara, and We Are Marshall. McConaughey is best known more recently for his performances as a leading man in the romantic comedies The Wedding Planner, How to Lose a Guy in 10 Days, Failure to Launch, Ghosts of Girlfriends Past and Fool's Gold.\\n\\nDescription above from the Wikipedia article Matthew McConaughey, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 11, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jdRmHrG0TWXGhs4tO6TJNSoL25T.jpg", Name = "Matthew McConaughey" },
