                        new { Id = 10402, Biography = "Mini Biography Alanna Noel Ubach (born October 3, 1975) is an American actress and voice actress. She is known for her roles in Legally Blonde as Serena and Meet the Fockers as Isabel Villalobos. She has provided voices for several characters in a number of animated shows, such as Liz Allan in The Spectacular Spider-Man, the title character in El Tigre: The Adventures of Manny Rivera and Lola Boa in Brandy &amp; Mr. Whiskers. She has also written and performed a one-woman show. She played the first female assistant, Josie, in Beakman's World. Ubach was born in Downey, California, the daughter of Sidna and Rodolfo Ubach.\\n\\nHer sister Athena Ubach is a therapist. Her father is of Puerto Rican descent as well as Mexican. Source The Mini Biography is from Wikipedia: http://en.wikipedia.org/wiki/Alanna_Ubach.", BirthDate = new DateTime(1975, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//g0GOzbSDAzhMxoCBNofiMxHIJJj.jpg", Name = "Alanna Ubach" },
