                        new { Id = 10409, Biography = "From Wikipedia, the free encyclopedia.\\n\\nShelley Alexis Duvall (born July 7, 1949) is an American film and television actress best known for her roles in 3 Women, Popeye, Thieves Like Us and The Shining.\\n\\nShe began her career in the 1970s films of Robert Altman, followed by roles in movies by Woody Allen, Stanley Kubrick, Terry Gilliam and Tim Burton. She is also an Emmy-nominated producer, responsible for Faerie Tale Theatre and other kid-friendly programming.\\n\\nDescription above from the Wikipedia article Shelley Duvall, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1949, 7, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iXBGoVOGCzBkz9klj7YJ83pkstf.jpg", Name = "Shelley Duvall" },
                        new { Id = 10410, Biography = "​From Wikipedia, the free encyclopedia\\n\\nDanny Lloyd (born January 1, 1973) is an American former child actor.\\n\\nLloyd's first and best-known role is that of Danny Torrance in Stanley Kubrick's The Shining, starring Jack Nicholson and Shelley Duvall.\\n\\nHe was selected for the role due to his ability to maintain his concentration for extended periods of time. In the DVD commentary by Garrett Brown and John Baxter, they state that Kubrick was able to film all of Lloyd's scenes without the six-year-old actor realizing he was in a horror movie.\\n\\nLloyd was also interviewed in The Making of The Shining (1980), filmed by Vivian Kubrick. Despite his performance in The Shining, little was subsequently heard or seen of Lloyd, other than an appearance as 'Young Liddy' in the 1982 made-for-TV movie, Will: The Autobiography of G. Gordon Liddy. Lloyd retired from acting and became a science teacher. In 2007, Lloyd became the professor of biology at a community college in Elizabethtown, Kentucky, and in December of the same year he became a teacher of sciences in Missouri.\\n\\nDescription above from the Wikipedia article Danny Lloyd, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1973, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ujXiZlSJVhrWR8FgUbuRmZHSdJp.jpg", Name = "Danny Lloyd" },
