                        new { Id = 10689, Biography = "From Wikipedia, the free encyclopedia\\n\\nRob Brown (born March 1, 1984) is an American actor. He is known for his roles in the films Finding Forrester (2000), Coach Carter (2005), Take the Lead (2006), The Express (2008), and currently stars in the HBO series Treme.\\n\\nDescription above from the Wikipedia article Rob Brown (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1984, 3, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//A0ZtklepPDhatTgldRFEX5Figvy.jpg", Name = "Rob Brown" },
