                        new { Id = 10730, Biography = "Rowan Sebastian Atkinson (born 6 January 1955) is an English comedian, screenwriter, and actor. He is most famous for his work on the satirical sketch comedy show Not The Nine O'Clock News, and the sitcoms Blackadder, Mr. Bean, and The Thin Blue Line. He has been listed in The Observer as one of the 50 funniest actors in British comedy, and amongst the top 50 comedy actors ever in a 2005 poll of fellow comedians.\\n\\nDescription above from the Wikipedia article Rowan Atkinson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1955, 1, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bzV8HPH9tZtJcvkYbhQb1zzR4fW.jpg", Name = "Rowan Atkinson" },
                        new { Id = 10734, Biography = "Kenneth Colley (born 7 December 1937) is an English actor. A long-time character actor, he came to wider prominence through his role as Admiral Piett in Star Wars Episode V: The Empire Strikes Back and Star Wars Episode VI: Return of the Jedi.\\n\\nColley was born in Manchester. He played Jesus (very briefly indeed) in The Life of Brian, having also appeared in the earlier Monty Python-related production Ripping Yarns episode \"The Testing of Eric Olthwaite\" alongside Michael Palin. As a Shakespearean actor he played the Duke of Vienna in the BBC Television Shakespeare production of Measure for Measure in 1979.\\n\\nColley also held an important role in the Clint Eastwood movie Firefox, where he played a Soviet Colonel tasked with the protection of the Firefox and its secrets.\\n\\nColley went on to play SS-Standartenführer Paul Blobel in the World War II drama War and Remembrance. His character was charged with hiding the evidence of the Holocaust, and putting dead victims through \"Economic Processing\".\\n\\nAccording to comments Terry Gilliam (who directed him in Jabberwocky and co-starred with him in Life of Brian) made in the DVD audio commentaries for both films, Colley is a terrible stutterer in real life. When he had a role in a film, however, he could recite the lines perfectly. Stuttering is a character trait, however, in his role as the \"Accordion Man\" in the 1978 BBC television drama, Pennies from Heaven. He has also recently starred in BBC's HolbyBlue as a drunk and violent father, grandfather and father-in-law.\\n\\nHe currently lives at Hythe in Kent.\\n\\nDescription above from the Wikipedia article Kenneth Colley, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1937, 12, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yNZF27tBauzUcg6Fw7M2xsRD8IC.jpg", Name = "Kenneth Colley" },
                        new { Id = 10744, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nGötz Otto (born 15 October 1967) is a German actor known for his very tall stature. He is 196 cm (6 ft 6 inches) tall and is often characterised by bleached blonde hair in his films.\\n\\nDescription above from the Wikipedia article Götz Otto, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1967, 10, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xl82gVjp9s2gSwx0QA52uRsM6Jt.jpg", Name = "Götz Otto" },
