                        new { Id = 10828, Biography = "Guillermo del Toro (born October 9, 1964) is a Mexican director, producer, screenwriter, novelist and designer. He is mostly known for his acclaimed films, Pan's Labyrinth and the Hellboy film franchise. He is a frequent collaborator with Ron Perlman, Federico Luppi and Doug Jones. His films draw heavily on sources as diverse as weird fiction, fantasy and war.", BirthDate = new DateTime(1964, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aBPPwt3jcFw2ridEkKTgchfPaic.jpg", Name = "Guillermo del Toro" },
