                        new { Id = 10930, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nIrvin Kershner (April 29, 1923 – November 27, 2010) was an American film director and occasional actor, best known for directing quirky, independent films early in his career, and then Star Wars Episode V: The Empire Strikes Back.\\n\\nDescription above from the Wikipedia article Irvin Kershner , licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1923, 4, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2010, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iSlCSA4WeR1eNt6T0yoL4HiO9XJ.jpg", Name = "Irvin Kershner" },
