                        new { Id = 10966, Biography = "Joanne \"Jo\" Rowling,  known as  J. K. Rowling and Robert Galbraith, is a British novelist, screenwriter and film producer best known as the author of the Harry Potter fantasy series.", BirthDate = new DateTime(1965, 7, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gZXoZrYxcn4d3XDcVcRE39RFZmL.jpg", Name = "J.K. Rowling" },
                        new { Id = 10967, Biography = "Steve Kloves, born in Austin, Texas, grew up in Sunnyvale, California, where he graduated from Fremont High School. He attended the University of California, Los Angeles but dropped out when he was not admitted into the film school in his third year. As an unpaidintern for a Hollywood agent, he gained attention for a screenplay he wrote called Swings. This led to a meeting where he successfully pitched Racing with the Moon (1984).  His first experience with professional screenwriting left him wanting more interaction with the actors so that the characters would stay true to his vision. Kloves wrote The Fabulous Baker Boys and also intended it to be his directorial debut. After years of trying to sell the project in Hollywood, the film finally got off the ground and was released in 1989. The Fabulous Baker Boys did reasonably well, but his next shot as writer/director for Flesh and Bone in 1993 fared poorly at the box office. Kloves then stopped writing for three years.  Realizing that he had to return to writing to support his family, he began adapting Michael Chabon's novel Wonder Boys into a screenplay. Kloves was offered the chance to direct but he declined, preferring to direct only his own original work. This was his first try at adapting another work to film. His screenplay was nominated for a Golden Globe and an Academy Award after the film's release in 2000.  Warner Bros. sent Kloves a list of novels that the company was considering to adapt as films. The listing included the first Harry Potter novel, which intrigued him despite his usual indifference to these catalogs. He went on to write the screenplays for the first four films in the series. After Michael Goldenberg wrote the screenplay for the fifth film, Kloves then returned to write the sixth, seventh and eighth installments.  As of 2011, Kloves is working on a film adaptation of Mark Haddon's novel The Curious Incident of the Dog in the Night-Time, which he will write and direct. He has also a draft written of the yet unproduced fantasy film Akira.", BirthDate = new DateTime(1960, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nhHzMwSiVse15WF1Qi7xfVBoo7A.jpg", Name = "Steve Kloves" },
                        new { Id = 10978, Biography = "Dame Margaret Natalie Smith, DBE (born 28 December 1934), better known as Maggie Smith, is an English film, stage, and television actress who made her stage debut in 1952 and is still performing after 59 years. She has won numerous awards for acting, both for the stage and for film, including five BAFTA Awards, two Academy Awards, two Golden Globes, two Emmy Awards, two Laurence Olivier Awards, two SAG Awards, and a Tony Award. Her critically acclaimed films include Othello (1965), The Prime of Miss Jean Brodie (1969), California Suite (1978), Clash of the Titans (1981), A Room with a View (1985), and Gosford Park (2001). She has also appeared in a number of widely-popular films, including Sister Act (1992) and as Professor Minerva McGonagall in the Harry Potter series. Smith has also appeared in the recent hit TV series \"Downton Abbey\" (2010-2011) as Violet, Dowager Countess of Grantham.", BirthDate = new DateTime(1934, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kkMNu2iqkBPkbjhNBmDaUX7FHr.jpg", Name = "Maggie Smith" },
                        new { Id = 10980, Biography = "Daniel Jacob Radcliffe (born 23 July 1989) is an English actor who rose to prominence playing the titular character in the Harry Potter film series. His work on the series has earned him several awards and more than £60 million.\\n\\nRadcliffe made his acting debut at age ten in BBC One's television movie David Copperfield (1999), followed by his film debut in 2001's The Tailor of Panama. Cast as Harry at the age of eleven, Radcliffe has starred in seven Harry Potter films since 2001, with the final installment releasing in July 2011. In 2007 Radcliffe began to branch out from the series, starring in the London and New York productions of the play Equus, and the 2011 Broadway revival of the musical How to Succeed in Business Without Really Trying. The Woman in Black (2012) will be his first film project following the final Harry Potter movie.\\n\\nRadcliffe has contributed to many charities, including Demelza House Children's Hospice and The Trevor Project. He has also made public service announcements for the latter. In 2011 the actor was awarded the Trevor Project's \"Hero Award\".\\n\\nDescription above from the Wikipedia article Daniel Radcliffe, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1989, 7, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kMSMa5tR43TLMR14ahU1neFVytz.jpg", Name = "Daniel Radcliffe" },
                        new { Id = 10988, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nGeraldine Margaret Agnew-Somerville (born 19 May 1967) is an Irish actress best known for her roles as Detective Sergeant Jane \"Panhandle\" Penhaligon in Cracker, and Lily Potter in the Harry Potter film series.\\n\\nDescription above from the Wikipedia article  Geraldine Margaret Agnew-Somerville , licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1967, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fgPi5cmDbJbMmQIA7AE901jhB3x.jpg", Name = "Geraldine Somerville" },
                        new { Id = 10989, Biography = "From Wikipedia, the free encyclopedia\\n\\nRupert Alexander Grint (born 24 August 1988) is an English actor, who rose to prominence playing Ron Weasley, one of the three main characters in the Harry Potter film series. Grint was cast as Ron at the age of 11, having previously acted only in school plays and at his local theatre group. From 2001 to 2010, he starred in eight Harry Potter movies alongside Daniel Radcliffe and Emma Watson.\\n\\nBeginning in 2002, Grint began to work outside of the Harry Potter franchise, taking on a co-leading role in Thunderpants. He has had starring roles in Driving Lessons, a dramedy released in 2006, and Cherrybomb, a small budgeted drama released in 2010. Grint co-starred with Bill Nighy and Emily Blunt in Wild Target, a comedy. His first project following the end of the Harry Potter series will be Comrade, a 2012 anti-war release in which he stars as the main role.\\n\\nDescription above from the Wikipedia article Rupert Grint, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1988, 8, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dFVVJufva2zUSP6WS0pFfR7g8uN.jpg", Name = "Rupert Grint" },
                        new { Id = 10990, Biography = "Emma Watson (born 15 April 1990) is an English actress who rose to prominence playing Hermione Granger, one of three starring roles in the Harry Potter film series. Watson was cast as Hermione at the age of nine, having previously acted only in school plays. From 2001 to 2011, she starred in eight Harry Potter films alongside Daniel Radcliffe and Rupert Grint. Watson's work on the Harry Potter series has earned her several awards and more than £10 million.\\n\\nShe made her modelling debut for Burberry's Autumn/Winter campaign in 2009. In 2007, Watson announced her involvement in two non-Harry Potter productions: the television adaptation of the novel Ballet Shoes and an animated film, The Tale of Despereaux. Ballet Shoes was broadcast on 26 December 2007 to an audience of 5.2 million, and The Tale of Despereaux, based on the novel by Kate DiCamillo, was released in 2008 and grossed over US $70 million in worldwide sales. In 2012, she starred in Stephen Chbosky's film adaptation of The Perks of Being a Wallflower, and was cast in the role of Ila in Darren Aronofsky's biblical epic Noah.\\n\\nDescription above from the Wikipedia article Emma Watson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1990, 4, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//s77hUycSJ4x8RJWHDC9WPgotgxE.jpg", Name = "Emma Watson" },
                        new { Id = 10991, Biography = "Bonnie Francesca Wright was born on February 17, 1991 to jewelers Gary Wright and Sheila Teague. Her debut performance was in Harry Potter and the Philosopher's Stone (2001) as Ron Weasley's little sister Ginny Weasley. Bonnie tried out for the film due to her older brother Lewis mentioned she reminded him of Ginny. Her role in the first film was a small cameo like role as Ginny, having bigger part in the second film Harry Potter and the Chamber of Secrets (2002). After shooting the first Potter film, in 2002 Bonnie did the Hallmark television film Stranded (2002) (TV) playing Young Sarah Robinson. Then in 2004 after doing the Harry Potter and the Prisoner of Azkaban (2004) Bonnie was cast in Agatha Christie: A Life in Pictures (2004) (TV) , a BBC TV film as Young Agatha. Then Bonnie was back as Ginny Weasley for Harry Potter and the Goblet of Fire (2005), Harry Potter and the Order of the Phoenix (2007) and for Harry Potter and the Half-Blood Prince (2009) where her role turned supporting as Harry's love interest. In 2007 she guessed voiced for Disney's The Replacements (TV Series 2006-) London Calling (#2.11) as Vanessa. Also that time she voiced Ginny for Harry Potter and the Order of the Phoenix (2007) (VG) as well for Harry Potter and the Half-Blood Prince (2009) (VG) in 2009. While shooting for Harry Potter and the Deathly Hallows: Part 1 (2010), Bonnie was cast as Mia for Geography of the Hapless Heart (2013) a feature length film shot in five international locations about the complexity of love. Bonnie's segment was shot in December 2009 in London. Also during that time and shooting for Harry Potter and the Deathly Hallows: Part 2 (2011) Bonnie was attending London College of Communication to study film. In 2011 Bonnie starred in The Philosophers (2013) with James D'Arcy (I) , Daryl Sabara and with Harry Potter co-star Freddie Stroma. Film to be out in 2012. Bonnie has also written and directed a short film for school called Separate We Come, Separate We Go starring Potter co-star David Thewlis IMDb Mini Biography By: Kgose31788", BirthDate = new DateTime(1991, 2, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1QzCiWSbESJVANYGHA1RwqZpzD0.jpg", Name = "Bonnie Wright" },
                        new { Id = 10992, Biography = "", BirthDate = new DateTime(1983, 11, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3HEK2yr0YOEE7A5qf0SGs3VhUNz.jpg", Name = "Chris Rankin" },
                        new { Id = 10993, Biography = "​From Wikipedia, the free encyclopedia\\n\\nThomas Andrew \"Tom\" Felton (born 22 September 1987) is a British actor and musician. He is best known for playing the role of Draco Malfoy in the Harry Potter film series, the movie adaptations of the best-selling Harry Potter fantasy novels by author J. K. Rowling, for which he auditioned at age twelve. Felton started filming in commercials when he was eight years old and in films at the age of ten, appearing in The Borrowers and Anna and the King. After being cast as Draco Malfoy he has subsequently appeared in all eight Harry Potter films, from 2001 to 2011, and finished filming the last two. A fishing aficionado, he helped form the World Junior Carp Tournament, a \"family-friendly\" fishing tournament. Felton's portrayal of Draco Malfoy in Harry Potter and the Half-Blood Prince won him the MTV Movie Award for Best Villain in 2010.\\n\\nDescription above from the Wikipedia article Tom Felton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1987, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1lzM9lcwuZynxX3WEfzJqAAxVag.jpg", Name = "Tom Felton" },
                        new { Id = 11065, Biography = "From Wikipedia, the free encyclopedia.\\n\\nAllen Wilford Brimley (born September 27, 1934) is an American actor. He has appeared in such films as The China Syndrome, Cocoon, The Thing and The Firm. Brimley has also done television commercials, including ads for Quaker Oats and Liberty Medical\\n\\nDescription above from the Wikipedia article Wilford Brimley, licensed under CC-BY-SA, full list of contributors on Wikipedia​", BirthDate = new DateTime(1934, 9, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//t0TLF4qXgXiroirvjVWWP88B0GD.jpg", Name = "Wilford Brimley" },
                        new { Id = 11074, Biography = "From Wikipedia, the free encyclopedia.\\n\\nKathy Ann Najimy (born February 6, 1957) is an American actress, most notable as Olive Massery on the television series Veronica's Closet, Sister Mary Patrick in Sister Act and the voice of Peggy Hill on the animated television series King of the Hill. Prior to her film work, she was best known for two Off Broadway shows with Mo Gaffney working as the duo Kathy and Mo. One of the shows became an HBO comedy special and garnered Najimy her first nationwide fan base.\\n\\nDescription above from the Wikipedia article Kathy Najimy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1957, 2, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eFFh5QU9ErNKls7WfyG8VHEc2MY.jpg", Name = "Kathy Najimy" },
                        new { Id = 11092, Biography = "Simon David Kinberg (born August 2, 1973) is a British-born American screenwriter and film producer. He is best known for his work on the X-Men film franchise, and has also written such films as Mr. &amp; Mrs. Smith and Sherlock Holmes. He has served as a producer on others including Cinderella, and The Martian, for which he was nominated for an Academy Award for Best Picture. His production company is Genre Films (usually credited as Kinberg Genre),[citation needed] which has a first-look deal with 20th Century Fox.", BirthDate = new DateTime(1973, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yXlDADc2rLEMLTFZAw9irqXMq2J.jpg", Name = "Simon Kinberg" },
                        new { Id = 11115, Biography = "​From Wikipedia, the free encyclopedia\\n\\nPeter Szymon Serafinowicz (born 10 July 1972) is an English actor, comedian, writer, composer, voice artist and occasional director.\\n\\nDescription above from the Wikipedia article Peter Serafinowicz, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1972, 7, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6bWPwi6HLej1gGObTjIzyLcxsYS.jpg", Name = "Peter Serafinowicz" },
                        new { Id = 11159, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRichard Anthony \"Cheech\" Marin (born July 13, 1946) is an American comedian and actor who gained recognition as part of the comedy act Cheech & Chong during the 1970s and early 1980s, and as Don Johnson's partner, Insp. Joe Dominguez on Nash Bridges. He has also voiced characters in several Disney movies, including Oliver and Company, The Lion King, Cars and its 2011 sequel. The thick Mexican accent he often uses is a part of a comic persona, rather than a natural accent.\\n\\nDescription above from the Wikipedia article Cheech Marin, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1946, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//efuXbXg7JpORy5hPDU7Zityq3k3.jpg", Name = "Cheech Marin" },
                        new { Id = 11161, Biography = "From Wikipedia, the free encyclopedia.  Thomas Vincent \"Tom\" Savini (born November 3, 1946) is an American actor, stuntman, director, award-winning special effects and makeup artist.  He is known for his work on the Living Dead films directed by George A. Romero, as well as Creepshow, The Burning, Friday the 13th, The Prowler, and Maniac. He directed the 1990 remake of Night of the Living Dead. Though officially retired from special effects, he has continued to direct, produce and star in several movies. Savini has been known to refer movie make-up effects projects to graduates of his school. He has appeared in films such as Dawn of the Dead (and its remake), From Dusk till Dawn, Grindhouse, and Machete.\\n\\nDescription above from the Wikipedia article  Tom Savini, licensed under CC-BY-SA, full list of contributors on Wikipedia.   ", BirthDate = new DateTime(1946, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yOZPKC3TXlxkvx4HoDrhq1PgXrU.jpg", Name = "Tom Savini" },
                        new { Id = 11162, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8een5rR4vQZaUGI9sbsrerxQfqY.jpg", Name = "Brenda Hillhouse" },
                        new { Id = 11179, Biography = "S​ean Biggerstaff was born on March 15, 1983 to a fireman and a community education worker. He joined a local drama group and he acted as \"Augustus Gloop\" in \"Charlie and the Chocolate Factory\". After that, for six years, he joined the Scottish Youth Theatre. It was there he got his big break when Alan Rickman asked him be Tom in The Winter Guest (1997). That appearance led to the role of Oliver Wood in Harry Potter and the Sorcerer's Stone (2001). He will continue the role of Oliver in the next Harry Potter movie,Harry Potter and the Chamber of Secrets (2002).", BirthDate = new DateTime(1983, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//raDTQ6gEo9XZG3O12dGKkGnP0BS.jpg", Name = "Sean Biggerstaff" },
                        new { Id = 11180, Biography = "David Bradley is an English character actor. He has recently become known for playing the caretaker of Hogwarts, Argus Filch, in the Harry Potter series of films.\\n\\nBradley was born in York, England. He became an actor in 1971, first appearing on television that year in the successful comedy Nearest and Dearest playing a police officer. He was awarded a Olivier Award in 1991 for his supporting actor role in King Lear at the Royal National Theatre.\\n\\nBradley appeared in Nicholas Nickleby (2002) and had a small role in the 2007 comedy film Hot Fuzz as a farmer who illegally hoarded weapons, including a sea mine which later proves important to the story.", BirthDate = new DateTime(1942, 4, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5BPFRv4io7U1zxkYHtKaE9a8FDD.jpg", Name = "David Bradley" },
                        new { Id = 11184, Biography = "From Wikipedia, the free encyclopedia. Warwick Ashley Davis (born 3 February 1970) is an English actor. Davis is known for playing the title characters in Willow and the Leprechaun series of films; other prominent roles include Wicket W. Warrick in Star Wars Episode VI: Return of the Jedi, Professor Filius Flitwick and Griphook in the Harry Potter movies, Marvin the Paranoid Android in The Hitchhiker's Guide to the Galaxy, as well as Nikabrik in the Walden Media version of Prince Caspian and Reepicheep in the BBC television versions of Prince Caspian and Voyage of the Dawn Treader and Mr Glimfeather the owl in The Silver Chair. Davis has a condition resulting in dwarfism, and stands at 3 ft 6 in (1.07 m) tall.\\n\\nDescription above from the Wikipedia article Warwick Davis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1970, 2, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4LjgmjD9nKOgL3gGRhIS5EkI0a.jpg", Name = "Warwick Davis" },
                        new { Id = 11207, Biography = "​David Thewlis (born 20 March 1963) is an English film, television and stage character actor, as well as a writer.", BirthDate = new DateTime(1963, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lWCGcTKvr4QUi8MvFBleMw8xY8.jpg", Name = "David Thewlis" },
                        new { Id = 11212, Biography = "Joshua was born in Hampton, England in March, 1987 to Martin and Jessica Herdman. He is the youngest of four boys. He started acting when he was about seven. His father is an actor and got him an agent. He got his big break when he auditioned for \"Harry Potter and the Sorcerer's Stone\" and got the part of Gregory Goyle. In his spare time, he enjoys going back home to Hampton, spending time with friends and family, reading and writing. IMDb Mini Biography By: adam_mar", BirthDate = new DateTime(1987, 9, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hebwDG5XsbfMaEaWJ0X6OrvlXwW.jpg", Name = "Josh Herdman" },
                        new { Id = 11218, Biography = "Alfonso Cuarón Orozco is an Academy Award-winning Mexican film director, screenwriter and film producer, best known for Gravity, Children of Men, Y Tu Mamá También, Harry Potter and the Prisoner of Azkaban, and A Little Princess.\\n\\nCuarón was born in México City. He is the son of Alfredo Cuarón, a nuclear physicist who worked for the United Nations' International Atomic Energy Agency for many years.\\n\\nHe studied Philosophy at the National Autonomous University of Mexico (UNAM) and filmmaking at CUEC (Centro Universitario de Estudios Cinematográficos), a faculty of the same University. There, he met director Carlos Marcovich and cinematographer Emmanuel Lubezki, and they made what would be his first short film, Vengeance is mine. The controversy caused by the fact that the film was shot in English was the reason he was expelled from the Film School.\\n\\nHe began working in television in Mexico, first as a technician and then as a director. Cuarón's television work led to assignments as an assistant director for several Latin American film productions including Gaby: A True Story and Romero, and in 1991, he landed his first big-screen directorial assignment.\\n\\nIn 1995, Cuarón released his first feature film produced in the United States, A Little Princess, an adaptation of Frances Hodgson Burnett's classic novel.\\n\\nDuring his time studying in CUEC (Centro Universitario de Estudios Cinematográficos) he met Mariana Elizondo, and with her he has his first son, Jonás Cuarón born 1981, in Mexico City, Distrito Federal, Mexico.", BirthDate = new DateTime(1961, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3zYO8I24q4q3cJNohCg63V88uWo.jpg", Name = "Alfonso Cuarón" },
                        new { Id = 11266, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJames McTeigue (born 29 December 1967) is an Australian film director. He has been an assistant director on many films, including No Escape (1994), the Matrix trilogy (1999–2003) and Star Wars Episode II: Attack of the Clones (2002), and made his directorial debut in the 2006 film V for Vendetta.\\n\\nBorn on Sydney's North Shore, he grew up in Collaroy Plateau, a suburb on the Northern Beaches of Sydney, Australia. McTeigue attended Marist Brothers North Sydney then Cromer High School, in Cromer, a northern beach suburb of Sydney. He completed tertiary study in film at Charles Sturt University, Wagga Wagga Campus.\\n\\nDescription above from the Wikipedia article James McTeigue, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1967, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//amtLeEkP6UoB41r48vX8mew9MHJ.jpg", Name = "James McTeigue" },
                        new { Id = 11291, Biography = "Clémence Poésy is a French actress and model. Since starting on the stage as a child, Poésy had dramatic education, and has been active on both film and television since 1999, including some English-language productions. Outside of her home country, she is perhaps best known for playing Fleur Delacour in Harry Potter and the Goblet of Fire and Chloë in In Bruges.", BirthDate = new DateTime(1982, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tkPX3tPrIJHJaLQQiWQVOPcsW3I.jpg", Name = "Clémence Poésy" },
                        new { Id = 11295, Biography = "", Name = "Fiona Weir" },
                        new { Id = 11343, Biography = "David Yates (born 30 November 1963) is an English director of film and television, best known for directing the final four films in the Harry Potter franchise.\\n\\nHis first two Potter films (Order of the Phoenix and Half-Blood Prince) became the highest-grossing entries in the series after the first instalment, which was later surpassed by Yates' Deathly Hallows, making him the most commercially successful British director in recent years. He is the only director in the series to be honoured with a Best Director accolade for his work on Harry Potter. He achieved international attention for his award-winning short films early in his career, which led to him becoming a prolific television director with credits including the BBC costume drama The Way We Live Now, the acclaimed political thriller State of Play and the BAFTA-lauded two-part drama Sex Traffic. Due to the success of these dramas and subsequent projects, Yates is considered as one of Britain's most celebrated directors of film and television.\\n\\nThroughout his works, Yates uses hand-held cameras to visually provoke the subject matter; the technique is noted as one of his directorial trademarks. Yates is married to Yvonne Walcott, who is the aunt of Arsenal football player Theo Walcott.\\n\\nDescription above from the Wikipedia article David Yates, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1963, 11, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sCjOa6Yt5o4YeyB7t8LZwNVvtSw.jpg", Name = "David Yates" },
                        new { Id = 11345, Biography = "", Name = "Mark Day" },
                        new { Id = 11355, Biography = "Jason Isaacs is an English actor born in Liverpool, who is most well known for his performance as the villain Lucius Malfoy in the Harry Potter films, the brutal Colonel William Tavington in The Patriot and as lifelong criminal Michael Caffee in the internationally-broadcast American television series Brotherhood.\\n\\nJason Isaacs was born on 6 June 1963, in Liverpool, England, to Jewish parents who later emigrated to Israel. He spent his earliest childhood years in an \"insular\" and \"closely-knit\" Jewish community of Liverpudlians, of which his Eastern European great-grandparents were founder-members.\\n\\nWhen he was 11, he moved with his family to Northwest London. He describes his childhood as \"preparation\" for portraying the \"unattractive\", villainous characters whom he has most often played.", BirthDate = new DateTime(1963, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1GtGhAJz1JloqHARqc2xMsq5rG4.jpg", Name = "Jason Isaacs" },
                        new { Id = 11367, Biography = "Bradley Whitford (born October 10, 1959) is an American film and television actor. He is best known for his roles as Deputy White House Chief of Staff Josh Lyman on the NBC television drama The West Wing, as Danny Tripp on Studio 60 on the Sunset Strip, as Dan Stark in the Fox police buddy-comedy The Good Guys, as Red John in the CBS series The Mentalist, and as antagonist Eric Gordon in the film Billy Madison.\\n\\nWhitford has been nominated for three consecutive Emmy Awards from 2001-2003 for \"Outstanding Supporting Actor in a Drama Series\" for his role on The West Wing, winning the award in 2001. This role has also garnered him three consecutive Golden Globe Award nominations for \"Best Performance by an Actor in a Supporting Role\".\\n\\nDescription above from the Wikipedia article Bradley Whitford, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1959, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//66brylvzWLg94TRMd6QFrVyMOei.jpg", Name = "Bradley Whitford" },
                        new { Id = 11370, Biography = "Elton Hercules John (born Reginald Kenneth Dwight) is an English singer, pianist and composer.\\n\\nHe has made appearances in numerous films such as \"Born to Boogie\" (1972) with Marc Bolan and Ringo Starr;  \"Tommy\" (1975) as the Pinball Wizard; \"Spice World\" (1997); \"The Country Bears\" (2002). And in the autobiographies \"Elton John: Tantrums &amp; Tiaras\" (1997) and \"Elton John: Me, Myself &amp; I\" (2007).", BirthDate = new DateTime(1947, 3, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bFQvidUsrWfWo4ZI7oZgTnB8Zb6.jpg", Name = "Elton John" },
                        new { Id = 11375, Biography = "", Name = "Anne D. McCulley" },
                        new { Id = 11382, Biography = "​From Wikipedia, the free encyclopedia\\n\\nRyuichi Sakamoto (born January 17, 1952) is an Academy Award-winning Japanese musician, composer, record producer and actor, based in New York and Tokyo. He plays keyboards in the influential Japanese electropop band Yellow Magic Orchestra. His 1999 musical composition \"Energy Flow\", also known as the alternative title of the single disc Ura BTTB, is the first number-one instrumental single in Japan's Oricon charts history.\\n\\nDescription above from the Wikipedia article Ryuichi Sakamoto, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1952, 1, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sznCz9OIUYxBgNhn7hsd9LK5jsN.jpg", Name = "Ryuichi Sakamoto" },
                        new { Id = 11405, Biography = "David A. Permut (born March 23, 1954) is an American television and movie producer. In 1979 he was the producer of Richard Pryor: Live in Concert (the first theatrical live comedy concert), and Dragnet (1987), an early example of remaking a television series into a motion picture. He is owner and president of Permut Presentations, Inc. of Los Angeles. Since 1999 he has maintained a second home in Palm Springs, California.\\n\\nPermut's credits include The Marrying Man (1991) written by Neil Simon, Captain Ron (1992) starring Kurt Russell, Eddie (1996) starring Whoopi Goldberg, Double Take (2001) starring Orlando Jones and Eddie Griffin, and Dysfunktional Family (2003) also starring Griffin. In addition, Permut conceived the idea behind the hit comedy spoof Farce of the Penguins (2006) with writer and director Bob Saget. Other credits from Permut include Charlie Bartlett starring Robert Downey Jr. and Anton Yelchin, Blind Date directed by Blake Edwards and starring Kim Basinger and Bruce Willis in his big-screen debut, and Face/Off starring John Travolta and Nicolas Cage.\\n\\nPermut produced Youth in Revolt (2009) with Dimension Films; the film stars Michael Cera (Superbad, Juno) along with a cast that includes Steve Buscemi, Ray Liotta, Jean Smart, Justin Long, Fred Willard, Mary Kay Place and M. Emmet Walsh. Youth in Revolt is based on the classic cult-novel by C.D. Payne.\\n\\nIn 2012 Permut produced the film \"Struck By Lightning\", which is written by and starring Chris Colfer (Glee). The movie, directed by Brian Dannelly (Saved), will showcase Sarah Hyland (Modern Family), Christina Hendricks (Mad Men), Dermot Mulroney, Allison Janney, Rebel Wilson (Bridesmaids) and Allie Grant (Weeds).\\n\\nIn 2013 Permut began production of the film 'Match starring Patrick Stewart, Carla Gugino and Matthew Lillard which premiered at the 2014 Tribeca Film Festival and is set for a theatrical release in the fall of 2014. He is also producing Mel Gibson's film Hacksaw Ridge.\\n\\n*Source:* **Wikipedia**", BirthDate = new DateTime(1954, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7pAjvPIcB8a6aGefNJqMMvqKOKU.jpg", Name = "David Permut" },
                        new { Id = 11472, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nIrwin Winkler (born May 25, 1931) is an American film producer and director. He is the producer or director of 50 major motion pictures, dating back to 1967's Double Trouble, starring Elvis Presley. The fourth film he produced, They Shoot Horses, Don't They? (1969), starring Jane Fonda, was nominated for nine Academy Awards. In 1976, he won an Oscar for Best Picture for Rocky. As a producer, he has been nominated for Best Picture for three other films: Raging Bull, The Right Stuff, and Goodfellas.\\n\\nDescription above from the Wikipedia article Irwin Winkler, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1931, 5, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//chJjLXD7PlFhuyeverNCgemIAAC.jpg", Name = "Irwin Winkler" },
                        new { Id = 11480, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nFrank Sivero (born January 6, 1952) is an American character actor, perhaps best known for playing the roles of Genco Abbandando in Mario Puzo's and Francis Ford Coppola's The Godfather Part II and Frankie Carbone (based on Angelo Sepe) in Martin Scorsese's Goodfellas. Sivero was born Francesco LoGiudice in Siculiana, Sicily, Italy, and raised in Brooklyn, New York. He can be seen as an extra in The Godfather as one of the witnesses to Sonny Corleone's brutal beating of his brother-in-law, Carlo. Director Martin Scorsese cast him as Frankie Carbone after seeing his performance in The Godfather: Part II. He also appeared in the The Wedding Singer with Adam Sandler.\\n\\nDescription above from the Wikipedia article Frank Sivero,  licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1952, 1, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tLogWMv98IE1S3P7RosPSaKs891.jpg", Name = "Frank Sivero" },
                        new { Id = 11505, Biography = "John Hughes (February 18, 1950 – August 6, 2009) was an American film director, producer and screenwriter. He directed and scripted some of the most successful films of the 1980s and 1990s, including National Lampoon's Vacation, Ferris Bueller's Day Off, Weird Science, The Breakfast Club, Some Kind of Wonderful, Sixteen Candles, Pretty in Pink; Planes, Trains and Automobiles; Uncle Buck, Career Opportunities, 101 Dalmatians, Home Alone, and its sequels, Home Alone 2 and Home Alone 3.", BirthDate = new DateTime(1950, 2, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2009, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dFVgYYRY1R0aUCYvfEah00Iwzlt.jpg", Name = "John Hughes" },
