                        new { Id = 11703, Biography = "Kerry Washington is an American actress. She is known for her roles as Ray Charles's wife, Della Bea Robinson, in the film Ray (2004), as Idi Amin's wife Kay in The Last King of Scotland, and as Alicia Masters, love interest of Ben Grimm/The Thing in the live-action Fantastic Four films of 2005 and 2007. She has also starred in the critically acclaimed independent films Our Song and The Dead Girl, and is the lead actress in the 2012 ABC drama Scandal, a Shonda Rhimes series in which Washington plays Olivia Pope, a former crisis management expert to the President. Her most recent role was as Broomhilda von Schaft, Django's wife, in Quentin Tarantino's film Django Unchained.", BirthDate = new DateTime(1977, 1, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yufNCkn9YuYei9ThzSgApczUe4K.jpg", Name = "Kerry Washington" },
                        new { Id = 11713, Biography = "", Name = "W. Steven Graham" },
                        new { Id = 11770, Biography = "John Howard Carpenter (born January 16, 1948) is an American film director, screenwriter, producer, editor, composer, and occasional actor. Although Carpenter has worked in numerous film genres in his four-decade career, his name is most commonly associated with horror and science fiction.\\n\\nMost films in Carpenter's career were initially commercial and critical failures, with the notable exceptions of Halloween (1978), The Fog (1980), Escape from New York (1981), and Starman (1984). However, many of Carpenter's films from the 1970s and the 1980s have come to be viewed as cult classics, and he has been acknowledged as an influential filmmaker. Cult classics that Carpenter directed include: Dark Star (1974), Assault on Precinct 13 (1976), The Thing (1982), Christine (1983), Big Trouble in Little China (1986), Prince of Darkness (1987), They Live (1988) and In the Mouth of Madness (1995).\\n\\nHis films are characterized by minimalist lighting and photography, static cameras, use of steadicam, and distinctive synthesized scores. Carpenter is also notable for having composed or co-composed most of the music of his films; some of them are now considered cult as well, with the main theme of Halloween being considered a part of popular culture. His music is generally synthesized with accompaniment from piano and atmospherics. He released his first studio album Lost Themes in 2015, and also won a Saturn Award for Best Music for Vampires (1998).\\n\\nCarpenter is an outspoken proponent of widescreen filming, and all of his theatrical movies (with the exception of Dark Star and The Ward) were filmed anamorphic with a 2.35:1 or greater aspect ratio. The Ward was shot in Super 35, the first time Carpenter has ever used that system. Carpenter has stated he feels that the 35mm Panavision anamorphic format is \"the best movie system there is\", preferring it over both digital and 3D film.\\n\\nMany of Carpenter's films have been re-released on DVD as special editions with numerous bonus features.  \\n\\nCarpenter has been the subject of the documentary film John Carpenter: The Man and His Movies, and American Cinematheque's 2002 retrospective of his films. Moreover, in 2006, the United States Library of Congress deemed Halloween to be \"culturally significant\" and selected it for preservation in the National Film Registry.\\n\\nIn 2010, writer and actor Mark Gatiss interviewed Carpenter about his career and films for his BBC documentary series A History of Horror. Carpenter appears in all three episodes of the series. He was also interviewed by Robert Rodriguez for his The Director's Chair series on El Rey Network.\\n\\nMany filmmakers have been influenced by Carpenter, including James Cameron, Quentin Tarantino ((The Hateful Eight was heavily influenced by The Thing), Guillermo del Toro, Robert Rodriguez, Edgar Wright, Danny Boyle, Nicolas Winding Refn, Bong Joon-ho, among others. The video game Dead Space 3 is said to be influenced by Carpenter's The Thing, The Fog and Halloween, and Carpenter has stated that he would be enthusiastic to adapt that series into a feature film.\\n\\nDescription above from the Wikipedia article John Carpenter, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1948, 1, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jGprVNNSmlJzLNhm2tcdmjquLyL.jpg", Name = "John Carpenter" },
                        new { Id = 11799, Biography = "", Name = "Gary M. Zuckerbrod" },
                        new { Id = 11800, Biography = "", Name = "Charles Collum" },
                        new { Id = 11801, Biography = "", Name = "Sandy Reynolds-Wasco" },
                        new { Id = 11802, Biography = "", Name = "Betsy Heimann" },
                        new { Id = 11803, Biography = "Peter Greene (born Peter Green; October 8, 1965) is an American character actor.\\n\\nA native of Montclair, New Jersey, Greene did not pursue a career in acting until his mid 20s. He initially landed several roles in cinema and television in the early 1990s.\\n\\nGreene's breakthrough came in 1994-1995 with a roles in Pulp Fiction, The Mask, Clean, Shaven, and The Usual Suspects. Greene is possibly best remembered for his role in Pulp Fiction, as Zed who rapes Marsellus Wallace. The Mask saw him play the villainous Dorian Tyrell opposite Jim Carrey and Cameron Diaz. Greene's most accomplished role was that of schizophrenic Peter Winter in Clean, Shaven. The Usual Suspects saw him play the small but memorable character, Redfoot. Greene often plays villains such as in Under Siege 2: Dark Territory, Training Day (as a corrupt narcotics officer) and martial arts/crime film Fist of the Warrior (opposite Ho-Sung Pak, Roger Guenveur Smith and Sherilyn Fenn).\\n\\nHe worked with one director, Jordan Alan, twice. Once on the film Kiss and Tell, a dark comic turn for the actor and then again 4 years later in The Gentleman Bandit (aka Gentleman B). After Greene's arrests in 1998 for drug related crimes, Alan had to put the actor through rehab to get him through the second film and eventually, after coming upon Greene doing heroine with Mike Starr, he was forced to replace Greene's voice because of the vocal problems caused by drugs. Despite these problems, Mr. Alan vouched for Greene to producer Tobe Jaffe for the movie Blue Streak.\\n\\nHe played Martin Lawrence's nemesis in Blue Streak.\\n\\nGreene has continued to mostly work as a character actor. He appeared in the short-lived television drama The Black Donnellys. He also appeared as a policeman in Prodigy of Mobb Deep's video for \"A,B,C's\", as well as the focal character in House of Pain's video for \"Fed Up\".\\n\\nGreene recently appeared in the opening scene of the premier of the new FX series Justified.\\n\\nDescription above from the Wikipedia article Peter Greene, licensed under CC-BY-SA, full list of contributors on Wikipedia​", BirthDate = new DateTime(1965, 10, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zCHUxWj7BZ3Uzmkbq9FPpOicniQ.jpg", Name = "Peter Greene" },
                        new { Id = 11804, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDuane Whitaker  (born June 23, 1959) is an American actor.\\n\\nDuane Whitaker is probably best known for his role in Quentin Tarantino's popular 1994 film Pulp Fiction as Maynard, the sadistic pawn shop owner. He wrote and portrayed the title role in Eddie Presley (based on his own successful stage play). Whitaker also wrote, directed and appeared in Together and Alone.\\n\\nOther notable roles include; a racist cop in Tales from the Hood, the bouncer Roadrash in Hobgoblins, Boss Man in Feast, The Sheriff in Trailer Park of Terror, Luther in From Dusk Till Dawn 2: Texas Blood Money (which he also co-wrote), Buddy in Dead Letters (film), Winslow in Broke Sky, Mickey in Cordoba Nights and Dr. Bankhead in The Devil's Rejects.\\n\\nMost recently Duane has appeared in the feature films Albino Farm and Dozers and on TV in the Cold Case episode \"The Brush Man\" and appears in the new Rob Zombie film Halloween II. Whitaker has also written numerous screenplays including \"Stripteaser.\"\\n\\nOn March 31, 2010, American Cinematheque hosted a screening of Eddie Presley and \"Together and Alone\" at Grauman's Egyptian Theatre in Los Angeles.\\n\\nDuane is a graduate of Monterey High School in Lubbock, Texas.\\n\\nDescription above from the Wikipedia article Duane Whitaker, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1959, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cFSmuGjUNonH683dmvx0mZ2Uots.jpg", Name = "Duane Whitaker" },
