                        new { Id = 12074, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nJohn Arthur Lithgow (born October 19, 1945) is an American actor, musician, and author. Presently, he is involved with a wide range of media projects, including stage, television, film, and radio. He also has written and published several books of poetry and children's literature. He appeared in the films The World According to Garp (1982) and Terms of Endearment (1983), receiving an Academy Award nomination for Best Actor in a Supporting Role for each. Lithgow is known for his roles as the Reverend Shaw Moore in Footloose, Dick Solomon on the NBC sitcom 3rd Rock from the Sun, the voice of Lord Farquaad in Shrek, and The Trinity Killer on Showtime's Dexter for which he won Golden Globe and Emmy awards. On the stage, he appeared in the musical adaptation of Sweet Smell of Success, winning the Tony Award for Best Leading Actor in a Musical. He again appeared in a musical, Dirty Rotten Scoundrels, again receiving the Tony nomination for Best Leading Actor in a Musical. He has also recorded music, such as the 1999 album of children's music, Singin' in the Bathtub, and has written poetry and short stories for children, such as Marsupial Sue.\\n\\nDescription above from the Wikipedia article John Lithgow, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1945, 10, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uquz3dZ0fs0lAK57lCXwxaslVkb.jpg", Name = "John Lithgow" },
                        new { Id = 12077, Biography = "James Jonah \"Jim\" Cummings (born November 3, 1952) is an American voice actor who has appeared in almost 100 roles.\\n\\nDescription above from the Wikipedia article Jim Cummings, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1952, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//i9frXvIJsGtoFikBEFVqE7uN8Bq.jpg", Name = "Jim Cummings" },
                        new { Id = 12132, Biography = "Michael Rooker (born April 6, 1955) is an American actor.\\n\\nRooker, who has eight brothers and sisters, was born in Jasper, Alabama and studied at the Goodman School of Drama in Chicago, where he moved to be with his mother and siblings at the age of 13, after his parents divorced.\\n\\nDescription above from the Wikipedia article Michael Rooker, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1955, 4, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bvmf7TIjCyRPrBNrmZ5qyePTL5y.jpg", Name = "Michael Rooker" },
                        new { Id = 12133, Biography = "Laurie Metcalf is an American stage, film and television actress, best known for playing Jackie Harris, the title character's sister on the television sitcom \"Roseanne\", as well as for voicing Ms. Davis in the \"Toy Story\" animation movie franchise. She's a three-time Emmy award winner and was nominated for three Golden Globe awards, a Tony Award, and a Screen Actors Guild Award.", BirthDate = new DateTime(1955, 6, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oHhTbuv9eNJV4YlgizhCkZsPV0N.jpg", Name = "Laurie Metcalf" },
                        new { Id = 12206, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nRichard Roxburgh (born 23 January 1962) is an Australian AFI Award-winning actor who has starred in many Australian films and has appeared in supporting roles in a number of Hollywood productions, usually as villains.\\n\\nDescription above from the Wikipedia article Richard Roxburgh, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1962, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//hN1bWQ0Qe0DrA33Ch6TLKuIWs0.jpg", Name = "Richard Roxburgh" },
                        new { Id = 12248, Biography = "Sir Alec Guinness, CH, CBE (2 April 1914 – 5 August 2000) was an English actor. He was featured in several of the Ealing Comedies, including Kind Hearts and Coronets in which he played eight different characters. He later won the Academy Award for Best Actor for his role as Colonel Nicholson in The Bridge on the River Kwai. His is known for playing Obi-Wan Kenobi in the original Star Wars trilogy. He also played Prince Feisal in Lawrence of Arabia and George Smiley in the TV adaptation of Tinker, Tailor, Soldier, Spy.\\n\\nDescription above from the Wikipedia article Alec Guinness, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1914, 4, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2000, 8, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nv3ppxgUQJytFGXZNde4f9ZlshB.jpg", Name = "Alec Guinness" },
