                        new { Id = 12401, Biography = "From Wikipedia, the free encyclopedia.\\n\\nGary Kurtz (born July 27, 1940 in Los Angeles, California) is an American film producer whose list of credits include American Graffiti, Star Wars and The Empire Strikes Back. He later produced The Dark Crystal and Return to Oz after departing from the Star Wars series. Kurtz also co-produced the 1989 low-budget science fiction film Slipstream, which reunited him with Star Wars star Mark Hamill.\\n\\nDescription above from the Wikipedia article Gary Kurtz, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1940, 7, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//q6tgPiNqzEOIYmHxMrpWoUirmmu.jpg", Name = "Gary Kurtz" },
                        new { Id = 12415, Biography = "Born in New Jersey and raised in Brooklyn, Richard Burton Matheson first  became a published author while still a child, when his stories and  poems ran in the \"Brooklyn Eagle\". A lifelong reader of fantasy tales,  he made his professional writing bow in 1950 when his short story \"Born  of Man and Woman\"? appeared in \"The Magazine of Fantasy and Science  Fiction\"; Matheson turned out a number of highly regarded horror,  fantasy and mystery stories throughout that decade. He broke into films  in 1956, adapting his novel \"The Shrinking Man\" for the big-screen Die unglaubliche Geschichte des Mr. C (1957).", BirthDate = new DateTime(1926, 2, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2013, 6, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qpcAG1Rpic5EWY8LMPN3e1R6TKs.jpg", Name = "Richard Matheson" },
