                        new { Id = 12538, Biography = "From Wikipedia, the free encyclopedia.\\n\\nNick Searcy (born March 7, 1959) is an American actor who currently portrays Chief Deputy United States Marshal Art Mullen on FX's Justified. He also had a major role in the Tom Hanks produced miniseries From the Earth to the Moon as Deke Slayton.", BirthDate = new DateTime(1959, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//v9GX9SeQsWwAzRIw5RUB0eG8VT8.jpg", Name = "Nick Searcy" },
