                        new { Id = 12833, Biography = "Edward Fitzgerald Burns (born January 29, 1968) is an American actor, film producer, writer and director.\\n\\nDescription above from the Wikipedia article Edward Burns, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1968, 1, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lwFncQkXtJ9pCNMjl464F1bJ0eh.jpg", Name = "Edward Burns" },
                        new { Id = 12834, Biography = "Barry Robert Pepper is a Canadian actor. He is best known for roles such as Private Daniel Jackson in Saving Private Ryan, Sergeant Michael Strank in Flags of Our Fathers, Dean Stanton in The Green Mile, Roger Maris in 61*, \"Lucky\" Ned Pepper in True Grit and Jonnie Goodboy Tyler in Battlefield Earth. He has been nominated for three Screen Actors Guild Awards and a Golden Globe Award. In 2011, for his role as Robert F. Kennedy in the miniseries The Kennedys, Pepper won the Emmy Award for Outstanding Lead Actor in a Miniseries or a Movie.", BirthDate = new DateTime(1970, 4, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xLVueyLs2MERkS9RxERa3VCn95s.jpg", Name = "Barry Pepper" },
                        new { Id = 12835, Biography = "Vin Diesel is an American actor, producer, director, and screenwriter. He came to prominence in the late 1990s, and first became known for appearing in Steven Spielberg's Saving Private Ryan in 1998. He is most known for his portrayals of Riddick in The Chronicles of Riddick trilogy (2001–2013), and of Dominic Toretto in The Fast and the Furious film series (2001–present), two franchises in which he also acted as producer. He also starred in xXx (2002) and Sidney Lumet's Find Me Guilty (2006). His voice acting work includes Brad Bird's The Iron Giant (1999), the video games of The Chronicles of Riddick franchise, and the upcoming Guardians of the Galaxy adaptation of the Marvel comics of the same name. As a filmmaker, Diesel directed, wrote, produced and starred in the drama film Strays, as well as in two short films. He is also the founder of the production companies One Race Films, Racetrack Records, and Tigon Studios.\\n\\nFrom Wikipedia", BirthDate = new DateTime(1967, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7rwSXluNWZAluYMOEWBxkPmckES.jpg", Name = "Vin Diesel" },
                        new { Id = 12836, Biography = "From Wikipedia, the free encyclopedia.\\n\\nEdward Bridge “Ted” Danson III (born December 29, 1947) is an American actor best known for his role as central character Sam Malone in the sitcom Cheers, and his role as Dr. John Becker on the series Becker. He also plays a recurring role on Larry David's HBO sitcom Curb Your Enthusiasm, starred alongside Glenn Close in legal drama Damages and is now a regular on the HBO comedy series Bored to Death.\\n\\nIn his thirty-year career, Danson has been nominated for fourteen Primetime Emmy Awards, winning two; ten Golden Globe Awards nominations, winning three; one Screen Actors Guild Awards nomination; one American Comedy Award and a star on Hollywood's Walk of Fame. He was ranked second in TV Guide's list of the top 25 television stars.\\n\\nDanson has also been a longtime activist in ocean conservation. In March 2011, he published his first book, \"Oceana: Our Endangered Oceans And What We Can Do To Save Them,\" written with journalist Michael D'Orso. Description above from the Wikipedia article Ted Danson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 12, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wWm9eDLuPDw29R76KAjg6gIE9dS.jpg", Name = "Ted Danson" },
