                        new { Id = 12852, Biography = "Barry Corbin is an American film and television actor.", BirthDate = new DateTime(1940, 10, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//38AilHla20EFhEYAqoz6EzfsrQf.jpg", Name = "Barry Corbin" },
                        new { Id = 12890, Biography = "Peter Hans \"Pete\" Docter (born October 9, 1968) is an American film director, animator, and screenwriter from Bloomington, Minnesota. He is best known for directing the films Monsters, Inc. and Up, and as a key figure and collaborator in Pixar Animation Studios. The A. V. Club has called him \"almost universally successful\". He has been nominated for six Oscars (one win thus far for Up -- Best Animated Feature), three Annie Awards (winning two), a BAFTA Children's Film Award (which he won), and a Hochi Film Award (which he won). He has described himself as a \"geeky kid from Minnesota who likes to draw cartoons.\" He is now working on a top-secret project, that will be released in 2013 or 2014. He will not direct Monsters, Inc. 2. Description above from the Wikipedia article Pete Docter, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1968, 10, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//r6ngPgnReA3RHmKjmSoVsc6Awjp.jpg", Name = "Pete Docter" },
                        new { Id = 12897, Biography = "Steven Paul \"Steve\" Jobs ( February 24, 1955 – October 5, 2011) was an American entrepreneur, marketer,[ and inventor, who was the co-founder, chairman, and CEO of Apple Inc. Through Apple, he is widely recognized as a charismatic and design-driven pioneer of the personal computer revolution and for his influential career in the computer and consumer electronics fields, transforming \"one industry after another, from computers and smartphones to music and movies.\" Jobs also co-founded and served as chief executive of Pixar Animation Studios; he became a member of the board of directors of The Walt Disney Company in 2006, when Disney acquired Pixar. Jobs was among the first to see the commercial potential of Xerox PARC's mouse-driven graphical user interface, which led to the creation of the Apple Lisa and, a year later, the Macintosh. He also played a role in introducing the LaserWriter, one of the first widely available laser printers, to the market. After a power struggle with the board of directors in 1985, Jobs left Apple and founded NeXT, a computer platform development company specializing in the higher-education and business markets. In 1986, he acquired the computer graphics division of Lucasfilm, which was spun off as Pixar. He was credited in Toy Story (1995) as an executive producer. He served as CEO and majority shareholder until Disney's purchase of Pixar in 2006. In 1996, after Apple had failed to deliver its operating system, Copland, Gil Amelio turned to NeXT Computer, and the NeXTSTEP platform became the foundation for the Mac OS X. Jobs returned to Apple as an advisor, and took control of the company as an interim CEO. Jobs brought Apple from near bankruptcy to profitability by 1998. As the new CEO of the company, Jobs oversaw the development of the iMac, iTunes, iPod, iPhone, and iPad, and on the services side, the company's Apple Retail Stores, iTunes Store and the App Store. The success of these products and services provided several years of stable financial returns, and propelled Apple to become the world's most valuable publicly traded company in 2011. The reinvigoration of the company is regarded by many commentators as one of the greatest turnarounds in business history. In 2003, Jobs was diagnosed with a pancreas neuroendocrine tumor. Though it was initially treated, he reported a hormone imbalance, underwent a liver transplant in 2009, and appeared progressively thinner as his health declined. On medical leave for most of 2011, Jobs resigned in August that year, and was elected Chairman of the Board. He died of respiratory arrest related to the tumor on October 5, 2011. Jobs received a number of honors and public recognition for his influence in the technology and music industries. He has been referred to as \"legendary\", a \"futurist\" and a \"visionary\", and has been described as the \"Father of the Digital Revolution,\" a \"master of innovation,\" \"the master evangelist of the digital age\" and a \"design perfectionist.\"", BirthDate = new DateTime(1955, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2011, 10, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mOMP3SwD5qWQSR0ldCIByd3guTV.jpg", Name = "Steve Jobs" },
                        new { Id = 12898, Biography = "From Wikipedia, the free encyclopedia.\\n\\nTim Allen (born Timothy Allen Dick; June 13, 1953) is an American comedian, actor, voice-over artist, and entertainer, known for his role in the sitcom Home Improvement. He is also known for his film roles in several popular movies, including the Toy Story series, The Santa Clause series, and Galaxy Quest.\\n\\nDescription above from the Wikipedia article Tim Allen, licensed under CC-BY-SA, full list of contributors on Wikipedia​", BirthDate = new DateTime(1953, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uX2xVf6pMmPepxnvFWyBtjexzgY.jpg", Name = "Tim Allen" },
                        new { Id = 12900, Biography = "Wallace Michael Shawn (born November 12, 1943) is an American actor, voice actor, playwright, essayist and comedian. His film roles have included those of Wally Shawn in the Louis Malle directed comedy-drama My Dinner with Andre (1981), Vizzini in The Princess Bride (1987), Mr. Wendell Hall in Clueless (1995) and providing the voice of Rex in the Toy Story franchise. He has also appeared in a variety of television series, including recurring roles as Cyrus Rose in Gossip Girl (2008–2012) and as Grand Nagus Zek in Star Trek: Deep Space Nine (1993–1999).\\n\\nHis plays include The Designated Mourner, Aunt Dan and Lemon and Grasses of a Thousand Colors. He also co-wrote the screenplay for My Dinner with Andre with Andre Gregory, and he scripted A Master Builder (2013), a film adaptation of of the play by Henrik Ibsen, which he also starred in. His book Essays was published in 2009 by Haymarket Books.\\n\\nDescription above from the Wikipedia article Wallace Shawn, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1943, 11, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oGE6JqPP2xH4tNORKNqxbNPYi7u.jpg", Name = "Wallace Shawn" },
