                        new { Id = 13242, Biography = "Paul Edward Valentine Giamatti (born June 6, 1967) is an American actor. Giamatti began his career as a supporting actor in several commercially successful and critically acclaimed films produced during the 1990s including Private Parts, The Truman Show, Saving Private Ryan, The Negotiator, and Man on the Moon, before earning lead roles in several projects in the 2000s including American Splendor, Sideways, Cinderella Man, The Illusionist, John Adams, Cold Souls, and Barney's Version.  Description above from the Wikipedia article Paul Giamatti, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1967, 6, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//rX4LRmkYshMRfQ6lVbeZVAfqVKI.jpg", Name = "Paul Giamatti" },
