                        new { Id = 15009, Biography = "Justin Paul Theroux is an American actor and screenwriter. He is best known for his work with film director David Lynch in Mulholland Drive (2001) and Inland Empire (2006), his starring role as Kevin Garvey in the HBO series The Leftovers (2014–2017) and as Tom in The Girl on the Train (2016). He is also known as a screenwriter for films such as Tropic Thunder, Iron Man 2, Rock of Ages, and Zoolander 2.", BirthDate = new DateTime(1971, 8, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vnI9L0rXBAw1HeC0Q8hJGeJMGAW.jpg", Name = "Justin Theroux" },
                        new { Id = 15011, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nBrent Briscoe (May 21, 1961 – October 18, 2017) is an American actor and screenwriter. Briscoe was born in Moberly, Missouri. After finishing his education at the University of Missouri, Briscoe launched his career as a theater actor. He then segued into screenwriting and acting in feature films. He moved to Los Angeles permanently after working with Billy Bob Thornton on Sling Blade and the two frequently collaborated in the subsequent years. He also frequently works with Mark Fauser who was his college roommate.", BirthDate = new DateTime(1961, 5, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2017, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7ws22WEvxt6cvMDyijZOdf9AuiS.jpg", Name = "Brent Briscoe" },
