                        new { Id = 15411, Biography = "​From Wikipedia, the free encyclopedia\\n\\nThomas Kent Carter (born December 18, 1956) better known as T. K. Carter, is an American comedian and actor. He is best known for playing Michael \"Mike\" Fulton, an elementary school teacher, on the NBC series Punky Brewster and Mylo Williams on the Disney Channel series Good Morning, Miss Bliss as a supervisor, whose catchphrase was \"Mylo gots to get his!\" He is also well known for playing the role of drug addicted Gary McCullough in the hard hitting dramatic HBO miniseries The Corner. Carter also made appearances on Good Times, The Steve Harvey Show, A Different World, and in the TV movie Polly.\\n\\nDescription above from the Wikipedia article T. K. Carter, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1956, 12, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//qoeRT7O8ORQ36Hd18mmN4WfP9ZP.jpg", Name = "T. K. Carter" },
                        new { Id = 15412, Biography = "​From Wikipedia, the free encyclopedia\\n\\nDavid Clennon (born May 10, 1943) is an American actor perhaps best known for his portrayal of Miles Drentel in the ABC series Thirtysomething, a role he reprised on Once and Again.\\n\\nClennon was born in Waukegan, Illinois, the son of Virginia, a homemaker, and Cecil Clennon, an accountant. Clennon is well known for his political activism.\\n\\nIn 1980, David Clennon provided the voice for Admiral Motti in NPR's Star Wars The Original Radio Drama. He was a regular on the TV shows Almost Perfect, The Agency and Saved. Most recently, Clennon played Carl Sessick (a.k.a Carl the Watcher) on Ghost Whisperer.\\n\\nIn 1993 he won an Emmy award for his guest appearance on the series Dream On.\\n\\nDescription above from the Wikipedia article David Clennon, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1943, 5, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sUZ6eL77Eh0aNYSx2NaB9NEZeCf.jpg", Name = "David Clennon" },
                        new { Id = 15413, Biography = "From Wikipedia, the free encyclopedia\\n\\nRichard A. Dysart (born March 30, 1929) is an American actor, perhaps best known for his role as Leland McKenzie on the NBC legal drama L.A. Law.\\n\\nDysart served for four years in the Air Force during the Korean War. In 1979, he was featured in the film Being There, portraying a good-hearted physician. In 1980, he portrayed Abraham Lincoln's Secretary of War Edwin Stanton in the TV movie The Ordeal of Dr. Mudd. He also lent his voice to the kindly miner Uncle Pom in the Disney English language version of Hayao Miyazaki's 1986 adventure classic, Castle in the Sky. He starred in movies such as The Last Days of Patton, Being There, The Day of the Locust, The Rumor Mill, Pale Rider, The Falcon and the Snowman, Prophecy, The Thing, Warning Sign, Hard Rain, Mask, An Enemy of the People, The Hospital, and The Hindenburg.\\n\\nThe scene where his L.A. Law character, Leland, the patriarchal and stiff founder of a successful law practice, was revealed to be in bed with competitor Rosalind Shays (Diana Muldaur) was ranked as the 38th greatest moment in television in an issue of EGG magazine. He earned one Emmy Award, and three more nominations, for his role as McKenzie on L.A. Law.\\n\\nDysart was a founding member of the American Conservatory Theater, San Francisco. He attended Gould Academy in Bethel, Maine. He received the Drama Desk Award in 1972 and an Emmy Award in 1992. He is a brother of the Phi Alpha Tau fraternity based out of Emerson College in Boston. In 1990, Dysart was awarded an Honorary Doctorate of Law. He is also a certified open water diver.\\n\\nDysart and his wife, artist Kathryn Jacobi, have been married since 1987.\\n\\nDescription above from the Wikipedia article Richard Dysart, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1929, 3, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2015, 4, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uYWgsPAjJ2VyhVwGuBkVxmwB2wt.jpg", Name = "Richard Dysart" },
                        new { Id = 15414, Biography = "From Wikipedia, the free encyclopedia.  Charles John Hallahan (July 29, 1943 – November 25, 1997) was an American film, television and stage actor best known for his performances in Going in Style, The Thing, and Dante's Peak.\\n\\nDescription above from the Wikipedia article Charles Hallahan, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1943, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1997, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bXRE5dfHZZhovEbXgQCXDTw9ZHY.jpg", Name = "Charles Hallahan" },
