                        new { Id = 15416, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nRichard Masur  (born November 20, 1948) is an American actor who has appeared in more than 80 movies during his career. From 1995-1999, he served two terms as president of the Screen Actors Guild (SAG). Masur sits on the Corporate Board of the Motion Picture &amp; Television Fund.", BirthDate = new DateTime(1948, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//w8qQdmxLRRSXNXkjHKHlY5vawXG.jpg", Name = "Richard Masur" },
