                        new { Id = 15418, Biography = "From Wikipedia, the free encyclopedia\\n\\nJoel Polis (born October 3, 1951) is an American television, film and stage actor. He has appeared in over one hundred television programs and films during his career. Polis' first film role was the character 'Fuchs' in the science fiction film The Thing. He appeared in numerous television series including Cheers, Alien Nation, Northern Exposure, Star Trek: Voyager, Roseanne, Seinfeld, Chicago Hope, Boston Legal and CSI. He appeared in a recurring role on the television series Cheers as the mischievous Gary, owner of the rival bar, Gary's Olde Towne Tavern. Polis's theater credits include performances at the Astor Place Theatre, Hartford Stage, Old Globe Theater, South Coast Repertory, Mark Taper Forum, Odyssey Theatre, Laguna Playhouse, Lillian Theater and the Pasadena Playhouse.", BirthDate = new DateTime(1951, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bwDOMBwBxL2cyXHBa4sLO00ifQg.jpg", Name = "Joel Polis" },
                        new { Id = 15419, Biography = "From Wikipedia, the free encyclopedia\\n\\nThomas G. Waites (born January 8, 1955) is an American actor and acting instructor born in Philadelphia, Pennsylvania. Waites runs an acting studio in New York City which is named for him. He has been a member of the Actor's Studio since 1984.\\n\\nSince the 1970s, Waites has appeared in over 30 television and film productions. Some of his credits as a television actor includeNYPD Blue, Buffy the Vampire Slayer, Oz, Law &amp; Order, Law &amp; Order: Criminal Intent and The Jury. In film, he appeared inUnwed Father, State of Grace, ...And Justice for All, Gangland, An American Affair, The Warriors, and the John Carpenter filmThe Thing.\\n\\nDescription above from the Wikipedia article Thomas G. Waites, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1955, 1, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//siYdrSBj0ubxuCZm66lotNulg6M.jpg", Name = "Thomas G. Waites" },
