                        new { Id = 15659, Biography = "From Wikipedia, the free encyclopedia\\n\\nMarianna Hill (sometimes: Mariana Hill) born in Santa Barbara, California on February 9, 1941 is an American actress mostly working in American television.\\n\\nShe has appeared in more than 70 films and television episodes. She co-starred in the Elvis Presley film Paradise, Hawaiian Style in 1966 as Lani Kaimana; the Clint Eastwood film High Plains Drifter as Callie Travers in 1973; and in The Godfather II as Deanna Dunn-Corleone.\\n\\nHill guest-starred in several 1960s sitcoms, a short list of which include My Three Sons, Hogan's Heroes, Love American Style, and Batman.\\n\\nOne of Hill's many TV appearances was as Dr. Helen Noel in the Star Trek: The Original Series episode, \"Dagger of the Mind\".\\n\\nShe also guest-starred in the following drama series: Death Valley Days, Bonanza, The High Chaparral, Gunsmoke, The F.B.I., Mission: Impossible, Quincy, S.W.A.T., Kung Fu, The Outer Limits, and Harry O, to name only a few.\\n\\nDescription above from the Wikipedia article Marianna Hill, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1941, 2, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//h3X58tFp2a7Tgt7gNW2sbM6N2EH.jpg", Name = "Marianna Hill" },
                        new { Id = 15737, Biography = "From Wikipedia, the free encyclopedia.\\n\\nHelen McCrory (born 17 August 1968) is an English actress. She portrayed Cherie Blair in both the 2006 film The Queen and the 2010 film The Special Relationship. She also portrayed Narcissa Malfoy in the final three installments of the Harry Potter movies.\\n\\nDescription above from the Wikipedia article Helen McCrory, licensed under CC-BY-SA, full list of contributors on Wikipedia  ", BirthDate = new DateTime(1968, 8, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//jKBqL7Y6ToKRKSQ9kkgo7rOjMHS.jpg", Name = "Helen McCrory" },
