                        new { Id = 15831, Biography = "Franklin Wendell \"Frank\" Welker (born March 12, 1946) is an American actor who specializes in voice acting and has contributed character voices and other vocal effects to American television and motion pictures. As of September 2010, Welker had voiced or appeared in 93 films with a combined gross revenue of $5.7 billion making him the top grossing actor by this standard (and over $800 million ahead of the next highest grossing actor, Samuel L. Jackson).\\n\\nDescription above from the Wikipedia article Frank Welker, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 3, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//b3gImArbw13mMKJIe9leFc9YYb7.jpg", Name = "Frank Welker" },
