                        new { Id = 16504, Biography = "From Wikipedia, the free encyclopedia.\\n\\nAnthony \"Tony\" Burton (March 23, 1937 – February 25, 2016) was an American actor, boxer, and football player. He was known for his role as Tony \"Duke\" Evers in the Rocky franchise. He, Sylvester Stallone and Burt Young are the only actors who have appeared in every Rocky installment (not counting Creed).\\n\\nDescription above from the Wikipedia article Tony Burton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1937, 3, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2016, 2, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ue54hK217thXeQMzN4qUYXLImLd.jpg", Name = "Tony Burton" },
                        new { Id = 16525, Biography = "​Joe Spinell was born Joseph J. Spagnuolo in Manhattan, New York of Italian immigrant parents, and the last of six children. His father, Pelegrino Spagnuolo (b. 1892, d. 1950), died from liver and kidney disease. His mother Filomena Spagnuolo (b. 1903, d. 1987) was a bit-part actress who acted in a few movies, some of them alongside her son. Spinell stood 5 foot and 11 inches. He was born at his family's apartment in Manhattan's Little Italy on 2nd Avenue in Manhattan. A few years after the death of his father, he moved with his mother and older siblings to Woodside, Queens, New York where he lived off-and-on for the remainder of his life. Spinell suffered most of his life from hemophilia as well as chronic asthma. Because of his large, heavyset frame and imposing looks, Spinell was often cast as criminals, thugs, or corrupt police officers. His most notable roles were as mafioso Willi Cicci in The Godfather and The Godfather Part II, and as loan shark Tony Gazzo in Rocky and Rocky II. Although primarily known as a character actor, Spinell co-wrote and starred as a serial killer in the 1980 film, Maniac. Joe Spinell died in his apartment on January 13, 1989 at the age of 52. The cause of his untimely death is arguable to this day. Some say that his death was caused by sudden heart attack due to heavy drug use, drinking and emotional distress in light of his mother passing away two years earlier. It is also speculated that he may have died from asthma complications, or bled to death from hemophilia related causes. He was planning a sequel to Maniac before his death. He was buried in Calvary Cemetery, Queens near his home. He is the distant cousin of the American football team St. Louis Ram's Head Coach Steve Spagnuolo. Spinell was married to adult film star Jean Jennings from February 1977 to July 1979. Together they had one daughter, but they eventually divorced.", BirthDate = new DateTime(1936, 10, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1989, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wzZZO8xXn9OgljCmrGGR4L6wBdg.jpg", Name = "Joe Spinell" },
                        new { Id = 16591, Biography = "", Name = "Stewart Arnott" },
