                        new { Id = 16841, Biography = "Peter Brett Cullen (born August 26, 1956) is an American actor who has appeared in numerous motion pictures and television programs. Early in 2007, he was cast as the role of an estranged father to one of the American football players, Tim Riggins (played by actor Taylor Kitsch), in the NBC drama series Friday Night Lights.\\n\\nCullen was born in Houston, Texas, the son of Lucien Hugh Cullen, an oil industry executive, and Catherine Cullen. He graduated from Madison High School in Houston in 1974. Cullen graduated from the University of Houston, giving great credit to his highly acclaimed acting mentor and University of Houston professor, Cecil Pickett, who also mentored such Houston born actors as Dennis Quaid, Randy Quaid, &amp; Brent Spiner among others. Cullen and Dennis Quaid's close friendship to this day dates back to the 1970s and it is Cullen who introduced Dennis Quaid to his current wife, Kimberly Buffington at a dinner in Austin, Texas.\\n\\nCullen played Dan Fixx in the 1980s CBS drama Falcon Crest for two seasons (1986–1988) and Marshal Sam Cain in the ABC western series The Young Riders for one season (1989–1990). In 1980, he appeared as the second Gideon Chisholm in the last nine episodes of the CBS western miniseries The Chisholms. In the four earlier episodes, the Gideon Chisholm role was played by Brian Kerwin. Cullen was the lead actor as Ned Logan in the short-lived Legacy, which lasted for just one season (1998–1999). On the series The West Wing Cullen played Ray Sullivan, a fictional governor of West Virginia and the Republican nominee for Vice President.\\n\\nHis guest appearances on TV include: The Incredible Hulk, Tales from the Crypt, MAS*H, V, Matlock, Star Trek: Deep Space Nine, Ally McBeal, Walker, Texas Ranger, Once and Again, Without a Trace, Cold Case, The Mountain, Monk, CSI: Miami, NCIS, Desperate Housewives, Pepper Dennis, Lost, Ghost Whisperer, Private Practice, Ugly Betty, and Friday Night Lights. In 2009, he had a recurring role in the ABC Family television series Make It or Break It.\\n\\nHe has played two real-life astronauts, Jack Lousma in Apollo 13 (Brett is the CapCom at the time of the explosion; at that shift Lousma was the CapCom in real life) and David Scott in the HBO mini-series From the Earth to the Moon.\\n\\nHis most recent appearance was in the role of Barton Blaze in the movie Ghost Rider. Other movie credits include Wyatt Earp (with Kevin Costner), Gambler V: Playing for Keeps (with Kenny Rogers and Bruce Boxleitner), Something to Talk About (with Julia Roberts and Dennis Quaid), The Replacements (with Gene Hackman), On Golden Pond (with Julie Andrews and Christopher Plummer), Nancy Drew, and Gridiron Gang. He also played Bob Cleary in the 1983 mini-series The Thorn Birds.\\n\\nCullen was recently cast in the up-coming femme comedy Monte Carlo alongside Selena Gomez, Andie MacDowell and Leighton Meester and is playing the role of Tom Eckert in the upcoming war film Red Dawn.\\n\\nOn February 8, 2011, Brett was named the official spokesman for Houston Works which helps Houston residents with job training and placement, scholarships, consulting, technical initiatives focusing on science, technology, engineering and mathematics and summer job programs along with Youth Summits.\\n\\nDescription above from the Wikipedia article Brett Cullen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1956, 8, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dSucCeOCUJy8nDjUjxmWguu3W1D.jpg", Name = "Brett Cullen" },
                        new { Id = 16848, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRob Zombie (born Robert Bartleh Cummings; January 12, 1965) is a musician, film director, screenwriter and film producer. He founded the heavy metal band White Zombie and has been nominated three times as a solo artist for the Grammy Award for Best Metal Performance.\\n\\nZombie has also established a successful career as a film director, creating the movies House of 1000 Corpses, The Devil's Rejects, the 2007 remake of Halloween, its sequel, and The Haunted World of El Superbeasto. His next film will be the upcoming The Lords of Salem.\\n\\nDescription above from the Wikipedia article Rob Zombie, licensed under CC-BY-SA, full list of contributors on Wikipedia .", BirthDate = new DateTime(1965, 1, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2LGOgBVEAqC2rStyY7ys0wHNbEs.jpg", Name = "Rob Zombie" },
                        new { Id = 16851, Biography = "Josh James Brolin (born February 12, 1968) is an American actor. He has acted in theater, film and television roles since 1985, and won acting awards for his roles in the films W., No Country for Old Men, Milk and Wall Street: Money Never Sleeps. He appeared in True Grit, a 2010 western film adaptation of the 1968 novel by Charles Portis.\\n\\nDescription above from the Wikipedia article Josh Brolin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1968, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//x8KKnvHyPvH16M6waAnY1OeCtA8.jpg", Name = "Josh Brolin" },
                        new { Id = 16937, Biography = "", BirthDate = new DateTime(1956, 11, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2ze2PNirf4vle9sWRkSxHgv1iH0.jpg", Name = "Rex Linn" },
                        new { Id = 16940, Biography = "Jeremy John Irons (born 19 September 1948) is an English actor.\\n\\nAfter receiving classical training at the Bristol Old Vic Theatre School, Irons began his acting career on stage in 1969, and has since appeared in many London theatre productions including The Winter's Tale, Macbeth, Much Ado About Nothing, The Taming of the Shrew, and Richard II. In 1984, he made his Broadway debut in Tom Stoppard's The Real Thing and received a Tony Award for Best Actor.\\n\\nIrons's first major film role came in the 1981 romantic drama The French Lieutenant's Woman, for which he received a BAFTA nomination for Best Actor. After starring in such films as Moonlighting (1982), Betrayal (1983), and The Mission (1986), he gained critical acclaim for portraying twin gynecologists in David Cronenberg's psychological thriller Dead Ringers (1988).\\n\\nIn 1990, Irons delivered another strong performance as a European aristocrat in Reversal of Fortune, and took home multiple awards including an Academy Award for Best Actor. Other notable films have included The House of the Spirits (1993), The Lion King (1994), Die Hard with a Vengeance (1995), Lolita (1997), The Merchant of Venice (2004), Being Julia (2004), and Appaloosa (2008). Irons has also made several notable appearances on television. He earned his first Golden Globe Award nomination for his breakout role in the ITV series Brideshead Revisited (1981).\\n\\nIn 2006, Irons starred opposite Helen Mirren in the historical miniseries Elizabeth I, for which he received a Golden Globe Award and an Emmy Award for Best Supporting Actor.\\n\\nDescription above from the Wikipedia article Jeremy Irons, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1948, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9AWphjIgGX7JjTrwrx3tsTZlUgv.jpg", Name = "Jeremy Irons" },
                        new { Id = 16961, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nMichael Arndt is an American screenwriter. After graduating from New York University, Arndt was a script reader for some time before choosing to write screenplays instead. He is best known for his first produced screenplay Little Miss Sunshine, for which he received multiple awards including the Academy Award for Best Original Screenplay. Arndt also best known for his second screenplay from the film Toy Story 3, for which he also received multiple awards and nominations including nomination for the Academy Award for Best Adapted Screenplay. This making Arndt the first ever screenwriter to be nominated for both Academy Award for Best Original Screenplay and Best Adapted Screenplay for his first two screenplays.\\n\\nDescription above from the Wikipedia article Michael Arndt , licensed under CC-BY-SA, full list of contributors on Wikipedia.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ii6Z9GrrnsRuWMu9PVoiz4VlH4S.jpg", Name = "Michael Arndt" },
                        new { Id = 16970, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nIvana Baquero Macías (born June 11, 1994; Barcelona, Spain) is a Spanish actress. At the age of 11, Baquero was chosen by director Guillermo del Toro to play the lead role of Ofelia in Pan's Labyrinth, for which she won critical acclaim and the Goya Award for Best New Actress.\\n\\nDescription above from the Wikipedia article Ivana Baquero , licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1994, 6, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4aGa2JpOnMoXxe8Y7kfkpil3VPm.jpg", Name = "Ivana Baquero" },
                        new { Id = 16971, Biography = "Maribel Verdú (born Madrid 2 October 1970) is a Spanish actress. She is known to English-speaking audiences for playing Luisa in the 2001 film Y tu mamá también and Mercedes in Guillermo del Toro's 2006 film Pan's Labyrinth. In Spain she is known for films such as Belle Époque, Tetro, and Huevos de oro.\\n\\nVerdú was born María Isabel Verdú Rollán. She began acting at 13. She has appeared in almost 50 movies since 1984. Most have been in Spanish. She has also been in TV shows. In 2007, she was invited to join the Academy of Motion Picture Arts & Sciences. She won a Goya Award in 2008 for her lead role in Seven Billiard Tables (Siete mesas de billar francés).\\n\\nVerdú is married to Pedro Larrañaga, son of actors Carlos Larrañaga and María Luisa Merlo.\\n\\nDescription above from the Wikipedia article Maribel Verdú, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1970, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//i2ylwxUIUMdC9paltuovtud2bv5.jpg", Name = "Maribel Verdú" },
