                        new { Id = 17419, Biography = "Bryan Lee Cranston (born March 7, 1956) is an American actor, voice actor, writer and director. He is perhaps best known for his roles as Hal, the father in the Fox situation comedy \"Malcolm in the Middle\", and as Walter White in the AMC drama series Breaking Bad, for which he has won three consecutive Outstanding Lead Actor in a Drama Series Emmy Awards. Other notable roles include Dr. Tim Whatley on Seinfeld, Doug Heffernan's neighbor in The King of Queens, Astronaut Buzz Aldrin in From the Earth to the Moon, and Ted Mosby's boss on How I Met Your Mother.", BirthDate = new DateTime(1956, 3, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fnglrIFnI5cK4OAh66AZN86mkFq.jpg", Name = "Bryan Cranston" },
