                        new { Id = 19278, Biography = "William \"Bill\" Hader (born June 7, 1978 height 6' 1\" (1,85 m)) is an American actor, comedian, producer and writer. He is best known as a cast member on Saturday Night Live and for his supporting roles in comedy films such as Superbad, Hot Rod, Tropic Thunder and Adventureland.\\n\\nDescription above from the Wikipedia article Bill Hader, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1978, 6, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3Z5JsyLw7YTLZgpA3FAlLmFSN9F.jpg", Name = "Bill Hader" },
