                        new { Id = 20354, Biography = "Amber Rose Tamblyn (born May 14, 1983) is an American actress, author, poet, and film director. She first came to national attention in her role on the soap opera General Hospital as Emily Quartermaine, followed by a starring role on the prime-time series Joan of Arcadia, portraying the title character. Her feature film work includes roles in The Sisterhood of the Traveling Pants, The Grudge 2, The Ring, and 127 Hours; she had an extended arc as Martha M. Masters on the main cast of the medical drama series House. She also had a starring role on season eleven of the CBS sitcom Two and a Half Men.\\n\\nDescription above from the Wikipedia article Amber Tamblyn, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1983, 5, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4nwsbtFzoxzN2YF2HOW4P4vdit2.jpg", Name = "Amber Tamblyn" },
                        new { Id = 20374, Biography = "Teresa Mary Palmer (born 26 February 1986) is an Australian actress, writer, producer and model who made her film debut in the suicide drama 2:37. She starred in the 2013 film Warm Bodies as a young woman who falls in love with a zombie, and as Rebecca in the 2016 horror film Lights Out. She has further appeared in films such as December Boys, The Sorcerer's Apprentice, I Am Number Four, Take Me Home Tonight, Love and Honor, The Ever After (which she co-wrote and co-produced with her husband, Mark Webber), Kill Me Three Times, the 2015 remake of Point Break, Triple 9, The Choice, and the Mel Gibson-directed war film Hacksaw Ridge.\\n\\nDescription above from the Wikipedia article Teresa Palmer, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1986, 2, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tEtdhkeKak6eJIlZj3N0kJYqhnC.jpg", Name = "Teresa Palmer" },
