                        new { Id = 20494, Biography = "From Wikipedia, the free encyclopedia.\\n\\nZoë E. Bell (born 17 November 1978) is a stuntwoman and actress from New Zealand. Some of her most notable stunt work includes doubling for Lucy Lawless on Xena: Warrior Princess and for Uma Thurman in Kill Bill. As an actress, she has appeared both on television and in feature films and also starred in the web series Angel of Death. She is probably most recognized for playing herself in the Quentin Tarantino film, Death Proof.\\n\\nDescription above from the Wikipedia article Zoë Bell, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1978, 11, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//44OHciSZtHTggiXyNM8jntKMsot.jpg", Name = "Zoë Bell" },
                        new { Id = 20504, Biography = "", BirthDate = new DateTime(1925, 9, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2012, 8, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Carlo Rambaldi" },
                        new { Id = 20582, Biography = "A native of Birmingham, Alabama, Michael graduated from Vestavia Hills High School in 1983.\\n\\nThe Texas Rangers drafted him in 1985, but he chose instead to attend Louisiana State University on a baseball scholarship. He was the starting center-fielder on the first LSU team to go to the College World Series in 1986, and again in 1987.\\n\\nIn 1987, Everybody's All-American (1988) came to shoot in Baton Rouge, and Michael was chosen as Dennis Quaid stunt double for the football scenes. He caught the attention and earned the admiration of Director Taylor Hackford, who encouraged Michael to pursue a career in stunt work.\\n\\nWhile filming Charlie's Angels (2000), Michael was kicked in the jaw with a stiletto boot. He found himself in an emergency room, insisting that he was not the victim of domestic violence. The spousal abuse representatives had a hard time believing that he had been kicked by Cameron Diaz\\n\\n.Michael is most widely known as \"The Carjacker\" in Spider-Man (2002), whose actions ultimately lead Peter Parker to become Spider-Man. Michael first met director Sam Raimi\\n\\n when he played Kevin Costner's nemesis in For Love of the Game (1999).\\n\\nAnother notable role was as Guard Papajohn in The Longest Yard (2005) for producerAdam Sandler\\n\\n. They met when Michael did all of Adam's stunts in The Waterboy (1998), making the hard hits as Bobby Boucher. In The Longest Yard, things came full circle when Michael had his own stuntman.\\n\\nHe has produced one film, Rustin (2001), that went on to win festival awards.  IMDb Mini Biography By: PRMP", BirthDate = new DateTime(1964, 11, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9nVHCoYxCpGh9pO00xp7SybWd7b.jpg", Name = "Michael Papajohn" },
