                        new { Id = 20753, Biography = "Fred Willard (born September 18, 1939) is an American comedian, actor and voice over actor known for his improvisational comedy skills. He is known for his roles in the Christopher Guest mockumentary films This is Spinal Tap, Waiting for Guffman, Best in Show, A Mighty Wind, and For Your Consideration as well as television series D.C. Follies. He is an alumnus of The Second City comedy troupe. He received three Emmy nominations for his recurring role on the TV series Everybody Loves Raymond as Robert Barone's father-in-law, Hank MacDougall.", BirthDate = new DateTime(1939, 9, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//j1jWdqmklfIH4hpAbw1DK0gPMX0.jpg", Name = "Fred Willard" },
