                        new { Id = 21007, Biography = "American actor and writer Jonah Hill is most famous for his comedic roles in Superbad (2007), and Get Him to the Greek (2010). The California native attended college in New York where he studied acting, produced plays, and was introduced to movie producer Dustin Hoffman.\\n\\nAfter meeting Jonah, Hoffman asked him to audition for a role in I Heart Huckabees (2004). This turned out to be Jonah's breakthrough film debut. Throughout his career, Hill has been known for his quasi dorky character with an offbeat, often self-deprecating sense of humor.\\n\\nJonah Hill’s other interests include writing, and he has expressed interest in working with shows such as The Simpsons.", BirthDate = new DateTime(1983, 12, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7GXzpyHLCEA36J9biB0wJVAauiO.jpg", Name = "Jonah Hill" },
