                        new { Id = 21125, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRichard John Kind (born November 22, 1956) is an American actor known for his roles in the sitcoms Mad About You (as Dr. Mark Devanow) and Spin City (as Paul Thomas Lassiter).", BirthDate = new DateTime(1956, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xpLufPiiFgoCEdIMqD4RY79PKGb.jpg", Name = "Richard Kind" },
                        new { Id = 21181, Biography = "​From Wikipedia, the free encyclopedia.  Fabio Testi (born 2 August 1941) is an Italian film actor, notable as the star of, among many other films, First Action Hero.  Born in Peschiera del Garda, Italy, the 1.84m tall actor started his film career as a stuntman in his college years. His most famous job as a stuntman was in Sergio Leone's Once Upon a Time in the West, where he fell from a rooftop and hit the ground on his shoulder.  Testi married only once, in 1979, to Lola Navarro, with whom he fathered three children.  He skirted international stardom through a series of unusual role choices and a firm decision to remain in Italy. He chose to work with people like Miles Deem, known as the \"Ed Wood of Spaghetti Westerns\" when better roles were available. Testi was cast by director Andrzej Żuławski in L'important c'est d'aimer (1975), opposite Romy Schneider, Klaus Kinski, Jacques Dutronc and Claude Dauphin.  Description above from the Wikipedia article Fabio Testi, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1941, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//45fHWF6fhX0hKMf9LbgjrDfUTKS.jpg", Name = "Fabio Testi" },
                        new { Id = 21182, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9h0iG4zHhgnbiMOCnNBdvBvNCev.jpg", Name = "David Dayan Fisher" },
                        new { Id = 21198, Biography = "From Wikipedia, the free encyclopedia\\n\\nPeter Sohn is a Pixar storyboard artist and animator. Sohn started his career with Pixar in the art and story departments for Finding Nemo. He also worked on The Incredibles, Ratatouille and WALL-E. Sohn performed the voice of Emile in Ratatouille. He made his directorial debut with the short film Partly Cloudy in 2009 which he also wrote. In a CGSociety article, Sohn says his idea for Partly Cloudy came from watching Dumbo as a child. In the movie, a stork delivers Dumbo. This made him wonder where the bird gets the babies from. He decided the babies came from clouds and so that is why birds have to deliver them. Partly Cloudy was included in the Animation Show of Shows in 2009.\\n\\nSohn was born and raised in New York. He attended CalArts and while there got a summer job working on Brad Bird's The Iron Giant. After school he worked at The Walt Disney Company and Warner Brothers before coming to Pixar.\\n\\nRussell, the boy in Up, was based on Peter Sohn.\\n\\nDescription above from the Wikipedia article Peter Sohn, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1975, 6, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ouaPg2hdBBXfq8N7HPatvEq3P81.jpg", Name = "Peter Sohn" },
                        new { Id = 21215, Biography = "Elise Neal was born in Memphis, Tennessee on March 14, 1966. She graduated from OvertonHigh School for the Creative and Performing Arts in 1984, and attended the University of the Arts in Philadelphia. Elise left college after two years and moved to New York City where she landed roles in musical theater and found herself traveling the world with various touring companies. Her experience in musical theater allowed her to easily transition into commercials, eventually bringing her to Los Angeles. Her film debut was a starring role in John Singleton's Rosewood. Other film credits include: Paid in Full, Money Talks, Mission to Mars and Restaurant. Neal has demonstrated her versatility in roles from Hustle and Flow to Scream 2. She has worked with such acclaimed directors/producers such as John Singleton, Brian De Palma, Steven Spielberg and Craig Brewer.", BirthDate = new DateTime(1966, 3, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6Z6LVIlaCVMWsRgOPFOA4NOXAQO.jpg", Name = "Elise Neal" },
                        new { Id = 21316, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nNestor Gastón Carbonell (born December 1, 1967) is an American actor, known for portraying Richard Alpert in ABC's drama Lost and Mayor Anthony Garcia in the film The Dark Knight. He is also known for his role on the sitcom Suddenly Susan.", BirthDate = new DateTime(1967, 12, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yALf2koeUAc2UNoT5o0hQO6Akzn.jpg", Name = "Nestor Carbonell" },
