                        new { Id = 21485, Biography = "Blake Clark ist ein US-amerikanischer Schauspieler und Synchronsprecher.\\n\\nEr ist häufig in Gastrollen in diversen US-Fernsehserien, wie z. B. Roseanne , Sabrina – total verhext! oder Hör mal, wer da hämmert zu sehen. Im Kino war er in kleineren Rollen, häufig an der Seite von Adam Sandler, zu sehen. Zu seinen Filmen zählen u.a. Mr. Deeds, 50 erste Dates, und Kindsköpfe.\\n\\nAußerdem tritt er häufig als Stand-Up-Comedian auf. Clark ist die Synchronstimme von Slinky in Toy Story 3.", BirthDate = new DateTime(1946, 2, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//j6nhwuLKJXzHuD4zv2d3y99PcIC.jpg", Name = "Blake Clark" },
