                        new { Id = 22075, Biography = "Reggie Lee is an American actor who played William Kim on the show Prison Break and also appeared as Tai Huang in two Pirates of the Caribbean films, as well as The Fast and the Furious. Currently, he plays the role of Tom in the NBC series Persons Unknown.\\n\\nDescription above from the Wikipedia article Reggie Lee , licensed under CC-BY-SA,full list of contributors on Wikipedia.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//t3kM9otyaduJseoqFgfBXndtKa5.jpg", Name = "Reggie Lee" },
                        new { Id = 22132, Biography = "​From Wikipedia, the free encyclopedia\\n\\nMike Connor Gainey (born January 18, 1948) is an American film and television actor whose distinctive mustache, 6'2½\" height, and threatening look have given him supporting roles as Southern/Southwestern types, thugs, and criminals. M.C. Gainley attended the University of Southern Mississippi prior to moving to California. He worked as an undertaker's apprentice before he decided to study acting. In the early 1970s he attended the American Conservatory Theater in San Francisco along with Ken Hixon. In 1981, he made his big-screen debut in the Steve Martin musical Pennies from Heaven. Since the early 1980s he has been in over 50 movies and made for TV movies, including Breakdown, Two Idiots in Hollywood, Con Air, The Mighty Ducks, Are We There Yet, Terminator 3, Sideways, and 2005's The Dukes of Hazzard. He was one of the stars of the short-lived television series Against the Law. He has guest starred on over 40 television shows, including The Dukes of Hazzard, Knight Rider, Designing Women, The Adventures of Brisco County, Jr., Walker, Texas Ranger, CSI, Cheers, Days of our Lives, The X-Files, Desperate Housewives, Burn Notice, The Fresh Prince of Bel-Air, and had a role as Tom Friendly on the series Lost, a character who appeared in 20 episodes, as many as some former main cast members. He also played the murderous drug dealer Bo Crowder in a recurring role in the 2010 season of the hit FX TV show Justifed. He attended the 2007 Emmys with Lost's show runners Damon Lindelof and Carlton Cuse. Gainey played Kurtz/The Wizard in the controversial road-revenge film Apocalypse Oz, a film containing no original dialogue as it is all taken from Apocalypse Now or The Wizard of Oz. In 2007 he appeared in a trio of films including Mr. Woodcock, Wild Hogs, and the sci/horror film Unearthed; in 2010 he appeared in Love Ranch. In 2010, he voiced one of the characters of the animated musical film Tangled as Captain of the Palace Guard.", BirthDate = new DateTime(1948, 1, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//icWXPTZlbOytDwMzRLM37TyBcox.jpg", Name = "M.C. Gainey" },
                        new { Id = 22161, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kNlIbggJHDN13udH3hTCtvsSMM6.jpg", Name = "Ben Davis" },
                        new { Id = 22302, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vBdZqJTDv7PpM6a5dBSO4orV8z1.jpg", Name = "Stuart Cornfeld" },
                        new { Id = 22383, Biography = "Franco Nero (born 23 November 1941) is an Italian actor.  He is best known for his roles of the title character in Sergio Corbucci's Django (1966), Sir Lancelot in Joshua Logan's Camelot (1967), Horacio in Luis Buñuel's Tristana (1970), the title character in Enzo G. Castellari's Keoma (1976), Captain Nikolai Lescovar/Colonel von Ingorslebon in Guy Hamilton's Force 10 from Navarone (1978), Cole in Menahem Golan's Enter the Ninja(1981), his reprising role again as the title character in Nello Rossatti's Django Strikes Again (1987), General Ramon Esperanza in Renny Harlin's Die Hard 2 (1990), Gianni Versace in Menahem Golan's The Versace Murder (1998), General Francini in Brian Trenchard-Smith's Megiddo: The Omega Code 2 (2001) and Lorenzo Bartolini in Gary Winick's Letters to Juliet (2010).  He also played the narrator in the film Rasputin (2010) directed by Louis Nero and voiced the character of Uncle Topolino in the animated film Cars 2 (2011) directed by John Lasseter and co-directed by Brad Lewis. In 2012 Nero made a cameo appearance inQuentin Tarantino's Django Unchained.", BirthDate = new DateTime(1941, 11, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lwXfTQrFqAw4zcVjrhgq3THfWCg.jpg", Name = "Franco Nero" },
