                        new { Id = 22612, Biography = "Lisa Kreuzer (born Elisabeth Kreuzer; December 2, 1945) is a German television and film actress with credits for appearances in over 120 films and television series.\\n\\nKreuzer featured with Dennis Hopper in Wim Wenders' film The American Friend (1977), a German-French co-production. Other Wenders' films featuring Kreuzer include Alice in the Cities (1974) and Kings of the Road (1976). She additionally features in Christopher Petit's Wenders-influenced Radio On (1979) which was shot in the UK and is predominantly in English..\\n\\nShe performed in the German TV series Derrick from 1977 to 1990 on nearly a dozen occasions.", BirthDate = new DateTime(1945, 12, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ur06QfGJtQDONbLGeY11JsPNaf3.jpg", Name = "Lisa Kreuzer" },
                        new { Id = 22767, Biography = "From Wikipedia, the free encyclopedia\\n\\nAlfonso Arau (born January 11, 1932) is a Mexican actor and director.\\n\\nDescription above from the Wikipedia article Alfonso Arau, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1932, 1, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//Agw6LyoGlrfJaBvTOQYzdxwUWHh.jpg", Name = "Alfonso Aráu" },
