                        new { Id = 23532, Biography = "Jason Kent Bateman (born January 14, 1969) is an American television and film actor. After appearing in several 1980s and 1990s sitcoms including Silver Spoons, It's Your Move, and The Hogan Family, Bateman came to prominence in the early 2000s for playing Michael Bluth on Arrested Development, for which he won a TV Land, a Golden Globe, and two Satellite Awards. He has since established himself in Hollywood by appearing in several films including The Kingdom, Juno, Hancock, Up in the Air, and Paul.\\n\\nDescription above from the Wikipedia article Jason Bateman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 1, 14, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ttzLpjvcLkvXyyTBpjmZw11tjlr.jpg", Name = "Jason Bateman" },
