                        new { Id = 24342, Biography = "From Wikipedia, the free encyclopedia\\n\\nDavid Prowse, MBE (born 1 July 1935) is an English former bodybuilder, weightlifter and actor, most widely known for playing the role of Darth Vader in physical form. In Britain, he is also remembered as having played the Green Cross Code man. Prowse is a native of Bristol, where he attended Bristol Grammar School.\\n\\nDescription above from the Wikipedia article David Prowse, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1935, 7, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cJtmBVrjYwawh2cCiAfZkEjPeqc.jpg", Name = "David Prowse" },
                        new { Id = 24343, Biography = "Peter Mayhew (born 19 May 1944) is a British-American actor. He is best known for playing Chewbacca in the Star Wars films.\\n\\nMayhew was born on 19 May 1944 in Barnes, Surrey, where he was also raised. His height is a product not of gigantism — \"I don't have the big head\" — but of an overactive pituitary gland secondary to a genetic disease called Marfan Syndrome. The overactive pituitary gland was treated successfully in his mid-teens. His peak height was 7 feet 3 inches (2.21 m)", BirthDate = new DateTime(1944, 5, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//din1s5H4C4CfcnkHfEeRcdFlsVj.jpg", Name = "Peter Mayhew" },
                        new { Id = 24358, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLori Alan (born July 18, 1966), sometimes credited as Lori Allen, is an American voice actress who provides the voice of news anchor Diane Simmons on Family Guy, various voices on Hey Arnold!, and SpongeBob SquarePants as Pearl.\\n\\nShe has also contributed voice work as \"The Boss\" in the videogame Metal Gear Solid 3: Snake Eater. Alan acted in one episode of Friends titled The One Where Monica Sings in Season 9. In addition to voice acting, she is also a stand up comedian.", BirthDate = new DateTime(1966, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mNfJWzuaKgkIaK7CuirXOMosd2h.jpg", Name = "Lori Alan" },
                        new { Id = 24625, Biography = "Milton Johns (born 13 May 1938) is an English actor whose thin features and talent for obsequious or oily characters has often influenced the many television parts he has received. He trained at the Bristol Old Vic Theatre School.  Johns was born in Bristol, Gloucestershire. He was in Coronation Street as Brendan Scott (1991–93), the shopkeeper who died of a heart attack while pedalling along the eponymous cobbled street. Other roles have included parts in Poldark, Born and Bred, Ever Decreasing Circles, Home to Roost, Dempsey and Makepeace, Murder Most English, Shoestring, Yes Minister, Some Mothers Do 'Ave 'Em, Softly, Softly, Going Straight, The Good Life, Don't Wait Up, Butterflies, Campion and Z-Cars. He played the landlord in The Basil Brush Show (2002–07).  Johns also played jobsworth Mr Cassidy in Murphy's Mob, an ITV children's television drama series (1982–85). His character helped to manage the building used by the junior supporters' of the football club, Dunmore United.  Johns has appeared in Doctor Who on several occasions: as Theodore Benik in The Enemy of the World; Guy Crayford in The Android Invasion; and Castellan Kelner in The Invasion of Time.  In 1972 he starred in the children's Sunday evening series The Intruder and in 1977, appeared in another children's series, Midnight Is A Place.  Johns also appeared as an Imperial Officer (Captain Bewil) in the 1980 Star Wars sequel, The Empire Strikes Back. He played Perker in the 1985 adaptation of The Pickwick Papers. In the 1986 television series War and Remembrance, Johns took the role of the senior Nazi SS officer Adolf Eichmann.", BirthDate = new DateTime(1938, 5, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//114XmLdlsWn9yY4ACX4U604Ueql.jpg", Name = "Milton Johns" },
                        new { Id = 24627, Biography = "From Wikipedia, the free encyclopedia. Oliver Cotton (born 20 June 1944 in London) is an English actor, known for his work on stage, TV and film.\\n\\nAfter training at the Drama Centre London, he has worked extensively at the Royal National Theatre playing in many productions including The Royal Hunt of the Sun, Rosencrantz and Guildenstern Are Dead, Much Ado About Nothing, As You Like It, Oedipus, In His Own Write, Hamlet, Tamburlaine, No Man's Land, The Passion, Despatches, Half Life, The World Turned Upside Down, Julius Caesar, The Madras House, The Man With the Flower in His Mouth, Tales from the Vienna Woods, The Crucible, Piano, Troilus and Cressida, Money, Summerfolk, The Villain's Opera, Life x 3.\\n\\nAt the Royal Court Theatre, he has appeared in The Local Stigmatic, The Duchess of Malfi, Man is Man, The Enoch Show, Erronenous Zones, The Tutor by Brecht, Lear and Bingo by Edward Bond and Piano/Forte by Terry Johnson.\\n\\nHe was a founder member of Joint Stock appearing in their inaugural production The Speakers by Heathcote Williams. At The Royal Shakespeare Company he has played in The Marrying of Ann Leete, Henry VI, Edward IV, Richard III, The Plain Dealer, Some Americans Abroad by Richard Nelson, Brand by Ibsen.\\n\\nHis West End appearances include The Homecoming by Harold Pinter, Children of a Lesser God by Mark Medoff, Benefactors by Michael Frayn (in whose Liberty Hall he also appeared in at the Greenwich Theatre), An Ideal Husband by Oscar Wilde, Life x 3 by Yasmina Reza, and Brand by Ibsen. He has also played the title role in King Lear at the Southwark Playhouse and Malvolio in Shakespeare's Globe's all-male production of Twelfth Night.\\n\\nHis many TV appearances have included The Borgias (Cesare Borgia), David Copperfield, The Year of the French, The Play on One, Redemption, Poirot, The Camomile Lawn, Westbeach, Zorro, Sharpe's Battle, Rhodes, All Quiet on the Preston Front, Innocents, Judge John Deed, Inspector Lynley, Waking the Dead, M.I.T.: Murder Investigation Team, Beastly Games, Sensitive Skin, Midsomer Murders, Hotel Babylon.\\n\\nHis films include Here We Go Round the Mulberry Bush, The Day Christ Died, Firefox, Oliver Twist, The Sicilian, Eleni, Hiding Out, Christopher Columbus, Son of the Pink Panther, The Innocent Sleep, Phoenix Blue, The Opium War, Beowulf, Baby Blue, The Dancer Upstairs, Shanghai Knights, The Bone Collector, Raindogs, Colour Me Kubrick.\\n\\nDescription above from the Wikipedia article Oliver Cotton, licensed under CC-BY-SA,full list of contributors on Wikipedia.  ", BirthDate = new DateTime(1944, 6, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//d193v7k42LUOfWud2R4W0KrenGy.jpg", Name = "Oliver Cotton" },
                        new { Id = 24697, Biography = "", BirthDate = new DateTime(1934, 6, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1994, 9, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xlz09P6AQ6MGGrU8j5EjfhoWwi9.jpg", Name = "Maria Carta" },
                        new { Id = 25129, Biography = "From Wikipedia, the free encyclopedia\\n\\nDonnie Wayne \"Don\" Johnson (born December 15, 1949) is an American actor known for his work in television and film. He played the lead role of Sonny Crockett in the 1980s TV cop series, Miami Vice, which led him to huge success. He also played the lead role in the 1990s cop series, Nash Bridges. More recently, Johnson played Kenny Powers' father on the HBO series, Eastbound and Down. Johnson is a Golden Globe winning actor for his role in Miami Vice, a winner of the APBA Offshore World Cup, and has received a star on the Hollywood Walk of Fame. He is also a singer, songwriter, producer, and director. The Donzie speedboat is not named after him as previously noted, it was named after the boats designer Don Aronow . It was thought to be named after him due to his time on the TV show, Miami Vice.\\n\\nThe Don Johnson is also a Miami Vice themed drink made from vodka, gin, curaçao, and orange juice.\\n\\nDescription above from the Wikipedia article Don Johnson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1949, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yQHW10SE2HyuaZmHvUrSxKhqqWg.jpg", Name = "Don Johnson" },
