                        new { Id = 25451, Biography = "Spencer Lee Wilding, is a Welsh actor and stuntman based in the UK. He is from St Asaph in North Wales.", BirthDate = new DateTime(1972, 7, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//g3FJIpQZri7gG515rLehuo81T6W.jpg", Name = "Spencer Wilding" },
                        new { Id = 25453, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nStefen Markus Fangmeier (born 9 December 1960 in El Paso, Texas, USA) has been a visual effects supervisor of numerous major feature films, including Lemony Snicket's A Series of Unfortunate Events, Saving Private Ryan, Terminator 2: Judgment Day, Twister, Perfect Storm and Master and Commander. He also has been a second unit director for two films, Dreamcatcher (2003) and Galaxy Quest (1999). After more than 15 years of visual effects work, Fengmeier moved into feature film directing with his debut on Eragon, which was released in 2006 and was a critical disappointment.\\n\\nDescription above from the Wikipedia article Stefen Fangmeier, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 12, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fv6ObyJnaielYg2YbgHFbszinYd.jpg", Name = "Stefen Fangmeier" },
