                        new { Id = 26088, Biography = "Douglas Christopher Judge (born October 13, 1964) is an American actor best known for playing Teal'c in the Canadian-American military science fiction television series Stargate SG-1, and has done voice acting for animated series and video games. He attended the University of Oregon on a football scholarship and was a Pacific Ten Conference player.\\n\\nDescription above from the Wikipedia article Christopher Judge, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1964, 10, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5ZS5BJwSRLXxujP1eUeX8tJRscF.jpg", Name = "Christopher Judge" },
                        new { Id = 26473, Biography = "Fisher Stevens is an American stage and screen actor, director, writer and producer. In 2010, he was honoured with an Academy Award in the category \"Best Documentary Feature\" for his movie \"The Cove\".", BirthDate = new DateTime(1963, 11, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//TutpOyw0A6FF5hEoFDYseI2EVN.jpg", Name = "Fisher Stevens" },
