                        new { Id = 26678, Biography = "", BirthDate = new DateTime(1957, 4, 9, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Bruce Winant" },
                        new { Id = 27165, Biography = "John Hollis was an English actor. He played the role of Lobot in Star Wars Episode V: The Empire Strikes Back and the German porter at the chateau in The Dirty Dozen. He appeared in the classic 1978 film Superman as one of the Elders of Krypton, and reprised his role in the 1980 theatrical version of Superman II. He also played the role of Ernst Stavro Blofeld in the cold open of the 1981 James Bond film For Your Eyes Only, going uncredited due to the controversy over the film rights and characters of Thunderball. In this sequence, his character was famously lifted from a wheelchair and dropped to his death down a chimney stack by Bond after he had attempted to kill Bond by using a remote control link to Bond's MI6 helicopter. Hollis also took the role of Sondergaard in the Jon Pertwee era of Doctor Who in the story The Mutants, and appeared in The Avengers episode The Cybernauts as a sensei and also in The Tomorrow People. John Hollis was a versatile character actor for BBC Radio. Notable roles include Magwitch in Great Expectations, Leonard Bast in Howards End, Conan Doyle's Inspector Lestrade and Shakespeare's Bardolph.", BirthDate = new DateTime(1931, 1, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2005, 10, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ts7bAzI7hvePWVprMjzHyvpBwNB.jpg", Name = "John Hollis" },
                        new { Id = 27319, Biography = "Christoph Waltz (born 4 October 1956) is an Austrian actor who also holds German citizenship. He received international acclaim for his portrayal of SS Colonel Hans Landa in the 2009 film Inglourious Basterds, for which he won the Best Actor Award at the Cannes Film Festival and the BAFTA, Golden Globe and Screen Actors Guild Award for Best Supporting Actor in 2009 and the Academy Award for Best Supporting Actor in 2010.", BirthDate = new DateTime(1956, 10, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2Hhztd4mUEV9Y25rfkXDwzL9QI9.jpg", Name = "Christoph Waltz" },
                        new { Id = 27578, Biography = "Ellen Philpotts-Page (born February 21, 1987), known professionally as Ellen Page, is a Canadian actress. Page received both Golden Globe and Academy Award nominations for Best Actress for her role as the title character in the film Juno.\\n\\nIn 2008, Page was nominated for Time's 100 Most Influential People list and placed #86 on FHM's Sexiest Women in the World list, and moved up to #70 for 2010. In June 2008, Page was named on Entertainment Weekly's future A-List stars list.\\n\\nPage resides in her hometown of Halifax, Nova Scotia and has two dogs named Julie and Sprout. She is prone to walk and talk in her sleep. In 2008, Page was one of 30 celebrities who participated in an online ad series for U.S. Campaign for Burma, calling for an end to the military dictatorship in Burma. She describes herself as a pro-choice feminist.\\n\\nIn the fall of 2008 Page spent a month living in an eco-village, studying permaculture at the Lost Valley Educational Center outside Eugene, Oregon.", BirthDate = new DateTime(1987, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//paexwBfmlVyzva7q4XgcBdqowmL.jpg", Name = "Ellen Page" },
                        new { Id = 27740, Biography = "Walton Sanders Goggins, Jr. (born November 10, 1971) is an American actor best known for his roles on the FX Networks series The Shield and Justified, portraying Detective Shane Vendrell and Boyd Crowder, respectively. He is also known for his character roles in the films Miracle at St. Anna and Predators. Goggins co-produced and starred in the 2001 short film The Accountant, which won an Academy Award for Best Live Action Short Film. Goggins accepted the award alongside Ray McKinnon and Lisa Blount.", BirthDate = new DateTime(1971, 11, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gA5nf2alzIPPjs1MSjS1PmrCedJ.jpg", Name = "Walton Goggins" },
                        new { Id = 27762, Biography = "Ian McDiarmid was born in Tayside, Scotland, in 1944. He studied for an M.A. in Clinical Psychology at The University of St Andrews, but eventually found that his calling was in theatre. He went to the Royal Academy in Glasgow, where he received the prestigious gold medal for his work. He now has a highly successful career as a theatre director, and from 1990 until his retirement in 2001 was Joint Artistic Director of London's Almeida Theatre in Islington. He and his co-director Jonathan Kent revived the Almeida and persuaded many Hollywood stars including Kevin Spacey, Ralph Fiennes and Anna Friel to tread the boards in their humble theatre. They won the coveted London Evening Standard Award in 1998 for their efforts. McDiarmid is also well known for his film and television appearances, and is perhaps most famous for his chilling performance as The Emperor in George Lucas's Star Wars films.", BirthDate = new DateTime(1944, 8, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sa6FTcK7xCHCFFR10jyOOOffd7f.jpg", Name = "Ian McDiarmid" },
                        new { Id = 27770, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDennis Christopher (born Dennis Carrelli on December 2, 1955) is an American actor. He was born in Philadelphia, Pennsylvania. He is known for playing Dave Stoller in Breaking Away and tragic film buff psychopath Eric Binford in Fade to Black.\\n\\nHis Golden Globe-nominated breakthrough role was as Dave Stohler in the coming-of-age classic Breaking Away (1979). Other roles include American track star Charlie Paddock in Chariots of Fire, and Fade to Black, science fiction movies like Plughead Rewired: Circuitry Man II. He has appeared in nearly 40 movies and made-for-TV movies since 1975. Television roles include \"Jack of All Trades\" in the Profiler TV series, Eddie Kaspbrak in Stephen King's It, Desmond Floyd in Jake Speed, and in the HBO series Deadwood.\\n\\nChristopher has guest starred in two Star Trek episodes: the Star Trek: Deep Space Nine episode \"The Search (Part II)\" and the Star Trek: Enterprise episode \"Detained\". He also guest-starred as the demon-sorcerer Cyvus Vail in three episodes of Angel. Christopher had a reunion with Breaking Away \"father\" Paul Dooley, again as his son, in an episode of TV's Law &amp; Order: Criminal Intent. The two had first played father and son in Robert Altman's A Wedding.\\n\\nIn December 2006 he played Dr. Martin Ruber in the Sci Fi Channel miniseries The Lost Room.", BirthDate = new DateTime(1955, 12, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sNFwlPHBAVn2fQIMVBTXMfx5E69.jpg", Name = "Dennis Christopher" },
                        new { Id = 27822, Biography = "", BirthDate = new DateTime(1935, 1, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2014, 12, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kthcBrIdXP9QwlKXkVzzRsHwJkq.jpg", Name = "David Ryall" },
