                        new { Id = 28413, Biography = "Carmen Argenziano an actor and producer.", BirthDate = new DateTime(1943, 10, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8fi4xfPwYVHulKvmTTlwBx2nvLo.jpg", Name = "Carmen Argenziano" },
                        new { Id = 28633, Biography = "Richard Dale Jenkins (born May 4, 1947) is an American stage, film, and television actor. After beginning his career in theatre, Jenkins made his film debut in 1974, and appeared in supporting roles in numerous film productions in the 1980s and the 1990s before coming to prominence in the early 2000s for playing the deceased patriarch Nathaniel Fisher on the HBO funeral drama series Six Feet Under. He has since established himself in Hollywood by appearing in lead roles in the films The Visitor and The Cabin in the Woods.\\n\\nDescription above from the Wikipedia article Richard Jenkins , licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1947, 5, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iz61iPIgNUp0yk48bRNjEJ5GHO4.jpg", Name = "Richard Jenkins" },
                        new { Id = 28847, Biography = "Rafe Joseph Spall is an English actor on both stage and screen. He is perhaps best known for his roles in BBC's The Shadow Line, Channel 4's Pete versus Life, One Day, Anonymous, and the Ridley Scott film Prometheus. He played writer Yann Martel in the 2012 film Life of Pi.", BirthDate = new DateTime(1983, 3, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7ucsDEWvcMU4SpxtZEaYErPpXHh.jpg", Name = "Rafe Spall" },
