                        new { Id = 30083, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLindsay Vere Duncan, CBE (born 7 November 1950) is a Scottish stage and television actress, and winner of a Tony Award for Private Lives.\\n\\nDescription above from the Wikipedia article Lindsay Duncan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1950, 11, 7, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//ddjjwMEHLBvzkZzZ5frEvJyWnZ6.jpg", Name = "Lindsay Duncan" },
                        new { Id = 30488, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nMiguel Sandoval  (born November 16, 1951) is an American film and television actor.\\n\\nSandoval was born in Washington, D.C. He began working as a professional actor in 1975 when he joined a mime school in Albuquerque, New Mexico. He later joined the troupe full time and continued his study of mime. He began his film career in the early 1980s. He had small roles in such acclaimed films Do the Right Thing, Jungle Fever, and Jurassic Park. After appearing in Clear and Present Danger in 1994, he began to take on larger roles, and appeared in Get Shorty, Up Close & Personal, and Blow.\\n\\nHaving appeared briefly in Repo Man and Sid and Nancy, Sandoval has also played the major roles of Treviranus (in Death and the Compass) and Bennie Reyes (in Three Businessmen) for director Alex Cox. In addition to film, Sandoval has acted in numerous television shows, often in recurring roles. Though shows such as The Court and Kingpin failed, he found a success with Medium in 2005, where he played D.A. Manuel Devalos until the series ended in 2011. Sandoval's other guest starring roles include appearances in popular series such as Frasier, The X-Files, Seinfeld and Lois & Clark: The New Adventures of Superman.\\n\\nSandoval has recently moved into directing, taking the helm for the third season Medium episode Whatever Possessed You which aired in March 2007. He has since directed one episode in each of seasons four through seven.\\n\\nDescription above from the Wikipedia article Miguel Sandoval, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1951, 11, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//x0mn76606kpJtzzl0B2nfJlZXkE.jpg", Name = "Miguel Sandoval" },
