                        new { Id = 31366, Biography = "From Wikipedia, the free encyclopedia\\n\\nJames Carter Walker Jr. (born June 25, 1947), known professionally as Jimmie Walker, is an American actor and comedian. Walker is best known for portraying James Evans Jr. (J. J.), the oldest son of Florida and James Evans Sr. on the CBS television series Good Times which originally ran from 1974–1979. Walker was nominated for Golden Globe awards Best Supporting Actor In A Television Series in 1975 and 1976 for his role. While on the show, Walker's character was known for the catchphrase \"Dy-no-mite!\" which he also used in his mid–1970s TV commercial for a Panasonic line of cassette and 8-track tape players. He also starred in Let's Do It Again with John Amos, and The Greatest Thing That Almost Happened with James Earl Jones. Walker continues to tour the country with his stand-up comedy routine.\\n\\nIn 1967, Walker began working full-time with WRVR, the radio station of the Riverside Church. In 1969, Walker began performing as a stand-up comedian and was eventually discovered by the casting director for Good Times, after making appearances on Rowan & Martin's Laugh In and on the Jack Paar Show. He eventually released one stand-up comedy album during the height of his Good Times popularity: Dyn-o-mite on Buddah Records (5635). During Good Times' 1974–75 season, Walker was 26 years old, though his character was much younger. John Amos, the actor who portrayed Walker's father on Good Times, was actually just eight years older than Walker. Walker credits producer/director John Rich for inventing \"Dy-no-mite!\" which Rich insisted Walker say on every episode. Both Walker and executive producer Norman Lear were skeptical of the idea, but the phrase and Walker's character caught on with the audience. Also, off- and on-camera, Walker did not get along with series' lead, Esther Rolle, who played Florida Evans, in the series, because she and Amos disapproved of Walker's increasingly buffoonish character and his popularity, and Walker felt hurt by their disdain. Dissatisfaction led Amos (before Rolle), to leave the show, making Walker the star of the show. Walker was the only Good Times star to not attend Rolle's funeral.", BirthDate = new DateTime(1947, 6, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3E8l7vhY1LHSOqbb6UTjRpHIZRM.jpg", Name = "Jimmie Walker" },
                        new { Id = 31422, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//n8yubYemSiZq5PB0AebjCDmHnWr.jpg", Name = "Ivan Massagué" },
                        new { Id = 31549, Biography = "Phillip \"Phil\" LaMarr (born January 24, 1967) is an American actor, comedian and voice actor. One of the original cast members on the sketch comedy series MADtv, he is also known for his voice acting on the animated series Futurama, Static Shock, Samurai Jack, Justice League, Justice League Unlimited, Star Wars: Knights of the Old Republic II The Sith Lords, Star Wars: The Clone Wars, Metal Gear Solid 2: Sons of Liberty, Metal Gear Solid 4: Guns of the Patriots, and inFAMOUS.", BirthDate = new DateTime(1967, 1, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2rYa0M1bOSAATGbF5oe5pmoNeDn.jpg", Name = "Phil LaMarr" },
                        new { Id = 31649, Biography = "From Wikipedia, the free encyclopedia.  \\n\\nBrooke Smith (born May 22, 1967) is an American actress. She is best known for her role on the TV show Grey's Anatomy as Dr. Erica Hahn and for her role as Catherine Martin in the 1991 film The Silence of the Lambs.\\n\\nDescription above from the Wikipedia article Brooke Smith, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1967, 5, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fiR32HbDUWCZuRjdlknQMIyIsrw.jpg", Name = "Brooke Smith" },
