                        new { Id = 32205, Biography = "Brendan Fletcher (born December 15, 1981) is a Canadian actor.\\n\\nDescription above from the Wikipedia article Brendan Fletcher, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1981, 12, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pt6kjBmnhamO1nvc1YqX3AczYpS.jpg", Name = "Brendan Fletcher" },
                        new { Id = 32349, Biography = "", Name = "Charles Wood" },
                        new { Id = 32363, Biography = "From Wikipedia, the free encyclopedia.\\n\\nWill Estes (born William Estes Nipper, October 21, 1978 in Los Angeles, California) is an American actor best known for his role as JJ Pryor, on the NBC drama American Dreams. In 2010, he joined the cast of Tom Selleck's new CBS police drama Blue Bloods. In the series, he plays Jamieson \"Jamie\" Reagan, a New York Police Department officer and the younger son of the fictional police commissioner, played by Selleck.\\n\\nEstes' break-out movie role was Seaman Ronald 'Rabbit' Parker on U-571. Early in his career, he did many commercials including Fruit of the Loom and numerous guest starring roles in shows like Highway to Heaven and Santa Barbara. Then he was chosen out of 700 other kids for the series The New Lassie. Since then he has had many starring roles in TV shows and he dabbled in the Music Video industry. He has appeared in Meat Loaf's video \"Objects In The Rear View Mirror May Appear Closer Than They Are\" (from Bat out of Hell II: Back into Hell) and was in Bon Jovi's video \"It's My Life\" with Shiri Appleby.\\n\\nIn 2000, according to a 2005 Soap Talk interview, Jon Bon Jovi asked him to be in his music video after he worked with him on U-571. He did most of his own stunts in the video. So far, this has been one of his favorite career moments.\\n\\nWill had a leading role in the Fox show Reunion. The show followed six best friends over the course of 20 years, with each episode marking the next successive year. When the group meets up for their 20th high school reunion, one turns up dead at the end of the night. In late 2005 Fox announced that the series would be cancelled due to low ratings and the identity of the murderer would not be revealed.\\n\\nAn upcoming project is a short movie Luz Del Mundo. He will be playing Jack Kerouac, a good friend of Neal Cassady. The movie is in post production and will be seen in future film festivals. It was written by Ty Roberts and David Trimble, directed by Ty Roberts and produced by Ryan McWhirter and John Pitts.\\n\\nHe has also appeared in a couple photographs, in the books Hollywood Splash ISBN 1-57687-183-5 and Men Before 10 AM Too ISBN 1-57687-084-7.\\n\\nHe was nominated 4 different times for one award, the Young Artist Awards for The New Lassie and Kirk.", BirthDate = new DateTime(1978, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aE4k0hiJN6VcBDN7ZasXZLV0a1N.jpg", Name = "Will Estes" },
                        new { Id = 32535, Biography = "", Name = "Jim Capobianco" },
                        new { Id = 32830, Biography = "Víctor Israel, born Josep Maria Soler Vilanova, was a Spanish film actor. He appeared in more than 200 feature films, shorts and tv-productions from 1961 to 2008. He made frequent appearances in rugged action films, excessive horror movies and gritty Italian spaghetti Westerns. Seldom did he have more than a few lines of dialogue and often he appeared in uncredited roles. Remembered as a veteran character actor.", BirthDate = new DateTime(1929, 6, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2009, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8PXsO9wKgvyKuXiesMoZNLHjfoj.jpg", Name = "Víctor Israel" },
                        new { Id = 33185, Biography = "Jeremy Bulloch (born 16 February 1945) is an English actor best known for the role of the bounty hunter Boba Fett in the original Star Warstrilogy,. He has appeared in numerous British television and film productions, including Doctor Who and Robin of Sherwood.", BirthDate = new DateTime(1945, 2, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yRnHoDmmWKdoLdiscCFfRpzzqMa.jpg", Name = "Jeremy Bulloch" },
                        new { Id = 33259, Biography = "Jennifer Love Hewitt (born February 21, 1979) is an American actress, singer-songwriter, film and television director and producer. Hewitt began her acting career as a child by appearing in television commercials and the Disney Channel series Kids Incorporated. She rose to fame in teenage popular culture in her roles in the Fox series Party of Five, as Sarah Reeves, and films I Know What You Did Last Summer and its sequel, as Julie James. As a singer, Hewitt has been signed by Atlantic Records and Jive Records. She is primarily known for her recordings in the pop genre. Her most successful single on the Billboard Hot 100 is the 1999 release \"How Do I Deal\", which peaked at No. 59. In addition, she has contributed music to the promotion or soundtracks of acting projects. Hewitt's appearance has been the subject of media attention throughout her career. She has been lauded as one of the most attractive women in the entertainment industry by publications such as Maxim, in which she was named the sexiest woman in the world in 1999, and TV Guide, which named her the sexiest woman on television in 2008. In 2007, paparazzi photos of Hewitt on a beach led to a much-publicized matter in which she defended her weight, and was supported by other celebrities. These incidents received coverage from People magazine. In addition to acting, Hewitt has also served as producer on some of her film and television projects. In 2010, Hewitt wrote a book on relationships entitled The Day I Shot Cupid. She also starred on the hit CBS television program Ghost Whisperer as Melinda Gordon, a young woman who can communicate with ghosts. She won a Saturn Award in 2007 and 2008 for Best Actress on Television. She was nominated for a Golden Globe for her television movie The Client List.\\n\\nDescription above from the Wikipedia Jennifer Love Hewitt, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1979, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//kp8cLdEivtJD5yu8Ij8xMeZ1Jc8.jpg", Name = "Jennifer Love Hewitt" },
                        new { Id = 33399, Biography = "From Wikipedia, the free encyclopedia\\n\\nBronagh Gallagher (born 1972) is an Irish singer and actress from Derry, Northern Ireland.\\n\\nDuring her teens she got involved, through school, in drama and music activities, and joined a local amateur dramatics group, the Oakgrove Theatre Company. At one time she was a backing singer in a local band, The Listener. Her big break came when she starred as Bernie in The Commitments. She has also appeared in such films as Thunderpants, You, Me &amp; Marley, Divorcing Jack, Pulp Fiction, Star Wars Episode I: The Phantom Menace and Last Chance Harvey, Sherlock Holmes, and on stage in a Théâtre de Complicité production of The Street of Crocodiles.\\n\\nHer first album Precious Soul was released in 2004 on the Salty Dog Records label and was produced by John Reynolds. The album features collaborations with Brian Eno on the songs \"He Don't Love You\" and \"Hooks\". Gallagher wrote most of the music on the album, played the drums and sang lead vocals.\\n\\nIn 2009, she starred alongside a well-known cast on the MySpace/Vertigo Films production Faintheart.\\n\\nDescription above from the Wikipedia article Bronagh Gallagher, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1972, 11, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nFeWufPvkdYOj4wyjF0zb9tL1rb.jpg", Name = "Bronagh Gallagher" },
                        new { Id = 33403, Biography = "Mac McDonald (born Terence McDonald, 18 June 1949, in Long Island, New York, USA) is an American actor. He is best known for playing Captain Hollister on the BBC TV series Red Dwarf and frequently plays American characters in other British TV shows. He has also had many movie roles in films such as Aliens, Batman and The Fifth Element, all of which were filmed in England.\\n\\nDescription above from the Wikipedia article Mac McDonald, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1948, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Mac McDonald" },
                        new { Id = 33625, Biography = "", Name = "Daniel B. Clancy" },
                        new { Id = 33655, Biography = "", BirthDate = new DateTime(1969, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eYERW4fLaXHd5pU04fimQ7nQqls.jpg", Name = "Erika Alexander" },
                        new { Id = 33685, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mms5qpMvookGWLw2UZ54QqO9hES.jpg", Name = "Tatiana S. Riegel" },
                        new { Id = 34901, Biography = "From Wikipedia, the free encyclopedia. \\n\\n \\n\\nJoanna Lamond Lumley, OBE, FRGS (born 1 May 1946) is an English actress, voice-over artist and author, best known for her roles in British television series Absolutely Fabulous portraying Edina Monsoon's best friend, Patsy Stone, as well as parts in The New Avengers, Sapphire &amp; Steel, and Sensitive Skin. She is a former model and Bond girl. Her distinctive voice has been supplied for animated characters, film narration, and AOL's \"You have email\" notification in the UK. She has spoken out as a human rights activist for Survival International and the Gurkha Justice Campaign, and is now considered a \"national treasure\" of Nepal because of her support. She is an advocate for a number of charities and animal welfare groups such as CIWF and Viva!. She has won three BAFTA awards and a British comedy award.\\n\\nDescription above from the Wikipedia article Joanna Lumley, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1946, 5, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2RFXqaFpeN9WmhfAyNaumz0rZUV.jpg", Name = "Joanna Lumley" },
                        new { Id = 35013, Biography = "David Oyelowo was born in Oxford in 1976. His family originates from Nigeria. David studied Theatre Studies for A level and his teacher suggested he should become an actor. After A levels David enrolled for a year on an Art foundation course. In December 2000 David became the first black actor to play an English monarch for the RSC taking the title role in Henry VI. His performance won him the 'Ian Charleson' Award 2001 for best newcomer in a classical play.", BirthDate = new DateTime(1976, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uhFLGQqNmhLgcqgITkoGoHy9FTl.jpg", Name = "David Oyelowo" },
