                        new { Id = 36592, Biography = "Saoirse Una Ronan (/ˈsɜːrʃə ˈuːnə ˈroʊnən/ sur-shə; born 12 April 1994) is an Irish and American actress. She is a three-time Academy Award nominee; receiving a Best Supporting Actress nomination for Atonement (2007), and Best Actress nominations for Brooklyn (2015) and Lady Bird (2017). She also received four BAFTA Award nominations, three Golden Globe nominations including one win for Best Performance by an Actress in a Motion Picture - Musical or Comedy for Lady Bird (2017), four Screen Actors Guild nominations and three Satellite Awards.\\n\\nShe had her feature film debut in the romantic comedy I Could Never Be Your Woman (2007). Other roles include City of Ember (2008), The Lovely Bones (2009), Hanna (2011), The Way Back (2010), Byzantium (2012), The Host (2013), How I Live Now (2013), and The Grand Budapest Hotel (2014).\\n\\nIn January 2016, Ronan was included in Forbes '30 Under 30' in both the European and USA editions. In March 2016, Ronan made her Broadway debut in a revival of the The Crucible, in the role of Abigail Williams, for which she received much acclaim. She appeared on the cover of Time magazine in June 2016, one of ten young leaders selected as 'Next Generation Leaders'.", BirthDate = new DateTime(1994, 4, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//88gXoCSPvhWo7aGTjoCRqRRx9xM.jpg", Name = "Saoirse Ronan" },
