                        new { Id = 44208, Biography = "From Wikipedia, the free encyclopedia\\n\\nNigel Bennett (born 19 November 1949) is an English actor/director/writer who has been based in Canada since 1986. He is best known for playing the vampire patriarch Lucien LaCroix in the TV series Forever Knight, for which he won the Canadian Gemini Award for best supporting actor in a dramatic series.\\n\\nDescription above from the Wikipedia article Nigel Bennett, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1949, 11, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wx1zmmpMi9luYFGzikSBIvwyDdR.jpg", Name = "Nigel Bennett" },
                        new { Id = 44482, Biography = "", BirthDate = new DateTime(1964, 3, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Robert Graf" },
                        new { Id = 45210, Biography = "Jarratt was born and grew up in Wongawilli, a small rural town near Wollongong, New South Wales and later in the Snowy Mountains area. Jarratt’s father was a coal miner and later a concreter, who worked on the Snowy Mountains hydroelectric scheme. His 5x great-grandfather, George Jarratt, born 1833, came from Croxton in Cambridgeshire, England; his son, John, married a Mary Kelly from Ireland. While in high school, Jarratt directed and acted in a school play which was a great success and led to his school principal recommending him for an acting career.  Jarratt graduated from the National Institute of Dramatic Art (NIDA) in 1973. His screen debut was in The Great Macarthy. He also appeared in Peter Weir’s Picnic at Hanging Rock in 1975 and Summer City in 1977 with Mel Gibson. Jarratt had the lead role in the mini series The Last Outlaw playing Ned Kelly in 1979. He played a major supporting role as a young Australian soldier in Vietnam war movie The Odd Angry Shot, 1980. In the late 1980s, Jarratt recognised he had a problem with binge drinking and related violence and joined Alcoholics Anonymous, an organisation in which he continues to be active.  In the 1990s, he was a presenter on the lifestyle show Better Homes and Gardens with then-wife Noni Hazlehurst. He had guest roles in Inspector Morse, Police Rescue, Blue Murder, Water Rats and Blue Heelers in the 1990s and 2000s. He joined the cast of McLeod’s Daughters in 2001, and left the show in 2006. In 2010, Jarratt appeared in a commercial for Husqvarna.\\n\\nIn May 2013, Jarratt filmed a guest star role in the third instalment of the ABC telemovie series, Jack Irish: Dead Point.  In 2005, he had a major role in the Australian film Wolf Creek, playing the villain Mick Taylor.[5] In 2007, he appeared in two films, Rogue and The Final Winter. Jarratt also had a small role in the 2008 film, Australia, as a soldier.\\n\\nIn 2008, Jarratt launched his own film production company, Winnah Films. Winnah’s first feature film, Savages Crossing (originally carrying the working title Flood) went into principal photography outside Ipswich, Queensland in February. In 2009, he appears as the father of a teenage girl via phone in Telstra’s “Next G” commercials.  In 2010, Jarratt starred in the ensemble exploitation extravaganza, Bad Behaviour, written and directed by Joseph Sims. In the same year, Jarratt also had a role in the supernatural horror movie Needle.\\n\\nHe made a cameo in Quentin Tarantino’s Django Unchained in 2012, appearing as an employee of the Le Quint Dickie Mining Company alongside Tarantino himself, both appearing with Australian accents.\\n\\nIn February 2013, Jarratt reprised his role as Mick Taylor, filming the Wolf Creek sequel, Wolf Creek 2, with Matt Hearn producing and Greg McLean directing. The film was released on 20 February 2014.  In January 2014, a new thriller called StalkHer began filming on the Gold Coast, Queensland. The film is co-directed by Jarratt, who also stars in the production. The producer of the film is ‘OZPIX’, a production company partly owned by Jarratt. Filming was completed in February 2014, and will screen later in the year.", BirthDate = new DateTime(1951, 8, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yRUY3lMYP5NTkxc54Wrj8NgXxAu.jpg", Name = "John Jarratt" },
