                        new { Id = 46418, Biography = "Mickey Knox was an American actor and good friend of Lee Strasburg. When the McCarthy hearings blacklisted Knox as a possible Communist sympathizer, he found his career in ruins and subsequently moved to Italy where he became central in their dubbing industry.  He found work as a dialog director, dubber, producer, voice actor, and writer as he would often be charged with translating scripts for the numerous Italian films to be shot in English. Knox worked closely with other dubbing legends including Robert Rietty, Lewis E. Cianelli, Ted Rusoff, and Robert Spafford. Like them, he would continue to occasionally appear in front of the camera as well.", BirthDate = new DateTime(1921, 12, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2013, 11, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5tyGEyr0PwKt9tFhDySAFekOj7S.jpg", Name = "Mickey Knox" },
