                        new { Id = 54564, Biography = "George Buck Flower (October 28, 1937 – June 18, 2004) was an American actor, writer, producer, assistant director, production manager, and casting director. He was sometimes credited as Buck Flower, George \"Buck\" Flower, George Flower, Buck Flowers, C. D. LaFleur, C.D. LaFleure, C.D. Lafleuer, and C.D. Lafleur.\\n\\nDue to his gruff appearance, he was often cast as a drunk or homeless character. Director John Carpenter gave Flower a cameo role in almost every film he made throughout the 1980s.\\n\\nFlower was also the father of actress/costume designer Verkina Flower. He succumbed to cancer at age 66 on June 18, 2004.\\n\\nDescription above from the Wikipedia article George Buck Flower, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1937, 10, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2004, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xHzW4GszCLTZLNxvTcKL9ICuLIc.jpg", Name = "George Buck Flower" },
                        new { Id = 54693, Biography = "Emily Jean \"Emma\" Stone is an American actress best known for her deadpan acting style, husky voice, and red hair. Having been born in Arizona she dropped out of high school at age 15 to move to Hollywood and pursue acting. Though naturally a blonde her first role ever was landed after dying her hair brunette and eventually red by director Judd Apatow for her breakout role in Superbad. Her notable low voice is a side effect from incessant screaming as a baby.", BirthDate = new DateTime(1988, 11, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lhjnYohEn2HflqCEnWuuilcNUsj.jpg", Name = "Emma Stone" },
                        new { Id = 54855, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nJoseph Pilato (born March 16, 1949) is an American film and voice actor.\\n\\nDescription above from the Wikipedia article Joseph Pilato, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1949, 3, 16, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6rlSP8oxYygfjri8beGlFLDxSy1.jpg", Name = "Joseph Pilato" },
                        new { Id = 55091, Biography = "Cornelius C. \"Neil\" Brown, Jr. (born June 19, 1980) is an American actor. His most recognizable role may be in the television series The Walking Dead as Guillermo, leader of the Vatos and as Felix on the short-lived South Beach on the former UPN. He also played DJ Yella in the 2015 biopic, Straight Outta Compton.\\n\\nBrown was born in Orlando, Florida, to Cornelius Brown, a US Marine, and Carrie Brown, an insurance underwriter.\\n\\nHe appears alongside Denzel Washington in Out of Time (2003) and Colin Farrell in Tigerland (2000). He plays the smart-mouthed Marine, Lcpl. Richard \"Motown\" Guerrero, in the action film Battle: Los Angeles. The movie reunited him with Fast &amp; Furious castmate Michelle Rodriguez.  He has since performed guest appearances in the TV shows Harry's Law, Castle, the season 8 premiere of Weeds, the first-season finale of USA's Suits, and the new independent sketch comedy King Bachelor's Pad.\\n\\nDescription above from the Wikipedia article Neil Brown Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1980, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mv2DgT9RABBYCxOY4ZHYalYBiUt.jpg", Name = "Neil Brown Jr." },
