                        new { Id = 57755, Biography = "Woodrick Tracy \"Woody\" Harrelson (born July 23, 1961) is an American actor and comedian. Harrelson's breakthrough role came in the television sitcom Cheers as bartender Woody Boyd. Notable film characters include basketball hustler Billy Hoyle in White Men Can't Jump, bowler Roy Munson in Kingpin, serial killer Mickey Knox in Natural Born Killers, magazine publisher Larry Flynt in The People vs. Larry Flynt, country singer Dusty in A Prairie Home Companion, bounty hunter Carson Wells in No Country for Old Men, zombie killer Tallahassee in Zombieland, blind piano player/meat salesman Ezra Turner in Seven Pounds, conspiracy nut Charlie Frost in 2012, a delusional man who believes that he is a superhero named Defendor in Defendor and Cpt. Tony Stone in The Messenger. For The People vs. Larry Flynt and The Messenger, Harrelson earned Academy Award nominations for Best Actor and Best Supporting Actor, respectively.\\n\\nDescription above from the Wikipedia article Woody Harrelson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1961, 7, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tFAngknlbFZebWVMaFFLFIsFvLE.jpg", Name = "Woody Harrelson" },
