                        new { Id = 63296, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJohn Charles \"J.C.\" MacKenzie (born 17 October 1970, height 6' 1\" (1,85 m)) is a Canadian actor. He is known for his roles as Arnold Spivak in Steven Bochco's ABC television series Murder One (1995–1997), Reagan \"Normal\" Ronald in James Cameron's Dark Angel television series (FOX from 2000—2002) and Ludlow in Martin Scorsese's The Aviator (2004).", BirthDate = new DateTime(1970, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//znCOHTsdWW1WgrJ8NuYecdcSqOE.jpg", Name = "J.C. MacKenzie" },
                        new { Id = 63978, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJodi Marie Benson (born Jodi Marie Marzorati on October 10, 1961) is an American voice actress and soprano singer. She is best known for providing both the speaking and the singing voices of Disney's Princess Ariel in The Little Mermaid and its sequels. In 2002 and 2006, she reprised the role of Ariel in the English versions of the Kingdom Hearts series. Most recently Benson voiced the high-profile animated character Barbie in the 1999 movie Toy Story 2 and the 2010 movie Toy Story 3.\\n\\nDescription above from the Wikipedia article Jodi Benson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1961, 10, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9tOpKgu6cBBL29LxEC21fOVVVPW.jpg", Name = "Jodi Benson" },
