                        new { Id = 65534, Biography = "Polish-born German-American character animator, most noted for his work at Walt Disney Animation Studios.  Deja's work includes serving as supervising animator on characters in  several Disney animated films, including the Disney villains Gaston from Beauty and the Beast, Jafar from Aladdin, Scar from The Lion King and the hero Hercules from Hercules. -Wikipedia", BirthDate = new DateTime(1957, 4, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1VGoB3RPHqf0qhEHActAsWxfaiK.jpg", Name = "Andreas Deja" },
