                        new { Id = 65731, Biography = "Samuel Henry John \"Sam\" Worthington is an Australian actor, best known for the portrayals of Jake Sully in Avatar, Marcus Wright in Terminator Salvation and Perseus in Clash of the Titans and its sequel, Wrath of the Titans, and Alex Mason in the video game Call of Duty: Black Ops and its sequel Call of Duty: Black Ops II.\\n\\nIn 2004, Worthington received Australia's highest film award for his lead performance in Somersault. He performed predominantly in leading roles in a variety of low-budget films before moving to major studio films, ranging from romantic drama and comedy-drama to science fiction and action.\\n\\nDescription above from the Wikipedia article Samuel L. Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1976, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9XzAE3ZnCnazub4xrSY8YBN7sNq.jpg", Name = "Sam Worthington" },
                        new { Id = 65780, Biography = "", Name = "Scott Bernstein" },
                        new { Id = 65827, Biography = "Keith David Williams (born June 4, 1956), better known as Keith David, is an American film, television, and voice actor, and singer. He is perhaps most known for his live-action roles in such films as Crash, There's Something About Mary, Barbershop and Men at Work. He has also had memorable roles in numerous cult favorites, including John Carpenter's films The Thing (as Childs) and They Live (as Armitage), the Riddick films Pitch Black and The Chronicles of Riddick (as the Imam), the General in Armageddon, King in Oliver Stone's Platoon, and Big Tim in Darren Aronofsky's Requiem for a Dream. David is also well known for his voice over career, primarily his Emmy winning work as the narrator of numerous Ken Burns films. Characters that he has voiced include Goliath on the Disney series Gargoyles, the Arbiter in Halo 2 and Halo 3, David Anderson in Mass Effect and Mass Effect 2, the Decepticon Barricade in Transformers: The Game, Julius Little in Saints Row and Saints Row 2, Sgt. Foley in Call of Duty: Modern Warfare 2, Dr. Facilier in The Princess and the Frog, and Chaos in Dissidia: Final Fantasy and Dissidia 012 Final Fantasy.\\n\\nDescription above from the Wikipedia article Keith David, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1956, 6, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nwAC9TgwRkj0Ritq93O8GeublyL.jpg", Name = "Keith David" },
