                        new { Id = 66142, Biography = "", Name = "Kenneth Wannberg" },
                        new { Id = 66190, Biography = "Tony Bancroft has spent the past 16 years developing his skills as an  Animator/Director with Walt Disney Feature Animation, Sony Imageworks,  and currently with Toonacious Family Entertainment, his own animation  studio.\\n\\nIn 2001, with his two partners, Tony started Toonacious Family  Entertainment, as Executive VP/Creative Production. Using his 16 years  experience in the animation industry, Tony has helped to make Toonacious  an animation studio committed to producing quality family  entertainment. -IMDB", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mZr5XBPTWHUgYDN8r3NS6POXTWK.jpg", Name = "Tony Bancroft" },
                        new { Id = 66193, Biography = "Christopher Michael \"Chris\" Sanders (born March 15, 1960) is an American film animator and voice actor best-known for co-directing and co-writing the Disney animated feature Lilo & Stitch, and providing the voice of Experiment 626 from Lilo & Stitch and Leroy from Disney's Leroy & Stitch. After being later dismissed from Walt Disney Animation Studios, Sanders went on to work for DreamWorks Animation, directing the highly acclaimed animated feature film, How to Train Your Dragon. He is currently serving as co-director on the upcoming feature, The Croods.\\n\\nDescription above from the Wikipedia article Chris Sanders (director), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1960, 3, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//m4kZMS2J0AFjlAuwtijEmsOXYfc.jpg", Name = "Chris Sanders" },
