                        new { Id = 68763, Biography = "From Wikipedia, the free encyclopedia.\\n\\nDean Winters (born July 20, 1964) is an American actor, who has portrayed Ryan O'Reily on HBO's Oz, Johnny Gavin on FX Network's Rescue Me, and Dennis Duffy on NBC's 30 Rock. He also currently portrays \"Mayhem\" in Allstate commercials.\\n\\nDescription above from the Wikipedia article Dean Winters, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1964, 7, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1BUNhhGs5drp5plGstAE8WKmfyq.jpg", Name = "Dean Winters" },
                        new { Id = 68939, Biography = "", Name = "Jack Grossberg" },
                        new { Id = 69133, Biography = "From Wikipedia:\\n\\nBorn in New York City, New York, he worked for The Walt Disney Company as a character designer and story artist beginning in 1933 on the Mickey Mouse short, \"Mickey's Gala Premiere\". He was a Disney legend.  He created the Queen in Snow White and the Seven Dwarfs. He co-wrote Dumbo. He also led development of Pinocchio and Fantasia. During World War II, Grant worked on war cartoons including the Academy Award winning Der Fuehrer's Face. He left the Disney studio in 1949 and ran a ceramics business and a greeting card business but returned in 1989 to work on Beauty and the Beast. He also worked on Aladdin, The Lion King, Pocahontas, Mulan, Fantasia 2000, and Pixar's Monsters, Inc. among others.  The last two films he worked on before his death, Chicken Little and Pixar's Up, were dedicated to him. Grant worked four days a week at Disney until he died, nine days before his 97th birthday. Grant's final project, Lorenzo, for which he conceived the idea and helped storyboard, received an Academy Award nomination in 2005.", BirthDate = new DateTime(1908, 5, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2005, 5, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mg7LDm6HN26fWDJSmlJCkp8oSCd.jpg", Name = "Joe Grant" },
                        new { Id = 69227, Biography = "", Name = "Bill Mechanic" },
                        new { Id = 69415, Biography = "", BirthDate = new DateTime(1949, 9, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nwdAp8FacfZ1eRU7gNkOwWvDqnc.jpg", Name = "Ernie Sabella" },
                        new { Id = 69476, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5wSg6QryUOlxMT5UxE8dQsxjEIB.jpg", Name = "Ashley McGuire" },
                        new { Id = 69494, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nDonald Lee Stroud (born 1 September 1943) is an American actor and surfer who appeared in many films in the 1960s, 1970s and 1980s, and has starred in over 100 movies and 175 television shows to date.\\n\\nDescription above from the Wikipedia article Don Stroud, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1943, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7jT8523HL3myVWDXPpNOqf9Ubp0.jpg", Name = "Don Stroud" },
                        new { Id = 69948, Biography = "William Bowers (Las Cruces, 1916 - Woodland Hills, California, 1987) was a reporter in Long Beach, California before becoming a screenwriter and specializing in writing comedy westerns and also turned out several thrillers. His first credited screenplay was My Favorite Spy in 1942.\\n\\nHis career noticeably picked up after his Oscar nomination for the gritty Gregory Peck Western The Gunfighter in 1950, leading to such assignments as the remake of My Man Godfrey in 1957 and The Sheepman in 1958 (a second Oscar nomination).\\n\\nBowers produced the last film that he wrote, the superior Western parody Support Your Local Sheriff! (1969). He also had a bit part as an actor in The Godfather Part II (1974).", BirthDate = new DateTime(1916, 1, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1987, 3, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//31257PgXpPD7npsbBlO9eZoKgXK.jpg", Name = "William Bowers" },
                        new { Id = 70225, Biography = "John Nolan is an actor.", BirthDate = new DateTime(1938, 4, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1Is0RIeDdAXlXft1EfqC97qiJl5.jpg", Name = "John Nolan" },
                        new { Id = 70250, Biography = "", BirthDate = new DateTime(1922, 2, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2000, 2, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Newt Arnold" },
                        new { Id = 70417, Biography = "Michael Sheard (18 June 1938 – 31 August 2005) was a Scottish actorwho featured in a large number of films and television programmes and was best known for playing villains. His most prominent television role was as strict deputy headmaster Maurice Bronson in the British children's series Grange Hill which he played from 1985-89. His most prominent film role was that of Admiral Ozzel in The Empire Strikes Back (1980).", BirthDate = new DateTime(1938, 6, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(2005, 8, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//a29SbacT0kV8WWuoAMp2FHI5Y7I.jpg", Name = "Michael Sheard" },
                        new { Id = 70509, Biography = "", Name = "Martin Bergmann" },
                        new { Id = 70772, Biography = "From Wikipedia, the free encyclopedia.\\n\\nKathryn \"Kathy\" Mullen is an actress, voice actress, and puppeteer most closely associated with Jim Henson projects. She began performing on The Muppet Show in its third season, primarily as Gaffer the Backstage Cat. She also voice directed Dog City for Nelvana, worked as a designer for The Muppet Movie, a performing assistant for Yoda on The Empire Strikes Back, and was one of the creators of Between the Lions. While reprising this character for several Muppet movies, she also created the character of Mokey - a gentle, New Age style Fraggle - on Henson's Fraggle Rock. She performed the Gelfling Kira in the movie The Dark Crystal, Allegra on \"Allegra's Window\", and Leona the Lion on \"Between the Lions\".\\n\\nKathy Mullen, with her husband, former Muppet designer Michael K. Frith, has joined forces with British charity \"No Strings\" to create a film for children in Afghanistan, warning of the dangers of land mines. In the film, \"The Story of the Little Carpet Boy,\" one puppet loses several limbs before he learns to avoid land mines completely. Kathy and Michael picked up the idea from Johnie McGlade, an emergency aid worker who used a scruffy rabbit puppet to bring smiles to the faces of people who had lived through earthquakes, hunger, or genocide.\\n\\nDescription above from the Wikipedia article Kathryn Mullen, licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1940, 2, 10, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//e3EzSopbVgMVZTNSCNiQu7N2Dow.jpg", Name = "Kathryn Mullen" },
                        new { Id = 70851, Biography = "Thomas Jacob \"Jack\" Black (born August 28, 1969) is an American comedian, actor and musician.\\n\\nHe makes up one half of the comedy and satirical rock duo Tenacious D. The group has two albums as well as a television series and a film. His acting career is extensive, starring primarily as bumbling, cocky, but internally self-conscious outsiders in comedy films. He was a member of the Frat Pack, a group of comedians who have appeared together in several Hollywood films, and has been nominated for a Golden Globe award. He has also won an MTV Movie Award, and a Nickelodeon Kids Choice Award.\\n\\nDescription above from the Wikipedia article Jack Black, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 8, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vMXgtzMdt2jSAjOECFQ5F53blbr.jpg", Name = "Jack Black" },
