                        new { Id = 71536, Biography = "Matthew Russell Wood (born August 15, 1972) is an American sound engineer and employee of Skywalker Sound. For the last 15 years, he has worked on numerous film projects, his work being credited as sound editing and sound design. He has been an innovative force within the industry, pioneering new technologies for motion picture sound. He is currently a Supervising Sound Editor employed at Skywalker Sound in Marin County, California.", BirthDate = new DateTime(1972, 8, 15, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//oB9wVbEIg8fjY3ulDKjKsGn2A55.jpg", Name = "Matthew Wood" },
                        new { Id = 71586, Biography = "Alfie Allen was born in Hammersmith, London. His older sister is singer Lily Allen. Allen's first professional appearance was in a one-off Channel 4 comedy, You Are Here in 1998. The same year, Allen and his sister Lily appeared in the 1998 film, Elizabeth, which was produced by their mother. His early work included small roles in Agent Cody Banks 2: Destination London, Atonement and BBC1's historical hospital drama, Casualty 1907. In 2008, he took over Daniel Radcliffe's role in the stage play, Equus. Currently, he is best know for his role as Theon Greyjoy in the hit series from HBO, Game of Thrones.  Allen has continued to work in films, appearing in Soulboy, The Kid, Freestyle and Powder in 2010. In 2012, he starred in the upcoming British thriller, Confine. ", BirthDate = new DateTime(1986, 9, 12, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4q6yzSMi8Q5XeIn5A1yUD1tEfwq.jpg", Name = "Alfie Allen" },
