                        new { Id = 74276, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nCindy Lou Pickett (born April 18, 1947) is an American actress best known for her 1970s role as Jackie Marler-Spaulding on the CBS soap Guiding Light; her role as Dr. Carol Novino on the hugely-popular television drama St. Elsewhere in the 1980s; for her critically acclaimed performance as the real-life Kay Stayner, the mother of a boy who was kidnapped for several years, in the dramatic TV movie I Know My First Name Is Steven; and for her cinematic roles and performances as Valerie St. John in Roger Vadim's little-known 1980 erotic cult film, Night Games, for which she would have the leading role, and as the tough-as-nails and heroic Dr. Jane Norris in the 1989 sci-fi-horror film DeepStar Six. Pickett, however, is handily best-known to audiences for her highly memorable turn as Katie Bueller, Matthew Broderick's titular character's loving and unsuspecting mother, in the 1986 classic and iconic American comedy movie Ferris Bueller's Day Off.", BirthDate = new DateTime(1947, 4, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6CqKvPebiGfLtPkUO2wJi9kd572.jpg", Name = "Cindy Pickett" },
