                        new { Id = 76064, Biography = "From Wikipedia, the free encyclopedia.\\n\\nKathleen Beller (born February 19, 1956, in Westchester, New York) is an actress. She was nominated for a Golden Globe Award for Best Motion Picture Actress in a Supporting Role for her role in Promises in the Dark (1979). She was noted for her youthful appearance, unusually long hair, large brown eyes and buxom figure.\\n\\nDescription above from the Wikipedia article Kathleen Beller, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1956, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1PmMe9QAvhiR7NGvtgyRfrO6Hxo.jpg", Name = "Kathleen Beller" },
