                        new { Id = 77264, Biography = "Ashlie Atkinson (born August 6, 1977) is an American stage, film, and television actress.", BirthDate = new DateTime(1977, 8, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//h0ykP84QXTDLxfzizdQaFXZzzY8.jpg", Name = "Ashlie Atkinson" },
