                        new { Id = 78021, Biography = "From Wikipedia, the free encyclopedia\\n\\nLloyd Kaufman (born December 30, 1945) is an American film director, producer, screenwriter and occasional actor. With producer Michael Herz, he is the co-founder of Troma Entertainment film studio, and the director of many of their feature films, including The Toxic Avenger and Tromeo and Juliet. Kaufman also serves as chairman of the Independent Film &amp; Television Alliance. Description above from the Wikipedia article Lloyd Kaufman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1945, 12, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//zTylEHdJL422WZ1vjEmEkDoWkk7.jpg", Name = "Lloyd Kaufman" },
