                        new { Id = 82219, Biography = "From Wikipedia, the free encyclopedia.\\n\\nLuis Valdez (born June 26, 1940) is an American playwright, writer and film director.\\n\\nHe is regarded as the father of Chicano theater in the United States.\\n\\nDescription above from the Wikipedia article Luis Valdez, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1940, 6, 26, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Luis Valdez" },
                        new { Id = 82312, Biography = "​From Wikipedia, the free encyclopedia.\\n\\nMaja Ostaszewska  (born September 3, 1972) is a Polish actress.\\n\\nShe was born in Kraków, the daughter of Polish musician Jacek Ostaszewski. She started her acting training in her native Kraków and later graduated from PWST, in 1996. She has since acted mostly on Teatr Rozmaitości in Warsaw, working with well-known Polish directors such as Krystian Lupa, Krzysztof Warlikowski and Grzegorz Jarzyna.\\n\\nIn 1993, during her acting training, she played a small role in Steven Spielberg's Schindler's List. Although her actual real film debut was in 1997, with the TV movie Przystań. For this role, she received the Best Actress Award at the Polish Film Festival held in Gdynia in 1998.\\n\\nOstaszewska recently played one of the main characters in Academy Award nominated Andrzej Wajda's Katyń.\\n\\nDescription above from the Wikipedia article Maja Ostaszewska (b. 10 April 1966 in Radzymin) is a Polish movie and stage actor., licensed under CC-BY-SA, full list of contributors on Wikipedia", BirthDate = new DateTime(1972, 9, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wkuVBi76iPd3O4JNts3YLFx6TcX.jpg", Name = "Maja Ostaszewska" },
                        new { Id = 82639, Biography = "", BirthDate = new DateTime(1986, 2, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wewyxidwQYHZxemnZdlYL7lQdOs.jpg", Name = "Ophelia Lovibond" },
                        new { Id = 83002, Biography = "Jessica Chastain (born March 24, 1977) is an American theater, film and television actress. She played guest roles in several television shows before making her feature film debut with the 2008 independent film Jolene.\\n\\nIn 2011, Chastain gained wide public recognition for her starring roles in seven film releases; for her performance in The Help she received Best Supporting Actress nominations at the Academy Award, Golden Globe, BAFTA, and Screen Actors Guild Award ceremonies. In 2012, Time magazine featured her as one of the \"100 Most Influential People in the World\". Chastain's performance in the 2012 military thriller Zero Dark Thirty and the 2013 horror film Mama led film critic Richard Roeper to describe her as \"one of the finest actors of her generation\". For the former, she won a Golden Globe Award for Best Actress (Drama) and received a nomination for the Academy Award for Best Actress.", BirthDate = new DateTime(1977, 3, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nkFrkn5NZVGWb4b2X0yIcXezhyt.jpg", Name = "Jessica Chastain" },
