                        new { Id = 83223, Biography = "Donnie Keshawarz (born July 30, 1969) is a Canadian film and television actor.\\n\\nHe was born in Guelph, Ontario, Canada and is of Afghan and Lithuanian descent.[citation needed]\\n\\nSince 1987, Keshawarz has appeared in numerous television roles, most notably in a recurring role in 2003 as Yusuf Auda on the television series 24.\\n\\nHe has also appeared in several films.\\n\\nDescription above from the Wikipedia article Donnie Keshawarz , licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1969, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//srTrT1DAjIhM4YMakExGcjLnpQi.jpg", Name = "Donnie Keshawarz" },
                        new { Id = 83271, Biography = "Glen Thomas Powell Jr. is an American actor, writer, and producer. Powell was born and raised in Austin, Texas by Glen Sr. and Cyndy Powell. He has one older sister, Lauren Powell, who lives in Houston, Texas. His younger sister, Leslie Powell, is a singer. Before moving to Los Angeles, Glen became an active member of the Sigma Phi Epsilon Fraternity and attended The University of Texas at Austin, majoring in Radio, Television and Film. Powell began performing in professional theatre with roles in The Music Man, Oliver, O. Henry, and The Sound of Music. He also was part of the award winning performance troupe, the \"Broadway Texas Players\" from 1999–2003. He has starred in television shows such as Into the West, Jack & Bobby, CSI: Miami, Without a Trace, along with feature films The Great Debaters, The Hottest State, Fast Food Nation, Jumping Off Bridges, The Safe Side, The Wendell Baker Story, and Spy Kids 3-D: Game Over. In 2007, before his first year of college, Glen landed a role in The Great Debaters, directed by and starring Denzel Washington. Since moving to Los Angeles, he has starred in television shows such as: Into the West, Jack & Bobby, CSI: Miami, Without a Trace, Rizzoli & Isles and The Lying Game along with feature films including: The Hottest State, Fast Food Nation, Jumping Off Bridges, The Safe Side, The Wendell Baker Story and The Dark Knight Rises. Most recently, he filmed the independent feature Stuck in Love.[2][3] In 2013, Powell was cast in a role in The Expendables 3.", BirthDate = new DateTime(1988, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//sCeY5nuPUhfwWElxNtXuwRYKMBr.jpg", Name = "Glen Powell" },
                        new { Id = 83356, Biography = "From Wikipedia, the free encyclopedia\\n\\nJames \"Jamie\" Campbell M. Bower (born 22 November 1988) is an English actor who is best known for his role as Anthony Hope in Tim Burton's Sweeney Todd: The Demon Barber of Fleet Street, his role of Caius in The Twilight Saga: New Moon and his role of King Arthur in the Starz original series Camelot. He also appeared as the young Gellert Grindelwald in the two-part Harry Potter and the Deathly Hallows and will play Jace Wayland in the upcoming film adaption of the Mortal Instruments (series).\\n\\nDescription above from the Wikipedia article Jamie Campbell Bower, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1988, 11, 22, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//wzuENDUCak8HKRh72Jj7p3BQ7NY.jpg", Name = "Jamie Campbell Bower" },
                        new { Id = 83367, Biography = "", BirthDate = new DateTime(1977, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cWJfFaL04KA7IcdNvxGhDStuLfQ.jpg", Name = "Krzysztof Soszynski" },
                        new { Id = 83860, Biography = "Aldis Alexander Basil Hodge (born September 20, 1986) is an American actor best known for portraying Alec Hardison on the TNT series Leverage. He also portrayed MC Ren in the 2015 biopic, Straight Outta Compton.\\n\\nHodge was born on September 20, 1986 in Onslow County, North Carolina. Both of his parents, Aldis Basil Hodge and Yolette Evangeline Richardson, served in the U.S. Marine Corps. Hodge's mother is from Florida, while his father is originally from Dominica. Aldis is the younger brother of actor Edwin Hodge.\\n\\nHodge played both the clarinet and the violin as a child, but as an adult, his focus is on the violin; he purchased his first at the age of 18. In addition to acting, Hodge designs watches, writes, and paints.\\n\\nIn 2007, Hodge was awarded the role of Alec Hardison on the day of his twenty-first birthday. In 2010, he received a Saturn Award nomination for Best Supporting Actor in Television for this role on Leverage. The win went to Aaron Paul of AMC's Breaking Bad.\\n\\nDescription above from the Wikipedia article Aldis Hodge, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1986, 9, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bwnP5uuAsJgceLF2kJbeMJN0ONP.jpg", Name = "Aldis Hodge" },
                        new { Id = 84115, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJason Michael Weaver (born July 18, 1979) also known by his stage name J-Weav, is an American actor and singer. He is perhaps best known for his television roles as a pre-teenage Michael Jackson in the Emmy Award-winning 1992 miniseries The Jacksons: An American Dream, and as the older brother Marcus Henderson on the WB sitcom Smart Guy.\\n\\nDescription above from the Wikipedia article Jason Weaver, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1979, 7, 18, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//cF8uNJYPN1PiIypkmsLWJwFfczV.jpg", Name = "Jason Weaver" },
