                        new { Id = 84495, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJess Q. Harnell (born December 23, 1963) is an American voice actor and singer, best known for voicing Wakko Warner on Animaniacs and Hunter on Road Rovers. Harnell has been the announcer for America's Funniest Home Videos since 1998.\\n\\nDescription above from the Wikipedia article Jess Harnell, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1963, 12, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//28IRdSEiIndu0vuTqV90cZK2uJq.jpg", Name = "Jess Harnell" },
