                        new { Id = 87130, Biography = "From Wikipedia, the free encyclopedia.\\n\\nMark A.Z. Dippé (born 1958 in Alaska) is an American film director and visual effects supervisor. He has directed numerous films from 1997 to now, starting with Spawn.\\n\\nHe is co-founder of The Animation Picture Company.\\n\\nDescription above from the Wikipedia article Mark A.Z. Dippé, licensed under CC-BY-SA, full list of contributors on Wikipedia .", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//aXHVL2NmsCnMgwnacF2YBkOJ73x.jpg", Name = "Mark A.Z. Dippé" },
                        new { Id = 87173, Biography = "Kyle and frequent collaborator Chris Yost are perhaps best known for the creation of mutant character X-23, teenage female clone of Wolverine. In 2003, Kyle and Yost co-wrote the episodes of X-Men: Evolution that introduced X-23 to the X-Men: Evolution universe. Marvel executives were impressed with X-23’s reception on TV, and subsequently asked Yost and Kyle to adapt the character into comics, first by writing the character into a six issue eponymous mini-series, and then by taking over writing chores (as of issue #20) on the New X-Men (formerly New X-Men: Academy X) title, bringing X-23 in as a regular character. The success of X-23's first miniseries (X-23: Innocence Lost) prompted Marvel to order a second six-issue miniseries with Kyle and Yost at the helm, titled X-23: Target X.\\n\\nKyle and Yost concluded their stint on the New X-Men title after the events of \"X-Men: Messiah Complex\" when the title turned into Young X-Men. Chris Yost and Kyle co-wrote the revamped X-Force with Clayton Crain on pencils; the cast featured Wolverine, Warpath, Wolfsbane, and X-23 as black ops agents on assassination missions per the orders of Cyclops. The series ended in 2010 and was replaced by Uncanny X-Force, written by Rick Remender.", BirthDate = new DateTime(1971, 11, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Craig Kyle" },
