                        new { Id = 94864, Biography = "Maximilian Carlo \"Max\" Martini (born December 11, 1969) is an American film, theater and television actor known for his roles as Corporal Fred Henderson in Saving Private Ryan, Wiley in Level 9, First Sergeant Sid Wojo in The Great Raid, and as Sergeant Mack Gerhardt on the military television drama, The Unit.", BirthDate = new DateTime(1969, 12, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fUGKNDsQnKCLzNrWyyBkx7O26XC.jpg", Name = "Max Martini" },
                        new { Id = 95051, Biography = "Tom's ability to deliver a powerful performance is not affected, but rather drawn from his real life experience. He grew up in the remote, unpopulated canyons of the Rocky Mountains doing things most of us only see in movies, like riding horses, breaking wild mustangs, driving cattle and training wild animals. He became a sponsored motorcycle racer and a world champion MMA fighter. He traveled the world in the occupation of bodyguard and \"executive protection\". But Tom's life-long dream was always set on becoming a filmmaker, and he made that dream come true and he figured out how to bridge the gap between reality and film by seeing the world through a camera lens: as grip, gaffer, camera operator, second unit director, director of photography, producer and director. His physical power, strength, agility and coordination are legendary, and his stunt resume impressive. His commitment to acting training led Tom to immerse himself in classes, workshops, private coaching, linguistics, improvisation, comedy, and Meisner techniques. [from IMDB]", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uiHr8zBlA319vnYavsqsDtwKxV2.jpg", Name = "Tom Proctor" },
                        new { Id = 95577, Biography = "From Wikipedia, the free encyclopedia. Jake Canuso (Carmine Canuso) was born in Switzerland to Italian descendants. In his late teens he trained as a professional dancer in London.\\n\\nCanuso has worked with Elton John, Annie Lennox, featured in Take That's \"Sure\" video and was a backing dancer for the Spice Girls SpiceWorld 1998 tour, where he befriended Louie Spence and Emma Bunton. He is best known for his role in the ITV series Benidorm as the barman Mateo. Canuso can speak six languages fluently including English, Spanish and Italian. Description above from the Wikipedia article Jake Canuso, licensed under CC-BY-SA,full list of contributors on Wikipedia.", BirthDate = new DateTime(1970, 1, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vzOkr261d23tdtMhXJp6cC2gkfu.jpg", Name = "Jake Canuso" },
                        new { Id = 95697, Biography = "​From Wikipedia, the free encyclopedia.  \\n\\nDileep Rao is an American actor who has appeared in feature films and television series. He starred in Sam Raimi's horror film Drag Me to Hell (2009), James Cameron's science fiction film Avatar (2009), and Christopher Nolan's thriller Inception (2010).\\n\\nDescription above from the Wikipedia article Dileep Rao, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1973, 7, 29, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//lsnmeKueImKeToe4oNo4YWie4aM.jpg", Name = "Dileep Rao" },
