                        new { Id = 96841, Biography = "Matthew David Lewis III is an English actor, best known for playing Neville Longbottom in the Harry Potter films.\\n\\nLewis was born in Horsforth,Leeds,West Yorkshire, England, the son of Adrian and Lynda Lewis. He has two older brothers and a foster sister.\\n\\nLewis has been acting since he was five years old. He started off with minor parts in television programmes, debuting in Some Kind of Life, and then went on to try out for the part of Neville Longbottom. He has portrayed Neville Longbottom in the first six Harry Potter films and is scheduled to be in the future Harry Potter films. For his role as Neville Longbottom, Lewis wears yellow and crooked false teeth, two-sizes-too-big shoes and has plastic bits placed behind his ears in order to make them stick out more. This is done to give the character a more clownish look.", BirthDate = new DateTime(1989, 6, 27, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//v9Ow0JEtJZCaKDMvdKXNnzEzmy1.jpg", Name = "Matthew Lewis" },
