                        new { Id = 115755, Biography = "Disney animator, whose contributions to animation have included several  Disney leading or title characters, most notably heroines. His work  includes Princess Jasmine in Aladdin, Young Simba in The Lion King and Mulan in Mulan. He has also been animator of such films as 2007's Enchanted and the Goofy short How to Hook Up Your Home Theater. Additionally he directed the award-winning short film John Henry. Recently, he was the supervising animator of Princess Tiana in The Princess and the Frog.", BirthDate = new DateTime(1958, 4, 6, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vMQ65QSAUskSbCLAgbShWZsaT4X.jpg", Name = "Mark Henn" },
                        new { Id = 115854, Biography = "Matthew was born and raised in Toronto, Canada. After graduating from Upper Canada College, he moved to London where he trained at LAMDA and then at the Webber Douglas Academy of Dramatic Arts. He then worked extensively in theatre in the UK, including playing leading parts in the West End productions of 'The Miracle Worker' and 'The Boys in the Band'. He also started landing film parts there, doing two films for Richard Attenborough as well as Saving Private Ryan (1998). He moved back to Toronto in 1998 where he immediately booked the sketch comedy TV series History Bites(1998) (for which he was nominated for a Gemini Television Award in 2000) as well as guest leads on 'Traders','The Associates' and 'Twice in a Lifetime'. He then landed the part of Henry Guyrich in X-Men (2000) in which he morphed into Rebecca Romijn-Stamos.  Matthew moved to Los Angeles in late 2001 and married Tove Limm on September 28, 2001 in Hualalai, Hawaii.", BirthDate = new DateTime(1968, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9iydy7N6gUjLliv9hO4IbR5cxQx.jpg", Name = "Matthew Sharp" },
