                        new { Id = 123879, Biography = "Matthew Nable (born 8 March 1972) is an Australian film and television actor, writer and former professional rugby league footballer After playing in the Winfield Cup Premiership during the 1990s for the Manly-Warringah and South Sydney clubs, he wrote and starred in the rugby league-centered drama The Final Winter in 2007. Nable went on to act in films such as Killer Elite and Riddick. He appears on The CW's Arrow as Ra's al Ghul.", BirthDate = new DateTime(1972, 3, 8, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yE5MHKIUreuzL5bEgh8NTN8bSYe.jpg", Name = "Matthew Nable" },
