                        new { Id = 125025, Biography = "Joey Lynn King (born July 30, 1999) is an American teen actress widely known for her starring role as Ramona Quimby in Ramona and Beezus, the 2010 adaption of Beverly Cleary's book series with the same title with Disney star Selena Gomez. She also released a single for the movie called \"Ramona Blue\".\\n\\nKing was featured in Battle: Los Angeles, where she played a girl named Kirsten, who was battling for her life with the help of many courageous Marines. Also in 2011 she co-starred in Crazy, Stupid, Love. In 2012 King had a role in Christopher Nolan's third Batman film, The Dark Knight Rises as a young Talia al Ghul.\\n\\nFrom Wikipedia, the free encyclopedia", BirthDate = new DateTime(1999, 7, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//Al8fXl18U4AwYP4wMVkHovfXk5n.jpg", Name = "Joey King" },
                        new { Id = 125660, Biography = "Andrew Scott (born October 21, 1976) is an Irish film, television, and stage actor. He received the 2005 Laurence Olivier Award for Outstanding Achievement in an Affiliate Theatre for the Jerwood Theatre Upstairs production of A Girl in a Car with a Man and an IFTA award for the film Dead Bodies. Scott's notable television roles have included Paul McCartney in the BBC television drama Lennon Naked and arch-villain Moriarty in Sherlock.", BirthDate = new DateTime(1976, 10, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//3yu4zC3OVq2lvmMqnPT4RYH4sBU.jpg", Name = "Andrew Scott" },
