                        new { Id = 127558, Biography = "Andrea Louise Riseborough (born 20 November 1981) is an English stage and film actress. Her film appearances include Birdman, Oblivion, Welcome to the Punch, Disconnect, Shadow Dancer, W.E., Brighton Rock, Made in Dagenham, Never Let Me Go, Happy-Go-Lucky, and Venus.", BirthDate = new DateTime(1981, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5Qi1DVUts9gahVpj1dCtspbwcAC.jpg", Name = "Andrea Riseborough" },
                        new { Id = 129101, Biography = "​From Wikipedia, the free encyclopedia\\n\\nLance Reddick (born December 31, 1962, height 6' 2½\" (1,89 m)) is an American theater, film and TV actor and musician born in Baltimore, Maryland. He starred in The Wire as Cedric Daniels, appeared in Oz as Detective Johnny Basil and appeared in the fourth and fifth seasons of Lost. He now has a prominent role in Fringe. Previously Reddick also starred in two episodes of Law &amp; Order.", BirthDate = new DateTime(1969, 12, 31, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5t4j7zvsjG5UyVxBJzly5OUMR3x.jpg", Name = "Lance Reddick" },
                        new { Id = 129314, Biography = "", BirthDate = new DateTime(1925, 6, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Al Mulock" },
                        new { Id = 129319, Biography = "", BirthDate = new DateTime(1918, 6, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//9I1oyF0Fee3pQABnADhG0Kq73Vw.jpg", Name = "Ivy Bethune" },
                        new { Id = 129868, Biography = "J.D. was born in the delta town of Greenville, Mississippi (also the birthplace of Muppets creator Jim Henson) on the same day Richard Nixon was elected president. He is of Irish-French-German-Cherokee-Choctaw decent, the oldest of 7 siblings, and attended 17 different schools (public and private) while moving back and forth between his mother and father. His great-great-great-great uncle was Horace Mann, the founder of the American Public School system. His father (Puddin - yep, that's what they call him) is a welder/artist/amateur archaeologist and inventor. His mother (Sally) has had many professions, including concert promoter and owner of a country/western nightclub called The Headless Horseman, where as a young child, J.D. spent many school nights until the wee hours of the morning hanging out backstage and on stage with the likes of Hank Williams, Jr., Juice Newton, Jerry Lee Lewis, Johnny Paycheck, David Allen Coe, Ray Price, and many others.\\n\\nAfter a short stint in college and a 15 month stint in the Marine Corps stationed at 29 Palms, California and after hanging out with some actors in L.A., J.D. thought he would give acting a shot. His only experience with acting had been playing the Prince in his pre-school production of The Nutcracker, and getting kicked out of his senior play, Oklahoma, after his second rehearsal because he and a friend drank a beer before hand. After the Marine Corps, he returned to Mississippi and worked as a debt collector for his mother's collection agency. After a year of hating his job, he decided to return to college and get a degree in theatre at The University of Southern Mississippi. Once on stage at college, he knew acting was what he had to do. His second year in theatre, he was one of 20 finalists in the state selected to attend SETC (Southeastern Theatre Conference). In 1995, a friend offered J.D. a $1,000 to come to Los Angeles and perform a lead role in his play \"Dylan's Ghost\" at the Morgan-Wixson Theatre in Santa Monica. J.D. took him up on the offer and left college a semester before graduating and since then has lived back and forth between Hollywood, California, Austin, Texas, and Oxford, Mississippi, where he just completed writing and directing his first independent feature Glorious Mail(2005).\\n\\nEven though he appeared on the short-lived game show, Hollywood Showdown with Todd Newton and won nearly $12,000, his friends like to tell him that he's almost one lucky son of a gun. Mainly because he's come so close to landing lead roles in major films so many times, usually being the director's second choice. In 2004 his luck proved true once again when he purchased a $100 raffle ticket and was 1st Runner Up (2nd Choice) for a $250,000 house in United Way's New Home Giveaway, where instead he won an artist's print worth $80.  IMDb Mini Biography By: JDsMOM", BirthDate = new DateTime(1968, 11, 5, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//iNn9JV3Kk7VJ9ICYKdjgwFq8EpF.jpg", Name = "J.D. Evermore" },
                        new { Id = 130735, Biography = "José Ramón Rosario is an actor.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//nvcYE46PsMPfFlyhguZMSe7bzOx.jpg", Name = "José Ramón Rosario" },
                        new { Id = 130843, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//DJj5tzb25LanRIeHoNtDccNm7b.jpg", Name = "Rosemary Howard" },
                        new { Id = 131119, Biography = "Richard “Bo” Dietl was a New York City Police Officer and Detective from June 1969 until he retired in 1985.  Bo was one of the most highly decorated detectives in the history of the police department, with several thousand arrests to his credit.  There were two particular cases that represent his career highlights.  The first was what former New York City Mayor Edward I. Koch labeled “...the most vicious crime in New York City history” (1981) which involved a nun who was raped and tortured in an East Harlem convent as 27 crosses were carved into her by two men, who later confessed and were convicted.  The second was the Palm Sunday Massacre in 1984, which was one of New York City’s most bloody mass slayings, of ten people.  Bo was instrumental in the arrest and conviction of the suspects in both cases.  \\n\\n \\n\\nBo is the co-author of the book “One Tough Cop”, which is a story about his life as a New York City police detective.  The movie version of “One Tough Cop” was made into a major motion picture. Bo’s next book, entitled “Business Lunchatations”, a story about networking and business strategies hit stores in April 2005, ranking #5 on Amazon’s Business Best Seller List.  Since then, Bo has embraced many faceted roles in the industry such as Associate Producer for the movie “The Bone Collector” and Producer for the movie “Table One.”  Bo entered into the television realm as an Executive Producer of ABC’s “The Runner” which was to be released back in 2002.  He also was Executive Producer of “The Gray Area” on CBS TV.", BirthDate = new DateTime(1950, 12, 4, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//p4g45Hu2GX8YgzMsAv4DnPvVZjt.jpg", Name = "Bo Dietl" },
                        new { Id = 131237, Biography = "", BirthDate = new DateTime(1970, 12, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//p2YkdXoS34b4HbPkPoTy11CbOYK.jpg", Name = "Agnieszka Wagner" },
                        new { Id = 131667, Biography = "From Wikipedia, the free encyclopedia.\\n\\nBenjamin Jeremy \"Ben\" Stein (born November 25, 1944) is an American actor, writer, lawyer, and commentator on political and economic issues. He attained early success as a speechwriter for American presidents Richard Nixon and Gerald Ford. Later he entered the entertainment field and became an actor, comedian, and Emmy Award-winning game show host.\\n\\nStein has frequently written commentaries on economic, political, and social issues, along with financial advice to individual investors. He is the son of economist and writer Herbert Stein,[1] who worked at the White House under President Nixon. His sister, Rachel, is also a writer. While as a character actor he is well-known for his droning, monotone delivery, in real life he is a public speaker on a wide range of economic and social issues.\\n\\nDescription above from the Wikipedia article Ben Stein, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1944, 11, 25, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//w0sjKYVV7BCK6SBpJy3KmogxLld.jpg", Name = "Ben Stein" },
