                        new { Id = 132538, Biography = "Jack Purvis was a British film actor. Purvis was a dwarf, and thus was mainly cast in roles requiring actors of short stature. Purvis appeared as a different alien creature in each of the three films of the original Star Wars trilogy, and also appeared in three of director Terry Gilliam's early fantasy films: Time Bandits, Brazil, and The Adventures of Baron Munchausen. Several years before his death, Purvis became quadriplegic after breaking his neck in a car accident. He died in November 1997 at the age of 60.", BirthDate = new DateTime(1937, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), DeathDate = new DateTime(1997, 11, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tuFTY1jhlEgZm3vM80KdAEvHwNI.jpg", Name = "Jack Purvis" },
