                        new { Id = 133451, Biography = "Aya Rachel Cash (born July 13, 1982) is an American actress, the daughter of poet and novelist Kim Addonizio and Buddhist teacher Eugene Cash, and the granddaughter of Wimbledon champion Pauline Betz Addieand sportswriter Bob Addie. In 2014, Cash was listed among \"10 Comic Actresses Who Deserve A Big-Screen Leading Role\" by Indiewire.", BirthDate = new DateTime(1982, 7, 13, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//xoZn7H0to2NwBtNj2knjUVtgsFW.jpg", Name = "Aya Cash" },
