                        new { Id = 134235, Biography = "From Wikipedia, the free encyclopedia.\\n\\nJacob Edward \"Jake\" Hoffman (born March 20, 1981) is an American actor.\\n\\nHe was born in Los Angeles County, California, the son of actor Dustin Hoffman and Lisa Hoffman (née Gottsegen). He is best known for playing the adult version of Ben Newman in the 2006 comedy fantasy film Click. He and his father both appeared in Barney's Version with Dustin Hoffman cast as the father of the protagonist, and Jake as his grandson.\\n\\nDescription above from the Wikipedia article Jake Hoffman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1981, 3, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6WdRhZyEk8S0stnzdAFtbhEVEms.jpg", Name = "Jake Hoffman" },
