                        new { Id = 139044, Biography = "From Wikipedia, the free encyclopedia\\n\\nMaia Luisa Brewton (born September 30, 1977) is an American actress who enjoyed success in the late 1980s and early 1990s.\\n\\nBrewton was born in Los Angeles, California. She is probably best known as the Mighty Thor-obsessed kid, Sara Anderson, in Adventures in Babysitting, and as Shelly Lewis on one of the Fox Network's earliest shows, Parker Lewis Can't Lose.\\n\\nIn addition to these more prominent roles, Brewton starred in the movies Sky Trackers with Pamela Sue Martin and A Family for Joe with Robert Mitchum. She also co-starred in the hit film Back to the Future as Sally Baines, the younger sister of Lorraine Baines played by Lea Thompson.\\n\\nHer television credits include 21 Jump Street, Highway to Heaven, Trapper John, M.D. and The Wonder Years. She also played Margaret Ann Culver in the short-lived television series, Lime Street with co-stars Robert Wagner and Samantha Smith.\\n\\nApart from her film and television roles, Maia Brewton acted in various theatre productions, most notably at the City Garage Theatre in Santa Monica, California.\\n\\nDescription above from the Wikipedia article Maia Brewton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1977, 9, 30, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//w10sqQx1ANA2KFwYc37gS4Kl8Up.jpg", Name = "Maia Brewton" },
                        new { Id = 139086, Biography = "John T. Kretchmer is an American film and television director.\\n\\nThroughout his career he has amassed a number of television credits namely Buffy the Vampire Slayer, Angel, Charmed, The Twilight Zone, Hercules: The Legendary Journeys, Special Unit 2 (also a producer), Dark Angel, Psych, Burn Notice, Veronica Mars, Star Trek: Deep Space Nine, Star Trek: Voyager, Moonlight and other series.\\n\\nPrior to a career in television, Kretchmer worked as a assistant director on number of films such as The In-Laws (1979), Baby Boom (1987), The Naked Gun: From the Files of Police Squad! (1988).\\n\\nDescription above from the Wikipedia article John T. Kretchmer, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", BirthDate = new DateTime(1954, 7, 23, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "John T. Kretchmer" },
