                        new { Id = 141432, Biography = "Allen Maldonado was born May 20, 1983 and named after his mother Alleen in the city of Bellflower, California. As a child Allen started to entertain at the early age of 5. \"He would hit the floor and break dance at the slightest sound of music\" Says his mother. At the age of seven things started to change for Allen due to a dangerous environment and some of his neighbors in Compton. He, his mother and two older sisters moved into a home in Rialto, California. His first foray into the entertainment business was dancing on Soul Train. This first love would lead him to his true love... Acting! Allen's senior year in high school is when the acting bug bit him. He performed in numerous comedy shows and pep rallies. After graduating he took some acting classes in the Inland Empire which put him in front of a manager by the name of Vance from Advance LA. This would help him make the transition to Los Angeles. His first appearance as a working actor would come soon afterwards. Starring in a PBS educational program called \"Madison Heights\" Allen portrayed the role of \"Tyrone\" a young street thug. Noticing the charisma and potential in Allen, Vance would later refer him to a woman that would change his life forever...Mrs. Bobbie Shaw Chance. Her alumni is some of the most wanted actors in the business such as Drew Barrymore, Giovanni Ribisi, Kiko Ellworth, and many other of Hollywood's elite. With Bobbie's help and that of an extraordinary fellow student by the name of Choice Skinner, Allen would grow from a young man with an extreme amount of raw energy and charisma to a bona fide \"A\" list actor. Allen quickly grew to love and understand the craft of acting. Shortly after joining Bobbie's acting studio, Allen booked his first big screen appearance in the hit film \"Friday After Next\" as a juvenile delinquent that would attack Ice Cube and Mike Epps with a pool stick. Currently Allen has a recurring role on the Emmy award winning soap opera \"The Young and The Restless\" as Jamal. He participates in a National Radio program called the \"The Courtyard\" as Malcolm Y every Saturday from 1:00 to 2:00 on the popular radio station KPFK 90.7. In the immediate future Allen has three films that will be premiering this fall. They are as follows, \"God Army 2: States of Grace\" as Rob, \"America 101\" as a smart mouth sarcastic ticket clerk and \"A Beautiful Life\" as Portfolio a young aspiring guitar player.", BirthDate = new DateTime(1983, 5, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//f2So7S5UBlzGVDwjjbkd6gQTYgP.jpg", Name = "Allen Maldonado" },
