                        new { Id = 181782, Biography = "Il est le fils du compositeur John Williams et de l'actrice Barbara Ruick. En 1986, après le départ de Fergie Frederiksen, il entre dans le groupe de rock Toto, avec lequel il enregistre deux albums, Fahrenheit en 1986 et The Seventh One en 1988. Il quitte le groupe en 1988 pour entamer une carrière solo1.\\n\\nEn 1997, il participe avec le bassiste Mike Porcaro et le claviériste Steve Porcaro au projet des « Porcaro Brothers » : il enregistre avec eux la chanson officielle de la Ligue des Champions de 1997, Young at Heart.\\n\\nIl collabore à nouveau avec le groupe Toto en 2006, sur l'enregistrement de Falling in Between, où il officie en tant que choriste sur le single Bottom of Your Soul. En 2010, il réintègre le groupe après le départ de Bobby Kimball, en participant aux tournées internationales en hommage à Mike Porcaro, atteint d'une sclérose latérale amyotrophique2. En 2014, Williams enregistre avec le groupe un nouvel album, Toto XIV, dont la sortie est prévue pour mars 2015.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//6cGy4r3b3r7u2oe3RrXAi7JvtoN.jpg", Name = "Joseph Williams" },
