                        new { Id = 204191, Biography = "Aramis Knight is an American actor. Knight was born in Woodland Hills, California. In 2005, Knight began acting in commercials and playing minor screen roles. Since then, he has guest starred and appeared as recurring characters on multiple television series, including Psych, NCIS, Lost, Dexter, and Boston Legal. Knight has most recently starred as Bean in the film Ender's Game. His previous film roles includedCrossing Over and Rendition. Knight has also done voice acting for multiple projects, including Shrek Forever After.", BirthDate = new DateTime(1999, 10, 3, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//8YwHVJtJGvSDg6leZDggV8xKPd8.jpg", Name = "Aramis Knight" },
