                        new { Id = 206919, Biography = "Daniel Kaluuya (born 24 February 1989) is an English actor and writer. Kaluuya played Chris Washington in the 2017 horror film Get Out,[1] Posh Kenneth in the E4 teen-drama Skins, and Bing in the Black Mirror episode \"Fifteen Million Merits\".\\n\\nHe also appeared as Tealeaf in the BBC dark comedy series Psychoville and Mac in the BBC Three horror drama The Fades. Kaluuya appeared as Agent Tucker in the 2011 film Johnny English Reborn, alongside Rowan Atkinson, and in 2013, he appeared in the film Kick-Ass 2.\\n\\nDescription above from the Wikipedia article Daniel Kaluuya, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1989, 2, 24, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//24trqMr2PBwAmttp9X4F3ZErgt4.jpg", Name = "Daniel Kaluuya" },
