                        new { Id = 234352, Biography = "Margot Elise Robbie (born 2 July 1990) is an Australian actress. She is known for her role as Donna Freedman on the soap opera Neighbours, which earned her two Logie Award nominations. In 2011, Robbie began starring as Laura Cameron in the ABC drama series Pan Am. Following Pan Am's cancellation, Robbie has appeared in the feature films About Time, The Wolf of Wall Street, Suicide Squad and many more. She got nominated for Best Actress at the Academy Awards for the 2017 biographical film I, Tonya.", BirthDate = new DateTime(1990, 7, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//njwWJLoSZ7PQiEl6K7KWDB71K1O.jpg", Name = "Margot Robbie" },
