                        new { Id = 291263, Biography = "Jordan Peele attended the Computer School in I.S. 44 for Junior High School and went on to attend The Calhoun School for high school, graduating in 1997. He then went on to attend Sarah Lawrence College as a member of the class of 2001. His mother is white and his father is black. Jordan has been dating comedian Chelsea Peretti since 2013.", BirthDate = new DateTime(1979, 2, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//2ZJgEIgG31efrRO2mUFnXxDi47E.jpg", Name = "Jordan Peele" },
