                        new { Id = 467645, Biography = "Robert Boyd Holbrook (born September 1, 1981) is an American fashion model, actor, and artist. He has appeared in films such as Milk, Out of the Furnace, Run All Night, A Walk Among the Tombstones, and Gone Girl, and stars as DEA Agent Steve Murphy in the Netflix series Narcos. In 2017, he portrayed villain Donald Pierce in Logan.", BirthDate = new DateTime(1981, 9, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//531YOKa2usleWCA55t6Db4MZhT3.jpg", Name = "Boyd Holbrook" },
