                        new { Id = 588183, Biography = "Es una actriz española nacida en Salamanca en 1992. Estudió interpretación en las escuelas Arte 4 y Metrópolis. Empezó su carrera como actriz participando en diversos cortometrajes. Su primera aparición en la gran pantalla fue en la película 'Planes para mañana' de Juana Macías en 2010. En la televisión es donde consiguió los papeles que la hicieron popular entre el gran público. Ha participado en 'Amar es para siempre', 'Tierra de lobos', 'Sin identidad' y 'La que se avecina'. También participa en la tercera temporada de la serie de Antena 3 'Velvet'.", BirthDate = new DateTime(1992, 12, 28, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//gdy33TDif5uXJWd8OEKl25hN6Yg.jpg", Name = "Silvia Alonso" },
