                        new { Id = 1008395, Biography = "Hanold-Lynch verließ mit 16 Jahren ihr Elternhaus und finanzierte sich selbst das Abitur. Ihr Germanistik- und Psychologiestudium an der Freien Universität Berlinbrach sie bald ab, um nach New York zu gehen. Dort besuchte sie die Neighborhood Playhouse School of Theatre von Sanford Meisner. Sie studierte gemeinsam mit Philip Seymour Hoffman mehrere Jahre bei dem Method-Lehrer Tony Greco. An der Columbia University, Graduate Film Division arbeitete sie mit Leonore de Koven in Directing Actors in Film, wirkte in Studentenfilmen mit, nahm weiteren Schauspielunterricht und stand als Gründungsmitglied einer Theatergruppe auf der Bühne, unter anderem in John Patrick Shanleys Stücken Danny and the Deep Blue Sea als Roberta und in Savage in Limbo in der Rolle der April White. Hanold-Lynch war verheiratet mit James E. Lynch, dessen Namen sie nach der Trennung behielt. 1994 kehrte sie nach Berlin zurück. Von 1999 bis 2010 arbeitete sie durchgängig als Schauspiel-Coach vorbereitend und am Set für unterschiedlichste Film- und Fernsehproduktionen, beginnend mit der Serie St. Angela. Als Dozentin konzipierte und präsentierte sie 2001 den Live-Workshop „Kamera läuft!“ im Rahmen des SAT.1 Actors’ Day auf dem Filmfest München, bei dem sie junge Leute aus dem Publikum live vor laufender Kamera coachte. 2009 entschied sie sich für einen künstlerischen Neuanfang als Schauspielerin. Parallel dazu systematisierte sie eigene Techniken der Rollenerarbeitung und ist seit 2010 als freier Coach und als Dozentin für Internationale Castings am iSFF (Institut für Schauspiel, Film- und Fernsehberufe Berlin) tätig. Stephen Daldry legte Hanold-Lynch beim Casting für Der Vorleser nahe, ihre eigene Schauspielkarriere voranzutreiben und Drehbuchautor David Hare schrieb ihr eine Rolle ins Drehbuch. Die Begegnung bewirkte, dass sich Hanold-Lynch beruflich neu ausrichtete. Seither hat sie Nebenrollen in weiteren großen internationalen Kinoproduktionen gespielt, u. a. an der Seite von Liam Neeson in Unknown Identity, an der Seite von Tom Hanks in Cloud Atlas, zuletzt als Tochter von Tilda Swinton und Schwester von Adrien Brody in Wes Andersons Grand Budapest Hotel. Auch in Deutschland stellt sie seit 2009 in Kino- und Fernsehproduktionen ihre Wandlungsfähigkeit unter Beweis. Franziska Augstein schrieb in der Süddeutschen Zeitung über ihre Figur der Else Weidt in Ein blinder Held – Die Liebe des Otto Weidt: „Dieser Film ist großes Kino (...) Großartig ist Heike Hanold-Lynch, die als Weidts verbittert-verbiesterte, eifersüchtige und nicht besonders attraktive Ehefrau auftritt.“ Neben Edgar Selge in der Titelrolle spielt sie in dem Film, welcher auf Erlebnissen Inge Deutschkrons während der Zeit des Nationalsozialismus basiert, eine unpolitische Frau, die die große Liebe ihres Mannes vor den Nazis versteckt. Neben anderen Filmprojekten besetzte Friedemann Fromm sie in der ersten Staffel der mit dem Deutschen Fernsehpreis ausgezeichneten ErfolgsserieWeissensee als Stasi-Mitarbeiterin Erika Bergner. Für Andres Veiel war sie als Mentorin Gudrun Ensslins in Wer wenn nicht wir zu sehen und für Marc-Andreas Bochert in einer Hauptrolle als Richterin an der Seite von Christoph Bach in Dyslexie. 2014 stand sie u. a. für Oskar Roehlers 80er-Jahre-Film Tod den Hippies, es lebe der Punk vor der Kamera. Heike Hanold-Lynch lebt in Berlin.", BirthDate = new DateTime(1962, 7, 11, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eXd4pykz6jDov6pSj2I6AaGtep5.jpg", Name = "Heike Hanold-Lynch" },
