                        new { Id = 1026950, Biography = "Bobby Beckles is a British-American stunt performer, coordinator and actor in film and television productions.", BirthDate = new DateTime(1967, 6, 19, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//bEpYscJS8dBJjPPwYRaC20H5jPf.jpg", Name = "Bobby Beckles" },
