                        new { Id = 1027545, Biography = "Riza Aziz brings a background in banking and financial advisory services to the entertainment industry as Chairman and CEO of Red Granite Pictures. With a B.S. in Government and Economics and a master's degree in Politics from the London School of Economics, Aziz took on the world of investment banking before venturing off as a mergers and acquisitions advisor for a global clientele. He then turned a talented eye toward the film industry and has been thriving since.\\n\\nAziz caught the attention of Hollywood when he was named in Variety's \"Top Ten Producers to Watch\" list in 2011. Aziz has since become the driving force behind the production of films such as Martin Scorsese's Academy Award-nominated The Wolf of Wall Street, Jennifer Westfeldt's Friends With Kids, Scott Cooper's Out of the Furnace and Alexandre Aja's Horns. Most recently, Red Granite Pictures produced Bobby and Peter Farrelly's Dumb and Dumber To; released on November 14, 2014. It opened number one at the box office.\\n\\nCurrently, Paramount Pictures and Aziz's production company Red Granite Pictures in association with Gary Sanchez Productions are working on the Will Ferrell and Mark Wahlberg comedy Daddy's Home. Red Granite Pictures will co-produce and co-finance the film, which Paramount Pictures will distribute worldwide.\\n\\nAziz's development slate includes The Brigands of Rattleborge and The General. The Brigands of Rattleborge, the blacklist's number 1 script of 2006, is a western revenge story and The General is a gritty look at the story of George Washington.\\n\\n- IMDb Mini Biography", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//7r9bReeCJHFY577kdvWE62U11sb.jpg", Name = "Riza Aziz" },
                        new { Id = 1027550, Biography = "Joey McFarland is an American film producer. Born in Louisville, Kentucky, he attended the University of Louisville. In 2010, with producing partner Riza Aziz, McFarland co-founded Red Granite Pictures. McFarland oversees the company's day-to-day operations, its business divisions, personnel and all matters relating to Red Granite Pictures' film slate. Under his leadership, Red Granite has developed, produced and structured financing for a slate of films representing more than $600 million in revenue. In 2011 Variety named McFarland in their list of Top 10 Producers to Watch.\\n\\nMcFarland's first production under the Red Granite banner was the hit romantic comedy Friends with Kids, written and directed by Jennifer Westfeldt.\\n\\nIn 2012 McFarland went on to executive produce the dramatic thriller Out of the Furnace, directed by Scott Cooper and starring Christian Bale.\\n\\nNext McFarland produced The Wolf of Wall Street. The Wolf of Wall Street is based on Jordan Belfort's best-selling novel of the same name. The book was adapted into a screenplay by Terence Winter. The film was directed by Martin Scorsese and stars Leonardo DiCaprio, Jonah Hill, Matthew Mcconaughey and Margot Robbie. Released on December 25, 2013 by Paramount Pictures, The Wolf of Wall Street achieved tremendous box office success and garnered critical acclaim - including a Golden Globe win for Best Actor in a Motion Picture Comedy for Leonardo DiCaprio and five Academy Award nominations including Best Actor, Best Director and Best Picture for which McFarland received a nomination.\\n\\nIn 2013 McFarland completed production on Horns, a supernatural thriller directed by Alexandre Aja and starring Daniel Radcliffe and Juno Temple. The film is based on the best-selling novel of the same name by Joe Hill and was released October 31, 2014 by Dimension-RADiUS.\\n\\nMcFarland was also a producer on the sequel Dumb and Dumber To, directed by Pete and Bobby Farrelly, starring Jim Carrey and Jeff Daniels. It was released on November 14, 2014 by Universal Pictures. Dumb and Dumber To opened number one at the box office.\\n\\nCurrently McFarland is an executive producer on the film Daddy's Home. Shooting in New Orleans, the film is being directed by Sean Anders and John Morris. It re-teams Will Ferrell and Mark Wahlberg for the first time since 2010. Red Granite Pictures is co-producing and co-financing the film with Paramount Pictures, in association with Gary Sanchez Productions. Paramount Pictures is also the worldwide distribution partner.\\n\\nMcFarland's current development slate includes The Brigands of Rattleborge and The General. The Brigands of Rattleborge, the blacklist's number one script of 2006, is a western revenge story and The General is a gritty look at the story of George Washington.\\n\\n- IMDb Mini Biography", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1FwGG5lkwaSj3NeAW6059XugCKL.jpg", Name = "Joey McFarland" },
