                        new { Id = 1076800, Biography = "Derek Kolstad is a writer best known for the John Wick film series.\\n\\nOriginally from Madison, Wisconsin, Kolstad attended Edgewood High School of the Sacred Heart and later studied business administration at Taylor University in Indiana. He moved to California at age 24 to pursue screenwriting. He says he started writing films when he was a teenager, but he struggled for success in Hollywood at first.\\n\\nThe first script he sold was called Acolyte, which was purchased by Voltage Pictures in June 2012. After that, he got some writing and re-writing work, including work on One in the Chamber, starring Dolph Lundgren and Cuba Gooding Jr. He then wrote another Dolph Lundgren film titled The Package.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//mi6jxGxkIPjEKNSu9BquWoFMTZy.jpg", Name = "Derek Kolstad" },
