                        new { Id = 1115984, Biography = "Jason Mitchell is an American actor. He is best known for portraying Eazy-E in the 2015 biopic Straight Outta Compton.\\n\\nMitchell had roles in the films Contraband and Broken City, both of which starred Mark Wahlberg. In 2015, Mitchell played Compton rapper Eazy-E in the biopic Straight Outta Compton, with his performance being met with general praise by critics.\\n\\nDescription above from the Wikipedia article Jason Mitchell, licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1987, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//eZBAmGqwG2q2bFWD3xLTLt69QAb.jpg", Name = "Jason Mitchell" },
                        new { Id = 1116011, Biography = "Prior to working in the entertainment industry, Han was a successful businessman in the building trades industry, created and operates a website and branding business, has worked as an independent consultant in corporate Information Technology, and has decades of retail experience.\\n\\nAs a new father to a beautiful daughter, Han is a family man who essentially raised his younger siblings and guided their education and professional careers while supporting his parents, assuming the role of head of the home, as his own father was stricken with a terminal disease.\\n\\nIn addition to his endless family support, Han has contributed much to international relief organizations, including traveling to remote parts of India to document the plight of blind children at a school where the boys live after being rejected from their families. He is also a leader among North American students who come from Southeast Asia, and helps provide fund-raising, scholarships, direction, and support for these 1st and 2nd generation young Asian Americans.\\n\\nHan is a natural leader who has the ability to inspire and encourage people to do their very best, and his entire focus in life is to help and support people to achieve excellence in their personal lives, as well as in their families and communities, both locally and abroad.\\n\\nHe recently completed producing a documentary about a Civil Rights worker, a man who was a friend and colleague of Dr. Martin Luther King, Jr. and had a significant and long-lasting impact on race relations in America. Future projects include producing inspirational and educational film and television projects, and helping provide to others opportunities similar to those that helped him early in his career, and continuing work with non-profits by guidance, viral marketing support, being a high visibility spokesperson and networker, and personally funding permanent projects in some of the neediest areas of the planet.\\n\\n- IMDb Mini Biography", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yNeZnnkO7aux7uKRM7AoOxX3mbG.jpg", Name = "Han Soto" },
                        new { Id = 1116442, Biography = "From Wikipedia, the free encyclopedia.  John Charles Morris (born October 2, 1984) is an American actor and voice actor. He is best known for his role as Andy Davis in the Toy Story film trilogy. He currently resides in Northern California. He graduated in 2007 from the University of California, Los Angeles's School of Theater, Film &amp; Television. When auditioning for the role of Andy he brought some of his X-Men action figures and made voices for them, the Pixar staff loved it and gave him the part. Morris was brought back on to Toy Story 3 by the request of the director Lee Unkrich. Unkrich described the process by which he went to get Morris on the Toy Story 3 Bluray detailing how he called him, requesting him to reprise his role of Andy (from the original Toy Story), and after hearing the voice mail left by Morris, Unkrich knew immediately that Morris would again be playing Andy.  Description above from the Wikipedia article John Morris (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.", BirthDate = new DateTime(1984, 10, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//vYGyvK4LzeaUCoNSHtsuqJUY15M.jpg", Name = "John Morris" },
