                        new { Id = 1194944, Biography = "From Wikipedia, the free encyclopedia  Gene Jones is an American actor best known for his roles in No Country for Old Men (2007) andThe Sacrament (2013). He has also appeared in the films The Odd Life of Timothy Green and Oz the Great and Powerful and the television shows Louie and Boardwalk Empire. He also appeared in an episode of House of Cards. In 2014 he appeared in Merry Friggin' Christmas starring Robin Williams.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//fiKIuNqja9okZmYEo7R0XN4gKNT.jpg", Name = "Gene Jones" },
