                        new { Id = 1223718, Biography = "From Wikipedia, the free encyclopedia.\\n\\nRizwan Manji (born October 17, 1974, height 5' 7\" (1,70 m)) is a Indo-Canadian actor. He is most most famous for his role as Rajiv in the now cancelled NBC Universal TV series Outsourced. Manji was born in Toronto, Canada where his Indian parents had immigrated to from Tanzania. His family is Ismaili Muslim, and he states that his religion is very important to him in life.  He was raised in Calgary, Alberta, and went to Crescent Heights High School. He later moved to the US where he attended the American Musical and Dramatic Academy.  Manji played small parts in various films and television shows with recurring roles in Privileged, Better Off Ted and 24. In 2010, he auditioned for the role of Gupta on the NBC comedy Outsourced. Although he lost the part to Parvesh Cheena, the producers decided to cast him as the scheming assistant manager Rajiv. Manji resides in Studio City, California, with his wife and two children.", BirthDate = new DateTime(1974, 10, 17, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//yB9w540vNe4pwa3ptvO1haDUKWy.jpg", Name = "Rizwan Manji" },
                        new { Id = 1224374, Biography = "Michael Bryan French was born in Lackawanna, NY and raised in Elmira NY. In his early career he worked as an associate member of The Wooster Group and then moved on to work on Broadway in Neil Simon's, Biloxi Blues and Off-Broadway at The New York Shakespeare Festival, Playwrights Horizons, The Vineyard Theater and Soho Rep as well as numerous regional theaters around the country including, The Actor's Theater of Louisville, Old Globe of San Diego, Merrimack Regional Theater and many more. After moving to Los Angeles in 1990, his performance emphasis turned to TV and Film before returning to his NY roots in 2010.  - IMDb Mini Biography By: Michael Bryan French", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//5c4JbJo0yzGzdHgRPjxps0k7Qjp.jpg", Name = "Michael Bryan French" },
