                        new { Id = 1366120, Biography = "Kristen Anderson-Lopez is an American songwriter. She is best known for co-writing songs for the animated film Frozen (2013) with her husband Robert Lopez. Lopez won the Academy Award for Best Original Song for \"Let It Go\" from Frozen and \"Remember Me\" from Coco (2017) at the 86th Academy Awards and 90th Academy Awards. She also won two Grammy Awards at the 57th Annual Grammy Awards.", BirthDate = new DateTime(1972, 3, 21, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//j0IJP06I5SVUtxcbZ1oRG0SB2D8.jpg", Name = "Kristen Anderson-Lopez" },
