                        new { Id = 1405317, Biography = "Robert Firth was born in Philadelphia in 1960 into a typical English household, he was the youngest of three. He trained with Jose Quintero, co-founder of the Circle in the Square Theater, in Greenwich Village. In addition to his writing and directing, Firth is also a pop art and voice over artist, and lives in London and Los Angeles. Recent projects include Marvel's Guardians of the Galaxy, directed by James Gunn and director Billy Lumby's adaptation of About A Goy.  - IMDb Mini Biography", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//1mq1G9iiu5u2QBgfQpcay6i7pIi.jpg", Name = "Robert Firth" },
