                        new { Id = 1450331, Biography = "British character animator. He was first known for his work on several Walt Disney Animation Studios films, including various characters in Who Framed Roger Rabbit, Rafiki in The Lion King, Belle in Beauty and the Beast, and Quasimodo in The Hunchback of Notre Dame.  After Notre Dame, Baxter moved over to DreamWorks Animation, where he worked on films such as The Prince of Egypt, The Road to El Dorado, Spirit: Stallion of the Cimarron, Shrek 2 and Madagascar. Early in 2005, Baxter left DreamWorks and set out on his own as an independent animator. He became the head of his own studio, James Baxter Animation, in Pasadena, California, where he has directed the animation for the 2007 film Enchanted and the opening credits to Kung Fu Panda, for which he received an Annie Award. As of the summer of 2008, James Baxter Animation has closed and Baxter has returned once again to DreamWorks Animation as a supervising animator.\\n\\nBaxter has also worked on Tummy Trouble, How to Train Your Dragon and The Croods.\\n\\nIn May 2013, Baxter was a guest animator for an episode of Adventure Time entitled \"James Baxter the Horse\".The episode's story focused on the lead characters trying to emulate a  horse who can cheer everyone up by neighing his name (James Baxter) and  balancing on a beach ball. Both the horse's animation (which is visually  distinct from the other characters) and voice were provided by Baxter.  The episode's title card features a drawing of the horse drawing a horse  on a beach ball, while sitting at an animation table. -Wikipedia", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dRTLlsnpqDTqfqMJ0OHDUnPaJEY.jpg", Name = "James Baxter" },
