                        new { Id = 1461378, Biography = "Filipino-Japanese American character animator and supervising animator who formerly worked at Walt Disney Animation Studios. His work has included several Disney characters, including Simba as an adult in The Lion King, Chief Powhatan in Pocahontas, Maurice in Beauty and the Beast, Denahi in Brother Bear, Shang in Mulan, and Ursula in The Little Mermaid.  In March 2013, it was announced that Aquino had been laid off, as well  as 8 other animators who worked at the studio, including Nik Ranieri.  His style is easily recognized by his powerful figures and his extremely geometric facial movements. -Wikipedia", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//geHs2wb6YkKxHEGwUjgMOnWwUyC.jpg", Name = "Ruben A. Aquino" },
