                        new { Id = 1471922, Biography = "Damon Carney is an American actor with roles in television ranging from \"Walker Texas Ranger\" to \"Friday Night Lights\"; most recently playing Don Wheeler in the critically acclaimed series \"American Crime\", opposite Felicity Huffman and Timothy Hutton.\\n\\nFilm credits include: Ranger Blaine in Disney's blockbuster \"The Lone Ranger\" alongside Johnny Depp and Armie Hammer; Mr. Heatherton in the upcoming film \"Waiting For The Miracle To Come\" alongside Willie Nelson; and Phil in \"My All American\" starring Aaron Eckhart. Damon will make his leading man debut as Detective Sean Carter in Dimension's film \"Hellraiser: Judgment\" set for release in 2017.\\n\\nBorn and raised in Tyler, Texas Damon is one of 11 children. An extraordinarily diverse actor, Damon has played a multitude of roles ranging from a drug dealing but, lovable womanizer in the 70's drama \"Swingtown\" to a hit man in the upcoming feature film \"Kreep\", starring Judd Nelson.\\n\\nIn addition to acting, Damon, an entrepreneur, opened up a restaurant with his wife of 25 years. He and his wife, Bradi, have owned and operated The Tin Cup deli in Arlington, Texas for 13 successful years while raising their two children.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//4SQ1Zy48o3R9kk9vHQJZtpsVV6u.jpg", Name = "Damon Carney" },
                        new { Id = 1472053, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//dg05PZ0a99ttosAHkJ12297Y4Uo.jpg", Name = "Melissa Santos" },
