                        new { Id = 1473749, Biography = "", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//uS0Dtwf09jU7d0yUc1zJ6B2CAfs.jpg", Name = "Tyler Dean Flores" },
                        new { Id = 1473960, Biography = "Kelsey Deanne was born Kelsey Deanne Grubbs on April 21 in Fort Worth, Texas, to Mike Grubbs, a mobile device and technology executive, and Rebecca Grubbs, a pottery and china painting artist. She has one older brother, David, an entrepreneur, and has Swedish, German, Scottish, English, Irish and Swiss ancestry. She is a direct descendant of King William the Conqueror, and Anne Plantagenet, sister of King Edward I and King Richard III, and is a direct descendent of the MacDougall Clan and Wemyss Clan of Scotland. She is also related to Daniel Boone. Her great-grandfather, Donald V. Dewey, played the trombone in John Philip Sousa's band.\\n\\nKelsey plays the piano and is classically trained. Growing up she danced ballet and was in cheerleading, symphonic and marching band (five instruments), symphony (viola), competitive road cycling (California State Champ 2002), scuba diving internationally, and collegiate cross-country and track.\\n\\nShe graduated from Burlingame High School (with actress Dianna Agron and Project Greenlight filmmaker Jason Mann) in the Bay Area, CA one year early to attend Lawrence University's Conservatory of Music in Appleton, WI on a piano performance scholarship. After one semester of practicing in a basement studio for 6 hours a day, she switched majors to anthropology where she had more human contact. She joined the Cross-Country and Track teams and earned a B.A. in three years. Kelsey continued her education to complete a M.A. in applied business anthropology from University of North Texas at age 21, and a M.A. in anthropology from The New School (NYC), where Marlon Brando and Rod Steiger took classes.\\n\\nIt was while pursuing a Ph.D. in NYC that she realized academia wasn't for her. Through the prompting of a friend, she began commercial print modeling with CESD, Abrams Artists Agency, and Rick Miller, appearing for ads in Make Up For Ever, Samsung, Toys 'R Us, and the front cover of a dozen fiction romance novels. She decided to pursue acting wholeheartedly and started with intro acting classes at Weist-Barron Studios in NYC, and subsequently took scene study, voice, on-camera, and private coaching from teachers at NYU and independent studios, learning Method, Meisner, Stanislavski, Stella Adler, and other techniques. Her mentor in NYC is Harry O'Reilly, a protege of Geraldine Page and Stella Adler. She currently studies in Los Angeles with Robert Colt, who studied with Warren Robertson and Harold Guskin in NYC.\\n\\nAfter five years of pursing acting whole heartedly, she found a drawing she did at the age of four that says, 'When I grow up, I want to be a movie star.'\\n\\nShe has been in over 20 films, including Shark Lake with Dolph Lundgren, and SYFY and Discovery ID shows.\\n\\nKelsey lives in Malibu with Francis Gregory O'Toole. She is a partner in Mercury Pictures, a full production studios in Los Angeles.", ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//tlUag36OawdIv7peVFVKbg5epND.jpg", Name = "Kelsey Deanne" },
