                        new { Id = 1477203, Biography = "Luca Marco Paracels has worked in the film industry for over 20 years. Many of those years were spent working in film production in Eastern Europe - Russia, Poland and The Czech Republic (Barrandov Studios). Luca resides in Los Angeles, CA, where he is the founder and co-owner of Revolution Sun Studios. Luca also lends his talents as a producer, creative consultant and story editor for companies like Sony Pictures, HBO and DreamWorks, to name a few.", BirthDate = new DateTime(1978, 8, 2, 0, 0, 0, 0, DateTimeKind.Unspecified), Name = "Luca Marco Paracels" },
