                        new { Id = 1540279, Biography = "Gregory M. Brown is an Actor, Writer, Director, and Producer.\\n\\nGregory M. Brown was born in Irvington, New Jersey to Warren John Brown, a stage actor, singer, and musician who was performing at the Paper Mill Playhouse in Millburn, New Jersey and Nell Joyce (Garlick) Brown, who at the time was a housewife. His mother would eventually become the first female member of the Stock Transfer Agents Association in New York while a manager at Union Pacific Corporation. Greg is the oldest of three children. He has a sister, Suzanne Tara (Brown) Jordan and brother, David Patrick Brown.\\n\\nAt the age of six, his parents divorced after thirteen years of marriage. His mother, Greg and his siblings moved in with his mother's parents in Paterson, New Jersey where Greg grew up. Greg attended Eastside High School, known for the movie Lean on Me with Morgan Freeman. Greg graduated high school in 1966 and remained in Paterson until his enlistment in the U.S. Navy in November 1967. In 1968, Greg did a tour in Vietnam aboard the USS Steinaker (DD-863) a Navy destroyer and deployed on two other cruises to the Caribbean and North Atlantic respectively before being transferred to Fighter Squadron 101 at Naval Air Station Oceana in Virginia Beach, Virginia. Greg had a niche for electronics and the evolving computer industry, learning computer programming while still in the Navy. Upon separation from active duty in 1971, he started to work on Wall Street in the information technology field where he remained for the most part until his retirement as a Vice President from J.P. Morgan Chase in 2005.\\n\\nAs a teenager, Greg enjoyed performing in church and school plays but did not pursue the acting profession because of the divorce of his parents. His mother didn't approve, so, out of respect for his mother he waited until he was 59 years old and after his retirement from J.P. Morgan Chase and the military.\\n\\nIn his short time as an actor, 2008-16 have been great years for Greg. He has performed more than 45 shorts, Ads, TV, and full feature films to date.\\n\\nGreg completed shooting Stephen King's \"Willa\", released in 2012 as the character Henry Lander with Clayton Watson.\\n\\nTwo of the films that Greg has been in recently have won various awards at film festivals across the country. One film being Rick Alverson's film \"The Comedy (2012)\" with Tim Heidecker and the other is Sloan Copeland's \"Wet Behind The Ears (2013)\" with Maggie Williams.\\n\\nGreg completed shooting \"Deep Water\" in Alaska and is scheduled to be released as a short later in 2013.\\n\\nRecently completed filming the Indie film \"Stuff (2015)\" with Yvonne Jung and Karen Sillas as Grandpa.\\n\\nRecently cast in the series, \"The Familia (2014)\" in the recurring role of Charlie Shea.\\n\\nRecently cast in the series \"Big Sky (2017)\" in the recurring role of Lionel Frost.", BirthDate = new DateTime(1948, 11, 20, 0, 0, 0, 0, DateTimeKind.Unspecified), ImageUrl = "https://image.tmdb.org/t/p/w600_and_h900_bestv2//pqnzVHwdqAjWAMp66ot7jyuSEIx.jpg", Name = "Gregory Brown" },
